                               '<p>Hohner HC-06 классическая полноразмерная гитара.&nbsp;В отличие от большинства недорогих гитар имеет удобный гриф и хороший внешний вид. •Гриф, обечайка, задняя дека изготовлены из красного дерева (махогони). •Передняя дека изготовлена из хвойных пород дерева. •Накладка — палисандр. •Классический колковый механизм, струны – нейлон. •18 ладов. Именно эту гитару чаще всего рекомендуют преподаватели музыкальных школ для своих учеников. Наилучшее сочетание \"цена/качество\", лидер продаж.</p><p><br></p>',
                               3300, '2014-09-10 09:10:05', 19,
                               'Hohner HC06 – это классическая гитара. Верхняя дека сделана из древесины ели. Задняя и боковые деки выполнены из древесины махагони.',
                               19308, 42, NULL, '\0', ''),
  (20218, 'Electro-Voice zxa1-sub', '<h2>Electro-Voice ZXA1‑Sub - активный сабвуфер</h2><p><strong>ZXA1‑Sub</strong>&nbsp;— это компактный активный сабвуфер, созданный для приложений, требующих максимальной портативности. Данный продукт является эффективным сочетанием деревянного корпуса с мощным динамиком&nbsp;<strong>EVS-12S</strong>, имеющим низкий уровень искажений, и цифровым усилителем класса&nbsp;D.<br><br>Характерными особенностями такой АС является мобильность и компактность наряду с глубоким низом и хорошим \"тычком\". Как гласит русская поговорка: \"Маленький, да удаленький\".<br><br>Применение&nbsp;<strong>ZXA1‑Sub</strong>&nbsp;в сочетании с ZXA1 позволяет быстро создать полноценную широкополосную систему профессионального уровня с минимальным количеством кабелей и дополнительного внешнего оборудования.<br><br>Акустическая система&nbsp;<strong>ZXA1-Sub</strong>&nbsp;оснащена 700-Вт интегрированным усилительным модулем, имеющим 2 XLR входа и 2 XLR выхода. Два XLR входа позволяют подать стереосигнал на сабвуфер. XLR выходы являются линейными и могут служить для подключения нескольких систем&nbsp;<strong>ZXA1‑Sub</strong>, для создания моносуммы, либо для добавления широкополосных систем ZXA1.<br><br>Усилитель оснащён кроссовером с большой крутизной нарастания и спада характеристики, а также цепью защиты от перегрузки динамика.<br><br>Лёгкий корпус изготовлен из 15-мм листов 9-слойной фанеры, скреплённых изнутри, а снаружи покрыт структурной краской.<br><br>Крепкие, удобные для переноса ручки, расположенные с двух сторон, и \"стакан\" для стойки в верхней части АС делают&nbsp;<strong>ZXA1-Sub</strong>&nbsp;идеальной для портативных приложений.<br><br><strong>Ключевые особенности:</strong><br><br>• Лёгкий 700-Вт усилительный модуль класса D с кроссовером и цепью защиты.<br>• 12\" НЧ динамик EVS-12S, обеспечивающий мощный, захватывающий \"низ\".<br>• \"Стакан\" для стойки для создания полнодиапазонной системы.<br>• Лёгкий корпус, покрытый структурной краской.<br>• XLR стереовход.<br>• Линейный XLR стереовыход.<br>• Переключатель для активации фильтра, расширяющего НЧ диапазон.<br>• Переключатель для смены полярности.<br>• LED-индикаторы питания и перегрузки.</p><table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:97%\"><tbody><tr><td>Частотный диапазон (‑3&nbsp;дБ):</td><td>53 - 93 Гц</td></tr><tr><td>Частотный диапазон (‑10&nbsp;дБ):</td><td>44 - 118 Гц</td></tr><tr><td>Мощность RMS - от усилителя:</td><td>700 Вт</td></tr><tr><td>Мощность пиковая - Общая:</td><td>—</td></tr><tr><td>Чувствительность, 1Вт/1м:</td><td>—</td></tr><tr><td>Максимальное звуковое давление:</td><td>126 дБ</td></tr><tr><td>Импеданс:</td><td>—</td></tr><tr><td>Угол раскрытия&nbsp;Г° x В°:</td><td>сферическая направленность</td></tr><tr><td>Динамики (НЧ/ВЧ):</td><td>12\" (EVS-12S) /&nbsp;—</td></tr><tr><td>Габаритные размеры&nbsp;(В x Ш x Г), мм:</td><td>400 x 445 x 457 мм</td></tr><tr><td>Масса (нетто):</td><td>20.9 кг</td></tr></tbody></table>', 34000, '2014-08-16 09:50:21', 476, 'ELECTRO VOICE ZXA1Sub - Активный 12\" субвуфер, деревянный, встроенный усилитель на 800 Вт.\r\n', 19223, 0, 1884815, '\0', ''),
  (20216, 'CASIO CDP-220 R', '<p><strong>ОПИСАНИЕ&nbsp;CASIO&nbsp;CDP-220</strong></p><p>Модель CASIO CDP-220R не разочарует своих владельцев. Инструмент получил клавиатуру от своих старших собратьев – линейки PRIVIA, а также ряд серьезных технических и конструкционных усовершенствований, по сравнению с предыдущими моделями этой знаменитой серии \"суперкомпактов\".<br><br>В CDP220R увеличено количество тембров, модернизирован слот для SD карт, добавлена кнопка для быстрого переключения органа и фортепиано, а также внедрена система обучения аккордам (Chord book).&nbsp;</p><p>Технические характеристики:<br>- 88 клавиш с молоточковым эффектом<br>- Стерео Образцы фортепиано&nbsp;<br>- 48-голосная полифония&nbsp;<br>- 700 AHL Мелодий<br>- 200 ритмов (в том числе 77 этнических ритмов)&nbsp;<br>- 152 мелодий / 10 песен<br>- 10 типов реверберации, 5 хоруса<br>- 90 Арпеджиатор&nbsp;<br>- Колесо Pitch Bend&nbsp;<br>- Слот для карт памяти SD&nbsp;<br>- GM и USB&nbsp;<br>- Книга аккордов&nbsp;<br>- Микрофонный вход и аудио-вход&nbsp;</p>', 22500, '2014-06-24 14:50:39', 106, 'Цифровое пианино CASIO CDP-220 R\r\nКлавиатура: 88 клавиш с молоточковым эффектом\r\nПроцессор эффектов: AHL\r\nПолифония: 48 нотная\r\nЭффекты DSP: Реверберация (10 типов), Хорус (5 типов).', 19217, 0, 1884815, '\0', '\0'),
  (3325, 'AKG D112', '<p>D 112 Динамический микрофон с большой мембраной для озвучивания бочки и баса. D 112 заработал репутацию лучшего микрофона для басового барабана всех времен и народов. `Тяжелоногие` барабанщики его не щадят, т.к. он выдерживает 168дБ SPL звукового давления без слышимых искажений. Специально сконструированная мембрана с очень низкой резонансной частотой сохраняет массивность и мощь бочки ниже 100 Гц, а узкий подъем на 4 кГц позволяет атаке `пробиться` сквозь плотный микс, выполнив минимальную эквализацию, или вообще без нее. В результате бочка звучит `как надо`.<br>&nbsp;Также D 112 может быть успешно применен для озвучивания тромбонов, басовых усилителей и т.д.</p>', 7250, '2014-07-10 09:32:05', 147, 'микрофон для ударных и басовых инструментов с большой диафрагмой, выдерживает давление до 160dB SPL без искажений Артикул: A011502', 19305, 17, NULL, '\0', ''),
  (20264, 'Electro-Voice ZXA1‑90', '<h2>Electro-Voice ZXA1‑90 - активная акустическая система</h2><p>Инженеры&nbsp;<strong>Electro-Voice</strong>&nbsp;вновь подняли планку портативного звука, добавив модель&nbsp;<strong>ZXA1</strong>&nbsp;в серию акустических систем&nbsp;<strong>ZX</strong>.<br><br>Акустическая система&nbsp;<strong>ZXA1</strong>&nbsp;— активная версия пассивной&nbsp;<strong>ZX1</strong>, одного из самых популярных продуктов компании.<br><br><strong>ZXA1</strong>&nbsp;имеет усилительный модуль класса D мощностью 800&nbsp;Вт, который используется в туровых high-end усилителях серии Tour&nbsp;Grade. Колонка выполнена в легком и очень надежном корпусе, который выглядит так же хорошо, как и звучит сама&nbsp;<strong>ZXA1</strong>. Это стильное решение, подходящее для широкого спектра задач, будь то мобильный DJ-комплект, сценические мониторы или постоянная инсталляция.<br><br>В&nbsp;<strong>ZXA1</strong>&nbsp;установлен новый 8\" динамик Electro-Voice&nbsp;<strong>EV8L</strong>&nbsp;(с увеличенным ходом диффузора) и новый высокочастотный драйвер Electro-Voice&nbsp;<strong>DH2005</strong>, c титановой диафрагмой 1,25\".<br><br>В качестве мобильного комплекта система&nbsp;<strong>ZXA1</strong>&nbsp;идеально сочетается с 12\" активным сабвуфером ZXA1‑Sub мощностью 700&nbsp;Вт.</p><p><br><strong>Ключевые особенности:</strong><br><br>• Усилительный 800-Вт модуль класса D.<br>• Биамп-схема с защитой динамика.<br>• Высокомощный 8\" НЧ-динамик&nbsp;<strong>EV8L</strong>.<br>• 1\" драйвер&nbsp;<strong>DH2005</strong>.<br>• Поворачиваемый рупор с раскрытием 90° x 50°.<br>• Максимальный уровень звукового давления 123 дБ.<br>• Включаемый ВЧ-фильтр для работы с сабвуферами.<br>• Линейный и микрофонный входы.<br>• Возможность использования в качестве напольного монитора.<br>• Отверстие под штангу или стойку.<br>• Малый вес (менее 9 кг) и удобная ручка для легкого переноса.</p><table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:97%\"><tbody><tr><td>Частотный диапазон (‑3&nbsp;дБ):</td><td>60 - 20 000 Гц</td></tr><tr><td>Частотный диапазон (‑10&nbsp;дБ):</td><td>48 - 20 000 Гц</td></tr><tr><td>Мощность RMS - от усилителя:</td><td>800 Вт</td></tr><tr><td>Мощность пиковая - Общая:</td><td>—</td></tr><tr><td>Чувствительность, 1Вт/1м:</td><td>—</td></tr><tr><td>Максимальное звуковое давление:</td><td>123 дБ</td></tr><tr><td>Импеданс:</td><td>8 Ω</td></tr><tr><td>Угол раскрытия&nbsp;Г° x В°:</td><td>90° x 50°</td></tr><tr><td>Динамики (НЧ/ВЧ):</td><td>8\" (EV8L) / 1\"&nbsp;(DH2005)</td></tr><tr><td>Габаритные размеры&nbsp;(В x Ш x Г), мм:</td><td>457 x 282 x 264 мм</td></tr><tr><td>Масса (нетто):</td><td>8.6 кг</td></tr></tbody></table>', 28000, '2014-08-16 09:51:08', 476, 'ELECTRO-VOICE ZXA1‑90 - АКТИВНАЯ АКУСТИЧЕСКАЯ СИСТЕМА', 19310, NULL, 124, '\0', ''),
  (4686, 'KRK VXT8', '<table style=\"width:1018px\"><tbody><tr><th colspan=\"2\" style=\"vertical-align:top\">Основные параметры</th></tr><tr><th style=\"vertical-align:top; width:270px\">Тип</th><td style=\"vertical-align:top\">полочная, активная, фазоинверторного типа</td></tr><tr><th style=\"vertical-align:top; width:270px\">Акустическое излучение</th><td style=\"vertical-align:top\">монополярная</td></tr><tr><th style=\"vertical-align:top; width:270px\">Назначение</th><td style=\"vertical-align:top\">мониторный громкоговоритель</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Характеристики</th></tr><tr><th style=\"vertical-align:top; width:270px\">Количество полос</th><td style=\"vertical-align:top\">2</td></tr><tr><th style=\"vertical-align:top; width:270px\">Мощность</th><td style=\"vertical-align:top\">180 Вт</td></tr><tr><th style=\"vertical-align:top; width:270px\">Диапазон воспроизводимых частот</th><td style=\"vertical-align:top\">37-22000 Гц (+/-1.5 дБ)</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Усилитель</th></tr><tr><th style=\"vertical-align:top; width:270px\">Раздельное усиление НЧ и ВЧ (Bi-amping)</th><td style=\"vertical-align:top\">есть</td></tr><tr><th style=\"vertical-align:top; width:270px\">Интерфейсы</th><td style=\"vertical-align:top\">балансный вход</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Излучатели</th></tr><tr><th style=\"vertical-align:top; width:270px\">Тип излучателей</th><td style=\"vertical-align:top\">динамические</td></tr><tr><th style=\"vertical-align:top; width:270px\">ВЧ-излучатель</th><td style=\"vertical-align:top\">25 мм, купол, шелк</td></tr><tr><th style=\"vertical-align:top; width:270px\">НЧ-излучатель</th><td style=\"vertical-align:top\">203.2 мм, кевлар</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Дополнительно</th></tr><tr><th style=\"vertical-align:top; width:270px\">Размеры (ШхВхГ)</th><td style=\"vertical-align:top\">318x438x300 мм</td></tr><tr><th style=\"vertical-align:top; width:270px\">Дополнительная информация</th><td style=\"vertical-align:top\">мощность усиления НЧ - 120 Вт, ВЧ - 60 Вт</td></tr></tbody></table>', 25120, '2014-06-24 14:49:48', 210, 'Мониторный громкоговоритель', 4280, 15, NULL, '\0', '\0'),
  (4779, 'Axelvox HD271', '<p>HD271 – студийные закрытые динамические наушники обеспечат высокую чувствительность, широкий динамический диапазон и максимальную звуковую изоляцию. Эргономические амбушюры, объединенные с легкой и саморегулирующейся лентой, делают их очень удобными. Записывает ли Вы голос, занимаетесь сведением или микшированием, наушники HD271 обеспечат комфорт и звуковую точность.</p><p>Характеристики:</p><p>* Драйверы с высоким разрешением<br>* Точно настроенный акустический канал<br>* Расширенный частотный и динамический диапазоны<br>* Саморегулирующаяся дужка<br>* Комфортные, плотно прилегающие чаши<br>* Прочный прорезиненный медный кабель, армированный капроновой нитью<br>* Мягкий чехол для переноски и хранения</p><p>Спецификации:</p><p>* Тип: Динамические<br>* Частотная характеристика: 10 - 30,000Гц<br>* Акустический дизайн: Закрытые<br>* Драйвер: диаметр 50мм, неодимовый магнит<br>* Максимальный импеданс: 32 Ом @ 1КГЦ<br>* Чувствительность: 98дБ SPL, 1mW<br>* Суммарный коэффициент гармонических искажений (КГИ): &lt;0.3% на 1КГц/1V<br>* Максимальная мощность: 200mW<br>* Кабель: 2.5 м, прямой<br>* Разъем: позолоченый 3.5мм с адаптером 3.5мм - 6.3мм<br>* Давление оголовья: ~ 5N<br>* Вес: 286 г</p>', 1620, '2014-06-24 15:45:42', 112, ' AXELVOX HD271 студийные закрытые динамические наушники.', 4367, 14, NULL, '\0', '\0'),
  (5195, 'JBL EON515XT', '<p>2-полосная активная 625 Вт акустическая система. 39-18000 Гц, 3 входа , 14.8 кг, 5 точек подвеса, копропиленовый корпус, ручки для переноски, возможно использование как монитора, цвет черный</p>', 28000, '2014-08-25 15:34:48', 211, '2-полосная активная 625 Вт акустическая система. 39-18000 Гц, 3 входа , 14.8 кг, 5 точек подвеса, копропиленовый корпус, ручки для переноски, возможно использование как монитора, цвет черный\r\n', 19103, 36, NULL, '\0', ''),
  (20214, 'JBL PRX712', '<p>Описание&nbsp;<strong>JBL PRX712 12”</strong>:</p><p>2-полосная активная портативная мониторная/FOH акустическая система. 1500 Вт программная мощность, 135дБ пик, 12” Differential Drive Woofer и 1.5 ” компресионный драйвер с полимерной диафрагмой, покрытие Duraflex™, 8 точек подвеса М10 и одна точка для оттяжки, 16-18 мм фанера, стальная решетка 16 Ga, встроенный усилитель с DSP процессором, 15.6 кг. входы XLR, RCA</p>', 34485, '2014-08-20 09:33:22', 211, 'JBL PRX712 активная 2-полосная мониторная/FOH АС 1500Вт. НЧ 1 x JBL 272G 12\" / ВЧ 1 x JBL 2408H-2, Макс SPL - 135дБ, Входы:(2x) XLR-1/4\", RCA, двойной 36мм \"стакан\", Вес 19,5кг\r\n', 19210, 0, 1884815, '\0', ''),
  (5207, 'JBL EON510/230', '<p>EON 510 Портативный активный громкоговоритель, двухполосный 10”</p><p><br></p><table cellspacing=\"0\" cellpadding=\"0\"><tbody><tr><td colspan=\"2\">EON510 – двухполосный активный портативный громкоговоритель с НЧ динамиком 10” и ВЧ-компрессионным драйвером 1”.<br><br>Полно-диапазонная система со встроенным 3-полосным микшером.<br><br>Раскрытие ВЧ-рупора 100 х 60.<br><br>Двухканальный усилитель класса D с отдельным усилением на каждую полосу.<br><br>Входная секция с функциями кроссовера, защиты и микширования.<br><br></td></tr><tr><td><ul><li>Активная акустическая система мощностью 280 Вт</li><li>Легкая и компактная</li><li>Мягкие ручки</li><li>10\" Differential Drive® НЧ драйвер с неодимовым магнитом</li><li>1\" неодимовый компрессионный драйвер JBL</li><li>Эффективный усилитель класса-D</li><li>Встроенный 3-канальный микшер</li><li>100° x 60° ассиметричный волновод с однородным покрытием</li><li>Линейный и микрофонный входы</li><li>Выбираемые настройки эквалайзера</li><li>Сквозной канал Mix/Loop для расширения системы</li><li>Встроенный точки подвеса M10</li><li>Многоугольный корпус с возможностью мониторного применения</li><li>Встроенный стакан 36 мм с винтовым зажимом</li><li>Легкие композитные корпуса, обеспечивающие прочность и отличные акустические свойства</li></ul></td></tr></tbody></table><p><strong>Мощность системы: </strong><br>280Вт продолжительная,<br>560Вт пиковая<br><br><strong>Частотный диапазон (-10dB):</strong><br>58Гц – 18,5кГц (без эквализации)<br><br><strong>Размеры (В х Ш х Г):</strong><br>490мм х 313мм х 262мм<br><br><strong>Диаграмма направленности</strong>:<br>100° Г x 60° В номинально<br><br><strong>Максимальное давление </strong>:<br>121 дБ<br><br><strong>Вес</strong>:<br>7.7 кг</p><p><br></p><p><br></p><p><br></p>', 18990, '2014-07-05 08:35:11', 211, '2-полосная активная 280 Вт акустическая система. 220 Вт НЧ + 60 Вт ВЧ, 10`, 3 входа , 7.7 кг, 5 точек подвеса, копропиленовый корпус, ручки для переноски, возможно использование как монитора, логотип подсвечивается (отключается) Артикул: D000621', 4701, 14, NULL, '\0', ''),
  (20360, 'ALLEN&HEATH ZED16FX', '<ul><li>Тип: аналоговый микшер, USB-интерфейс.</li><li>Каналы: 10 моноканалов mic/line, 3 стерео.</li><li>Эквалайзер: 3-х полосный с MusiQ.</li><li>Эффекты: встроенный процессор эффектов (16 внутренних эффектов \"time-delay\").</li><li>Программное обеспечение: Cakewalk Sonar X1 LE.</li><li>4 AUX.</li><li>Channel insert.</li><li>Подсветка PFL и \"пиковый\" индикатор.</li><li>Mute подсветки.</li><li>Sound image pan.</li><li>Микрофонный линейный вход \"супер-широкого\" усиления \"DuoPre\".</li><li>Фейдеры: 100 мм ALPS.</li><li>4 стереоканала с 2-х полосным эквалайзером.</li><li>Stereo returns &amp; playback (возврат/воспроизведение).</li><li>Все входы с регулировкой уровня.</li><li>12 bar meters.</li><li>Функции моно/стерео на AUX 1и2.</li><li>Секция мониторного выхода.</li><li>Alt stereo output source.</li><li>Настраиваемый стерео USB аудио вход/выход.</li><li>Фантомное питание +48 В.</li><li>Neutrik mic XLR.</li><li>Neutrik 1/4 inch jacks.</li><li>Рэковый монтажный комплект поставляется отдельно.</li><li><strong>Габариты и вес товара:</strong><ul><li>0.39 x 0.31 x 0.15 м.</li><li>Вес: 4.50 кг.</li></ul></li><li>Вес товара в заводской упаковке: 12 кг.</li></ul>', 31000, '2014-08-15 13:09:21', 184, 'Микшерный пульт 10 моно, 3 стерео, USB интерфейс, процессор эффектов ', 19434, NULL, 1884815, '\0', '\0'),
  (20361, 'Behringer  QX1202USB', '<p>XENYX QX1202USB - следующее поколение XENYX Q Серии USB микшеров может справиться с любым живым концертом и обеспечить современного технического уровня инструменты профессионального качества записями. Модель оснащена ”беспроводной готовностью” для новых ULM Серии USB микрофонов, что делает ее первой в этом виде микшеров. Встроенный USB/аудио интерфейс , компрессор на моно каналах и KLARK TEKNIK FX процессор со всем записывающим и редактирующим программным обеспечением превратит Ваш компьютер в полную, высокоэффективную студию.&nbsp;<br><br><strong>KLARK TEKNIK FX</strong>&nbsp;<br>Разработанные всемирно известной технической командой KLARK TEKNIK, эти более совершенные FX процессоры характеризуются 32 студийного класса пресетами с двойными параметрами, Tap функцией и сохраняемыми пользовательскими параметрами установок. Эти эффекты обеспечивают широкий ранг улучшенных опций от милых и спокойных до абсолютно диких.&nbsp;<br><br><strong>КОМПРЕССОР</strong>&nbsp;<br>Сжатие ограничивает динамический ранг сигнала, понижая уровень громкости звука и повышает мягкие звуки для достижения звукового баланса. Применение компрессии особенное мастерство, с которым возникают трудности у новичков и даже среднего класса звукоинженеров. Компрессия доступна на всех моно каналах и легка в обращении даже для начинающих пользователей. Одной кнопкой можно легко набирать необходимое количество компрессии для инструментов и вокала, создавая яркие миксы.&nbsp;<br><br><strong>МИКРОФОННЫЕ ПРЕДУСИЛИТЕЛИ</strong>&nbsp;<br>Эти современного технического уровня микрофонные предусилители огромный шаг в эволюции аудио технологий. XENYX предусилители предлагают 130 dB динамического диапазона с полосой пропускания 10 Hz - 200 kHz.&nbsp;<br><br><strong>XENYX QX1202USB</strong>&nbsp;<br>QX1202USB идеально подходит для использования дома, на концертах и в студии. Этот компактный микшер предусматривает 4 моно канала с XENYX микрофонными предусилителями, неоклассический британского стиля 3-полосный эквалайзер и 4 стерео канала.</p><ul><li>Сверхнизкий уровень шума</li><li>4 микрофонных предусилителей XENYX</li><li>4 студийного класса компрессора с легкой функциональностью и светодиодным контролем для профессионального вокала и инструментальных звуков на все моно каналы</li><li>Высококачественный KLARK TEKNIK FX процессор со студийного класса стерео FX процессором со 100 пресетами, включая reverb, chorus, flanger, delay и различными мульти эффектами</li><li>Неоклассический \"Британский\" 3-полосный эквалайзер с полупараметрической средней полосой для теплого и музыкального звука</li><li>FX посыл через канал для внутреннего FX процессора и/или как внешний посыл</li><li>Главный mix выход плюс отдельное управление комната/наушники и стерео CD/tape выходы</li><li>CD/tape входы, присваиваемые mix или комната/наушники выходам</li><li>Высококачественные компоненты и чрезвычайно прочная конструкция гарантируют долговечность</li></ul>', 5280, '2014-08-15 16:45:55', 70, 'Компактный малошумящий микшерный пульт (12 входов, 2 шины, компрессор, 24-бит эффект-процессор, USB аудио интерфейс). Klark Teknik', 19435, NULL, 1884815, '\0', ''),
  (20362, 'Behringer UB1622FX-PRO', '<p>BEHRINGER UB1622 FX-PRO Малошумящий 16-канальный микшерный пульт с 2/2 шинами 4 моноканала с IMP &lt;невидимым микрофонным предусилителем&gt;, разрывами и фантомным питанием. 4 стерео канала с высоким запасом по перегрузке. 2 субгруппы с одним фейдером, 2 посыла и 2 стерео возврата aux Ползунковые регуляторы громкости Динамический диапазон 130 дб диапазон изменения громкости 60 дб. Коэффициент нелинейных искажений: менее 0,0007% в диапазоне 20-20000 гц Эффективно, музыкально звучащий 4-полосный эквалайзер на каждом канале и фильтр НЧ на всех моно каналах 24-битовый цифровой процессор эффектов c 99 эффектами Диапазон регулировки эквалайзера: Low- 80 гц + 15 дб Low Mid - 500 Гц + 15 дб Mid -3 кГц + 15 дб High - 12 кГц + 15 дб Выносной импульсный блок питания В комплект поставки входит набор для установки в рэковую стойку Размеры: 97x301x351 мм Вес: 3,3 кг<br></p>', 8450, '2014-08-15 16:50:08', 70, 'Компактный малошумящий микшерный пульт (4 моновхода, 4 стереовхода, 2 AUX-шины, процессор эффектов, встроенный импульсный блок питания)', 19436, NULL, 1884815, '\0', ''),
  (20363, 'Behringer UB1222FX-PRO', '<p>Малошумящий 12-канальный микшерный пульт с 2/2 шинами 6 моноканала с IMP &lt;невидимым микрофонным предусилителем&gt;, разрывами и фантомным питанием. 2 стерео канала с высоким запасом по перегрузке. 2 субгруппы с одним фейдером, 2 посыла и 2 стерео возврата aux Ползунковые регуляторы громкости Динамический диапазон 130 дб диапазон изменения громкости 60 дб. Коэффициент нелинейных искажений: менее 0,0007% в диапазоне 20-20000 гц Эффективно, музыкально звучащий 3-полосный эквалайзер на каждом канале и фильтр НЧ на всех моно каналах 24-битовый цифровой процессор эффектов c 99 эффектами Диапазон регулировки эквалайзера: Low- 80 гц + 15 дб Mid -2,5 кГц + 15 дб High - 12 кГц + 15 дб Функция расширения стереобазы XPQ 3D 7-полосный эквалайзер на главный выход. Выносной импульсный блок питания В комплект поставки входит набор для установки в рэковую стойку Размеры: 97x345x334 мм Вес: 3,8 кг</p>', 7950, '2014-08-15 16:55:58', 70, 'Компактный малошумящий микшерный пульт (4 моновхода, 4 стереовхода, 2 AUX-шины, процессор эффектов, выходной эквалайзер с детектором обратной связи, функция подавления вокала, встроенный импульсный блок питания)', 19437, NULL, 1884815, '\0', ''),
  (5217, 'JBL EON518S/230 18`', '<p>EON 518S Портативный активный сабвуфер 18”</p><p><br></p><table cellspacing=\"0\" cellpadding=\"0\"><tbody><tr><td colspan=\"2\">EON 518S - это активный сабвуфер прямого излучения, созданный специально для работы в комплекте с системами EON серии 500.<br><br><br>Встроенный кроссовер и стерео-сквозной канал.<br><br><br>Состоит из 18” НЧ драйвера и усилителя класса D.<br><br></td></tr><tr><td><ul><li>Активный сабвуфер мощностью 500 Вт</li><li>Вес 29.5 кг.</li><li>Мягкие ручки</li><li>18\" Differential Drive® НЧ драйвер с неодимовым магнитом</li><li>Эффективный усилитель класса-D</li><li>Стерео балансный сквозной канал</li><li>Встроенный переключаемый кроссовер на выходах сквозного канала</li><li>Легкая масштабируемость системы за счет сквозного канала</li><li>Переключатель полярности сигнала</li><li>Встроенный стакан 36 мм</li><li>Деревянный корпус с покрытием DuraFlex</li></ul></td></tr></tbody></table><p><strong>Мощность:</strong><br>500 Вт продолжительная<br>1000 Вт пиковая<br><br><strong>Частотный диапазон (-10 dB):</strong><br>36 Гц - 130 Гц<br><br><strong>Размеры:</strong><br>617 мм x 569 мм x 652 мм<br><br><strong>Частотная характеристика (±3 dB):</strong><br>42 Гц – 100 Гц<br><br><strong>Максимальное давление:</strong><br>129 дБ<br><br><strong>Точка раздела кроссовера:</strong><br>120 Гц</p><p><br></p><p><br>Страна-производитель: МЕКСИКА</p><p><br></p>', 34900, '2014-07-05 08:30:57', 211, 'активный сабвуфер, 500 Вт, линейный стерео- вход, выход на сателлит с отключаемым кроссовером, пассивный вход, стакан под стойку, корпус - фанера 18 мм, 29,5 кг Артикул: A011981', 4711, 10, NULL, '\0', ''),
  (5281, 'JBL PRX718S 18”', '<p>Активный портативный сабвуфер мощностью 700 Вт с 18-дюймовым неодимовым НЧ-динамиком.<br><br>&nbsp;&nbsp;&nbsp; * Переносной активный сабвуфер, разработанный для совместного применения с сателлитами JBL серии PRX500<br>&nbsp;&nbsp;&nbsp; * Премиум класс активного портативного туринга от компании JBL<br>&nbsp;&nbsp;&nbsp; * Встроенный высокоэффективный цифровой усилтель Crown® класса D с техгологией Dual-Bridge Technology™<br>&nbsp;&nbsp;&nbsp; * Номинальная мощность 700 Вт<br>&nbsp;&nbsp;&nbsp; * 18-дюймовый НЧ-динамик Differential Drive® с неодимовым магнитом<br>&nbsp;&nbsp;&nbsp; * Входная секция оснащена DSP-процессором, включая кроссовер и динамический лимитер<br>&nbsp;&nbsp;&nbsp; * Частота разделения кроссовера - 120 Гц<br>&nbsp;&nbsp;&nbsp; * Максимальное звуковое давление - 133 dB<br>&nbsp;&nbsp;&nbsp; * Диапазон частот: 33 Гц - 160 Гц (-10dB)<br>&nbsp;&nbsp;&nbsp; * Частотная отдача: 37 Гц - 130 Гц (-3dB)<br>&nbsp;&nbsp;&nbsp; * 2 балансных XLR/TRS-входа<br>&nbsp;&nbsp;&nbsp; * 2 балансных XLR \'сквозных\' выхода для подключения сателлитов<br>&nbsp;&nbsp;&nbsp; * На верхней части корпуса имеется встроенный \'стакан\' диаметром 35 мм для установки соединительной стойки типа \'сабвуфер-сателлит\'<br>&nbsp;&nbsp;&nbsp; * Корпус из высококачественной 18 мм фанеры с запатентованным покрытием DuraFlex™ специально сконструирован для максимальной басовой отдачи и звуковой производительности<br>&nbsp;&nbsp;&nbsp; * Стильный, подсвечиваемый логотип на передней стенке для индикации включения<br>&nbsp;&nbsp;&nbsp; * Размеры В х Ш х Г - 673 x 535 x 610 мм<br>&nbsp;&nbsp;&nbsp; * Вес 36 кг &nbsp;<br><br><br><br>Страна-производитель: МЕКСИКА</p>', 60000, '2011-03-11 23:23:19', 211, 'компактный портативный сабвуфер. 700 Вт продолжительная мощность. 18” VCG™ Woofer, покрытие Duraflex™, 18 мм фанера, стальная решетка 16 Gauge, 35мм гнездо под штатив Артикул: A027238', 4776, 11, NULL, '', ''),
  (20209, 'JBL PRX710', '<p><strong>Описание JBL PRX710:</strong></p><p><strong>JBL PRX710</strong>&nbsp;является самым компактным устройством из серии PRX700. Несмотря на свои небольшие габариты, данная двухполосная активная акустическая система способна обеспечивать лучшие показатели, как для своего размера и веса, звуковых характеристик.</p><h3>Технические характеристики:</h3><p><br><br>На входной панели устройства имеются:<br>- два балансных комбо-входа XLR-Jack 1/4 \" и два небалансных RCA;&nbsp;<br>- LED-индикатор сигнала и срабатывания лимитера для каждого канала;<br>- переключатель чувствительности Mic / Line для канала 1 и Ground Lift для канала 2;&nbsp;<br>- кнопка для отключения LED индикатора, расположенного на передней стороне сабвуфера.<br>Показатели системы:<br>Диапазон частот — 50 Гц - 19,6 КГц<br>Номинальная мощность — 1500 Вт<br>Максимальный уровень звукового давления — 133 дБ<br>ВЧ драйвер — 2408H-1.5\"<br>НЧ драйвер — M110-4 - 10\" Differential Drive ®<br>Покрытие — 100° х 60°<br>Корпус — Фанера из тополя с покрытием DuraFlex<br>Размеры (В x Ш x Г) — 500 х 335 х 322 мм<br>Вес — 16,4 кг<br><br></p><p>Страна-производитель:&nbsp;МЕКСИКА</p>', 31450, '2014-06-27 07:48:48', 211, 'JBL PRX710 активная 2-полосная АС 1500Вт. НЧ 1 x JBL M110-4 10\" / ВЧ 1 x JBL 2408H-2, Макс SPL - 133дБ, Входы:(2x) XLR-1/4\", RCA, XLR loop-thru, 36мм \"стакан\", Вес 16,5кг\r\n', 19204, 0, 1884815, '\0', ''),
  (5600, 'Soundcraft EFX8', '<p>Soundcraft EFX8:</p><p>8-миканальный микшерский пульт Soundcraft EFX использует процессор AudioDNA, используемый во многих внешних устройствах Digitech и Lexicon, в том числе и в высокоуважаемом процессоре Lexicon MX500.</p><p>Серия Soundcraft EFX сочетает все свойства популярного микшерского пульта Soundcraft EPM со встроенным 24-хбиттным цифровым процессором эффектов Lexicon, расширяя диапазон недорогих, многофункциональных компактных микшерских пультов Soundcraft.</p><p>С более чем 35 годами опыта, имя Lexicon находится среди самых известных создателей оборудования для обработки сигнала и эффектов реверберации в индустрии. Это – гарантия того, что вы получите эффекты высочайшего качества, которые с большой вероятностью найдутся даже в консолях более высокого ценового диапазона.</p><p>Секция эффектов аккуратно помещена в компактный корпус микшерской консоли, имеет два стереоканала и эффекты, отправляемые на каждый канал. К вашим услугам 32 эффекта на выбор с функцией tap tempo, 3 эффекта управления параметрами и возможность сохранения пользовательских настроек эффекта. Светодиодный индикатор уровня канала эффекта, и функция блокировки звука дают пользователю еще большую маневренность и гибкость в работе.</p><p>Особый акцент при создании Soundcraft EFX уделялся качеству сборки и качеству передачи аудио, при этом рабочая поверхность должна была остаться простой в использовании и соответствующей профессиональному диапазону Soundcraft. Soundcraft EFX использует микрофонный преамп GB30 с высоким уровнем прозрачности (спроектированный Грэмом Бритом к 30-тилетнему юбилею компании, и используемый также на профессиональных консолях большего размера серий LX7ii и GB). Soundcraft EFX предлагает все свойства Soundcraft EPM, особенно замечательны из которых конфигурируемый aux send, металлические разъемы XLR и 1/4\", стерео входы RCA для воспроизведения и стерео выходы RCA для записи, 3-хполосный эквалайзер с развернутым диапазоном средних частот на моно входах, 3-хполосный эквалайзер на двух стерео входах, разъемы TRS, семисегментный светодиодный индикатор уровня и выход на наушники.</p><p>Soundcraft EFX может быть использован во множестве ситуаций, в числе которых работа на живых концертах, звукозапись, использование в монтажных студиях и работа с инсталляциями из нескольких акустических систем.</p><p>ОСНОВНЫЕ СВОЙСТВА МИКШЕСКОЙ КОНСОЛИ СО ВСТРОЕННЫМИ ЭФФЕКТАМИ SOUNDCRAFT EFX8:</p><p>• 8 каналов моно и 2 канала стерео<br>• Встроенный 24-хбиттный цифровой процессор эффектов Lexicon<br>• 32 настройки FX<br>• Tap Tempo и функция сохранения настройки FX<br>• 1 effect send на каждом канале<br>• 1 конфигурируемая вспомогательная шина<br>• Металлические разъемы XLR и 1/4\"<br>• Входы RCA для воспроизведения и выходы RCA для записи<br>• 3-хполосный эквалайзер с расширенной настройкой диапазона средних частот для моно входов<br>• 3-хполосный эквалайзер на стерео входах<br>• Разъемы TRS на всех стерео входах<br>• Десятисегментный светодиодный индикатор уровня выходного сигнала<br>• Интуитивная и понятная система<br>• Выход для подключения наушников<br>• Удобство в установке и использовании</p>', 14939, '2014-08-28 05:00:29', 185, 'Soundcraft EFX8  микшерный пульт 8 моно, 2 стерео, 2 AUX, встроенный процессор эффектов Lexicon, tap tempo, монтируется в рэк, крепления приобретаются отдельно.', 5060, 17, NULL, '\0', ''),
  (6032, 'QUIK LOK SP180BK', '<p>Легкий алюминиевый пневматический держатель штативного типа SP 180 предназначен для крепления акустической колонки. SP 180 имеет регулируемую высоту 106.7 – 193 см, длину в собранном виде 183см, и выпускается в двух цветовых модификациях – черной (BK) и серебристой (SR).<br><br>Страна-производитель: ИТАЛИЯ</p>', 3500, '2014-03-28 12:54:49', 84, 'алюминиевая подставка под акустические системы на треноге (черная) Артикул: 54447', 5473, 32, NULL, '\0', ''),
  (6468, 'AMERICAN DJ REVO III LED RGBW', '<p>American DJ Revo III LED RGBW<br>светодиодный прибор с эффектом 7-ми «лунных цветков», 7 пучков светодиодов – всего 392: 140 красных, 105 зеленых, 84 синих и 63 белых, 10 каналов DMX, аналогичен галогенной лампе мощностью 600 Вт, большой угол раскрытия луча, 3 режима: DMX-управление, звуковая активация и «MASTER/SLAVE», стробо-эффект, диммер: 0-100%, малая потребляемая мощность, срок службы светодиодов: 100000 ч., кронштейн крепления в комплекте, синхронизация с REVO II LED и REVO III LED, разъемы: XLR для DMX, 1/4 разъем для пульта ДУ, 220 В/ 50 Гц, размеры:312 x 306 x 334 mm</p>', 12700, '2014-08-16 10:24:30', 190, 'Светодиодный прибор с эффектом 7-ми «лунных цветков». ', 19270, 37, NULL, '\0', ''),
  (8492, 'Allen&Heath ZED10FX', '<p>Микшер со встроенным USB-интерфейсом.<br>Встроенный процессор эффектов с 16 алгоритмами<br>4 моно, 2 стерео, 1 дополнительный стерео вход<br>3-полосный эквалайзер с полупараметрической серединой на моно входах,<br>2-полосный эквалайзер на стерео каналах<br>Каналы 1 и 2 - универсальные микрофонно-линейные входы на разъемах Jack и XLR.<br>Каналы 3 и 4 с высокоомными инструментальными входами, что позволяет не пользоваться DI – боксом.<br>Оба стереоканала имеют входы на стандартных Джеках, но один из них также имеет пару RCA разъемов для CD проигрывателя.<br>ZED10 также имеет дополнительный стереовход с регулятором уровня, называемый PLAYBACK, который может получать сигнал со входов Jack и с разъема USB. Сигнал со входа Playback можно подавать на выход Aux для создания сопровождающего трека для вокала. Встроенный USB-аудио интерфейс работает со стерео входом и стереовыходом. Вход интерфейса может подключаться к мастер выходц микшера, к отдельной стерео шине REC и к шинам AUX. Выход аудио интерфейса может быть подключен ко входу второго стереоканала ST2 или дополнительному входу PLAYBACK.<br>Интерфейс использует стандартные драйвера систем PC и MAC, также прекрасно работает с драйвером asio4all.<br>В коплекте с пультом поставляется программа <a data-cke-saved-href=\"http://www.ikmultimedia.com/x-gear/features/\" href=\"http://www.ikmultimedia.com/x-gear/features/\">X-Gear Amplitube</a>.</p>', 14000, '2011-12-13 08:39:14', 184, 'Микшер 4мик. 2стерео, 1проигр. FX, USB I/ O, EQ 3-пол. с параметр. серединой, 2инстр вх', 7140, 0, 0, '\0', ''),
  (8493, 'Allen&Heath ZED12FX', '<p>Компания Allen&amp;Heath продолжает выпускать новые модели в рамкаx, ставшей уже популярной, серии микшеров ZED. На этот раз компания представляет два новых микшера: Микшеры для живой работы и записи,ZED-12FX (6 моно каналов и 4 стереоканала, из них 3 двойных стереоканала и один стереовозврат с процессора эффектов) и ZED-22FX (16 моно каналов и 4 стереоканала, из них 3 двойных стереоканала и один стереовозврат с процессора эффектов), которые сочетают в себе все функции серии ZED и секцию встроенных эффектов. Эффекты новых USB микшеров ZED подразделяются на 4 типа: TAP TEMPO DELAYS (ритмические задержки), SHORT REVERBS (короткая реверберация), LONG REVERBS (длинная реверберация), MODULATION (модуляция). Управление эффектами осуществляется при помощи всего 3х кнопок, что значительно облегчает процесс работы, обеспечивает удобную навигацию и позволяет быстро применить эффект, определив заранее идеальное время задержки и количество реверберации. \"Микшеры ZED-12FX и 22FX со встроенной секцией эффектов были разработаны специально для тех музыкантов, которым нужны качественные эффекты для живых выступлений и звукозаписи, но при этом они не хотят загружать свою звуковую установку дополнительной громоздкой аппаратурой.\" - Говорит Майк Гриффин – менеджер по исследованиям и разработкам компании Allen&amp; Неатн. Новые Микшеры ZED FX имеют 3х полосный эквалайзер с параметрической серединой для моно каналов и 2х полосный эквалайзер для стерео каналов, 100 мм фейдеры, 4 aux посыла (2 pre-fade и 2 post-fade0, посыл и возврат сигнала с/на USB (для записи и воспроизведения с PC или Mac), двойные стерео входы и обладают расширенными возможностями для мониторинга. Коннекторы расположены на лицевой панели для максимально легкого подключения/отключения устройств. Печатные платы чрезвычайно надежно закреплены на верхней панели, таким же образом, как и в туровых микшерах от компании Allen&amp;Heath.&nbsp;</p><p><br></p><ul><li>Микрофонный предусилитель DuePre Tm&nbsp;</li><li>6 моно каналов с Insert\'ом&nbsp;</li><li>3 двойных стерео канала входа&nbsp;</li><li>Встроенная стерео звуковая карта USB; 2 канала I/O&nbsp;</li><li>16 скоснтруированных эффектов с заданием темпа (Tap Tempo)&nbsp;</li><li>4 посыла Aux для мониторов или эффектов (один на встроенный процессор)&nbsp;</li><li>100мм фейдеры профессионального качества&nbsp;</li><li>3-х полосный эквалайзер с полупараметрической серединой</li><li>Дополнительный выход ALT на мониторы&nbsp;</li><li>Размеры – 385х465х98 мм</li></ul>', 25500, '2014-06-27 14:26:58', 184, 'Микшер 6мик. 4стер, FX, 4 AUX, USB I/ O, EQ 3-пол. с парам. серединой, 100мм. фейд.', 19138, 499, 0, '\0', ''),
  (9434, 'SOUNDKING DG001', '<p>Подставка под ногу гитариста.<br>Материал: сталь.<br>Цвет: черный.</p>', 350, '2014-06-26 10:30:28', 150, 'подставка под ногу гитариста', 8081, 1, 0, '\0', ''),
  (19749, 'SOUNDKING DF136', '<p>Стойка для мидиклавиатуры или ноутбука.<br>Регулируемая высота 920 - 1300 мм.<br>Сталь.<br>Цвет: черный<br>Вес 5 кг.</p>', 1800, '2014-03-28 12:25:53', 150, 'стойка для мидиклавиатуры или ноутбука, сталь, черный', 18421, 1, 0, '\0', ''),
  (20210, 'BEHRINGER B112D', '<p>EUROLIVE B112D профессиональная активная акустическая система предназначена стать легендой рядом с другими EUROLIVE моделями. Это более легкая система (12,3 кг) и более мощная. Если Вам нужно добавить беспроводные микрофоны, нет ничего проще, просто включите приемник в специализированный порт на задней панели, и Вы имеете полный доступ к двум каналам натурально звучащего беспроводного соединения.&nbsp;<br>Встроенный микшер характеризуется ультра низким уровнем шума, высокочастотным микрофонным предусилителем и двумя входами, которые принимают фактически любые mic/line сигналы. Если необходим больший охват используйте удобный Link выход XLR разъем для дополнения других активных акустических систем.&nbsp;<br>В эту 1000 Вт систему включен запатентованный DSP (цифровой процессор) с двух полосным эквалайзером, активным кроссовером, ограничителями с двойной защитой и корректированием, гарантирующие очень низкий уровень искажения. LF и НF преобразователи разработаны специально для каждого применения. B112D имеет массивный низ, отчетливую середину и кристально чистый верх.&nbsp;<br>Благодаря трапециевидной форме B112D подходит для широкого применения. Ее можно устанавливать на стандартные стойки, размещать вертикально наверху сабвуфера или положить на бок для использования как сценичных мониторов. Подключать очень просто, потребуется только XLR или 1/4\" кабель и питание. Дополнительные колонки могут быть подключены через XLR Link выход (джек) на задней панели.</p><ul><li>Мощная двухполосная акустическая система для живого применения и воспроизведения</li><li>Ультра компактная и легковесная система предоставляет превосходный звук даже при чрезмерном уровне звукового давления</li><li>Готовность приема беспроводных систем</li><li>2 канальный микшер с Mic/Line входами, управлением громкостью и светодиодами</li><li>2 полосный эквалайзер плюс встроенный звуковой процессор</li><li>Технология Class-D усилителя</li><li>Мощный 12\'\' динамик обеспечивает невероятно глубокий бас и акустическую силу</li><li>1,35\'\' динамик с алюминиевой диафрагмой для необыкновенных высоких частот</li><li>Дополнительный Line выход позволяет подключать дополнительные акустические системы</li><li>Трапециевидный дизайн позволяет по-разному размещать: на стандартную 35 мм стойку или как напольный монитор</li><li>Удобная форма ручек для легкой переноски и установки</li><li>Высококачественные компоненты и прочная конструкция гарантируют долгий срок службы</li></ul><p><strong>Характеристики:&nbsp;</strong><br><br>Частотный диапазон: 50 Hz - 20 kHz&nbsp;<br>Частота кроссовера: 2,8 kHz&nbsp;<br>Аудио входы:&nbsp;<br>XLR&nbsp;<br>&nbsp; &nbsp; &nbsp;Чувствительность: -36 dBu to 0 dBu&nbsp;<br>&nbsp; &nbsp; &nbsp;Сопротивление: 14 кОм&nbsp;<br>¼\" TRS jack&nbsp;<br>&nbsp; &nbsp; &nbsp;Чувствительность: -36 dBu to 0 dBu&nbsp;<br>&nbsp; &nbsp; &nbsp;Сопротивление: 14 кОм&nbsp;<br>Беспроводная система&nbsp;<br>&nbsp; &nbsp; &nbsp;Разъем: USB 3.0&nbsp;<br>&nbsp; &nbsp; &nbsp;Частотная группа: 2.4 GHz&nbsp;<br>&nbsp; &nbsp; &nbsp;Частотный диапазон: 20 Hz - 20 kHz (+0/-2.5 dB)&nbsp;<br>&nbsp; &nbsp; &nbsp;Расстояние: максимум 80 м&nbsp;<br><br>Питание:230 V~, 50 Hz (T 3.15 A H 250 V)&nbsp;<br>Эквалайзер: +/-15 dB @ 12 kHz; +/-15 dB @ 80 Hz&nbsp;<br>Размеры: 568 х 342 х 270 мм&nbsp;<br>Вес: 12,3 кг&nbsp;</p>', 11600, '2014-06-30 10:22:30', 70, 'JBL PRX710 активная 2-полосная АС 1500Вт. НЧ 1 x JBL M110-4 10\" / ВЧ 1 x JBL 2408H-2, Макс SPL - 133дБ, Входы:(2x) XLR-1/4\", RCA, XLR loop-thru, 36мм \"стакан\", Вес 16,5кг\r\n', 19201, 0, 1884815, '\0', '\0'),
  (20213, 'JBL PRX715XLF', '<table style=\"width:777px\"><tbody><tr><th colspan=\"2\" style=\"vertical-align:top\">Основные параметры</th></tr><tr><th style=\"vertical-align:top; width:270px\">Тип</th><td style=\"vertical-align:top\">концертная, активная, фазоинверторного типа</td></tr><tr><th style=\"vertical-align:top; width:270px\">Акустическое излучение</th><td style=\"vertical-align:top\">монополярная</td></tr><tr><th style=\"vertical-align:top; width:270px\">Назначение</th><td style=\"vertical-align:top\">сабвуфер</td></tr><tr><th style=\"vertical-align:top; width:270px\">Состав комплекта</th><td style=\"vertical-align:top\">1 громкоговоритель</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Характеристики</th></tr><tr><th style=\"vertical-align:top; width:270px\">Количество полос</th><td style=\"vertical-align:top\">1</td></tr><tr><th style=\"vertical-align:top; width:270px\">Мощность</th><td style=\"vertical-align:top\">1500 Вт</td></tr><tr><th style=\"vertical-align:top; width:270px\">Максимальное звуковое давление</th><td style=\"vertical-align:top\">131 дБ SPL</td></tr><tr><th style=\"vertical-align:top; width:270px\">Диапазон воспроизводимых частот</th><td style=\"vertical-align:top\">37-113 Гц (-10 дБ)</td></tr><tr><th style=\"vertical-align:top; width:270px\">Регулировка фазы</th><td style=\"vertical-align:top\">есть</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Усилитель</th></tr><tr><th style=\"vertical-align:top; width:270px\">Интерфейсы</th><td style=\"vertical-align:top\">балансный вход x2</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Излучатели</th></tr><tr><th style=\"vertical-align:top; width:270px\">Тип излучателей</th><td style=\"vertical-align:top\">динамические</td></tr><tr><th style=\"vertical-align:top; width:270px\">НЧ-излучатель</th><td style=\"vertical-align:top\">381 мм</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Дополнительно</th></tr><tr><th style=\"vertical-align:top; width:270px\">Размеры (ШхВхГ)</th><td style=\"vertical-align:top\">445x547x580 мм</td></tr><tr><th style=\"vertical-align:top; width:270px\">Вес</th><td style=\"vertical-align:top\">25.4 кг</td></tr></tbody></table>', 47998, '2014-07-29 09:51:02', 211, 'JBL PRX715XLF активный сабвуфер 1500Вт. 1 x JBL 2275H, Макс SPL - 131дБ, Входы:(2x) XLR-1/4\", XLR loop-thru, М20 \"стакан\" для соединительных стоек SS4-BK или SS4-BK24, Вес 25,5кг\r\n', 19209, 0, 1884815, '\0', ''),
  (20338, 'ROXTON AZ-650', '<p>Многозонный (6 зон) трансляционный усилитель&nbsp;ROXTON AZ-650&nbsp;используются для построения систем оповещения и музыкальной трансляции на базе дополнительного оборудования. Данный усилитель предназначен для микширования и усиления звукового сигнала с целью его дальнейшей трансляции на громкоговорители.&nbsp;<br>К&nbsp;ROXTON AZ-650&nbsp;может быть подключено до 5-ти источников аудио сигнала, 3 микрофонных и 2 линейных входа. Уровни линейных и микрофонных входов регулируются при помощи ручек на передней панели.<br>Выходной каскад усилителя содержит трансформатор, который дополнительно повышает напряжение усиленного сигнала до 100В. Это необходимо для минимизации потерь в линии. В усилитель встроен селектор на 6 зон. К высоковольтным выводам селектора необходимо подключать только специализированные громкоговорители, содержащие трансформатор.&nbsp;<br>Кроме высоковольтных, усилитель&nbsp;ROXTON AZ-650&nbsp;также имеет низкоомные выводы, для подключения стандартных акустических систем.&nbsp;<br>Общая регулировка усиления осуществляется при помощи регулятора на передней панели блока.<br>Питание усилителя осуществляется от переменного напряжения 220В. Конструктивно блок выполнен в настольном исполнении.<br></p><p><strong>Основные характеристики</strong></p><table style=\"width:543px\"><tbody><tr><td style=\"vertical-align:top\">Напряжение питания</td><td style=\"vertical-align:top\">АС 220-240В, 50 Гц</td></tr><tr><td style=\"vertical-align:top\">Выходная мощность</td><td style=\"vertical-align:top\">650 Вт</td></tr><tr><td style=\"vertical-align:top\">Потребляемая мощность</td><td style=\"vertical-align:top\">1300 Вт</td></tr><tr><td style=\"vertical-align:top\">Выходной сигнал (напряжение/сопротивление)</td><td style=\"vertical-align:top\">100В,70В~4-16 Ом</td></tr><tr><td style=\"vertical-align:top\">Встроенный селектор</td><td style=\"vertical-align:top\">6 зон (до 240 Вт / 100 В)</td></tr><tr><td style=\"vertical-align:top\">Частотный диапазон</td><td style=\"vertical-align:top\">100 Гц - 16к Гц</td></tr><tr><td style=\"vertical-align:top\">Коэффициент гармоник</td><td style=\"vertical-align:top\">менее 0.1%</td></tr><tr><td style=\"vertical-align:top\">Отношение сигнал/шум MIC</td><td style=\"vertical-align:top\">более 66 дБ</td></tr><tr><td style=\"vertical-align:top\">Отношение сигнал/шум AUX</td><td style=\"vertical-align:top\">более 70 дБ</td></tr><tr><td style=\"vertical-align:top\">Уровень на микрофонном входе 1,2,3</td><td style=\"vertical-align:top\">2 мВ / 600 Ом</td></tr><tr><td style=\"vertical-align:top\">Уровень сигнала на линейном входе 1,2</td><td style=\"vertical-align:top\">250 мВ / 10 кОм</td></tr><tr><td style=\"vertical-align:top\">Уровень сигнала на линейном выходе</td><td style=\"vertical-align:top\">0 дБ ~1В / 600 Ом</td></tr><tr><td style=\"vertical-align:top\">Мьютирование</td><td style=\"vertical-align:top\">0~-30дБ</td></tr><tr><td style=\"vertical-align:top\"><p>Защита по выходу</p><p><strong></strong></p></td><td style=\"vertical-align:top\"><p>перегрузка, КЗ</p></td></tr></tbody></table><p><strong>&nbsp;Прочие характеристики</strong></p><table style=\"width:543px\"><tbody><tr><td style=\"vertical-align:top\">Температура функционирования</td><td style=\"vertical-align:top\">+10°C +35°C</td></tr><tr><td style=\"vertical-align:top\">Относительная влажность</td><td style=\"vertical-align:top\">не более 90 %</td></tr><tr><td style=\"vertical-align:top\">Габаритные размеры</td><td style=\"vertical-align:top\">440 x 92 x 330 мм</td></tr><tr><td style=\"vertical-align:top\">Вес</td><td style=\"vertical-align:top\">24 кг</td></tr><tr><td style=\"vertical-align:top\">Другие наименования модели</td><td style=\"vertical-align:top\"><a data-cke-saved-href=\"http://www.escortpro.ru/299-1_roxton-az650.htm\" href=\"http://www.escortpro.ru/299-1_roxton-az650.htm\">Roxton AZ650</a></td></tr></tbody></table>', 21500, '2014-07-21 12:09:07', 250, 'Усилитель трансляционный зонный 650 Вт, 3 микрофонных и 2 линейных входа, 6 зон, настольный', 19402, NULL, 124, '\0', ''),
  (20339, 'ROXTON PA-20T', '<p>ROXTON PA-20T&nbsp;- потолочный громкоговоритель 20/10 Вт, двухполосный.</p><p>Достоинством громкоговорителя&nbsp;ROXTON PA-20T&nbsp;является сочетание хороших акустических характеристик с эргономикой и удобством монтажа. Конструктив громкоговорителя тщательно продуман. Громкоговоритель выполнен из первичного АВС пластика. Высокое качество звучания достигается за счет двух полосного исполнения – дополнительного тветтера и пассивного разделительного фильтра. Концентрически расположенный вращающийся твиттер позволяет дополнительно варьировать диаграммой направленности. Монтажные провода подводятся к винтовой клеммной колодке с различными градациями включения. Громкоговоритель устанавливается в подвесной потолок и легко крепится при помощи поворотных защелок.</p><p>Функциональные особенности:</p><ul><li>Потолочное врезное исполнение</li><li>Встроенный трансформатор</li><li>Двухполосны</li><li>Вращающийся ВЧ твиттер</li><li>Пассивный фильтр</li><li>Градация мощности</li><li>Врезное исполнение</li><li>Удобство монтажа</li><li>Интерьерный дизайн</li><li>Пластиковый корпус</li><li>Металлическая сетка</li><li>Винтовые зажимы</li><li>Терминал под винт</li></ul>', 1300, '2014-07-21 12:16:24', 250, 'Roxton PA-20T — Потолочный громкоговоритель 20/10 Вт, двухполосный', 19404, NULL, 124, '\0', ''),
  (20217, 'JBL PRX718XLF', '<p><strong>JBL PRX718XLF 18”</strong>&nbsp;– это портативный и компактный сабвуфер с продолжительной мощностью в 1500 Вт. Устройство обладает: выходами RCA и XLR, гнездом под штатив (35 мм), стальной решеткой 16 Gauge, стаканом под резьбу (М20), фанерой (18 мм), покрытием Duraflex и 18” VCG™ Woofer.<br><br>Данное устройство принадлежит к новой линейке PRX700, а так же имеет расширенный диапазон под низкие частоты. JBL PRX718S-XLF 18” – это пример портативного и активного туринга премиум класса от бренда JBL Professional.<br><br>Сабвуфер JBL PRX718S-XLF 18” наделен многоканальным 1500-Ватным цифровым усилителем, относящимся к классу «D» и произведенным компанией Crown. Такой усилитель гарантирует максимально эффективную работу устройства и его малый вес. В данной модели сабвуфера используются: низкочастотные запатентованные динамики «Differential Drive», обеспечивающие оптимальное рассеивание тепла, широчайший динамический диапазон и компрессию более низкого уровня в противоположность его традиционной конструкции. Результат показан высоким уровнем звукового давления и лучшим качеством звучания.<br><br>Корпус модели JBL PRX718S-XLF 18” произведен из фанеры высокого качества с запатентованным DuraFlex покрытием в 25 мм (на нижней и верхней части корпуса, обеспечивая ему дополнительную жесткость). 18 мм фанера для корпуса данной модели собранна с помощью шпунтовых соединений, благодаря чему корпус обладает максимальной басовой отдачей и звуковой производительностью. Верхняя часть корпуса содержит «стан», диаметр которого составляет 35 мм, позволяющий устанавливать соединительную стойку типа «сателлит-сабвуфер».<br><br><br></p><h3>Технические характеристики:</h3><p><br><br>• Тип: активный сабвуфер 18”;<br>• Частотная характеристика (±3 дБ): 35 Гц – 87Гц;<br>• Частотный диапазон (-10 дБ): 30 Гц – 113Гц;<br>• Мощность: 1500 Вт;<br>• Максимальное SPL: 134дБ;<br>• Точка кроссовера: аналоговый фильтр 90 Гц, 48 дБ крутизна;<br><br>Индикаторы сигнала:&nbsp;<br>• Желтый – сработал лимитер;&nbsp;<br>• Синий: режим ожидания, готов передавать аудио сигнал;<br>• Зеленый – сигнал присутствует;<br>• Красный: режим сохранения энергии, не готов передавать аудио;<br><br>• НЧ драйвер: 1 x JBL 2275H (18“);<br>• Динамическая защита (вход): dbx Type IV™ лимитер;<br>• Подвес/монтаж: стакан с резьбой М20;<br>• Выходной разъем: 2х XLR папа;<br>• Входные разъемы: 2 x балансных XLR / 1/4 джек;<br><br>• Размер (В x Ш x Г): 690мм x 523 мм x 724 мм;<br>• Вес: 36.8 кг.</p>', 55500, '2014-07-05 08:28:58', 211, 'JBL PRX718XLF активный сабвуфер 1500Вт. 1 x JBL 2278G, Макс SPL - 134дБ, Входы:(2x) XLR-1/4\", XLR loop-thru, М20 \"стакан\" для соединительных стоек SS4-BK или SS4-BK24, Вес 37кг\r\n', 19221, 0, 1884815, '\0', ''),
  (20224, 'Electro-Voice ELX115P', '<h2>Electro-Voice ELX 115P - акустическая система</h2><p>ELX 115P – это компактная универсальная акустическая система со встроенным усилителем мощности в 1000 Вт, являющаяся следующим шагом от ELX 112P к более мощному звуку в линейке серии Live X. Благодаря 15\'\' динамику, акустическая система имеет более расширенный низкочастотный диапазон, в отличие от ELX 112P. Отличный выбор как в качестве портальной, так и мониторной акустической системы! Реализована в прочном деревянном корпусе с порошковым покрытием, которое придаёт акустической системе устойчивость к различным механическим повреждениям. Коммутационная панель расположена под углом к плоскости корпуса, что снижает риск вырывания разъёма. Там, где стоит вопрос эффективности, надёжности, а также эксплуатационных качеств, серьёзным ответом будет серия Live X от Electro-Voice!<br><br>• Разработана для применения в профессиональной музыкальной деятельности, инсталляциях, церквях и в других сферах<br>• 15\'\' НЧ динамик EVS-15K<br>• 1.5\'\' высокочастотный компрессионный драйвер DH-1K с титановой мембраной<br>• Частотный диапазон 44 Гц – 20 кГц, max SPL 134 дБ<br>• Лёгкий 1000-Вт усилитель класса D с пассивной системой охлаждения<br>• ВЧ рупор с раскрытием 90° x 50°<br>• Прочный деревянный корпус со «стаканом»<br>• Может использоваться как монитор с углом раскрытия 60°</p><table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:97%\"><tbody><tr><td>Частотный диапазон (‑3&nbsp;дБ):</td><td><a data-cke-saved-href=\"tel:56 - 18 000\" href=\"tel:56 - 18 000\">56 - 18 000</a> Гц</td></tr><tr><td>Частотный диапазон (‑10&nbsp;дБ):</td><td><a data-cke-saved-href=\"tel:44 - 20 000\" href=\"tel:44 - 20 000\">44 - 20 000</a> Гц</td></tr><tr><td>Мощность RMS - Общая:</td><td>1000 Вт</td></tr><tr><td>Мощность пиковая - Общая:</td><td>—</td></tr><tr><td>Чувствительность, 1Вт/1м:</td><td>—</td></tr><tr><td>Максимальное звуковое давление:</td><td>134 дБ</td></tr><tr><td>Импеданс:</td><td>—</td></tr><tr><td>Угол раскрытия&nbsp;Г° x В°:</td><td>90° x 50°</td></tr><tr><td>Динамики (НЧ/ВЧ):</td><td>15\" (EVS-15K) /&nbsp;1.5\" (DH-1K)</td></tr><tr><td>Габаритные размеры&nbsp;(В x Ш x Г), мм:</td><td>708 х 432 х 382 мм</td></tr><tr><td>Масса (нетто):</td><td>24.3 кг</td></tr></tbody></table><p><br></p>', 43000, '2014-08-16 09:51:45', 476, 'ELECTRO VOICE ELX 115P – Активная Акустическая система,RMS Мощность 1000 Ватт,Звуковое Давление 134 Дб', 19237, 0, 1884815, '\0', ''),
  (20219, 'Dynacord CMS 1000-3', '<p><strong>Особенности CMS 1000-3:</strong></p><p>- высококачественные малошумные микрофонные предусилители,&nbsp;</p><p>- шесть AUX посылов,</p><p>- два блока обработки звукового сигнала</p><p>- USB интерфейс</p><p>- PC-MIDI интерфейс</p><p>- 11-полосный графический эквалайзер</p><p>- вокальный фильтр</p><p>- обрезной &nbsp;низкочастотный фильтр</p><p><br></p><table border=\"1\" cellpadding=\"3\" cellspacing=\"0\"><tbody><tr><td><strong>Модель</strong></td><td><strong>CMS&nbsp;1000-3</strong></td></tr><tr><td><p>Каналы (моно + стерео)&nbsp;</p></td><td><p>6+4</p></td></tr><tr><td><p>MIC GAIN (моно)</p><p>MIC GAIN (стерео)</p><p>LINE/CD/USB GAIN (стерео)</p></td><td><p>0... +60 дБ</p><p>+10... +60 дБ</p><p>-10... +20 дБ&nbsp;</p></td></tr><tr><td><p><strong>КНИ на 1 кГц, MBW=80 кГц</strong></p><p>Вход MIC на выход Main L/R, +16 dBu</p></td><td><p><br></p><p>&lt; 0,005%</p></td></tr><tr><td><p><strong>АЧХ,</strong>&nbsp;-3 дБ</p><p>Любой вход на любой микшерный выход&nbsp;</p></td><td><p><br></p><p>15 Гц - 70 кГц</p></td></tr><tr><td><p><strong>Входная чувствительность</strong></p><p>MIC</p><p>LINE (моно)</p><p>LINE (стерео)</p><p>CD ( стерео)</p></td><td><p><br></p><p>- 74 дБ</p><p>- 54 дБ</p><p>- 34 дБ</p><p>- 34 дБ</p></td></tr><tr><td><p><strong>Максимальный уровень входной чувствительности</strong></p><p>MIC</p><p>LINE (моно)</p><p>LINE (стерео)</p></td><td><p><br></p><p>+21 дБ</p><p>+41 дБ</p><p>+30 дБ</p></td></tr><tr><td><p><strong>Эквивалентный входной шум,</strong></p><p>Вход MIC, A-взвешанное, 150 Ом</p></td><td>-130 дБ</td></tr><tr><td><p><strong>Эквализация</strong><br>LO Shelving&nbsp;<br>MID Peaking, моновходы</p><p>MID Peaking, стереовходы</p><p>HI Shelving&nbsp;<br>Master EQ, 11 полос<br>(63, 125, 250, 400, 1 кГц, 1,6 кГц, 2,5 кГц, 4 кГц, 6,3 кГц, 12 кГц)</p></td><td><p><br></p><p>+/- 15 дБ / 60 Гц</p><p>+/- 15 дБ/100 Гц - 8 кГц<br>+/- 12 дБ / 2,4 кГц<br>+/- 15 дБ / 12 кГц</p><p><br></p><p>+/- 10 дБ / Q = 1,5 -2,5</p></td></tr><tr><td><p><strong>Потребляемая мощность</strong></p><p>без лампы</p><p>с лампой</p></td><td><p><br></p><p>45 Вт</p><p>50 Вт</p></td></tr><tr><td><p><strong>Фильтры</strong><br>LO-CUT, моно входы&nbsp;<br>VOICE FILTER, стерео входы</p><p>FEEDBACK FILTER, MON1/2</p></td><td><p><br></p><p>f = 80 Гц, 18 дБ / окт</p><p>переключаемый<br>10 Гц … 7 кГц, notch-фильтр, 9 дБ</p></td></tr><tr><td><p>Экран</p></td><td><p>высококонтрасный OLED&nbsp;</p><p><br><br></p></td></tr><tr><td><strong>Эффекты</strong><br>Тип процессора эффектов&nbsp;<br>Пресеты&nbsp;<br>ДУ</td><td><p><br></p><p>Двойное стерео 24/48 бит</p><p>100 заводских + 20 пользовательских, tap-delay</p><p>Ножной выключатель, MIDI</p></td></tr><tr><td><p><strong>Цифровой аудиоинтерфейс</strong><br>Каналы (моно + стерео)&nbsp;<br>АЦ/ЦА ковертер&nbsp;<br>Частота выработки&nbsp;<br>ПК</p><p>MIDI</p></td><td><p><br></p><p>4 входа / 4 выхода</p><p>24 бит</p><p>44,1 / 48 / 88,2 / 96 кГц</p><p>USB 2.0, Type-B \"мама\"</p><p>5-пиновый разъем DIN, вход/выход</p></td></tr><tr><td>Фантомное питание</td><td><p>48 В&nbsp;</p><p><br></p></td></tr><tr><td>Напряжение</td><td>100 В ... 240 В / 50-60 Гц</td></tr><tr><td>Габариты, мм</td><td><p>без крышки: 510,5 х 155 х 498,5</p><p>в рэк: 483 х 135 х 443,7</p></td></tr><tr><td><p>Вес, кг</p></td><td>9,5</td></tr><tr><td>Дополнительные аксессуары</td><td><p>DC-RMK1000CMS -&nbsp;элементы крепления для монтирования в 19\" рэковый шкаф</p><p>DC-LID1000 - крышка&nbsp;<br>DC-LILITE-4P - лампа на «гусиной шее», 12 В / 5 Вт, длина 12\", разъем XLR 4 pol.<br>FS11 ножной выключатель со световым индикатором</p></td></tr></tbody></table><p><br></p><p><strong>USB интерфейс</strong></p><p>Для расширения возможностей применения микшерные пульты CMS-3 оснащены USB портом, который осуществляет связь между пультом и ПК/Mac и используется как цифровой аудиоинтерфейс. Цифровой аудиоинтерфейс может быть использован для входа или вывода четырёх цифровых аудиоканалов одновременно. Подобная функция позволяет использовать CMS-3 в качестве студийного пульта.&nbsp;</p><p><br></p><p><strong>Процессор эффектов</strong></p><p>CMS-3 оснащён блоком обработки звукового сигнала, который полностью соответствует требованиям современных музыкантов на сцене и в студии. Он состоит из двух независимых блоков эффектов по 100 оптимизированных для живых выступлений, а также 20 пользовательских пресетов с</p><p>возможностью регулировки параметров. Кроме того, имеется дистанционное управление по MIDI, тап-делей, USB-интерфейс и большой контрастный OLED дисплей.</p>', 64000, '2014-08-11 18:57:33', 467, 'DYNACORD CMS 1000-3-univ микшерный пульт, 6 микроф.входов+4 микр/стерео линейных входа, 6 AUX, два процессора эффектов 24 бит, USB-аудио интерфейс.\r\n', 19225, 0, 1884815, '\0', ''),
  (20220, 'DYNACORD POWERMATE 600-3', '<p>В компактном корпусе PowerMate 600-3 заключено множество функций, что позволяет использовать его в любой профессиональной звуковой инсталляции. Несмотря на компактные размеры и массу 9 килограмм, пульт PowerMate 600-3 имеет 2-канальный усилитель класса D мощностью по 1000 Вт (4 Ом) на канал, 24-битный стерео процессор, разделенный на два независимых блока эффектов по 100 оптимизированных для живых выступлений, а также 20 пользовательских пресетов с возможностью регулировки параметров, 4-канальный USB интерфейс, дистанционное управление по MIDI, тап-делей и большой контрастный OLED дисплей.</p><p><br></p><p>Жесткая крышка для верхней панели со встроенной ручкой, входящая в комплект, не только выглядит красиво, но и обеспечит простую, а главное, удобную транспортировку пульта на концерт и после него. Дополнительно к пульту можно приобрести транспортировочную сумку (BAG-600PM) и монтажный комплект для установки PowerMate 600-3 в рэковый шкаф (RMK 600-3).</p><p>Удобен для перевозок, требует мало времени для установки, интуитивно понятный и удобный в управлении - все эти качества совмещены в самом маленьком из активных микшеров серии PowerMate-3.</p><p><br></p><table><tbody><tr><td><strong>Модель</strong></td><td><strong>PowerMate 600-3</strong></td></tr><tr><td>Каналы (моно + стерео)</td><td>4+4</td></tr><tr><td>Микрофонные входы XLR</td><td>6</td></tr><tr><td>Auxilarys (MON, FX, AUX)</td><td>1 Pre, 1 Post, 1 Pre/Post switchable</td></tr><tr><td>Макс. вых. мощность, один канал, запас по мощности (Dynamic-Headroom), соотношение сигнал/шум по IHF-A<br>на 2,66 Ом&nbsp;<br>на 4 Ом&nbsp;<br>на 8 Ом&nbsp;</td><td><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>2 х 1600 Вт<br>2 х 1250 Вт<br>2 х 675 Вт</p></td></tr><tr><td>Макс. вых. номинальная мощность при 1 кГц, КНИ=1%, один канал<br>на 2,66 Ом&nbsp;<br>на 4 Ом&nbsp;<br>на 8 Ом&nbsp;</td><td><p><br></p><p><br></p><p><br></p><p>2 х 1350 Вт<br>2 х 1150 Вт<br>2 х 650 Вт</p></td></tr><tr><td>Макс. вых. мощность в СЧ диапазоне, 1 кГц, КНИ 1%, два канала<br>на 2,66 Ом&nbsp;<br>на 4 Ом&nbsp;<br>на 8 Ом&nbsp;</td><td><br><br><br>2 х 1350 Вт<br>2 х 1000 Вт<br>2 х 600 Вт</td></tr><tr><td>Номинальная вых. мощность, один канал 20 Гц ... 20 кГц, КНИ 0,5%<br>на 4 Ом&nbsp;<br>на 8 Ом&nbsp;</td><td>2 х 900 Вт<br>2&nbsp;&nbsp;450 Вт</td></tr><tr><td>Макс. вых. напряжение усилителя мощности, без нагрузки</td><td>74 В</td></tr><tr><td>КНИ на 1 кГц, MBW=80 кГц<br>Вход MIC на Л/П мастер-выход, +16 dBu<br>Вход усилителя мощности на Л/П выход на громкоговорители</td><td><p>&lt; 0,005%</p><p><br></p><p>&lt; 0,075%</p></td></tr><tr><td>DIM 30, усилитель мощности</td><td>&lt; 0,05%</td></tr><tr><td>IMD-SMPTE, усилитель мощности, 60 Гц, 7 кГц</td><td>&lt; 0,15%</td></tr><tr><td>Частотный диапазон, - 3 дБ при 1 кГц<br>Любой вход на выход Mixer<br>Любой вход на Л/П выход на громкоговорители</td><td><br>15 Гц - 70 кГц<br>20 Гц - 30 кГц</td></tr><tr><td>CMRR, микрофонный вход, 1 кГц</td><td>&gt; 80 дБ</td></tr><tr><td>Эквивалентный входной шум, вход MIC, A-взвешанное, 150 Ом</td><td>-130 дБ</td></tr><tr><td><strong>Соотношение сигнал/шум</strong>, усилитель, А-взвешенное, 4 Ома</td><td>105 дБ</td></tr><tr><td><strong>Топология выходного каскада</strong>&nbsp;усилителя мощности</td><td>Класс D</td></tr><tr><td><strong>Эквализация</strong></td><td><br></td></tr><tr><td>Низкочастотный шельф</td><td>+/- 15 дБ / 60 Гц</td></tr><tr><td>Среднечастотный пиковый, моно вход</td><td>+/- 12 дБ / 2,4 кГц</td></tr><tr><td>Высокочастотный шельф</td><td>+/- 15 дБ / 12 кГц</td></tr><tr><td>Мастер эквалайзер, 9-полосный<br>(63, 125, 250, 500, 1k, 2k, 4k, 6.3k, 12k Hz)&nbsp;</td><td>±10 dB / Q = 1.5 to 2.5</td></tr><tr><td><strong>Фильтры</strong></td><td><br></td></tr><tr><td>Обрезной НЧ-фильтр, моно-входы</td><td>80 Гц, 18 дБ/окт</td></tr><tr><td>Голосовой фильтр</td><td>LPN, отключаемый</td></tr><tr><td><strong>Эффекты</strong></td><td><br></td></tr><tr><td>Тип</td><td>2 стерео-процессора эффектов 24/48-бит</td></tr><tr><td>Пресеты эффектов</td><td>100 заводских + 20 пользовательских, Tap-Delay</td></tr><tr><td>Дистанционное управление</td><td>Footswitch, MIDI</td></tr><tr><td>Дисплей</td><td>128 х 64 пикс, OLED</td></tr><tr><td>Цифровой аудио-интерфейс</td><td>4 входных / 4 выходных каналов</td></tr><tr><td>АЦ/ЦА-преобразователь</td><td>24-бит</td></tr><tr><td>Частота семплирования</td><td>44,1 / 48 / 88,2 / 96 кГц</td></tr><tr><td>ПК-интерфейс</td><td>USB 2.0, \"мама\" тип B</td></tr><tr><td>MIDI-интерфейс</td><td>5-контактный разъем DIN, вход/выход</td></tr><tr><td>Управление выходной мощностью</td><td>настраиваемый RMS-лимитер</td></tr><tr><td><strong>Защита</strong></td><td><br></td></tr><tr><td>Выходы микшера</td><td>AUX, MON, MASTER A L/R</td></tr><tr><td>Усилитель</td><td>Audio Limiters, High Temperature, DC, HF, Short Circuit, Peak Current Limiters, Turn-On-Delay</td></tr><tr><td>Импульсный источник питания</td><td>Inrush Current Limiters, Mains Over/Under Voltage, Mains Over Current, High Temperature</td></tr><tr><td>Охлаждение</td><td>вентиляторы с регулируемой скоростью</td></tr><tr><td>Фантомное питание, отключаемое по группам</td><td>48 В DC</td></tr><tr><td>Параметры сети</td><td>100 В .. 240 В AC, 50 Гц .. 60 Гц</td></tr><tr><td>Потребление энергии при 1/8 максимальной выходной мощности, 4 Ом</td><td>450 Вт</td></tr><tr><td>Класс безопасности</td><td>1</td></tr><tr><td><strong>Габаритные размеры, (ШxВxГ), мм</strong></td><td><br></td></tr><tr><td>для рэковой инсталляции</td><td>483 x 135.8 x 310.3 (высота 7 U)</td></tr><tr><td>с крышкой</td><td>438.8 x 161.7 x 362.5</td></tr><tr><td><strong>Масса</strong></td><td><br></td></tr><tr><td>Масса без крышки</td><td>9 кг</td></tr><tr><td>Масса с крышкой&nbsp;</td><td>9,5 кг</td></tr><tr></tr></tbody></table>', 64000, '2014-02-26 15:27:38', 467, 'DYNACORD POWERMATE 600-3 - Активный микшерный пульт со встроенный усилителем мощности, 2 х 300 Вт/ 4 0м или 2 х 150/ 8 0м, 6 моно/ 2 стерео . 2 процессора эффектов.', 19227, 0, 1884815, '\0', ''),
  (20221, 'ALLEN&HEATH Qu16', '<p>16-ти канальный цифровой микшер &nbsp;</p><ul><li>16 моно входов (TRS + XLR), 3 стерео входа (TRS)&nbsp;</li><li>14 миксов (включая основной микс LR, 10 aux миксов и 2 отдельные FX шины)&nbsp;</li><li>Выход AES&nbsp;</li><li>4 процессора эффектов с отдельными стереовозвратами&nbsp;</li><li>Встроенный USB мультитрек-рекордер Qu-Drive&nbsp;</li><li>Бесплатное iPad приложение Qu-Pad для управления&nbsp;</li><li>Сенсорный дисплей 800x480&nbsp;</li><li>Отдельные физические органы управления для всех основных элементов обработки&nbsp;</li><li>Моторизованные фейдеры&nbsp;</li><li>Интерфейс dSNAKE – возможность подключения модулей расширения AR84 и AR2412&nbsp;</li><li>Совместим с цифровой системой персонального мониторинга Allen &amp; Heath ME&nbsp;</li><li>Потоковая передача многоканального аудио на Mac по USB&nbsp;</li><li>Управление по MIDI цифровыми звуковыми рабочими станциями&nbsp;</li><li>Может устанавливаться в 19” стойки&nbsp;</li><li><p>Новый микшер оснащен пятью 2-ядерными DSP процессорами, которые обеспечивают обработку каналов и миксов, а также использование процессоров эффектов. Благодаря большому запасу мощности DSP Qu-16 обладает необходимым потенциалом для обновления и дополнения функциональности. Он также оснащен пятью 200 МГц процессорами ARM последнего поколения, которые обеспечивают работу сенсорного дисплея и органов управления на передней панели, использование Qu-Drive, Ethernet функционал и работу моторизованных фейдеров.</p><p>QU-16 имеет цветной сенсорный дисплей разрешением 800 x 480, который предоставляет быстрый и удобный доступ к обработке линеек, процессорам эффектов, меню Setup и всем настройкам системы. Аналогично консолям iLive, ALLEN &amp; HEATH QU-16 имеет отдельные физические органы управления для всех основных элементов обработки, которые расположены в блоке SuperStrip, включая Gain, фильтр НЧ, параметрический эквалайзер, гейт, компрессор и регулятор панорамы.</p><p>QU-16 также имеет встроенный USB мультитрек-рекордер Qu-Drive, который позволяет делать многоканальные и стереозаписи на внешние жесткие диски. Кроме этого, интерфейс USB используется для сохранения и загрузки сцен и библиотек, а при использовании Qu-16 в студиях он также обеспечивает потоковую передачу многоканального аудио на компьютеры Mac в цифровые звуковые рабочие станции.</p><p>Собственный протокол и интерфейс ALLEN &amp; HEATH– dSNAKE – позволяет при помощи одного кабеля Cat5 длиной до 120 м подключать к Qu-16 модули расширения AR84 и AR2412. Новый микшер совместим с цифровой системой персонального мониторинга ALLEN &amp; HEATH ME.</p><p>ALLEN &amp; HEATH QU-16 оснащен 17 моторизованными фейдерами ALPS, 16 из которых имеют два слоя, обеспечивая на компактной передней панели микшера доступ ко всем каналам и мастерам; 17-й фейдер – это отдельный мастер-фейдер, который отображает и регулирует уровень выбранного микса. Также доступен третий слой фейдеров, в который пользователь может по своему усмотрению назначить входы, посылы на эффекты, возвраты с эффектов и миксы.</p><p>С помощью бесплатного iPad приложения Qu-Pad, которое подключается к микшеру по Wi-Fi, можно настраивать мониторные миксы прямо на сцене, свободно перемещаться по залу при настройке портальной системы и затем управлять миксами во время концерта с любого месте в зале.</p><p>QU-16 оснащен шестнадцатью предусилителями AnalogiQ™ с возможностью полного сброса и вызова настроек, которые отличаются широким диапазоном регулировки сигнала. Qu-16 имеет 4 процессора эффектов, такие же, как в системе iLive, с обширной библиотекой пресетов, включающей в себя точные эмуляции классических приборов обработки таких типов, как Reverb, Gated Reverb, Delay, Modulation, Flanger и пр.</p></li></ul>', 95000, '2014-02-26 15:41:39', 184, 'ALLEN&HEATH Qu16 — 16-ти канальный цифровой микшер   16 моно входов (TRS + XLR), 3 стерео входа (TRS)  14 миксов (включая основной микс LR, 10 aux миксов и 2 отдельные FX шины)  Выход AES  4 процессора эффектов с отдельными стереовозвратами  Встроенный USB мультитрек-рекордер Qu-Drive  Бесплатное iPad приложение Qu-Pad для управления  Сенсорный дисплей 800x480  \r\n', 19230, 0, 1884815, '\0', ''),
  (20266, 'Allen&Heath ZED22FX', '<ul><li>16 эффектов с Tap Tempo;</li><li>16 микрофонных/линейных входов;</li><li>Предусилители DuoPre™;</li><li>3-полосный эквалайзер с полупараметрической серединой для моно каналов;</li><li>3 стерео входа с регулировкой уровня и 2-полосным эквалайзером;</li><li>4 посыла AUX (2 pre-fade и 2 post-fade);</li><li>Интерфейс USB;</li><li>100-миллиметровые фейдеры</li></ul>', 39900, '2014-06-28 05:16:19', 184, 'микшерный пульт', 19313, NULL, 124, '\0', ''),
  (20267, 'Allen&Heath ZED-14', '<ul><li>6 моно входов</li><li>Предусилители DuoPre™</li><li>3-полосный эквалайзер с полупараметрической серединой для моно каналов</li><li>4 стерео входа с регулировкой уровня и 2-полосным эквалайзером</li><li>4 посыла AUX</li><li>Интерфейс USB</li><li>100 мм фейдеры</li></ul>', 23400, '2014-06-28 05:18:00', 184, 'микшерный пульт', 19315, NULL, 124, '\0', ''),
  (20268, 'Allen&Heath ZED60-10FX', '<ul><li>4 микрофонных/линейных входа&nbsp;</li><li>2 стерео входа&nbsp;</li><li>60мм фейдеры&nbsp;</li><li>USB интерфейс&nbsp;</li><li>Процессор эффектов&nbsp;</li></ul>', 17800, '2014-06-28 05:17:38', 184, 'микшерный пульт', 19316, NULL, 124, '\0', ''),
  (20269, 'Allen&Heath ZED60-14FX', '<ul><li>8 микрофонных / линейных входов&nbsp;</li><li>2 стерео входа&nbsp;</li><li>60мм фейдеры&nbsp;</li><li>USB интерфейс&nbsp;</li><li>Процессор эффектов&nbsp;</li></ul>', 20000, '2014-06-28 05:16:33', 184, 'микшерный пульт', 19317, NULL, 124, '\0', ''),
  (20225, 'Electro-Voice ELX112P', '<p>ELX 112P – это компактная универсальная акустическая система со встроенным усилителем мощности в 1000 Вт. Великолепный выбор как в качестве портальной, так и мониторной акустической системы, мощностью в 250 Вт! Реализована в прочном деревянном корпусе с порошковым покрытием, которое придаёт акустической системе устойчивость к различным механическим повреждениям. Коммутационная панель расположена под углом к плоскости корпуса, что снижает риск вырывания разъёма. Там, где стоит вопрос эффективности, надёжности, а также эксплуатационных качеств, серьезным ответом будет серия Live X от Electro-Voice!</p><p><br>• Разработана для применения в профессиональной музыкальной деятельности, инсталляциях, церквях и в других сферах<br>• 12\'\' НЧ динамик EVS-12K<br>• 1.5\'\' высокочастотный компрессионный драйвер DH-1K с титановой мембраной<br>• Частотный диапазон 50 Гц – 20 кГц, max SPL 132 дБ<br>• Лёгкий 1000-Вт усилитель класса D с пассивной системой охлаждения<br>• ВЧ рупор с раскрытием 90° x 50°<br>• Прочный деревянный корпус со «стаканом»<br>• Может использоваться как монитор с углом раскрытия 60°</p>', 38000, '2014-08-16 09:52:10', 476, 'ELECTRO VOICE ELX 112P -  активная акустическая система, 12\'\' , усилитель класса D, мощность  1000 Вт.', 19240, 0, 1884815, '\0', ''),
  (20226, 'Electro-Voice ZLX-12P', '<p>ZLX‑12P — это активная 2‑полосная АС с 12\" вуфером EVS‑12K, 1.5\" компрессионным драйвером DH‑1K, LCD-дисплеем и круглой ручкой управления и выбора настроек.</p><p>Запатентованный дизайн разделительной перегородки обеспечивает превосходное согласование драйвера по времени. Это дает улучшенный акустический толчок и усиливает разборчивость.</p><p>На задней панели АС имеет 2 комбинированных входных разъёма XLR/TRS. Каждый разъем имеет регулятор уровня входного сигнала. На каждый из этих 2 входов можно подавать как микрофонный, так и линейный сигнал.</p><p>При подключении микрофона, используйте динамические микрофоны, поскольку в данных разъемах отсутствует фантомное питание.</p><p>Также имеется дополнительный входной разъём mini-Jack 3.5 мм, который позволяет просто подключить портативный источник звука: плеер, мобильный телефон, планшет, ноутбук и т. п.</p><p>Выходной разъём XLR позволяет передать сумму всех входных сигналов на другую АС или на сабвуфер.</p><p>Вход в меню предустановок осуществляется нажатием на круглую ручку регулировки уровня выходного сигнала.</p><p>Переход между пунктами меню осуществляется поворотом данной ручки по или против часовой стрелки.</p><p>АС имеет лёгкий, сверхпрочный композитный корпус с оригинальным дизайном. Форма корпуса позволяет устанавливать АС в качестве напольного монитора.</p><p>Фактически, система ZLX‑12P представляет собой решение \"всё в одном\" и избавляет от необходимости приобретения дополнительного оборудования (усилителя, кроссовера, микшера, коммутационных кабелей).</p><p>Данная система является самодостаточной портативной системой. Она легко помещается в багажник. Для её работы необходим лишь источник питания 220 В и источник звука.</p><p>В сочетании с активным сабвуфером ELX 118P Вы получаете простое решение профессионального качества.</p><p>Ключевые особенности:</p><p>• 12\" вуфер EVS‑12K.<br>• 1.5\" компрессионный драйвер DH‑1K с титановым куполом.<br>• ВЧ рупор с раскрытием 90° x 60°.<br>• Встроенный 1000-Вт усилитель класса D.<br>• 2 комбинированных входных разъёма XLR/TRS с регуляторами уровня сигнала.<br>• Дополнительный входной разъём mini-Jack.<br>• Выходной разъём XLR.<br>• DSP-контроль оптимизирует звучание АС для конкретного выступления или помещения.<br>• Измерители уровня входных сигналов и независимый контроль усиления — мгновенно обеспечивают оптимальную структуру усиления.<br>• LED-индикатор работы и перегрузки на передней панели.<br>• Возможность установки АС в качестве напольного монитора.<br>• 3 ручки для переноса АС: сверху, снизу и сбоку.<br>• Лёгкая установка на стойку.</p>', 25000, '2014-08-16 09:52:38', 476, 'ELECTRO-VOICE ZLX-12P - двухполосная активная акустическая система ZLX-12P 1000 Вт', 19243, 0, 1884815, '\0', ''),
  (20350, 'Yamaha C-40', '<p>Yamaha C-40 — одна из наиболее востребованных классических гитар, лучшее решение по соотношению цены и качества.<br><br>• Длина мензуры – 25,59’’ = 650мм;<br>• Материал деки – ель;<br>• Материал корпуса– меранти (сорт красного дерева);<br>• Материал грифа – нато (сорт красного дерева);<br>• Накладка на гриф – палисандр;<br>• Бридж – палисандр;<br>• Колки – хром;<br>• Цвет – Natural (нат. дерево).</p>', 4200, '2014-09-10 09:10:39', 4, 'классическая гитара, дека ель, корпус меранти, гриф нато, накладка на гриф палисандр, колки хромированные, цвет натуральный', 19422, NULL, 124, '\0', ''),
  (20227, 'Electro-Voice TX1152', '<p>ТХ1122 — это 2-полосная акустическая система с одним 15\" НЧ динамиком SMX2151, благодаря которому НЧ сигнал передается четко и убедительно, и 1.25\" ВЧ драйвером.</p><p>В данной АС применяется компрессионный драйвер DH3 с диафрагмой 1.25\", покрытой оксидом титана, и 1\" выходным отверстием.</p><p>На ВЧ драйвер установлен поворотный рупор с раскрытием 60° x 40°, разработанный с применением технологии Constant Directivity™.</p><p>Особое внимание следует обратить на данную серию музыкальным коллективам с небольшим бюджетом. Почему именно для них? Всё достаточно просто:<br>эти системы легко транспортировать, благодаря прямоугольной форме корпуса, которая позволяет легко складывать акустические системы в любом имеющемся объёме (багажник или салон автомобиля);</p><p>имеют универсальные ручки, которые позволяют брать акустическую систему в любом положении;</p><p>опционально акустическая система комплектуется транспортировочными роликами, облегчающими транспортировку на большие расстояния;</p><p>защитная решётка имеет особую форму, придающую ей большую прочность в сравнении с обычными решётками;</p><p>порошковое покрытие придаёт акустической системе устойчивость к различным механическим повреждениям;</p><p>коммутационная панель, расположенная под углом к плоскости корпуса, снижает риск вырывания разъёма.</p><p><br>Tour X — это весьма практичная и удобная серия акустических систем от Electro-Voice. Она прекрасно подходит как для применения в передвижных, так и в стационарных комплектах.</p><p>Примером могут послужить любые заведения, в которых необходимо получить качественный и плотный звук, такие как: концертные площадки, ночные клубы, рестораны.</p><p>Серия Tour X была представлена широкой публике на выставке InfoComm, проходившей в Лас Вегасе 18 июня 2008 г. и вызвала положительные отзывы профессионалов.</p>', 38000, '2014-08-16 09:53:07', 476, 'ТХ1152 — это 2-полосная акустическая система с одним 15\" НЧ динамиком SMX2151, благодаря которому НЧ сигнал передается четко и убедительно, и 1.25\" ВЧ драйвером', 19309, 0, 1884815, '\0', ''),
  (20228, 'Electro-Voice ZLX-15P', '<p><strong>Electro‑Voice ZLX-15P - активная акустическая система</strong></p><p><strong>ZLX‑15P</strong>&nbsp;— это активная 2‑полосная АС с 15\" вуфером&nbsp;<strong>EVS‑15L</strong>, 1.5\" компрессионным драйвером&nbsp;<strong>DH‑1K</strong>, LCD-дисплеем и круглой ручкой управления и выбора настроек.<br><br>Запатентованный дизайн разделительной перегородки обеспечивает превосходное согласование драйвера по времени. Это дает улучшенный акустический толчок и усиливает разборчивость.<br><br>На задней панели АС имеет&nbsp;<strong>2</strong>&nbsp;комбинированных&nbsp;<em>входных разъёма</em>&nbsp;<strong>XLR/TRS</strong>. Каждый разъем имеет регулятор уровня входного сигнала. На каждый из этих 2 входов можно подавать как микрофонный, так и линейный сигнал.<br><br>При подключении микрофона, используйте динамические микрофоны, поскольку в данных разъемах отсутствует фантомное питание.<br><br>Также имеется дополнительный входной разъём&nbsp;<strong>mini-Jack 3.5&nbsp;мм</strong>, который позволяет просто подключить портативный источник звука: плеер, мобильный телефон, планшет, ноутбук и т.&nbsp;п.<br><br><em>Выходной</em>&nbsp;разъём&nbsp;<strong>XLR</strong>&nbsp;позволяет передать сумму всех входных сигналов на другую АС или на сабвуфер.<br><br>Вход в меню предустановок осуществляется нажатием на круглую ручку регулировки уровня выходного сигнала.<br><br>Переход между пунктами меню осуществляется поворотом данной ручки по или против часовой стрелки.<br><br>АС имеет лёгкий, сверхпрочный композитный корпус с оригинальным дизайном. Форма корпуса позволяет устанавливать АС в качестве напольного монитора.<br><br>Фактически, система&nbsp;<strong>ZLX‑15P</strong>&nbsp;представляет собой решение \"всё в одном\" и избавляет от необходимости приобретения дополнительного оборудования (усилителя, кроссовера, микшера, коммутационных кабелей).<br><br>Данная система является самодостаточной портативной системой. Она легко помещается в багажник. Для её работы необходим лишь источник питания 220&nbsp;В и источник звука.<br><br>В сочетании с активным сабвуфером ELX&nbsp;118P Вы получаете простое решение профессионального качества.</p><table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:97%\"><tbody><tr><td>Частотный диапазон (‑3&nbsp;дБ):</td><td><a data-cke-saved-href=\"tel:55 - 18&nbsp;000\" href=\"tel:55 - 18 000\">55 - 18&nbsp;000</a> Гц</td></tr><tr><td>Частотный диапазон (‑10&nbsp;дБ):</td><td><a data-cke-saved-href=\"tel:42 - 20&nbsp;000\" href=\"tel:42 - 20 000\">42 - 20&nbsp;000</a> Гц</td></tr><tr><td>Мощность RMS - Общая:</td><td>250 Вт</td></tr><tr><td>Мощность усилителя:</td><td>1000 Вт</td></tr><tr><td>Чувствительность, 1Вт/1м:</td><td>—</td></tr><tr><td>Максимальное звуковое давление:</td><td>127 дБ</td></tr><tr><td>Импеданс:</td><td>—</td></tr><tr><td>Угол раскрытия&nbsp;Г° x В°:</td><td>90° x 60°</td></tr><tr><td>Динамики (НЧ/ВЧ):</td><td>15\" (EVS‑15L) /&nbsp;1.5\" (DH‑1K)</td></tr><tr><td>Габаритные размеры&nbsp;(В x Ш x Г),&nbsp;мм:</td><td>685 x 423 x 383 мм</td></tr><tr><td>Масса (нетто):</td><td>38.0 кг</td></tr></tbody></table>', 29600, '2014-08-16 09:53:34', 476, 'ELECTRO VOICE ZLX-15P - это активная 2-х полосная АС с 15\" вуфером EVS-15L, 1.5\" компрессионным драйвером DH-1K, LCD-дисплеем и круглой ручкой управления и выбора настроек. Встроенный 1000-Вт усилитель класса D.', 19247, 0, 124, '\0', ''),
  (20229, 'Behringer X1204USB', '<p><strong>Описание BEHRINGER X1204USB:</strong></p><p>Новый, компактный и малошумящий микшерный пульт&nbsp;<strong>BEHRINGER X1204USB</strong>&nbsp;премиум-класса представлен вниманию музыкантов достаточно известной Австрийской компанией Behringer, которая зарекомендовала себя и стала известна благодаря своим современным и инновационным подходом в области производства достаточно недорогих, но качественных устройств для работы со звуковым сигналом. Аналоговый микшерный пульт Behringer X1204USB представляет известную серии микшеров Xenyx, которая отличается особой, малошумящей схемой электроники с достаточно широкими возможностями маршрутизации звукового сигнала.&nbsp;</p><p><br></p><p>Компания производитель позиционирует микшер X1204USB как аналоговый микшер премиум-класса, следует отметить, что в серии сверхкомпактных микшеров, аналоговый микшер БЕРИНДЖЕР КСЕНУКС 1204 ЮСБ является одним из самых популярных и продаваемый устройств для маршрутизации звукового сигнала. Представленная модель компактного микшера премиум-класса Xenyx X1204USB имеет самые лучшие, оптимально спроектированные характеристики, которые в сочетании с тщательно продуманной схемой маршрутизации и обработкой звукового сигнала делает этот микшер прекрасным устройством для высококачественной обработки звука.</p><p><br></p><p>Функциональные особенности аналогового микшера Xenyx X1204USB</p><p><br></p><p>Пассивный аналоговый микшер Xenyx X1204USB оборудован четырьмя моно-входами и двумя стерео входами. Каждый из первых четырех входов имеет свой собственный, независимый компрессор с отдельной ручкой настройки уровня компрессии. Электроника микшера обладает всеми современными функциональными характеристиками для качественной маршрутизации, посыла и микширования звукового сигнала. Диапазон воспроизводимых микшером частот достаточно широк, он представлен характеристиками от от 20 до 20000 Герц. Первые четыре канала микшера оборудованы своими собственными микрофонными предусилителями с ручками настройки предусиления на каждом из XLR каналов. Каждый из микрофонных каналов с системой встроенных предусилителей, может поднимать уровень звукового сигнала до 60 децибел, при динамическом сопротивлении в 26кОм.&nbsp;</p><p><br></p><p>Микшер оборудован двумя шинами Aux для посыла звукового сигнала и встроенным процессором эффектов, имеющем в своем составе самые часто используемые и важные эффекты для обработки вокала и музыкальных инструментов. Входной эквалайзер микшера оборудован специализированной системой с детектором обратной связи, так же есть интегрированный USB интерфейс для работы микшера с персональным компьютером. Компактный, малошумящий микшер премиум-класса X1204USB от компании &nbsp;Behringer предлагает Вам высокое качество обработки и практичную надежность в работе со звуковым сигналом по достаточно доступной цене.&nbsp;</p><p><br></p><h3>Уникальные особенности портативного микшера BEHRINGER X1204USB</h3><p><br></p><p>- Доступность использования восьми каналов для активной презентационной или музыкальной деятельности.</p><p>- Встроенный, высокоскоростной USB-интерфейс для взаимодействия с персональным компьютером.</p><p>- Запатентованная система микрофонных предусилителей XENYX с возможностью подачи фантомного питания на динамические микрофоны. &nbsp;</p><p>- Высококачественные, отдельные компрессоры с индивидуальными ручками настроек уровня на четыре канала компактного микшера.&nbsp;</p><p>- Запатентованная система мягкого, трехполосного эквалайзера. &nbsp;</p><p>- Микшер оборудован процессором эффектов, с 16-ю редактируемыми пресетами, включающими эффекты реверберации, хоруса, фленджера и многие другие.&nbsp;</p><p>- Возможность редактирования и сохранения пресетов процессора эффектов для последующего использования. &nbsp;</p><p>- USB-аудиоинтерфейс, интегрированный в микшер работает в стерео режиме.&nbsp;</p><p>- Микшер оборудован двумя шинами AUX для посыла звукового сигнала на каждый канал.&nbsp;</p><p>- Чувствительная система индикации пиков, функция Mute / Alt 3-4, функция SOLO и PFL на всех каналах микшера.&nbsp;</p><p>- Изолированная, отдельная «комната» для управления, выходы для наушников и два Track\\Usb стерео выхода.&nbsp;</p><p>- Две встроенные подгруппы с совершенно отдельными выходами.&nbsp;</p><p>- Микшер оборудован импульсным источником питания работающим от напряжения 100 - 240 Вольт, имеющем низкое энергопотребление.&nbsp;</p><p>- Удобные, функциональные фейдеры с ходом в 60 миллиметров.</p><p>- В конструкции микшера используются только высококачественные компоненты, благодаря которым микшер имеет исключительно надежную конструкцию, гарантирующую долгий срок службы всех составляющих.&nbsp;</p><p><br></p><h3>Возможности маршрутизации микшера и аналоговая передача звукового сигнала</h3><p><br></p><p>Одной из действительно превосходных особенностей представленного пассивного микшера XENYX 1204USB являются его гибкие возможности маршрутизации звукового сигнала и &nbsp;превосходный звук, который передает аналоговая схемотехника. Микшер оборудован качественными ручками-потенциометрами и невероятно износоустойчивыми мастер-фейдерами с ходом в 60 миллиметров. Кроме этого, компания-производитель представила в этой модели микшера по настоящему высококачественные микрофонные предусилители XENYX. Эти предусилители являются устройствами элитного класса, позволяющими использовать этот компактный микшер как в домашней, так и в небольшой студии звукозаписи. Микшер X1204USB сочетает в себе компактные размеры, небольшой вес, высококачественные эффекты, возможности гибкой маршрутизации и много другое, что делает X1204USB удобным и практичным микшером в линейке недорогих аналоговых микшеров для широкой сферы &nbsp;применения.&nbsp;</p><p><br></p><p>Система фантомного питания и классические «британские» эквалайзеры</p><p><br></p><p>Микшер реализует возможность для использования встроенной системы фантомного питания, что в значительной степени расширяет возможности применения этого устройства, переводя его в разряд полупрофессиональных аналоговых микшеров. Фантомное питание необходимо для профессиональных студийных, динамических микрофонов, на которые микшер может посылать отдельное питание в 48 V. Конструкция микшера предлагает удобную и достаточно простую реализацию управления и настройки звукового сигнала, так работа с звуковым сигналом, изменение настроек эквализации осуществляется при помощи системы «британского» эквалайзера. Такая система помогает приобрести звучанию своеобразную теплоту и звучание классических микшерных консолей. Кроме всего, микшер с новейшей технологией XENYX помогает пользователям соединять первоклассное аналоговое звучание и новейшие цифровые технологии обработки звука.</p><p><br></p><h3>Технические характеристики микшера &nbsp;BEHRINGER X1204USB</h3><p><br></p><p>Спецификация микрофонных входов : &nbsp;</p><p>- Тип входов : XLR (электронно-балансные входы, дискретные входные цепи).</p><p>- Уровень входных шумов (эквивалентный, микр. вход, 20 Hz – 20 kHz) :&nbsp;</p><p>&nbsp; &nbsp; - Сопр. источника 150-Ohm : - 129 dB \\ 130.5 dB (A-взвешенный).&nbsp;</p><p>&nbsp; &nbsp; - Сопр. источника 50-Ohm : - 131 dB \\ 133.3 dB (A-взвешенный);</p><p>&nbsp; &nbsp; - Сопр. источника 0-Ohm : - 134 dB \\ 135.7 dB (A-взвешенный);</p><p>- Диап. усиления входн. сигнала : + 10 до +60 dB.&nbsp;</p><p>- Частотный диапазон входов : &lt; 10 Hz - 200 kHz (- 3 dB) \\ &lt; 10 Hz - 150 kHz (- 1 dB).&nbsp;</p><p>- Входн. сопр. : 2.6 kOhm (балансное сопр.).&nbsp;</p><p>- Соотношение сигнал/шум : 110 dB (A-взвешенное).&nbsp;</p><p>- Коэффициент искажений (THD + N) : 0.005% \\ 0.004% (A-взвешенное). &nbsp;</p><p>- Система фантомного питания : отключаемая, + 48 V.&nbsp;</p><p>- Максим. входн. уровень : + 12 dBu (при +10 dB Gain).&nbsp;</p><p>- Преобразователи устройства : 64\\128-кратное пересэмплирование, 24-bit Sigma-Delta.&nbsp;</p><p>- Частота сэмплирования : 40 kHz.&nbsp;</p><p><br></p><p>Спецификация эквалайзеров микшера :&nbsp;</p><p>- Эквалайзер моно-каналов микшера : &nbsp;</p><p>&nbsp; &nbsp; - Низкие частоты (НЧ) : +/-15 dB (80 Hz);&nbsp;</p><p>&nbsp; &nbsp; - Средние частоты (СЧ) : +/-15 dB (2.5 kHz);&nbsp;</p><p>&nbsp; &nbsp; - Высокие частоты (ВЧ) : +/-15 dB (12 kHz).&nbsp;</p><p>- Эквалайзер стереоканалов :&nbsp;</p><p>&nbsp; &nbsp; - Низкие частоты (НЧ) : +/-15 dB (80 Hz);</p><p>&nbsp; &nbsp; - Средние частоты (СЧ) : +/-15 dB (2.5 kHz);</p><p>&nbsp; &nbsp; - Высокие частоты (ВЧ) : +/-15 dB (12 kHz).&nbsp;</p><p><br></p><p>Спецификация входов \\ выходов микшера :&nbsp;</p><p>- Линейные входы микшера : тип - 1/4 Jack (электронно-балансные входы).</p><p>&nbsp; &nbsp; - Макс. входн. уровень : 30 dBu.&nbsp;</p><p>&nbsp; &nbsp; - Диапазон усиления входн. сигн. : - 10 до + 40 dB.&nbsp;</p><p>&nbsp; &nbsp; - Входное сопротивление : балансное - 20 kOhm, небалансное - 10 kOhm.&nbsp;</p><p>&nbsp; &nbsp; - Помехи перекрестные : &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; - Закрытый канальный фейдер : 89 dB.&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; - Закрытый фейдер Main : 90 dB;&nbsp;</p><p>- Стерео-входы микшера :&nbsp;</p><p>&nbsp; &nbsp; - Тип входов : 1\\4 Jack (электронно-балансные входы);&nbsp;</p><p>&nbsp; &nbsp; - Максимальный входн. уровень : + 22 dBu.&nbsp;</p><p>&nbsp; &nbsp; - Диапазон усиления входного сигнала стерео каналов : - 20 до + 20 dB;&nbsp;</p><p>&nbsp; &nbsp; - Входное сопротивление стерео-каналов : балансное - 20 kOhm, небалансное - 10 kOhm;</p><p>- Входы CD\\Tape In : &nbsp;</p><p>&nbsp; &nbsp; - Тип входов : RCA разьемы, небалансные;&nbsp;</p><p>&nbsp; &nbsp; - Входн. сопротивление : 10 kOhm;</p><p>&nbsp; &nbsp; - Максимальный входн. уровень : +22 dBu.</p><p>- Канальные инсерты : 1\\4 Jack (небалансные).</p><p>- AUX (SEND) : 1\\4 Jack &nbsp;(небалансные), вых. сопр. - 120 Ohm.&nbsp;</p><p>- AUX (RETURN, стерео) : 1\\4 Jack &nbsp;(небалансные).</p><p>- Главные (основные) выходы (MAIN) : XLR (х 2), электронно-балансные.&nbsp;</p><p>- Выходы CONTROL ROOM : 1\\4 Jack &nbsp;(небалансные).</p><p>- Выход для наушников PHONES : 1\\4 Jack, стерео, небалансный.&nbsp;</p><p>- CD\\Tape Out : RCA (небалансные), стерео.&nbsp;</p><p>- Порт USB : стерео-вход \\ стереовыход, тип – В.&nbsp;</p><p><br></p><p>Питание микшера : 100 - 240 V, 50\\60 Герц.&nbsp;</p><p>Потребляемая мощность : 40 Ватт.&nbsp;</p><p>Габаритные размеры : (В) 97 мм. х (Ш) 270 мм. х (Г) 328 мм.&nbsp;</p><p>Вес : 2.8 кг.</p><p><br></p>', 7500, '2014-07-04 12:26:23', 70, 'Behringer X1204USB Компактный малошумящий микшерный пульт премиум-класса (4 моновхода с независимыми компрессорами, 2 стереовхода, 2 AUX-шины, процессор эффектов, интегрированный USB-интерфейс, встроенный импульсный блок питания)\r\n', 19249, 0, 124, '\0', '\0'),
  (20230, 'Behringer X1622USB', '<p><strong>Описание BEHRINGER X1622USB:</strong></p><p>Компания Behringer представляет компактный микшерный пульт&nbsp;<strong>BEHRINGER X1622USB</strong>. Микшер относится к устройствам премиум-класса, зарекомендовавшим себя в активной музыкальной и студийной деятельности. Пассивный микшер X1622USB от компании Behringer является достаточно известным устройством благодаря безотказной работе в любых условиях и широким набором самых важных функций для активной музыкальной деятельности. Аналоговый микшер БЕРИНДЖЕР КСЕНУКС X1622 ЮСБ представлен в популярной серии Xenyx, которая отличается малошумящей схемой электроники и широкими возможностями коммутации и маршрутизации звукового сигнала.&nbsp;<br><br>Аналоговый микшер Xenyx X1622USB предлагает Вашему вниманию четыре микрофонных канала с разъёмами XLR, двенадцать моно каналов на стандартных 1\\4 Jack разъёмах, четыре запатентованных микрофонных предусилителя и встроенный процессор эффектов, который переводит этот микшер на ступень выше по сравнению с многими другими моделями этого ценового диапазона. Если Вы желаете купить компактный аналоговый микшер BEHRINGER X1622USB, приобретая эту модель, Вы получаете многофункциональное устройство для использования в музыкальных презентациях, выступлениях групп, project студиях и многих других сферах.&nbsp;</p><h3>Уникальные особенности аналогового микшера BEHRINGER X1622USB</h3><p><br><br>- В конструкции микшера используются самые современные разработки и инновационно технологические решения.&nbsp;<br>- Микшер оборудован четырьмя микрофонными входами с запатентованными предусилителями XENYX и системой фантомного питания.&nbsp;<br>- Микрофонные входы микшера оснащены высококачественными микрофонными компрессорами с отдельными ручками настройки уровня компрессии.&nbsp;<br>- Цифровой процессор эффектов предлагает 16 редактируемых пресетов высокого качества.<br>- Процессор эффектов микшера включает в себя пресеты реверберации, хоруса, фленджера, цифрового дилэя, эффекта Pitch Shifter, секции мульти эффектов и многие другие.&nbsp;<br>- Отредактированные пресеты процессора эффектов можно сохранять во внутреннюю память микшера с возможностью быстрого вызова.<br>- Микшер оборудован интегрированным стереофоническим USB аудиоинтерфейсом для прямого подключения к персональному компьютеру.&nbsp;<br>- Возможность использования двух посылов AUX в каждом канале (1 префейдерный для мониторинга \\ 1 постфейдерный посыл на внутренний процессор и\\или внешнее устройство).&nbsp;<br>- Отдельная «комната» (Control Room) управления, стерео выходы для наушников и два дополнительных выхода.&nbsp;<br>- Канальные разрывы (Insert) на каждом моноканале для гибкой интеграции внешнего оборудования и процессоров эффектов.&nbsp;<br>- Две подгруппы с отдельными выходами (Out) и два многофункциональных стереовозрата (Aux) для гибкой маршрутизации звукового сигнала.&nbsp;<br>- Импульсный источник питания \"Planet Earth\" (100 - 240 В) автоматически определяющий напряжение сети, обеспечивающий бесшумное звуковоспроизведение при минимальном потреблении энергии.&nbsp;<br>- В конструкции микшера использованы износостойкие 60-мм логарифмические мастер-фейдеры и герметичные потенциометры.&nbsp;<br>- Выходная коммутация предлагает симметричные выходы основного микса с позолоченными разъёмами XLR, отдельные мониторные выходы, стереовыходы на наушники и стерео рекордер.&nbsp;<br>- В комплекте поставки микшера прилагается специализированный крепеж для монтажа микшера в рэковую стойку.&nbsp;<br>- Благодаря высококачественным компонентам и исключительно надёжной конструкции, микшер гарантирует долгий срок службы в самых экстремальных условиях.&nbsp;</p><h3>Основные функциональные особенности микшера Xenyx X1622USB</h3><p><br><br>Пассивный аналоговый микшер Xenyx X1622USB предлагает 12 моно-входов, четыре входные стерео пары, четыре микрофонных входа с отдельными предусилителями и независимым компрессором на каждый канал. Диапазон воспроизводимых частот микшера представляет характеристики от 20 до 20000 Герц. Каждый микрофонный канал имеет свой независимый предусилитель, поднимающий уровень звукового сигнала до 60 децибел с динамическим сопротивлением в 26кОм. Микшер оборудован несколькими шинами Aux для маршрутизации звукового сигнала и цифровым процессором эффектов, предлагающим самые разнообразные эффекты для обработки вокала и музыкальных инструментов. Используя интегрированный USB порт Вы можете подключать микшер к персональному компьютеру.&nbsp;</p><h3>Микрофонные каналы с предусилителями XENYX</h3><p><br><br>В аналоговый микшерный пульт X1622USB можно подключать четыре микрофона с разъёмами XLR. Каждый из микрофонных каналов оборудован отдельным предусилителем, построенным на запатентованной производителем технологии XENYX. Производитель заявляет, что эта технология переводит микрофонные предусилители микшера в один ряд с профессиональными микрофонными предусилителями премиум класса.&nbsp;</p><h3>Система фантомного питания микрофонных каналов</h3><p><br><br>Используйте так же систему фантомного питания для подключения профессиональных конденсаторных микрофонов, что ранее не было возможным в недорогих микшерах. Фантомное питание значительно расширяет возможности эксплуатации микшера, переводя его в разряд полупрофессиональных микшеров для работы с конденсаторными микрофонами.&nbsp;</p><h3>Профессиональная компрессия микрофонных каналов</h3><p><br><br>Первые четыре микрофонных входа микшера оборудованы отдельными, высококачественными микрофонными компрессорами с отдельными ручками настройки уровня компрессии.&nbsp;</p><h3>Интегрированный процессор эффектов</h3><p><br><br>Интегрированный процессор эффектов предлагает Вашему вниманию 16 редактируемых пресетов высокого качества. Встроенный процессор включает в себя такие важные эффекты, как реверберация, эффекты хоруса и фленджера, цифровой дилэй, эффекты Pitch Shifter, секцию мульти эффектов и многие другие эффекты. Очень важно, что каждый из эффектов можно отредактировать и сохранить во внутреннюю память микшера с возможностью быстрого вызова.</p><h3>USB интерфейс</h3><p><br><br>Микшер оборудован интегрированным стереофоническим USB аудиоинтерфейсом для прямого подключения к персональному компьютеру. Теперь Вы с легкостью можете использовать микшер как полноценную цифровую консоль для записи Вашей музыки или целой музыкальной группы. Так же можно загружать и выгружать дополнительные пресеты цифрового процессора эффектов.</p><h3>AUX посылы и отдельные контрольные комнаты (Control Room)</h3><p><br><br>Вам доступна возможность использования двух AUX посылов на каждом из каналов микшера, это один префейдерный посыл для мониторинга и один постфейдерный посыл на внутренний процессор или внешнее устройство обработки. Доступна возможность направления звукового сигнала в отдельные контрольные комнаты (Control Room) управления, стерео выходы для наушников и два дополнительных выхода.&nbsp;</p><h3>Канальные разрывы Insert и две подгруппы с отдельными выходами (Out)</h3><p><br><br>Микшер предлагает отдельные, канальные разрывы Insert на каждом моноканале микшера. Используя инсертные разьемы Вы можете производить более гибкую интеграцию внешних процессоров эффектов и другого оборудования. Воспользуйтесь двумя подгруппами с отдельными выходами (Out) и двумя многофункциональными стереовозратами (Aux) для гибкой маршрутизации Вашего звукового сигнала.</p><h3>Импульсный источник питания Planet Earth&nbsp;</h3><p><br><br>Питание микшера осуществляется посредством импульсного источники питания Planet Earth, который автоматически определяет и подстраивается под напряжение сети в диапазоне 100 - 240 Вольт. Такой источник питания обеспечивает микшеру бесшумное звуковоспроизведение при минимальном потреблении энергии и провалов низкочастотного спектра при высоком уровне громкости.&nbsp;</p><h3>Износостойкие мастер-фейдеры и герметичные потенциометры</h3><p><br><br>Для лучшего комфорта и продолжительной эксплуатации в конструкции микшера использованы износостойкие 60-мм логарифмические мастер-фейдеры и герметичные потенциометры.&nbsp;</p><h3>Возможность крепления микшера в рэковую стойку</h3><p><br><br>В любой момент микшер можно установить в рэковую стойку. Специально для этого, в комплекте поставки микшера прилагается специализированный монтажный комплект крепежа.&nbsp;</p><h3>Металлический корпус, гарантирующий продолжительный срок эксплуатации&nbsp;</h3><p><br><br>Производитель использует в конструкции микшера только высококачественные компоненты. Металлический корпус и надёжная конструкция гарантирует микшеру долгий срок службы в самых экстремальных условиях.&nbsp;</p><h3>Эквалайзеры с запатентованной технологией XENYX</h3><p><br><br>Разработчики микшера предоставили пользователям возможность управления звуковым сигналом при помощи встроенного эквалайзера. Микшер оборудован оригинальным эквалайзером, построенным с использованием запатентованной технологии XENYX, позволяющей соединить воедино первоклассное аналоговое звучание и передовые технологии.&nbsp;</p><h3>Компактность в сочетании с функциональными возможностями&nbsp;</h3><p><br><br>Компактный аналоговый микшер X1622USB предлагает пользователям самые разные функциональные возможности для практического применения. В конструкции микшера использованы специализированные операционные усилители (4580) благодаря которым микшер получил минимальные показатели звуковых искажений и шума.&nbsp;</p><h3>Технические характеристики микшера Behringer X1622USB</h3><p><br><br>Микрофонные входы :<br>- Тип : XLR, электронно-балансные, с дискретными входными цепями.<br>- Эквивалентный уровень входных шумов (Микрофонный вход, 20Hz - 20kHz).<br>- При сопротивлении источника 150 Ohm : -129 dB / 130.5 dB A-weighted.<br>- При сопротивлении источника 0 Ohm : -134 dB / 135.7 dB A-weighted.<br>- При сопротивлении источника 50 Ohm : -131 dB / 133.3 dB A-weighted.<br>- Частотный диапазон :<br>&lt; 10 Hz - 150 kHz (-1 dB).<br>&lt; 10 Hz - 200 kHz (-3 dB).<br>- Макс. входной уровень : +12 dBu (+10 dB Gain).<br>- Диапазон усиления входного сигнала : от +10 до +60 dB.<br>- Соотношение сигнал/шум : 110dB/112dB A-weighted.<br>- Входное сопротивление : 2.6 kOhm (балансное).<br><br>Линейные входы :<br>- Тип : 1/4\" TRS, электронно-балансные.<br>- Входное сопротивление :<br>Балансное : 20 kOhm.<br>Небалансное : 10 kOhm.<br>- Макс. входной уровень : 30 dBu.<br>- Диапазон усиления входного сигнала : от -10 до +40 dB.<br>- Перекрестные помехи :<br>При закрытом фейдере Main : 90 dB.<br>При закрытом канальном фейдере : 89 dB.<br>- Частотный диапазон (микрофонный вход - основной выход) :<br>&lt; 10 Hz - 90 kHz (+0dB/-1dB).<br>&lt; 10 Hz - 160 kHz (+0dB/-3dB).<br><br>Стереовход :<br>- Входное сопротивление : 20 kOhm.<br>- Тип : 1/4\" TRS, электронно-балансные.<br>- Макс. входной уровень : +22 dBu.<br><br>Эквалайзеры моноканалов :<br>- СЧ : +/-15 dB (100 Hz - 8 kHz).<br>- ВЧ : +/-15 dB (12 kHz).<br>- НЧ : +/-15 dB (80 Hz).<br><br>Эквалайзеры стереоканалов :<br>- Низкие СЧ : +/-15 dB (500 Hz).<br>- Высокие СЧ : +/-15 dB (3 kHz).<br>- НЧ : +/-15 dB (80 Hz).<br>- ВЧ : +/-15 dB (12 kHz).<br><br>AUX-посылы :<br>- Выходное сопротивление : 120 Ohm.<br>- Тип : 1/4\" TS, небалансные.<br>- Макс. выходной уровень : +22 dBu.<br><br>AUX-возвраты (стерео) :<br>- Тип : 1/4\" TRS, электронно-балансные.<br>- Выходное сопротивление :<br>Балансное : 20 kOhm.<br>Небалансное : 10 kOhm.<br>- Макс. выходной уровень : +22 dBu.<br><br>Основные выходы (Main) :<br>- Тип :<br>XLR, электронно-балансные.<br>1/4\" TS, небалансные.<br>- Выходное сопротивление :<br>Балансное : 240 Ohm.<br>Небалансное : 120 Ohm.<br>- Макс. выходной уровень : +28 dBu.<br><br>Выходы Control Room :<br>- Выходное сопротивление : 120 Ohm.<br>- Тип : 1/4\" TS, небалансные.<br>- Макс. выходной уровень : +22 dBu.<br><br>Выходы для наушников :<br>- Тип : 1/4\" TRS, стерео, небалансные.<br>- Макс. выходной уровень : +19 dBu / 150 Ohm (+25 dBm).<br><br>Сигнал-процессинг :<br>- Преобразователи : 24-bit Sigma-Delta, 64/128-кратное пересэмплирование.<br>- Частота сэмплирования : 40 kHz.<br><br>Порт USB.<br>- Разъем : тип В.<br>- Частота сэмплирования : 48 kHz.<br>- Аудио : стереовход/стереовыход.<br>- Преобразователи : 16-bit.<br><br>Источник питания : 100 - 240 V~, 50/60 Hz.<br>Потребляемая мощность : 50 W.<br>Размеры (В х Ш х Г): 97 мм. х 301 мм. х 351 мм.<br>Вес : 3.3 кг.</p>', 10100, '2014-06-27 14:42:08', 70, 'Behringer X1622USB Компактный малошумящий микшерный пульт премиум-класса (4 моновхода с независимыми компрессорами, 4 стереовхода, 2 AUX-шины, процессор эффектов, интегрированный USB-интерфейс, встроенный импульсный блок питания)\r\n', 19251, 0, 124, '\0', '\0'),
  (20231, 'Electro-Voice ZX5', '<p>Electro-Voice ZX5 - пассивная акустическая система<br>ZX5-90 — это 2-полосная АС, созданная на основе новейших компонентов от Electro-Voice®, с углами раскрытия 90° x 50°.</p><p>Использование высокомощного 15\" динамика Electro-Voice DVX‑3150, применяемого также в низкочастотной системе DYNACORD Power Sub 315, позволяет, в отличие от ZX3‑90, эксплуатировать ZX5‑90 без дополнительных НЧ кабинетов.</p><p>2\" компрессионный неодимовый драйвер Electro-Voice ND2, обеспечивает хорошую артикуляцию и чистый звук в средне/высокочастотном диапазоне.</p><p>Обладая небольшими габаритами, акустическая система ZX5‑90 имеет среднюю мощность 600 Вт, а максимальный уровень звукового давления достигает 132 дБ!</p><p>Области применения очень различны. Для \"банкетного\" музыкального коллектива будет вполне достаточно двух АС ZX5, чтобы озвучить площадку более чем на 100 мест. При кластерной компоновке нескольких кабинетов можно озвучивать небольшие концертные залы и религиозные храмы, при этом с очень высоким качеством.</p><p>Модель ZX5-90 имеет следующие модификации:</p><p>• ZX5-90B — чёрная версия.<br>• ZX5-90W — белая версия.<br>• ZX5-90PI — всепогодная версия в водонепроницаемом корпусе (только в чёрном исполнении).</p><p>Форма кабинета позволяет использовать его в качестве напольного монитора. Система оборудована элементами для подвеса L-Track.<br>Дополнительно предлагается множество кронштейнов, как для установки отдельного кабинета, так и для формирования кластеров.</p><p><br></p><p>Частотный диапазон (‑3 дБ):&nbsp;&nbsp; &nbsp;<a data-cke-saved-href=\"tel:58 - 18 000\" href=\"tel:58 - 18 000\">58 - 18 000</a> Гц<br>Частотный диапазон (‑10 дБ):&nbsp;&nbsp; &nbsp;<a data-cke-saved-href=\"tel:39 - 20 000\" href=\"tel:39 - 20 000\">39 - 20 000</a> Гц<br>Мощность RMS - Общая, Biamp (НЧ/ВЧ):&nbsp;&nbsp; &nbsp; 600, (500 / 40) Вт<br>Мощность пиковая - Общая, Biamp (НЧ/ВЧ):&nbsp;&nbsp; &nbsp; 2400, (2000 / 160) Вт<br>Чувствительность, 1Вт/1м:&nbsp;&nbsp; &nbsp; 98 дБ<br>Максимальное звуковое давление:&nbsp;&nbsp; &nbsp; 132 дБ<br>Импеданс:&nbsp;&nbsp; &nbsp; 8 Ω<br>Угол раскрытия Г° x В°:&nbsp;&nbsp; &nbsp; 90° x 50°<br>Динамики (НЧ/ВЧ):&nbsp;&nbsp; &nbsp; 15\" (DVX3150) / 1\" (ND2)<br>Габаритные размеры(В x Ш x Г), мм:&nbsp;&nbsp; &nbsp; 692 x 446 x 411 мм<br>Масса (нетто):&nbsp;&nbsp; &nbsp; 22.2 кг<br><br></p>', 47000, '2014-08-16 09:53:59', 476, 'ELECTRO VOICE ZX5 — пассивная 2-х полосная акустическая система, 600 Вт. 15\'\' — динамик DXV3150;  2\" драйвер ND2 Мах. SPL: 132 дБ. Угол раскрытия: ZX5-60 - 60° x 60° / ZX5-90 - 90° x 50°.   Импеданс: 8 Ом.\r\n', 19255, 0, 124, '\0', ''),
  (20243, 'Tempo MS100BK', '<p>Продается микрофонная стойка TEMPO MS 100 BK.&nbsp;<br>Тип: микрофонная стойка \"журавль\",<br>тренога с фиксированной длиной журавля, с подвижными узлами из пластика, без держателя.<br>Высота - 100-176 см.<br>Длина плеча - 80 см.<br>Материал: сталь.<br>Цвет: черный.</p>', 1000, '2014-03-28 12:41:45', 472, 'Микрофонная стойка \"журавль\", материал - сталь, цвет - черный. ', 19267, NULL, 124, '\0', ''),
  (20244, 'Tempo SPS300', '<p>Продается стойка под колонку, тренога Tempo SPS300.<br>Технические характеристики:<br>&nbsp;Стыковочный диаметр: 35мм (стандартный).<br>&nbsp;Вес : 3,5kg&nbsp;<br>&nbsp;Номинальная несущая способность : 60 Kg<br>&nbsp;Минимальная высота : 1200 mm<br>&nbsp;Максимальная высота : 2200 mm<br>&nbsp;Цвет: черный, аллюминиевый.<br></p>', 2000, '2014-03-28 12:50:18', 472, 'Стойка под колонку, \"тренога\".  Материал - сталь.  Цвет - чёрный, серый. \r\n', 19268, NULL, 124, '\0', ''),
  (20245, 'American DJ Revo IV', '<p>Светодиодный DMX-управляемый прибор серии REVO, создающий эффект «лунного цветка», проецирующий красные, зеленые, синие и белые лучи на пол, стены и потолок. Эффектен как при использовании с дым-машиной, так и без нее!<br>Характеристики:<br>- 256 светодиодов диаметром 5 мм: 64 красных, 64 зеленых, 64 синих и 64 белых<br>- 2 DMX-режима: 4-канальный или 256-канальный<br>- 4-кнопочный LED-дисплей<br>- Разъемы XLR<br>- Большая площадь заливки<br>- Режимы работы: DMX, звуковая активация, Master/Slave<br>- Звуковая активация встроенных программ<br>- Стробо-эффект<br>- Угол раскрытия луча: 50°<br>- Увеличенное время работы прибора – Run all night!<br>- Крепежные приспособления в комплекте<br>- Потребляемая мощность: 29 Вт (макс.)<br>- Срок службы светодиодов: 100 000 ч.<br>- Пульт ДУ DJ UC3 (поставляется отдельно)<br>- Вилка/розетка IEC для последовательного подключения устройств<br>- Диапазон питающего напряжения: 100-240 В, 50/60 Гц<br>- Габариты: 312 х 306 х 334 мм<br>- Вес: 4,2 кг<br></p>', 12700, '2014-06-30 10:24:49', 473, 'Светодиодный DMX-управляемый прибор серии REVO, создающий эффект «лунного цветка». ', 19269, NULL, 124, '\0', '\0'),
  (20246, 'Nightsun SPD022', '<p><span style=\"line-height: 1.428571429; -webkit-text-size-adjust: 100%;\">Технические характеристики:</span><br>NIGHTSUN - световой прибор PAR,&nbsp;<br>Светодиоды - 36 x 3W LED (R12, G12, B12)&nbsp;<br>Управление - DMX512 - 7 каналов&nbsp;<br>Уровень защиты - IP20.&nbsp;<br>Потребляемая мощность - 120W.&nbsp;<br>Питание - AC 100~240 V, 50~60Hz<br></p>', 7300, '2014-03-28 13:21:55', 459, 'Светодиодный прожектор. ', 19271, NULL, 124, '\0', ''),
  (20233, 'Pasgao PAW-260/PAH-172', '<p>Настольная одноантенная радиосистема с ручным передатчиком.</p><p>Несущая частота 580-870 МГц.<br>Встроенная в корпус приемника антена.<br>Максимальное количество каналов - 16 ( 12 независимых каналов в заявленном диапазоне)<br>Цифровой индикатор номера канала.<br>Индикаторы уровня радиосигнала и выходного аудиосигнала.<br>Синхронизация приемника и передатчика через ИК порт.<br>Индикатор питания/разрядки батареи и кнопка ON/OFF на передатчике.</p><p><br>Технические характеристики:</p><p>Приемник PAW260</p><p>Несущая частота 580-870 МГц<br>Максимальное кол-во каналов 16<br>Частотный диапазон 60-16000 Гц<br>Сигнал/шум &gt;102 дБ<br>Динамический диапазон &gt; 95 дБ<br>Выход 1/4 Jack<br>Питание выносной адаптер 12-18 В DC/ 400 mA. ( в комплекте)<br>Габариты 210 х 116 х 42 мм<br>Вес 370 гр.</p><p>Передатчик</p><p>Несущая частота 580-870 МГц<br>Капсюль динамический кардиоидный<br>Максимальное кол-во каналов 16<br>Частотный диапазон 60-16000 Гц<br>Сигнал/шум &gt;101 дБ<br>Мощность 10 мВт<br>Питание 2 х 1.5 В (АА) батареи<br>Время непрерывной работы &gt;8 ч<br>батарей<br>Габариты 245 мм/ d 47 мм<br>Вес 195 гр.</p>', 4300, '2014-08-20 13:15:19', 367, 'Pasgao PAW-260/PAH-172 настольная одноантенная радиосистема с ручным передатчиком.', 19257, 0, 124, '\0', '\0'),
  (20234, 'ATHLETIC BOX-WR-290-STANDARD', '<p>Вес: 2.1 кг<br>Крепежное снование на стену: 150x200 мм<br>Регулировка по вертикали: 90-110 градусов<br>Длина \"плеча\": 290 мм<br>Нагрузка (макс.): 40 кг<br>Диаметр трубы: 35 мм<br>Цвет: черный<br></p>', 1000, '2014-06-30 10:24:06', 174, 'ATHLETIC BOX-WR-290-STANDARD - настенное крепление под акустические системы с регулировкой угла наклона.', 19258, 0, 124, '\0', '\0'),
  (20235, 'ATHLETIC MIC-5C', '<p>Тип: стойка для микрофона (журавль)<br>Вес: 2 кг<br>Высота: 950-1480 мм<br>Длина \"плеча\": 640 мм<br>Диаметр базы-штатива: 720 мм<br>Резьба: 3/8\"<br>Материал: Steel/Abc (сталь)<br>Цвет: черный</p>', 1100, '2014-03-12 09:02:40', 174, 'ATHLETIC MIC-5C Стойка для микрофона', 19259, 0, 124, '\0', ''),
  (20236, 'Behringer UB1832FX-PRO', '<p>Если вы ищете компактный микшер с захватывающим дух стереоэффектом 3D XPQ Surround и 9-полосным графическим стерео эквалайзером, это - ваша машина. Конечно, вы также получаете 14 симметричных линейных входов, 6 микрофонных предусилителей (IMP), 3 aux посыла на каждом канале (1 пре-фэйдер для монитора, 1 пре/пост фэйдер переключаемый для монитора/эффект-обработки и 1 пост-фэйдер для внутренних эффектов или как внешний посыл). Музыкальные 3-полосные эквалайзеры с полупараметрическими средними и отключаемыми обрезными НЧ фильтрами на всех моно каналах. 2 подгруппы с отдельными выходами и 2 многофункциональных aux стерео возврата - добавлены для вашего удобства. Вы также найдете интегрированный 24-битовый процессор цифровых стереоэффектов с 99 великолепно звучащими пресетами VIRTUALIZER.</p><p>Технические характеристики:</p><p>Малошумящий 18-канальный микшерный пульт с 2/2 шинами<br>6 моноканалов с IMP &lt;невидимым микрофонным предусилителем&gt;, разрывами и фантомным питанием.<br>4 стерео канала с высоким запасом по перегрузке.<br>2 субгруппы с одним фейдером, 3 посыла и 2 стерео возврата aux<br>Ползунковые регуляторы громкости<br>Динамический диапазон 130 дб; диапазон изменения громкости 60 дб.<br>Коэффициент нелинейных искажений: менее 0,0007% в диапазоне 20-20000 гц<br>Эффективно, музыкально звучащий 4-полосный эквалайзер на каждом канале и фильтр НЧ на всех моно каналах<br>24-битовый цифровой процессор эффектов c 99 эффектами<br>Диапазон регулировки эквалайзера: Low- 80 гц + 15 дб; Low Mid - 500 Гц + 15 дб; Mid -3 кГц + 15 дб; High - 12 кГц + 15 дб<br>9-полосный графический эквалайзер<br>Выносной импульсный блок питания<br>В комплект поставки входит набор для установки в рэковую стойку<br>Размеры: 97x408x367 мм<br>Вес: 4,7 кг</p>', 11400, '2014-03-12 11:10:45', 70, 'Behringer UB1832FX-PRO Универсальный малошумящий микшерный пульт (6 моновходов, 4 стереовхода, 3 AUX-шины, процессор эффектов, 3D процессор, выходной эквалайзер, встроенный импульсный блок питания)', 19260, 0, 124, '\0', ''),
  (20237, 'Behringer UB1204-PRO', '<p>Малошумящий и компактный, эргономичный микшерный пульт на 12 каналов от немецкого производителя звукового оборудования Behringer. Хотя и отличается достаточно низкой стоимостью, позволяет каждый день в студии, на выступлениях и дома (при любых условиях эксплуатации) уверенно использовать весь необходимый для профессиональной работы функционал. Компоненты вроде эффект-процессора очень высокого качества и с небольшим разбросом параметров (при этом дают немалые возможности в маршрутизации звуковых сигналов). Микшер успешно зарекомендовал себя в кругу как новичков, так и профессионалов и одобрен с точки зрения практичности и эффективности работы с ним.</p><p>Технические характеристики 4моно-2стерео BEHRINGER UB1204-PRO:</p><p>• Тип – аналоговый микшерный пульт.<br>• Число каналов – двенадцать.<br>• Параметры разъемов (интерфейсов, коннекторов): 1/4 дюймовый сбалансированный линейный джек-вход (6,25 миллиметра, телефонный, симметричные, уровень чувствительности +4/-10 на стереоканалах) – восемь штук, RCA – четыре (по два, аудиовходы и выходы), 1/4 дюймовый AUX – четыре (6,25 миллиметра, телефонные), XLR – четыре (телефонные, 6,25 миллиметра, микрофон) и два аудио. Тип подгрупп-шин – 2+2, индивидуальные выходы обеспечивают удобную и гибкую маршрутизацию сигналов.<br>• Выходы – два симметричных сбалансированных main-mix (разъемы XLR позолочены), отдельные сontrol-room (мониторные), а также четыре выхода в 1/4 дюйма (6,25 миллиметра, телефонные) для наушников и stereo-tape (для стереомагнитофона). Выходы на мониторы и наушники имеют назначаемые источники аудиосигналов, магнитофонные входы назначаются на основной выход или мониторы либо наушники.<br>• Тип конвертеров – ЦАП (24-битные, на 192 кГц).<br>• Микрофонные предусилители – четыре штуки, новые, студийные. Позволяют работать с оборудованием 24 бита и частотой дискретизации 192 кГц (дают уровень усиления, диапазон громкости, в 60 дБ с малыми искажениями).<br>• Динамический диапазон микрофонных предусилителей – 130 дБ.<br>• Диапазон частот составляет 10… 200 000 Гц.<br>• Виды средств управления – баланс и низкие частоты, эквалайзер и фейдер, высокие частоты и громкость (ползунковые регуляторы).<br>• Эквалайзер – эффективный, трехполосный на всех каналах, средняя полоса полупараметрическая, обрезной активируемый НЧ-фильтр отключается на каждом моноканале, диапазон регулировки Low-НЧ 80 Гц, Mid-СЧ 2,5 кГц, High-ВЧ 12 кГц, допуск во всех случаях +/- 15 дБ.<br>• Максимальный уровень сигнала – на моновходах + 12 дБц (+ 10 дБ усиления), на линейном входе 30 дБм, на стереовходах +22 дБм, на AUX-посылах +22 дБм, на стерео возврата AUX +22 дБм, на control-room выходах +22 дБм, на наушниках +19 дБм/150</p>', 5700, '2014-06-27 14:38:32', 70, 'Behringer UB1204-PRO Компактный малошумящий микшерный пульт (4 моновхода, 2 стереовхода, 2 AUX-шины, встроенный импульсный блок питания)', 19261, 0, 124, '\0', ''),
  (20238, 'MONOCASE M80 Classic Guitar', '<p>MONOCASE M80 Classic Guitar высококачественный чехол для классической гитары.<br>Соответствует стандартным классическим гитарам фирм Martin, Collings C10, OM Larrivee, Yamaha Classical и другие.<br>Характеристики:<br>Высокопрочный износостойкий материал<br>Водонеприницаемое покрытие<br>Стальные клепки на ручках<br>Складные наплечные лямки<br>Твердое дно<br>Защита грифа и колков<br>Специальные защитные вставки по периметру чехла<br>Мягкие буферы для защиты пина<br>Дополнительный карман для мелких принадлежностей<br>Усиленная молния&nbsp;<br>Карман для медиаторов<br>Потайной карман</p>', 7190, '2014-03-14 15:30:05', 471, 'MONOCASE M80 Classic Guitar высококачественный чехол для классической гитары.\r\nСоответствует стандартным классическим гитарам фирм Martin, Collings C10, OM Larrivee, Yamaha Classical и другие.', 19264, NULL, 124, '\0', ''),
  (20248, 'Monocase M80 Vertigo Electric Guitar', '<p>Данный чехол соответствует стандартным выпускаемым электрогитарам, таким как Fender Tele/Strat, Gibson, Les Paul, Ibanez, ESP.<br>Характеристики:<br>Высокопрочный износостойкий материал<br>Водонеприницаемое покрытие<br>Стальные клепки на ручках<br>Складные наплечные лямки<br>Твердое дно<br>Защита грифа и колков<br>Специальные защитные вставки по периметру чехла<br>Мягкие буферы для защиты пина<br>Дополнительный карман для мелких принадлежностей<br>Усиленная молния&nbsp;<br>Карман для медиаторов<br>Потайной карман</p>', 7450, '2014-09-02 15:49:29', 471, 'Чехол для электрогитары', 19275, NULL, 124, '\0', ''),
  (20249, 'Monocase M80 Acoustic Guitar', '<p>Соответствует стандартным акустическим гитарам фирм Fender, Gibson, Martin, Yamaha, Washburn.<br>Характеристики:<br>Высокопрочный износостойкий материал<br>Водонеприницаемое покрытие<br>Стальные клепки на ручках<br>Складные наплечные лямки<br>Твердое дно<br>Защита грифа и колков<br>Специальные защитные вставки по периметру чехла<br>Мягкие буферы для защиты пина<br>Дополнительный карман для мелких принадлежностей<br>Усиленная молния&nbsp;<br>Карман для медиаторов<br>Потайной карман</p>', 7290, '2014-06-28 05:21:36', 471, 'Чехол для акустической гитары. ', 19278, NULL, 124, '\0', ''),
  (20242, 'MONOCASE М80 Snare Bag', '<p>MONOCASE М80 Snare Bag.</p><p>Внутренний дизайн чехла может быть отрегулирован, так чтобы вместить любой барабан на ваш выбор. В комплект включены две боковые и две фронтальные прокладки для регулирования внутреннего пространства под барабаны меньшего диаметра. Внутренняя отделка из флиса. С внешней же стороны, укрепленный корпус со стальными заклепками, резиновое днище, водонепроницаемое покрытие и плечевой ремень из неопрена.</p><p>Максимальный диаметр - 14\".</p><p>Максимальная толщина - 7\".</p>', 4390, '2014-03-28 14:13:39', 471, 'Чехол для малого барабана.', 19281, NULL, 124, '\0', ''),
  (20247, 'MONOCASE M80 Keyboard', '<p><span style=\"line-height: 1.428571429; -webkit-text-size-adjust: 100%;\">Ручки со стальными заклепками, промышленная резиновая подошва, двойные не пропускающие молнии и усиленная прострочка.&nbsp;</span><br>Подходит для большинства 49 и 61 клавишных контроллеров включая Nord Electro 3 61, M-Audio Axiom 61, Korg X50 61, Akai MPK61, and Roland JUNO-Di 61.<br></p>', 7290, '2014-03-28 13:33:42', 471, 'Чехол для синтезатора. ', 19272, NULL, 124, '\0', ''),
  (20241, 'MONOCASE Dual Bass Guitar', '<p>MONOCASE Dual Bass Guitar высококачественный чехол для двух бас гитар.<br>Данный чехол соответствует стандартным выпускаемым басам фирм Fender, Ibanez, Fodera, Warwick, Tobias, Yamaha.<br>Этот проект типа «зигзаг» выполнен в виде отдельного чехла для каждой бас-гитары. Каждый гриф защищен технологией Neckbrace. Каждый гриф закреплен особенным образом. Чехол может использоваться как с одной, так и с 2-мя бас-гитарами. К тому же, у Вас есть доступ к любой из гитар. Возьмите одну гитару слева, другую – справа.<br>Характеристики:<br>Вместительность на две бас-гитары<br>Высокопрочный износостойкий материал<br>Водонеприницаемое покрытие<br>Стальные клепки на ручках<br>Складные наплечные лямки<br>Твердое дно<br>Защита грифа и колков<br>Специальные защитные вставки по периметру чехла<br>Мягкие буферы для защиты пина<br>Дополнительный карман для мелких принадлежностей<br>Усиленная молния&nbsp;<br>Карман для медиаторов<br>Потайной карман.</p>', 9990, '2014-03-14 15:31:21', 471, 'MONOCASE Dual Bass Guitar высококачественный чехол для двух бас гитар.\r\nДанный чехол соответствует стандартным выпускаемым басам фирм Fender, Ibanez, Fodera, Warwick, Tobias, Yamaha.', 19265, NULL, 124, '\0', ''),
  (20250, 'Monocase M80 Pedalboard PRO', '<p>Профессиональный чехол для педалборда рассчитан так, чтобы в него помещался Pedaltrain™ PRO, но так же подойдет и для других педабордов.<br>Кейсы для педалбордов MONO созданы для постоянных путешествий. Ручки со стальными клепками, промышленные резиновые подошвы и двойные молнии сделаны на совесть, в то время как съемный ремень с наполнителем запоминающим форму уменьшит нагрузку. Все это в оболочке из водонепроницаемого материала Sharkskin™.<br>В дополнение к основному отделению педалборда, в каждом чехле M80 есть большой внешний карман для дополнительных кабелей, эффектов, лаптопов и другой снасти. Внутренний накладной карман надежно сохранит все мелкие предметы.<br>Размеры (ШхВхГ): 840х480х130 мм.<br>Вес: 3 кг.</p>', 6790, '2014-06-28 05:20:45', 471, 'Чехол для педалборда', 19279, NULL, 124, '\0', ''),
  (20251, 'Monocase M80 Semi-Hollow Guitar', '<p>Соответствует большинству гитар типа semi-hollow, в том числе ES-335.<br>Характеристики:<br>Высокопрочный износостойкий материал<br>Водонеприницаемое покрытие<br>Стальные клепки на ручках<br>Складные наплечные лямки<br>Твердое дно<br>Защита грифа и колков<br>Специальные защитные вставки по периметру чехла<br>Мягкие буферы для защиты пина<br>Дополнительный карман для мелких принадлежностей<br>Усиленная молния&nbsp;<br>Карман для медиаторов<br>Потайной карман</p>', 7290, '2014-06-28 05:20:30', 471, 'Чехол для полу-акустической гитары.', 19290, NULL, 124, '\0', ''),
  (20252, 'Monocase M80 Cymbal Bag', '<p>Главный карман состоит из 4-х отделений с нейлоновыми разделителями (вы можете выбрать между 20 и 22 дюймовыми тарелками)<br>Карман для hat – 15 дюймов максимум<br>Карман для splash – 10 дюймов максимум<br>Характеристики:<br>Высокопрочный износостойкий материал<br>Водонеприницаемое покрытие<br>Стальные клепки на ручках<br>Складные наплечные лямки<br>Твердое дно<br>Раздельные карманы<br>Дополнительный карман для мелких принадлежностей<br>Усиленная молния.</p>', 5490, '2014-06-28 05:21:48', 471, 'Чехол для тарелок.', 19293, NULL, 124, '\0', ''),
  (20253, 'Monocase M80 Vertigo Bass Guitar', '<p>Данный чехол соответствует стандартным выпускаемым бас-гитарами фирм Fender, Ibanez, Fodera, Warwick, Tobias, Yamaha.<br>Характеристики:<br>Высокопрочный износостойкий материал<br>Водонеприницаемое покрытие<br>Стальные клепки на ручках<br>Складные наплечные лямки<br>Твердое дно<br>Защита грифа и колков<br>Специальные защитные вставки по периметру чехла<br>Мягкие буферы для защиты пина<br>Дополнительный карман для мелких принадлежностей<br>Усиленная молния&nbsp;<br>Карман для медиаторов<br>Потайной карман</p>', 7450, '2014-09-02 15:50:33', 471, 'Чехол для бас гитары.', 19295, NULL, 124, '\0', ''),
  (20254, 'Mono M80 Pedalboard club', '<p>&nbsp;Профессиональный чехол для педалборда рассчитан так, чтобы в него помещался Pedaltrain™ JR, но так же подойдет и для других педалбордов.<br>&nbsp;Кейсы для педалбордов MONO созданы для постоянных путешествий. Ручки со стальными клепками, промышленные резиновые подошвы и двойные молнии сделаны на совесть, в то время как съемный ремень с наполнителем запоминающим форму уменьшит нагрузку. Все это в оболочке из водонепроницаемого материала Sharkskin™.<br>&nbsp;В дополнение к основному отделению педалборда, в каждом чехле M80 есть большой внешний карман для дополнительных кабелей, эффектов, лаптопов и другой снасти. Внутренний накладной карман надежно сохранит все мелкие предметы.<br>&nbsp;Размеры (ШхВхГ): 440х350х130 мм.<br>&nbsp;Вес: 2 кг.<br></p>', 4990, '2014-03-28 14:34:45', 471, 'Чехол для педалборда.', 19297, NULL, 124, '\0', ''),
  (20255, 'JBL PRX715', '<p>Технические харакеристики:<br>• Тип: акустическая система<br>• Тип системы: активная<br>• Использование: многоцелевая<br>• Номинальная мощность (Вт): 1500<br>• Диапазон частот (Гц): от 43 до 19500<br>• Максимальное звуковое давление (дБ): 136<br>• ВЧ-драйвер: 1,5-дюймовый 2408H<br>• НЧ-драйвер: 15-дюймовый Differential Drive 275G<br>• Угол покрытия: 90 градусов х 50 градусов<br>• Корпус: фанера из тополя, усиление из DSP, покрытие DuraFlex<br>• Размеры (см): 72 х 45 х 36<br>• Вес (кг): 21,6<br>Страна-производитель: МЕКСИКА</p>', 39426, '2014-07-29 09:49:16', 211, 'Двухполосная активная акустическая система.', 19299, NULL, 124, '\0', ''),
  (20256, 'Tempo KS110', '<p>Материал: сталь.<br>Цвет черный.<br>Вес: 3.5 кг.<br></p>', 1200, '2014-03-28 15:28:24', 472, 'Клавишная стойка.', 19300, NULL, 124, '\0', ''),
  (20257, 'JBL PRX735', '<p>Характеристики<br>Диапазон частот&nbsp;&nbsp; &nbsp;35 Гц-20 кГц<br>Номинальная мощность&nbsp;&nbsp; &nbsp;1500 Вт<br>Максимальный уровень звукового давления&nbsp;&nbsp; &nbsp;136 дБ<br>ВЧ драйвер&nbsp;&nbsp; &nbsp;2408H-1.5\"<br>СЧ драйвер&nbsp;&nbsp; &nbsp; 196H-6,5\"<br>НЧ драйвер&nbsp;&nbsp; &nbsp;275G-15\" Differential Drive ®<br>Покрытие&nbsp;&nbsp; &nbsp;90° х 50°<br>Корпус&nbsp;&nbsp; &nbsp;Фанера из тополя с покрытием DuraFlex<br>Размеры (В x Ш x Г)&nbsp;&nbsp; &nbsp;952 х 445 х 538 мм<br>Вес Нетто&nbsp;&nbsp; &nbsp;34,9 кг</p>', 47000, '2014-08-14 15:02:21', 211, 'Трехполосная активная акустическая система.\r\n', 19302, NULL, 124, '\0', '\0'),
  (20265, 'TC ELECTRONIC M350', '<p><strong>Двухсистемный процессор эффектов M350</strong><br><br>M350 – это невероятно простой в использовании рэковый двухсистемный процессор, который одинаково хорошо подходит и для работы вживую и для работы в студии. Он предлагает к вашим услугам 15 совершенно новых эффектов реверберации качества TC и 15 многофункциональных эффектов, в числе которых дилэй, модуляция и компрессия. Студийные звукорежиссеры и записывающиеся музыканты получат преимущества имеющегося программного обеспечения для редактирования, совместимого с AU/VST, что позволяет осуществлять безупречный контроль и редактирование, благодаря полному интегрированию в системы цифровых аудио рабочих станций. Через имеющийся программное обеспечение для редактирования, отмена параметров и пресетов может быть полностью автоматизирована или контролируема в реальном времени. Высокоплотная 24-хбитная обработка и аналогово-цифровое/цифроаналоговое преобразование делают использование реверберации TC и эффектов простым и понятным.&nbsp;<br><br><strong>ОСНОВНЫЕ СВОЙСТВА ПРОЦЕССОРА ЭФФЕКТОВ TC ELECTRONIC M350:</strong><br><br>• Полная интеграция цифровых аудио рабочих станций через редактор, совместимый с VST/AU<br>• 15 подлинных и ошеломляющих стереоэффектов реверберации<br>• 15 легендарных эффектов<br>• 5 видов эффекта задержки<br>• 256 пресетов реверберации/мультиэффектов + 99 пользовательских пресетов = 355 пресетов<br>• Встроенный источник питания – никаких внешних блоков<br>• 24-хбитные цифровые входы и выходы S/PDIF с автоматическим опознаванием, 44.1 – 48 кГц<br>• Tap Tempo<br><br><strong>Выбор набора эффектов</strong><br><br>В число ревербераторов M350 входят классические TC hall, cathedral, ambience, room, равно как и ревербераторы plate и spring, и обширная секция эффектов, в которой вы найдете несколько необходимых вариаций компрессии, модуляции и дилэя.<br><br><strong>Оптимизированные пресеты</strong><br><br>256 заводских пресетов покрывают широкий диапазон приложений и аудио источников, и позволяют вам использовать M350 сразу же после покупки. С 99-ю дополнительными пользовательскими пресетами, общее их количество становится равным 355-ти.<br><br><strong>Простой доступ к фронтальной панели</strong><br><br>M350 был спроектирован так, чтобы пользовательский интерфейс был настолько интуитивен и понятен, насколько это вообще возможно. Все эффекты реверберации и другие эффекты, равно как и их параметры, доступны прямо с фронтальной панели, гарантируя максимальную универсальность в любой ситуации.<br><br><strong>Прекрасный процессор для звукозаписи с использованием компьютера</strong><br><br>Благодаря имеющемуся программному обеспечению пользователь может управлять и редактировать параметры M350 автономно и в любом приложении AU/VST.<br><br><strong>Универсальные, всеохватывающие входы и выходы</strong><br><br>Цифровой 24-хбитный вход S/PDIF с автоопросом гарантирует сверхнадежное входящее соединение в любой установке. Более того, M350 имеет предварительно установленный дисплей, с которого легко считывается информация. Дисплей снабжает вас информацией о входах и выходах MIDI, синхронизации темпа MIDI, педальном управлении tap tempo и режимом байпас.&nbsp;<br></p><p><br><span style=\"line-height: 1.428571429;\">Страна-производитель:&nbsp;ТАИЛАНД</span><br></p>', 10000, '2014-06-27 14:14:49', 260, 'Процессор эффектов, 24 бита, 256 пресетных и 99 пользовательских пэтчей, аналоговый вход/выход, SPDIF I/O, MIDI I/O, вход для педали', 19312, NULL, 124, '\0', ''),
  (20271, 'SHURE BETA 58A', '<p>Shure Beta 58A – это суперкардиодный динамический вокальный микрофон с высоким уровнем выходного сигнала, спроектированный для профессионального звукоусиления и студийной записи. Он имеет настоящую суперкардиоидную схему на всем протяжении своего частотного диапазона. Это гарантирует высокое усиление без обратной связи, максимальную изолированность от других источников звука, и минимальное присутствие нецентральных звуков.<br><br>Beta 58A имеет приспособленные частотные характеристики, которые идеально подходят для работы близко с микрофоном. Отменная звукопередача этого микрофона не сказывается на небрежном обращении, из-за сверхнадежной конструкции, проверенной противоударной системы, и усиленной металлической защитной решетки. Обыкновенная применимость Beta 58A включает в себя передачу и запись лидирующего вокала, бэк-вокалов и речи.<br><br><strong>СВОЙСТВА</strong><br><br>• Частотные характеристики адаптированы для вокалов, с более ярким средним диапазоном и спадом низких частот при «эффекте близости»<br>• Постоянная суперкардиоидная диаграмма для большего усиления без эффекта обратной связи и невероятное отклонение неосевых звуков<br>• Неодимовый магнит для высокого отношения сигнал – шум<br><br><strong>СПЕЦИФИКАЦИЯ</strong><br><br>• Тип: динамический (магнитоэлектрический)<br>• Частотный диапазон: от 50 до 16 000 Гц<br>• Корпус: серебристо-голубой цвет; покрыт эмалевой краской; закаленный, литой под давлением металл; матовая поверхность; шарообразная сетка из стальной проволоки, съемная<br>• Переходник для стойки: вставная установка микрофона; небьющийся; настраиваемый в диапазоне 180 градусов со стандартной резьбой – 5/8’’-27; черный<br>• Размеры: 160 х 50 мм<br>• Чистый вес: 278 г<br>• Предоставляемые аксессуары: настраиваемый переходник для стойки A25D, чехол для хранения 26A21<br>• Опционально: ветровой экран серии A58W (доступно 8 цветов); установка изоляции A55M, A55Hm; кабель C25E, C25F, длиной 7,6 м&nbsp;<br>• Заменяемые детали: головка R176, решетка Rk265G, соединительный узел 90F1984<br>Страна-производитель:&nbsp;МЕКСИКА</p>', 7300, '2014-08-14 12:05:05', 146, 'динамический суперкардиоидный микрофон', 19319, NULL, 124, '\0', ''),
  (20272, 'SHURE SM58S', '<p>Модель SM 58 — это профессиональный динамический микрофон, ставший стандартом и пользующийся наибольшей популярностью среди вокалистов во всем мире. SM 58 обладает живым и ясным звучанием, уникальной прочностью и надежностью. Его плавно поднимающаяся характеристика на средних частотах и завал на басах дают максимум мощности и энергии при минимальном “бубнении” на воспроизведении как мужского, так и женского вокала. Однонаправленная кардиоидная характеристика микрофона эффективно отсекает все посторонние шумы и внеосевую окраску. SM 58 имеет следующие характеристики: частотный диапазон 50 Гц — 15 кГц, сопротивление 150 Ом, уровень выходного сигнала -75 дБ (0.18 мВ). Микрофон идеален для вокальных партий в стилях рок, поп, кантри, ритм-энд-блюз, а также для работы с медными и деревянными духовыми.</p><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Ручной</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Динамический</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>50..15000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-54,5</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>150</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>XLR</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>298</td></tr></tbody></table>', 5000, '2014-08-14 12:06:38', 146, 'динамический кардиоидный микрофон (с выключателем)', 19320, NULL, 124, '\0', ''),
  (20369, 'INVOLIGHT FM900', '<p>Компактная дым-машина (генератор дыма) Involight FM900<br>Управление: проводной пульт, радио пульт (в комплекте)<br>Мощность нагревательного элемента: 900 Вт<br>Выброс дыма: 3 м&nbsp;<br>Объём выброса: 141 кубометр/мин<br>Бак для жидкости: 1 л<br>Питание: 230 В<br>Потребляемая мощность: 1100 Вт&nbsp;<br>Применяемая жидкость: Involight FW905, GMC - E,C,EC<br>Габариты: 240х240х160 мм&nbsp;<br>Вес: 2 кг<br><br></p>', 3300, '2014-08-16 10:14:51', 286, 'Involight FM900 - дым машина 900 Вт, проводной и радио пульт', 19442, NULL, 1884815, '\0', ''),
  (20273, 'SHURE PGX24E/BETA58', '<p>Двухантенная вокальная радиосистема серии PGX с микрофоном Beta58. Качественный звук, высокая помехозащищенность и надежность Shure в одном доступном по деньгам комплекте. Противоударное устройство передатчика PGX2 гарантирует работу системы в самых тяжелых условиях эксплуатации.&nbsp;<br>&nbsp;<br>В комплект радиосистемы входит ручной передатчик PGX2 с капсюлем BETA58 и двухантенный радиоприемник GX4.</p><p>Прочная конструкция, наличие сканера частот, технология Audio Reference Companding, одновременная работа до 12 систем в UHF-диапазоне и переносной кейс призваны обеспечить пользователю системы PGX превосходное выступление в любое время и в любых условиях.С точки зрения удобства эксплуатации радиосистема PGX абсолютно не требует усилий со стороны пользователя для ее установки и настройки.</p><p>Благодаря автоматическим функциям подбора частот и настройки передатчика система самостоятельно сканирует радио ландшафт и моментально находит свободный канал. После чего одного нажатия кнопки достаточно, чтобы передатчик по инфракрасной связи автоматически синхронизировался с радиоприемником. Такой подход позволяет с легкостью настроить до 12 систем на совместную работу в стенах одного помещения.&nbsp;<br>&nbsp;<br><strong>Особенности:&nbsp;</strong><br><br></p><ul><li>Технология Audio Reference Companding</li><li>Одновременная работа до 12 систем в UHF диапазоне</li><li>Автоматический подбор частоты</li><li>Автоматическая синхронизация приемника с передатчиком</li><li>90 переключаемых частот</li><li>1/4 волновые антенны</li><li>Анализатор уровня сигнала</li><li>Многофункциональный индикатор (питание, блокировка, мьют, разряженность батареи)</li><li>1/4 и XLR аудио выходы</li></ul><p>&nbsp;<br><strong>Технические характеристики:&nbsp;</strong><br><br></p><ul><li>Диапазон радиочастот: 800-820&nbsp;Мгц</li><li>Дальность действия: 100 м ( в обычных условиях)</li><li>Диапазон звуковых частот: 20 Гц-16 кГц +/- 3 Дб</li><li>Подавление зеркального канала: 75 Дб</li><li>Подавление паразитного сигнала: 75 Дб</li><li>Коэффициент нелинейных искажений:0,1 %</li><li>Отношение сигнал/шум: 90 Дб</li><li>Продолжительность работы передатчиков: до 12 часов</li></ul>', 20000, '2014-07-01 16:46:04', 146, 'двухантенная `вокальная` радиосистема с капсюлем микрофона BETA 58', 19322, NULL, 124, '\0', ''),
  (20274, 'SHURE PGX24E/SM58', '<p>Система незаменима для вокалистов, всерьез обеспокоенных энергетикой подачи музыкального материала, благодаря микрофонному капсулю легендарного SM58. Качественный звук, высокая помехозащищенность и надежность Shure в одном доступном по деньгам комплекте.</p><p>В комплект радиосистемы входит ручной передатчик PGX2 с капсулем SM58 и двухантенный радиоприемник GX4.&nbsp;<br><br>Радиосистема PGX является прекрасным сочетанием простоты и функциональности - бескомпромиссный шаг в мир беспроводных микрофонных систем Shure. Большой ассортимент легендарных микрофонов Shure совместно с передовыми технологиями радиопередачи и удобством эксплуатации делают Shure PGX оптимальным выбором как профессионалов, так и начинающих исполнителей.&nbsp;<br>Прочная конструкция, наличие сканера частот, технология Audio Reference Companding, одновременная работа до 12 систем в UHF-диапазоне и переносной кейс призваны обеспечить пользователю системы PGX превосходное выступление в любое время и в любых условиях.С точки зрения удобства эксплуатации радиосистема PGX абсолютно не требует усилий со стороны пользователя для ее установки и настройки.</p><p><br>Благодаря автоматическим функциям подбора частот и настройки передатчика система самостоятельно сканирует радио ландшафт и моментально находит свободный канал. После чего одного нажатия кнопки достаточно, чтобы передатчик по инфракрасной связи автоматически синхронизировался с радиоприемником. Такой подход позволяет с легкостью настроить до 12 систем на совместную работу в стенах одного помещения.</p><p><strong>Система PGX состоит из следующих компонентов:</strong></p><ul><li>Приемник SHURE PGX4E</li><li>Ручной передатчик SHURE PGX2/SM58 (капсуль динамического микрофона)</li></ul><p><strong>Преимущества системы PGX:</strong></p><ul><li>Технология Audio Reference Companding</li><li>Одновременная работа до 12 систем в UHF диапазоне</li><li>Автоматический подбор частоты</li><li>Автоматическая синхронизация приемника с передатчиком</li><li>90 переключаемых частот</li><li>1/4 волновые антенны</li><li>Анализатор уровня сигнала</li><li>Многофункциональный индикатор (питание, блокировка, мьют, разряженность батареи)</li><li>1/4\" и XLR аудио выходы</li></ul><p><br><strong>Технические характеристики:</strong></p><ul><li>Диапазон радиочастот: 800-820&nbsp;Мгц</li><li>Дальность действия: 100 м ( в обычных условиях)</li><li>Диапазон звуковых частот: 20 Гц-16 кГц +/- 3 Дб</li><li>Подавление зеркального канала: 75 Дб</li><li>Подавление паразитного сигнала: 75 Дб</li><li>Коэффициент нелинейных искажений:&lt;0,1 %</li><li>Отношение сигнал/шум: 90 Дб</li><li>Продолжительность работы передатчиков: до 12 часов ( в обычных условиях)</li></ul>', 19000, '2014-07-01 16:46:44', 146, 'двухантенная `вокальная` радиосистема с капсюлем микрофона SM58 ', 19323, NULL, 124, '\0', ''),
  (20275, 'SHURE PGX24E/BETA87', '<table border=\"0\" cellspacing=\"0\" cellpadding=\"2\" align=\"left\"><tbody><tr><td><p><strong><strong>Shure PGX24E/BETA87</strong>&nbsp;- двухантенная \"вокальная\" радиосистема с капсюлем микрофона&nbsp;<strong>BETA 87</strong>, сканер частот. Удобная и высококачественна аудиосистема, созданная компанией&nbsp;<strong>«Shure».&nbsp;</strong>Основанная на инновационной технологии Audio Reference Companding, система обеспечивает высочайшее качество воспроизведения акустики и бесперебойную передачу данных. Система надежна, проста в эксплуатации и настройке. Благодаря сканеру и инфракрасному датчику модули автоматически синхронизируются и находят свободный частотный канал в UHF диапазоне.</strong></p><p><strong><strong>Технические характеристики Shure PGX24E/BETA87 :</strong></strong></p><ul><li><strong>Суммарное количество частотных вариаций: 90;</strong></li><li><strong>Возможно одновременное подключение до 12 систем в этом диапазоне;</strong></li><li><strong>Удобный дисплей позволяет отслеживать параметры заряда батарей и уровней выходного сигнала;</strong></li><li><strong>Настройка частотного выхода осуществляется посредством двух 1/4 волновых антенн;</strong></li><li><strong>Коммуникации: 1/4\" и XLR аудио-out.</strong></li></ul></td></tr></tbody></table>', 30000, '2014-06-30 16:01:46', 146, 'двухантенная `вокальная` радиосистема с капсюлем микрофона BETA 87', 19324, NULL, 124, '\0', ''),
  (20276, 'SHURE BLX24E/B58', '<p><strong>Описание SHURE BLX24E/B58 K3E 606-638 MHz:</strong></p><p>Переход от знакомых всем проводных микрофонов к беспроводным радиосистемам должен стать простым и свободным. Линейка беспроводных радиосистем SHURE BLX объединяет в себе профессиональное качество звучания с интуитивным и понятным интерфейсом, благодаря которым вы сможете быть уверенны в том, что начинать работу с данными системами можно сразу же после открытия их заводской упаковки. Вокальная радиосистема&nbsp;<strong>SHURE BLX24E/B58 K3E 606-638 MHz</strong>&nbsp;может быть доступна в комплектации с петличным и головным микрофонами, головным передатчиком или в инструментальной конфигурации. Данная система является наиболее доступной из радиосистем компании SHURE для сценического использования.</p><p><br></p><p><strong>Компоненты&nbsp;радиосистемы SHURE BLX24E/B58 K3E 606-638 MHz представлены приемником BLX4 и ручным передатчиком BLX2.</strong></p><p><strong>Приемник BLX4 обладает:</strong></p><p><br>• совместимостью до двенадцати систем в одном частотном общем диапазоне;<br>• микропроцессорным контролем, осуществляющим переключение внутренних антенн;<br>• быстрым выбором \"в одно касание\" наилучшей радиочастоты из свободных в рабочем • диапазоне;<br>• аудио выходами XLR и 1/4\";<br>• двумя цветами LED индикаторов всевозможных аудио сигналов.</p><p><strong>Ручной передатчик BLX2 обладает:</strong></p><p><br><br>• LED индикатором заряда батареи и статуса работы;<br>• регулируемым контролем уровня громкости;<br>• удобным и быстрым выбором подходящих радиочастот;<br>• двумя батареями типа АА (входящими в комплектацию), обеспечивающими до четырнадцати часов непрерывной работы устройства;<br>• дальностью работы в 91 м, осуществляющейся в прямой видимости передатчик/приемник.</p><p><strong>Технические характеристики:</strong></p><p><br><br>• Дальность работы: 300 ft (91 м)в прямой видимости (реальная дальность работы зависит • от поглощения. отражения и интерференции RF сигнала)<br>• Доступный диапазон радиочастот: в интервале 524–865 MHz (зависит от регионов и стран, где используется система)<br>• Аудио частоты: 50–15,000 Hz(зависят от типа капсуля микрофона)<br>• Выходная мощность RF передатчика: 10 mW, typical (варьируется по регионам)<br>• Аудио выход, разъем: XLR и джек 1/4\" (6.3 mm) небалансный<br>• Максимальный уровень выходного сигнала:-27 dBV (XLR, mic level), -13 dBV (1/4\")<br>• Батарея, время работы: до 14 часов<br>• Динамический диапазон: 100 dB A-weighted<br>• Искажения: 0.5% THD typical (ref. +/- 38 kHz deviation, 1 kHz tone)<br>• Диапазон рабочих температур: -18°C (0°F) – +50°C (122°F)<br>• Требования к электропитанию: BLX4: 12–18 V DC at 150 mA, внешний адаптер, в комплекте</p>', 16500, '2014-08-13 11:31:34', 146, 'радиосистема вокальная с капсюлем динамического микрофона BETA 58', 19325, NULL, 124, '\0', ''),
  (20277, 'SHURE BLX24E/PG58', '<p><strong>Описание SHURE BLX24E/PG58 K3E 606-638 MHz:</strong></p><p>Компания Shure представляет комплект вокальной радиосистемы&nbsp;<strong>SHURE BLX24E/PG58</strong>&nbsp;K3E 606-638 MHz. Представленная модель с капсюлем микрофона PG58 представляет собой вокальную беспроводную систему среднего класса, сочетающую в себе профессиональное качество звучания с интуитивно простой настройкой и максимально простым интерфейсом для пользователей любого уровня. Если Вы желаете купить вокальную беспроводную систему, комплект SHURE BLX24E/PG58 K3E станет лучшим выбором в данной ценовой категории, предлагая Вам легендарное звучание радиосистем компании Shure.&nbsp;</p><p><strong>Функциональные особенности вокальной радиосистемы</strong></p><p><br>Беспроводная вокальная радиосистема SHURE BLX24E/PG58 K3E максимально проста в использовании и ежедневной эксплуатации. Так простым нажатием кнопки поиска канала (Chanel 0 – 9), находящейся на передней панели ресивера, система начнет экспресс-сканирование радиочастот, что бы выбрать свободный канал и не допустить посторонних помех. Одним из преимуществ такой системы является возможность использования комплекта с другими вокальными радиосистемами. В любой момент Вы можете быстро сменить радиоканал, не переживая за смешение частот и появление посторонних шумов от других устройств. Это особенно важно на мероприятиях с использованием сразу нескольких вокальных радиосистем.&nbsp;</p><p><strong>Сферы эксплуатации и использования вокальной радиосистемы SHURE PGX24E/PG58 K5E</strong></p><p><br>Представленный комплект можно использовать практически на всех мероприятиях, начиная от концертов в школах, офисных презентациях, караоке-барах и ресторанах, заканчивая выступаниями музыкальных и вокальных групп. Комплект изготовлен из высококачественных материалов, что гарантирует долгий срок его службы даже при самом интенсивном пользовании.<br><br>Вокальный микрофон комплекта идеально подойдет как для исполнителей монологов, так и вокалистов совершенно разных жанров с разными тембральными особенностями голоса.<br>Вокальная радиосистема может быть использована как в помещении, так и на открытых площадках при любой погоде.&nbsp;</p><p><strong>Состав комплекта поставки</strong>&nbsp;</p><p><br>Комплект состоит из качественного беспроводного микрофона с капсюлем PG58, ресивера с антенной для качественного приема сигнала, адаптера питания, подробного описания функций и руководства эксплуатации.&nbsp;</p><p><strong>Технические характеристики вокальной радиосистемы SHURE PGX24E/PG58 K5E</strong></p><p><br>Тип устройства : беспроводная радиосистема с ручным микрофоном.&nbsp;<br>Спецификация комплекта :<br>- Модель передатчика : ВLX2.<br>- Модель приемника : BLX4.<br>- Модель капсуля микрофона : PG58.&nbsp;<br><br>Рабочие частоты : 606 - 638 МГц.<br>Функция выбора радиоканала : есть&nbsp;<br>Рабочий диапазон микрофона : до 100 метров.<br>Яркая светодиодная индикация : есть.&nbsp;<br>Светодиодный индикатор отключения звука : есть.<br><br>Органы управления :&nbsp;<br>- Кнопка выбора группы : Group (A – Y).<br>- Кнопка выбора канала : Chanel (0 – 9).<br>- Кнопка включения\\выключения питания : есть.<br><br>Время автономной работы : около восьми часов непрерывной работы от двух батареек\\аккумуляторов типа «АА».<br>Коммутация системы :&nbsp;<br>- Выходная секция : XLR разъем гнезда Mic Out, небалансный выход 1/4” Jack.&nbsp;<br>Цвет комплекта : черный.</p>', 12000, '2014-08-14 15:02:45', 146, 'радиосистема вокальная капсюлем микрофона PG58', 19326, NULL, 124, '\0', ''),
  (20368, 'Dynacord CMS 600-3', '<p>&nbsp;Представляем Вам новый микшерный пульт Dynacord CMS 600-3. Пожалуй это самый маленький пульт из всего семейства CMS. Новейшая модель 2012 года оснащена 6 моно каналами MIC/LINE, но самое главное появились 4 стереоканала, подключение к которым возможно через USB 2.0. Доступ ко всем функциям пульта возможен через яркий контрастный OLED дисплей. Ну и конечно же как и в старых моделях Dynacord CMS 600-3 оснащен двумя независимыми процессорами эффектов, с возможностью доступа к 100 заводским пресетам, а также возможностью сохранения 20 пользовтельских настроек.<br>&nbsp;&nbsp;&nbsp;Секция микширования CMS 600-3<br>&nbsp;&nbsp;&nbsp;Отличительной особенностью секции микширования является конфигурации каналов 4 + 4. В дополнение к стандартной конфигурации 6 моно-каналов Mic/Line и 2 линейных стерео-канала,<br>&nbsp;&nbsp;&nbsp;CMS 600-3 оснащен двумя цифровыми стерео-входами (по USB), сигналы с которых автоматически направляются на каналы 5-6 и 7-8. Таким образом, вы получаете 4 стерео-канала, что должно особенно понравиться диджеям.<br>&nbsp;&nbsp;&nbsp;Мастер-секция Dynacord Cms 600-3<br>&nbsp;&nbsp;&nbsp;Мастер-секция оснащена правым и левым мастер-фейдерами, фейдерами FX1, FX2, AUX и MON, графическим 9-полосным стерео-эквалайзером, а также цифровым процессором эффектов с двумя DSP по 100 заводских и 20 пользовательских изменяемых пресетов.<br>&nbsp;&nbsp;&nbsp;8 линеек фейдоров:<br>&nbsp;&nbsp;&nbsp;4 входных канала Mic/Line<br>&nbsp;&nbsp;&nbsp;2 входных канала Mic/Line, совмещенные со стерео-USB входами<br>&nbsp;&nbsp;&nbsp;2 входных линейных стерео-канала<br>&nbsp;&nbsp;&nbsp;Входы Mic 1 – 6 оснащены регуляторами усиления и фантомным питанием с возможностью отключения. Каналы 9/10 и 11/12 оснащены регуляторами уровня входного сигнала. Каналы с 1 по 4 оснащены обрезными НЧ-фильтрами на 80 Гц с возможностью отключения. На всех каналах установлены 3-полосные эквалайзеры Lo, Mid, Hi. Посылы: FX (пост-фейдер); AUX (с общим переключателем пре- и пост-фейдер) и MON (пре-фейдер). Также каждый канал оснащен регуляторами Balance/ Panorama, переключателями Mute и PFL, фейдером регулировки громкости и светодиодными индикаторами пиков и наличия сигнала.<br></p><p><strong>Характеристики Dynacord CMS 600-3-MiG</strong></p><table><tbody><tr><td colspan=\"3\" style=\"vertical-align:top\"><strong>Характеристики</strong></td></tr><tr><td style=\"vertical-align:top; width:255px\">Тип</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Микшерный пульт</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Первоклассные компоненты – все фейдеры и потенциометры торговой марки ALPS.</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Простое интуитивное управление</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Профессиональный цифровой интерфейс USB 2.0 (4 входа / 4 выхода) для подключения к компьютеру.</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Стерео-эквалайзер в мастер-секции</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Большой контрастный OLED-дисплей</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Вес 8 кг<br><br></td></tr></tbody></table>', 48000, '2014-08-16 09:39:20', 467, 'CMS 600-3-MiG микшерный пульт (4 мик./лин. + 2 мик./лин., совмещенные со стерео-USB входами + 2 линейных стерео-канала), два блока обработки звукового сигнала и новый USB аудио-интерфейс', 19441, NULL, 1884815, '\0', ''),
  (20358, 'SHURE BLX24E/SM58', '<p><strong>Описание SHURE BLX24E/SM58 K3E 606-638 MHz:</strong></p><p>Компания Shure представляет Вашему вниманию комплект вокальной радиосистемы SHURE BLX24E/SM58 K3E 606-638 MHz. Представленный комплект включает в себя радиопередатчик с капсюлем микрофона SM58, который переводит эту беспроводную систему на более высокий профессиональный уровень. Комплект радиомикрофона с передатчиком сочетает в себе профессиональное качество звучания микрофонов Shure с интуитивно простой настройкой и понятный интерфейс для пользователей любого уровня.&nbsp;<br><br>Представляя широкому кругу пользователей радиосистему вокальную с капсюлем динамического микрофона SM58, производитель уделил особое внимание высокому качеству передачи голоса исполнителя. В комплект включен ставший классикой, капсюль динамического микрофона Shure SM58. Если Вы решили купить вокальную беспроводную систему, комплект&nbsp;<strong>SHURE BLX24E/SM58</strong>&nbsp;K3E станет одним из лучшим решений в данной ценовой категории, предлагая Вам легендарное, профессиональное звучание микрофонов Shure.&nbsp;<br></p><p><strong>Функциональные особенности вокальной радиосистемы</strong></p><p>Беспроводная вокальная радиосистема SHURE BLX24E/SM58 K3E достаточно легко использовать в режиме ежедневной эксплуатации. Комплект отличает функциональная простота и интуитивность настройки. Одним нажатием кнопки поиска свободного канала (Chanel 0 – 9), находящейся на передней панели ресивера, система произведет быстрое сканирование радиочастот для поиска свободного канала. Возможность сканирования и выбора свободного канала поможет не допустить посторонних помех.&nbsp;<br><br>Одним из преимуществ вокальной радиосистемы является возможность его использования параллельно с другими вокальными радиосистемами. В любой момент пользователи могут быстро изменить радиоканал, не переживая за смешение радиочастот и появления посторонних шумов от других электронных и радио устройств. Это функция особенно важна на мероприятиях, в которых используются сразу несколько вокальных радиосистем.&nbsp;<br></p><p><strong>Сферы эксплуатации и использования вокальной радиосистемы</strong></p><p>Новую модель вокальной радиосистемы Shure SHURE PGX24E/SM58 можно использовать практически на всех типах мероприятий, начиная от небольших концертов в школах, на офисных презентациях, в караоке-барах и ресторанах, а так же в выступлениях музыкальных и вокальных групп. Весь комплект изготавливается из материалов высокого качества, что гарантирует продолжительный срок службы комплекта при самом интенсивном пользовании.<br><br>Вокальный радиомикрофон SM58 станет прекрасным решением для дикторов, исполнителей монологов и вокалистов самых разных жанров с различными тембральными особенностями голоса. Эта вокальная радиосистема может быть использована внутри помещения и на открытых площадках при любой погоде.&nbsp;<br></p><p><strong>Состав комплекта SHURE PGX24E/SM58 K5E</strong></p><p>&nbsp;Представленный комплект состоит из качественного беспроводного радиомикрофона с капсюлем SM58, ресивера с антенной качественного приема сигнала, дополнительного адаптера питания и руководства эксплуатации с подробными описаниями функций комплекта.&nbsp;<br></p><p><strong>Особенности радиомикрофона с капсюлем SM58</strong></p><p>Динамический микрофон Shure SM58 на протяжении многих лет является самым востребованным и популярным микрофоном во всем мире. Капсюль микрофона SM58 представляет собой динамический микрофон, имеющий «фирменное» звучание, ставшее своеобразным эталоном в сфере вокальных динамических микрофонов. Динамические микрофоны SM58 отличает чистота и мягкость тембра, невероятная ясность звучания, что стало визитной карточкой микрофонов&nbsp;<br></p><p><strong>Технические характеристики вокальной радиосистемы SHURE PGX24E/PG58 K5E</strong></p><p>Тип устройства : беспроводная радиосистема с ручным микрофоном.&nbsp;<br>Спецификация комплекта :<br>- Модель капсуля микрофона : SM58.&nbsp;<br>- Модель приемника : BLX4.&nbsp;<br>- Модель передатчика : ВLX2.<br><br>Рабочие частоты : 606 - 638 МГц.<br>Функция выбора радиоканала : есть&nbsp;<br>Рабочий диапазон микрофона : до 100 метров.<br>Светодиодный индикатор отключения звука : есть.<br>Яркая светодиодная индикация : есть.&nbsp;<br><br>Органы управления :&nbsp;<br>- Кнопка выбора канала : Chanel (0 – 9).<br>- Кнопка выбора группы : Group (A – Y).<br>- Кнопка включения\\выключения питания : есть.<br><br>Время автономной работы : около восьми часов непрерывной работы от двух батареек\\аккумуляторов типа «ААА».<br>Коммутация системы :&nbsp;<br>- Выходная секция : XLR разъем гнезда Mic Out, небалансный выход 1/4” Jack.&nbsp;<br>Цвет комплекта : черный.</p>', 13850, '2014-08-14 11:19:33', 146, 'радиосистема вокальная с капсюлем динамического микрофона SM5', 19432, NULL, 1884815, '\0', ''),
  (20278, 'SHURE GLXD14E', '<p><strong>Shure GLXD14E</strong>&nbsp;- гитарная радиосистема с поясным передатчиком GLXD1</p><p>Революционные, цифровые, беспроводные система Shure GLX-D сочетают в себе передовые технологии автоматического управления частотами с лучшими в своем классе интеллектуальным литий-ионным аккумулятором определяющим новые стандарты для бесперебойной работы и цифровой аудио ясности.</p><p>Комплект: одноканальный цифровой приемник GLXD4, нательный передатчик GLXD1, гитарный кабель WA302, блок питания, литий-ионный аккумулятор SB902, USB кабель для зарядки, прочный мягкий чехол на молнии, инструкция.</p><p><strong>GLXD1 - Нательный передатчик</strong></p><p>Автоматически подключается до GLXD4 или GLXD6<br>Радиус действия: до 60м (при прямой видимости)<br>До 16 часов работы<br>Красивый дизайн и металлическая конструкция</p><p><strong>Технические характеристики&nbsp;Shure GLXD14E:</strong></p><p>Рабочий диапазон: 60 м прямой видимости (фактическая дальность зависит от поглощения, отражения и интерференции радиочастотного сигнала)<br>Частотный диапазон: ISM 2400 - 2483,5 МГц<br>Аудио диапазон: 20 - 20 000 Гц (в зависимости от типа микрофона)<br>Выходная мощность передатчика: 10 мВт E.I.R.P. максимум (зависит от региона)<br>Аудио выходы: XLR и 1/4 \"(6,3 мм) несбалансированный<br>Максимальный уровень выходного сигнала: 0 дБВ (XLR/линейный вход), 8,5 дБВ (1/4 \")<br>Срок службы батареи: До 16 часов<br>Динамический диапазон: 120 дБ<br>Системное искажение: 0,2% THD типичное (при девиации +/- 38 кГц отклонение частоты 1 кГц)<br>Диапазон рабочих температур: -18°C (0°F) до +57°C (135°F)</p>', 21000, '2014-06-30 16:40:53', 146, 'цифровая радиосистема с поясным передатчиком GLXD1', 19327, NULL, 124, '\0', ''),
  (20279, 'SHURE BLX14E/PG30', '<p><strong>Описание SHURE BLX14E/PG30 K3E 606-638 MHz:</strong></p><p>Shure BLX14E/PG30 K3E 606-638 MHz представляет собой головную радиосистему с высококачественной гарнитурой PG30. Представленная в новой линейке беспроводных микрофонов серии BLX, головная радиосистема&nbsp;<strong>Shure BLX14E/PG30</strong>&nbsp;обладает прекрасным дизайном и конструкцией, предназначенной для максимально легкого использования практически в любом месте. Электроника радиосистемы обеспечивает пользователей предельно простым подключением и использованием системы с надежной беспроводной связью.&nbsp;<br><br>Если Вы желаете купить радиосистему головную с гарнитурой, Shure BLX14E/PG30 предлагает Вам самый оптимальный выбор, сочетающий в себе самое лучшее качество из профессиональной беспроводной продукции компании Shure по достаточно доступной.&nbsp;<br></p><p><strong>Сферы эксплуатации и возможности головной радиосистемы Shure BLX14/PG30</strong></p><p>Комплект головной радиосистемы Shure BLX14/PG30 может начать свою работу практически сразу после распаковки. Радиосистема является идеальным решением для тех музыкантов, которые желают использовать преимущества беспроводных радиосистем без долгого процесса установки и настройки. Приобретая Shure BLX14/PG30 музыканты и исполнители и прокатчики музыкального оборудования смогут полностью отказаться от использования проводных микрофонов, предоставляя музыкантам бескомпромиссное достижение самого высокого качества.&nbsp;<br><br>Радиосистему можно использовать для выступления вокальных исполнителей, музыкантов и гитаристов, система прекрасно покажет себя в офисных и публичных выступлениях, проведении мероприятий в торговых центрах. Все пользователи головной радиосистемы могут полноценно наслаждаться полной свободой передвижения по сцене.&nbsp;<br></p><p><strong>QuickScan - система быстрого сканирования и поиска свободных каналов&nbsp;</strong></p><p>В конструкции приемника используется новая функция QuickScan. Данная функция производит сканирование радиочастот, максимально быстро находя лучший, открытый канал частот для точной работы радиосистемы. Пользователи могут практически в одно касание настроить работу приемника и головного передатчика на стабильную работу.<br></p><p><strong>Автономность радиосистемы и возможность питания от батареек&nbsp;</strong></p><p>Головной передатчик может свободно работать на большом расстоянии, вплоть до 100 метров без видимых барьеров. Система будет принимать четкое, чистое звучания даже при динамичном движении передатчика. Используя две батарейки, типа «АА» радиосистема может работать в автономном режиме вплоть до 14-ти часов при беспрерывном использовании.&nbsp;<br></p><p><strong>Технические характеристики головной радиосистемы SHURE BLX14E/PG30 K3E&nbsp;</strong></p><p>Комплект поставки радиосистемы :&nbsp;<br>- Поясной передатчик : Shure BLX1.<br>- Микрофон с оголовьем : Shure PG30.<br>- Одноканальный приемник : Shure BLX4.<br><br>Спецификация передатчика BLX1 Bodypack :<br>- Коммутация : TQG соединение (использование с петличными гарнитурами, наушниками, инструментальными микрофонами, гитарными кабелями Shure).<br>- Переключатели : переключатель режимов, переключатель Вкл/Выкл.<br>- Настройка уровня предусиления : есть.&nbsp;<br>- Конструкция : сверхпрочный пластик, черный цвет.<br><br>Мощность входного аудиосигнала :<br>- Минимальные показатели (0 dB) : +10 dBV (max.).<br>- Максимальные показатели : -16 dBV (max.).<br><br>Спецификация электроники BLX1 Bodypack :<br>- Диапазон регулировки уровня усиления : 26 dB.<br>- Вес : 75 грамм (с батарейкой).<br>- Входное сопротивление : 1 Ом.<br>- Питание устройства : 2 LR6 «AA» батарейка (1.5 V, alkaline).<br>- Габаритные размеры : 110 мм. x 64 мм. x 21 мм.&nbsp;<br>- Автономное время работы от батареек : до 14 часов.&nbsp;<br><br>Спецификация приемника BLX4 :&nbsp;<br>- Тип : одноканальный приемник.<br>- Совместимость с другими системами : до 12-ти совместимых систем в диапазоне частот.<br>- Дисплей : светодиодный.<br>- Выбор частот : функция one-touch QuickScan.&nbsp;<br>- Индикация : светодиодная двухцветная индикация состояния.<br>- Коммутация :&nbsp;<br>- Выходные разьемы : XLR и 1\\4 Jack.&nbsp;<br>- Выходное сопротивление 1\\4 Jack : 50 Ом.<br>- Выходное сопротивление разьема XLR : 200 Ом.<br>- Габаритные размеры : 40 мм. х 188 мм. х 103 мм.<br>- Вес : 241 грамм.<br>- Питание : 12–15 V DC, 160 mA (BLX88, 320 mA).<br>- Материал корпуса : сверхпрочный пластик, черный цвет.<br><br>Спецификация микрофона (с оголовьем) PG30 :<br>- Тип микрофона : конденсаторный, электретный.<br>- Направленность: кардиоидная (однонаправленная).<br>- Выходной импеданс : 1200 Ом (1кГц).<br>- Частотные характеристики : от 60 Гц до 18000 Гц.<br>- Динамический диапазон : 92 дБ.<br>- Уровень выходного сигнала : -52 дБВ\\Па (2.5мВ).<br>- Соотношение сигнал\\шум : 61 дБ, 1кГц (1Па).<br>- Уровень шума : 33 дБ.<br>- Максимальный уровень звукового давления : 125 дБ.<br>- Вес : 51.6 грамм.</p>', 14000, '2014-07-01 13:43:29', 146, 'радиосистема головная с гарнитурой PG30', 19328, NULL, 124, '\0', ''),
  (20280, 'SHURE BETA 87A', '<p><strong>Описание SHURE BETA 87A:</strong></p><p>Безусловным лидером среди вокальных микрофонов является&nbsp;<strong>SHURE BETA 87A</strong>. Удобный конденсаторный микрофон с четкой суперкардиодной головкой с “нулевой точкой” на 125° обеспечивает не только точный и теплый звук голоса. Он имеет гладкую частотную характеристику, обеспечивая максимальную детализацию любого голоса и достоверность его звучания.<br><br>При исполнении вокальной партии в SHURE BETA 87A воспроизведение будет защищено от источников помех и нежелательных призвуков, которые часто портят общую картину звучание даже при самом красивом и мощном вокале. С SHURE BETA 87A можно забыть неприятный звук, создаваемый обратной связью.<br>Данная модель работает с трехслойным поп-фильтром, через который пение очищается от дыхательных и поп-шумов.<br><br>Плюс реализована возможность работать с более высокими уровнями давления звука, чем у других аналогичных устройств. Если вокалист использует эффект приближения, в микрофоне срабатывает электронная низкочастотная компенсация, которая призвана корректировать низкие частоты.<br><br>Производитель поместил SHURE BETA 87A в прочный металлический корпус, который надежно обеспечивает защиту устройства от всевозможных повреждений. Защита микрофонного капсюля осуществляется прочной стальной сеткой.<br></p><p><strong>Где используется микрофон</strong></p><p>• Концертные площадки (вокал и бэк-вокал), включая турне в «полевых» условиях<br>• Студии звукозаписи<br>• Студии телевещания<br>• Студии радиовещания<br></p><p><strong>Технические характеристики:</strong></p><p>• Тип: конденсаторный вокальный микрофон<br>• Направленность диаграммы: однонаправленная суперкардиодиная<br>• Частотный диапазон: от 50 Гц до 18 000 Гц<br>• Сигнал/шум: 72 дБ (при условии, что звуковое давление 94 дБ)<br>• Наличие трехслойного поп-фильтра<br>• Чувствительность: -51 dBV/Pa<br>• Питание: фантомное ±11 В - ±52 В («+» будет подаваться на контакты 2 и 3); потребляемый ток: 1 мА - 1.2 мА<br>• Подключение: 3-pin XLR<br>• Выходное сопротивление: 150 Ом<br>• Динамический диапазон при максимальном звуковом давлении: 117 дБ<br>• Минимальное сопротивление нагрузки: 800 Ом<br>• Максимальное звуковое давление: 139 дБ (при условии, что сопротивление нагрузки составляет 1 кОм, а коэффициент нелинейных искажений равен 0.25%)<br>• Перегрузка выходного сигнала: -6 dBV (0.5 В) (при условии, что частота составляет 1 кГц, а сопротивление нагрузки равно 1 кОм).<br>• Защита от обратной полярности: до 100 V<br>• Вес: 207 г<br>• Металлический прочный корпус, капсюль защищен стальной сеткой.<br></p><p>Страна-производитель:&nbsp;МЕКСИКА</p>', 11800, '2014-07-01 14:10:06', 146, 'конденсаторный суперкардиоидный вокальный микрофон', 19329, NULL, 124, '\0', ''),
  (20281, 'SHURE BETA 91A', '<p>Инструментальный конденсаторный микрофон для НЧ-инструментов с полукардиоидной характеристикой направленности, эффективным внеосевым ослаблением сигнала, широким динамическим диапазоном, переключателем эквалайзера (-7 dB, 400 kHz), сопротивлением 146 Ohm и диапазоном воспроизводимых частот 20 Hz - 20 kHz.</p><p><strong>Особенности:</strong></p><ul><li>Равномерная полукардиоидная характеристика направленности.</li><li>Высокая чувствительность с эффективным противодействием возникновению обратной связи.</li><li>Эффективное внеосевое подавление сигнала.</li><li>Низкопрофильная конструкция корпуса с интегрированным предусилителем и разъемом XLR.</li><li>Амплитудно-частотная характеристика, оптимизированная для работы с большим барабаном и другими низкочастотными источниками звука.</li><li>Широкий динамический диапазон для использования в акустической среде с большими уровнями звукового давления.</li><li>Двухпозиционный переключатель эквалайзера, позволяющий эффективно управлять чувствительностью в низком среднечастотном диапазоне и придавать бас-инструментам дополнительную аттаку, четкость и чистоту звучания.</li><li>Литой металлический корпус и стальная защитная сетка.</li><li>Не требует дополнительного монтажного оборудования и аксессуаров.</li><li>Для хранения и транспортировки, комплектуется чехлом с замком-молнией.</li><li>Рекомендуемые области применения: большой барабан, фортепиано, орган и т.д.</li></ul><p><strong>Технические характеристики</strong></p><ul><li>Тип: конденсаторный инструментальный микрофон</li><li>Диапазон воспроизводимых частот: 20 Hz - 20 kHz</li><li>Характеристика направленности: полукардиоидная</li><li>Сопротивление: 146 Ohm</li><li>Чуствительность (1 kHz): -48.5 dBV/Pa (3.8mV)</li><li>Макс. звуковое давление (1 kHz, 1% THD)<ul><li>При нагрузке 2500 Ohm: 155 dB</li><li>При нагрузке 1000 Ohm: 151 dB</li></ul></li><li>Соотношение сигнал/шум (1 kHz, 94 dB SPL): 64 dB</li><li>Динамический диапазон (1 kHz)<ul><li>При нагрузке 2500 Ohm: 125.5 dB</li><li>При нагрузке 1000 Ohm: 121.5 dB</li></ul></li><li>Внеосевое ослабление сигнала (20 Hz to 20 kHz): &gt; 55 dB</li><li>Уровень клиппирования (20Hz - 20kHz, 1% THD)<ul><li>При нагрузке 2500 Ohm: 12.5 dBV</li><li>При нагрузке 1000 Ohm: 7.50 dBV</li></ul></li><li>Уровень собственных шумов: 29.5 dB SPL-A</li><li>Переключатель эквалайзера: -7 dB на частоте 400 kHz</li><li>Разъем: XLR</li><li>Фантомное питание<ul><li>Напряжение: 11 - 52 Vdc</li><li>Ток: 5.6 mA</li><li>Вес: 470 г</li></ul></li></ul>', 10700, '2014-09-01 13:43:06', 146, 'полукардиоидный конденсаторный инструментальный микрофон (плоский)', 19334, NULL, 124, '\0', '\0'),
  (20282, 'SHURE 55SH SERIESII', '<p>Shure 55SH Series II&nbsp; –микрофон, сделанный в память о золотом веке рок-н-ролла. Этот аппарат не только стильно выглядит, но отлично звучит. Конструкторы, трудившиеся над его созданием, вложили в свое детище последние разработки SHURE. Shure 55SH Series идеальное сочетание стиля и функциональности.</p><p>Аппарат оснащен динамическими преобразователями звука. для многих вокалистов этот микрофон станет не только инструментом в работе, но и элементом антуража. В Shure 55SH Series однонаправленная кардиоидная направленность. Диапазон частот варьируется от 55 Гц до 15 кГц. Все характеристики микрофона указывают на его «вокальное» предназначение. Он идеально подходит для вокала, речи, бэк-вокала.</p><p><strong>Технические арактеристики :</strong></p><ul><li>Регулируемый, поворотный держатель с переключателем</li><li>Кардиоидный динамический</li><li>Частотный диапазон: от 50 до 15.000 Гц</li><li>Основное применение: основной вокал, бэк-вокал, речь.</li><li>Частотный диапазон: 50 Гц - 15 кГц</li><li>Импеданс: 150 Ом (реально 270 Ом)</li><li>Подключение (разъем) : XLR</li><li>Тип: динамический</li><li>Уровень выходного сигнала: напряжение открытой цепи (на частоте 1 кГц) : -58.0 dBV/Pa (1.3 мВ) ; 1 Pa =94 дБ SPLуровень мощности: -58.5 дБ; 0 дБ = 1 мВт/10 микробар;</li><li>Полярность: при прямом давлении на мембрану капсюля, на контакте 2 разъема XLR возникает положительное напряжение относительно контакта 3</li><li>Рекомендуемое сопротивление входа: от 75 Ом до 300 Ом</li><li>Корпус: литье, хромированный</li><li>Габаритные размеры: 56х188х78 мм</li></ul>', 8000, '2014-07-01 14:36:46', 146, 'динамический кардиоидный вокальный микрофон с выключателем', 19335, NULL, 124, '\0', ''),
  (20283, 'SHURE SM57-LCE', '<p>SM57 - легендарный универсальный динамический микрофон. Превосходно подходит для различных инструментов, для работы в студии и на концертной площадке. Оптимальная АЧХ способствует ясному, разборчивому звучанию. Микрофон незаменим для гитар, инструментальных усилителей, ударных инструментов, томов, рабочего барабана, перкуссии, банджо, медных и деревянных духовых, электропиано, электроорганов, эффекта Лесли.</p><p><strong>Особенности:</strong></p><ul><li>Чистая и натуральная звукопередача инструментальных и вокальных источников</li><li>Точное профессиональное звучание ударных инструментов, перкуссии и инструментальных усилителей</li><li>Кардиоидная характеристика направленности, препятствующая проникновению внеосевых звуков и возникновению обратной связи</li><li>Пневматическая система защиты от механического воздействия</li><li>Высокая прочность и надежность конструкции</li></ul><p><strong>Область применения:</strong></p><ul><li>Гитарные/басовые усилители.</li><li>Медные духовые.</li><li>Саксофон.</li><li>Гармоника.</li><li>Ударные.</li><li>Перкуссия.</li><li>Вокал.</li></ul><p><strong>Технические характеристики:</strong></p><ul><li>Направленность: кардиоидная (узконаправленная).</li><li>Частотный диапазон: 50 Гц - 15 кГц.</li><li>Чувствительность: на частоте 1 кГц: –56 dBV/Pa (1.6 мВ), 1 Pa = 94 дБ SPL.</li><li>Подключение (разъем): XLR (M).</li><li>Тип: динамический (подвижная электромагнитная система).</li><li>Полярность: прямое давление на диафрагму создает положительное напряжение на &nbsp;</li><li>контакте 2 относительно контакта 3 выходного разъема микрофона.</li><li>Корпус: литая металлическая рукоятка с черным матовым покрытием, усиленная &nbsp;</li><li>стальная коническая защитная сетка капсюля.</li><li>Выходное сопротивление: 200 Ом (на частоте 1 кГц).</li><li>Чувствительность к наводкам: звуковое давление в 20 дБ эквивалентно &nbsp;</li><li>воздействию поля (60 Гц) в 1 миллиэрстэд.</li><li>Переключатель: встроенный, включение/отключение.</li><li>Температура эксплуатации: от –29° до 57° C при относительной влажности от 0 до 95%.</li><li>Габаритные размеры: 47х166х47 мм.</li><li>Комплект поставки: микрофон SM57-LCE, микрофонный держатель, мягкий чехол.</li></ul>', 5500, '2014-07-01 14:53:19', 146, 'динамический кардиоидный инструментальный микрофон', 19336, NULL, 124, '\0', ''),
  (20284, 'SHURE SM81', '<p>Высококачественный студийный конденсаторный микрофон SM 81 обеспечивает точную детальную передачу звука и является одной из лучших студийных моделей во всем мире. Микрофон идеален при озвучивании вокальных ансамблей, акустического фортепиано, акустических гитар, банджо, скрипки, флейты, тарелок и хай-хэта. Микрофон имеет достаточно надежный, прочный стальной корпус с виниловым покрытием для работы в любых сложных условиях. Микрофон имеет расширенную частотную характеристику, низкий уровень собственных шумов и хорошую защиту от воздействия электромагнитных полей. Практически линейная&nbsp;частотная характеристика может быть изменена при помощи переключателя, также есть встроенный переключаемый аттенюатор на 10 дБ. Для работы микрофона необходимо фантомное питание. В комплект поставки входит держатель, ветрозащита и футляр для хранения.</p><p>Технические характеристики</p><p>Направленность: кардиоидная, симметричная относительно акустической оси микрофона&nbsp;<br>Частотный диапазон: 20 Гц - 20 кГц<br>Соотношение сигнал/шум: 78 дБ (IEC 651, при 94 дБ SPL)&nbsp;<br>Потребление тока: 1.2 мА<br>Подключение (разъем): XLR, выход симметричный<br>Общий коэффициент гармонических искажений: &lt;0.5 % (при 131 SPL, частоте 250 Гц и сопротивлении нагрузки 800 Ом)&nbsp;<br>Тип микрофона: конденсаторный<br>Уровень выходного сигнала - напряжение открытой цепи (на частоте 1 кГц): -45 dBV/Pa (5.6 мВ) 1 Pa = 94 дБ SPL -65 dBV/микробар (0.56 мВ), 1 микробар = 74 дБ SPL<br>Полярность: при прямом давлении на мембрану микрофона на контакте 2 возникает положительное напряжение по отношению к контакту 3 выходного разъема микрофона<br>Корпус: сталь, виниловое покрытие (цвет: черный \"металлик\"), стальная защитная сетка<br>Выходное сопротивление: 150 Ом (реальное: 85 Ом)&nbsp;<br>Минимальное сопротивление нагрузки: 800 Ом (допускается 150 Ом с учетом понижения уровня запирания сигнала)&nbsp;<br>Максимальное звуковое давление на частоте 1 кГц: при сопротивлении нагрузки 800 Ом: 136 дБ (аттенюатор в положении 0 дБ); 146 дБ (аттенюатор в положении -10 дБ) при сопротивлении нагрузки 150 Ом: 128 дБ (аттенюатор в положении 0 дБ); 138 дБ (аттенюатор в положении -10 дБ)&nbsp;<br>Чувствительность к наводкам: &lt;3 дБ (SPL при воздействии поля 60 Гц силой в 1 миллиэрстед)&nbsp;<br>Фантомное питание: от 11 В до 52 В постоянного тока (\"+\" подается на контакты 2 и 3)&nbsp;<br>Уровень собственных шумов: 16 дБ SPL (А-взвешенный); 19 дБ (взвешенный DIN 45405) измерен RMS-вольтметром<br>Уровень перегрузки выходного сигнала на частоте 1 кГц: -4 dBV (0.63 В при сопротивлении нагрузки 800 Ом) -15 dBV (0.18 В при сопротивлении нагрузки 150 Ом)&nbsp;<br>Переключатель аттенюатора (2-позиционный с возможностью фиксации): 0 дБ или -10 дБ<br>Переключатель обрезного фильтра низких частот (3-позиционный): 1) равномерная характеристика 2) -6 дБ/окт ниже 100 Гц 3) -18 дБ/окт ниже 80 Гц&nbsp;<br>Температура эксплуатации: от -6.7° С до 49° С&nbsp;<br>Диапазон температур при хранении: от -29° С до 74° С (от 22° С до 27° С при влажности 0 - 95 %)&nbsp;<br>Габаритные размеры: 24 х 212 х 24 мм</p><p><br></p>', 17500, '2014-07-01 15:47:17', 146, 'конденсаторный кардиоидный вокально-инструментальный микрофон ', 19337, NULL, 124, '\0', ''),
  (20285, 'SHURE SM94', '<table border=\"0\" cellpadding=\"3\" cellspacing=\"0\" style=\"width:100%\"><tbody><tr><td><p>Кардиоидный конденсаторный микрофон SM 94 - это приемлемое качество за умеренную цену. Лучше всего использовать SM 94 для записи в студии, при озвучивании инструментов и хоров на сцене, а также для цифрового сэмплирования. Микрофон особенно подходит при воспроизведении струнных инструментов, духовых и тарелок. Фантомное питание производится также и от батареек типа АА. Встроенное противоударное крепление, большой динамический диапазон, мягкая линейная частотная характеристика, частотный диапазон: 40 Гц до 16 кГц - все это SM 94 и, согласитесь, его отменный звук и прекрасные характеристики весьма привлекательны за такие небольшие деньги!.</p><p><br></p></td></tr></tbody></table><p><br></p>', 8200, '2014-07-01 15:53:56', 146, 'конденсаторный кардиоидный инструментальный микрофон', 19338, NULL, 124, '\0', ''),
  (20286, 'SHURE BLX288E/PG58', '<p><strong>Описание SHURE BLX288E/PG58 K3E 606-638 MHz:</strong></p><p>На летней выставке NAMM-2013 компания SHURE представила музыкальным кругам еще одну линейку беспроводных радиокомплектов, которые входят в серию BLX.<br>В них были скомбинированы дизайн мирового класса, легкая установка и самое главное – надежная беспроводная связь.&nbsp;<strong>SHURE BLX288E/PG58 K3E</strong>&nbsp;станет оптимальным вариантов как для музыкантов и вокалистов, так и для ведущих различных мероприятий, которые хотят получить самую лучшую профессиональную радиосистему.<br></p><p><strong>Компактные устройства с высоким уровнем надежности</strong></p><p>В комплект входят два ручных передатчика BLX2 с капсюлем микрофона PG58 и двухканальный приемник BLX88. Главное преимущество этой радиосистемы – отсутствие долгого процесса установки и настройки. SHURE BLX288E/PG58 K3E может работать сразу же после распаковки, поэтому является идеальным решением для людей, которые ценят свое время.<br>Благодаря этому комплекту Вы сможете полностью отказаться от классических проводных микрофонов. SHURE BLX288E/PG58 K3E предоставляет бескомпромиссное достижение высочайшего качества и при этом наслаждаться полноценной свободой передвижения по сцене.<br>Новая функция «QuickScan» оперативно найдет лучший открытый канал частоты, поэтому вы сможете буквально в одно касание настроить работу ресивера на стабильную работу.<br>Радиосистема SHURE BLX288E/PG58 K3E может работать на расстоянии до 91 метров, а 2 батарейки типа АА обеспечат до 14 часов беспрерывной работы.<br></p><p><strong>Технические характеристики:</strong></p><p>• Тип: цифровая беспроводная радиосистема<br>• Комплект: 2 ручных передатчика BLX2 с капсюлем микрофона PG58; приемник BLX88<br>• Диапазон доступных частот: между 524 и 865 МГц<br>• Звуковой диапазон: от 50 до 15 000 Гц<br>• Динамический диапазон: 100 дБ<br>• Уровень нелинейных искажения (типичное): 0,5%<br>• Диапазон рабочих температур: от -18 до +50 градусов Цельсия<br></p><p><strong>Технические характеристики передатчика BLX2:</strong></p><p>• Уровень усиления/затухания: - 10 дБ<br>• Максимальная мощность входного аудио: -20 дБВ<br>• Регулирование мощности: 10 дБ<br>• Корпус: противоударный пластик<br>• Питание: 2 батареи типа АА<br>• Срок беспрерывной работы: до 14 часов<br>• Рабочий диапазон: до 91 м<br>• Индикация: LED-индикатор питания и заряда<br>• Диаметр: 53 мм<br>• Длина: 224 мм<br>• Вес (с батарейками): 218 г<br></p><p><strong>Технические характеристики приемника BLX88:</strong></p><p>• Функция «QuickScan» для быстрого выбора лучшего открытого канала частоты<br>• Количество совместимых систем в частотном диапазоне: до 12<br>• Индикация: 2-цветный индикатор<br>• Дисплей: LED<br>• Выходные разъемы: 1/4-дюймовые (выходное сопротивление 50 Ом) и XLR (выходное сопротивление 200 Ом)<br>• Выходной уровень: +/- 33 кГц<br>• Выходной уровень XLR-разъема: -27 дБВ<br>• Выходной уровень 1/4-дюймового разъема: -105 дБм<br>• Коэффициент отклонения: более 50 дБ<br>• Материал корпуса: противоударный пластик<br>• Питание: от 12 до 15 В<br>• Размер: 4 см х 39 см х 12 см<br>• Вес: 429 г</p>', 23700, '2014-07-01 16:19:48', 146, 'двухканальная радиосистема с двумя ручными передатчиками PG58', 19339, NULL, 124, '\0', ''),
  (20287, 'SHURE BLX288E/SM58', '<p>SHURE BLX288E/SM58 K3E 606-638 MHz представляет собой двухканальную беспроводную радиосистему с двумя микрофонными ручными передатчиками. Комплект состоит из двух ручных передатчиков BLX 2 и приемника BLX 88. Динамический диапазон, в котором работает система, составляет 100 дБ, а звуковой от 50 до 15 000 Гц. Вес передатчика составляет 21 грамм, а приемника 429. Приемник оснащен LED дисплеем, а его корпус сделан из противоударного пластика. Встроенная функция QuickScan позволит осуществить быстрый выбор лучшего из доступных каналов частоты.<br><strong>Особенности:</strong><br>-функция «QuickScan»: быстрый выбор лучшего из открытых каналов частоты;<br>-корпуса выполнены из прочного противоударного пластика;<br>-LED дисплей упрощает настройку и управление системой.</p><table style=\"width:1060px\"><thead><tr><td colspan=\"2\" style=\"vertical-align:top; width:145px\">Основные параметры</td></tr></thead><tbody><tr><td style=\"vertical-align:top; width:145px\">Тип</td><td style=\"vertical-align:top; width:145px\">беспроводная цифровая радиосистема</td></tr><tr><td style=\"vertical-align:top; width:145px\">Диапазон рабочих температур</td><td style=\"vertical-align:top; width:145px\">от +50 до -18 до градусов (по Цельсию)</td></tr><tr><td style=\"vertical-align:top; width:145px\">Уровень типичных искажений (нелинейных)</td><td style=\"vertical-align:top; width:145px\">0,5%</td></tr><tr><td style=\"vertical-align:top; width:145px\">Динамический диапазон</td><td style=\"vertical-align:top; width:145px\">100 дБ</td></tr><tr><td style=\"vertical-align:top; width:145px\">Звуковой диапазон</td><td style=\"vertical-align:top; width:145px\">от 50 до 15 000 Гц</td></tr><tr><td style=\"vertical-align:top; width:145px\">Диапазон доступных частот</td><td style=\"vertical-align:top; width:145px\">между 865 и 524 МГц</td></tr></tbody></table><table style=\"width:1060px\"><thead><tr><td colspan=\"2\" style=\"vertical-align:top; width:145px\">Приемника BLX88</td></tr></thead><tbody><tr><td style=\"vertical-align:top; width:145px\">Вес</td><td style=\"vertical-align:top; width:145px\">429 г;</td></tr><tr><td style=\"vertical-align:top; width:145px\">Размеры</td><td style=\"vertical-align:top; width:145px\">4 см х 39 см х 12 см</td></tr><tr><td style=\"vertical-align:top; width:145px\">Питание</td><td style=\"vertical-align:top; width:145px\">от 12 до 15 В</td></tr><tr><td style=\"vertical-align:top; width:145px\">Материал корпуса</td><td style=\"vertical-align:top; width:145px\">из противоударного пластика</td></tr><tr><td style=\"vertical-align:top; width:145px\">Коэффициент отклонения</td><td style=\"vertical-align:top; width:145px\">более 50 дБ</td></tr><tr><td style=\"vertical-align:top; width:145px\">Выходной уровень (1/4-дюймовый разъем)</td><td style=\"vertical-align:top; width:145px\">-105 дБм</td></tr><tr><td style=\"vertical-align:top; width:145px\">Выходной уровень (XLR-разъем)</td><td style=\"vertical-align:top; width:145px\">-27 дБВ</td></tr><tr><td style=\"vertical-align:top; width:145px\">Выходной уровень</td><td style=\"vertical-align:top; width:145px\">+/- 33 кГц</td></tr><tr><td style=\"vertical-align:top; width:145px\">Выходные разъемы</td><td style=\"vertical-align:top; width:145px\">XLR (выходное сопротивление 200 Ом), 1/4-дюймовые (выходное сопротивление 50 Ом);</td></tr><tr><td style=\"vertical-align:top; width:145px\">Дисплей (тип)</td><td style=\"vertical-align:top; width:145px\">LED</td></tr><tr><td style=\"vertical-align:top; width:145px\">Индикация</td><td style=\"vertical-align:top; width:145px\">двухцветный индикатор</td></tr><tr><td style=\"vertical-align:top; width:145px\">Количество совместимых систем (один частотный диапазон)</td><td style=\"vertical-align:top; width:145px\">до 12</td></tr></tbody></table><table style=\"width:1060px\"><thead><tr><td colspan=\"2\" style=\"vertical-align:top; width:145px\">Передатчик BLX2</td></tr></thead><tbody><tr><td style=\"vertical-align:top; width:145px\">Вес (включая батарейки)</td><td style=\"vertical-align:top; width:145px\">218 г</td></tr><tr><td style=\"vertical-align:top; width:145px\">Длина</td><td style=\"vertical-align:top; width:145px\">224 мм</td></tr><tr><td style=\"vertical-align:top; width:145px\">Диаметр</td><td style=\"vertical-align:top; width:145px\">53 мм</td></tr><tr><td style=\"vertical-align:top; width:145px\">Индикация</td><td style=\"vertical-align:top; width:145px\">LED-индикатор (заряд и питание)</td></tr><tr><td style=\"vertical-align:top; width:145px\">Рабочий диапазон</td><td style=\"vertical-align:top; width:145px\">до 91 м</td></tr><tr><td style=\"vertical-align:top; width:145px\">Срок беспрерывной работы</td><td style=\"vertical-align:top; width:145px\">включительно до четырнадцати часов</td></tr><tr><td style=\"vertical-align:top; width:145px\">Питание</td><td style=\"vertical-align:top; width:145px\">две батареи (тип АА)</td></tr><tr><td style=\"vertical-align:top; width:145px\">Корпус</td><td style=\"vertical-align:top; width:145px\">из противоударного пластика</td></tr><tr><td style=\"vertical-align:top; width:145px\">Регулировка мощности</td><td style=\"vertical-align:top; width:145px\">10 дБ</td></tr><tr><td style=\"vertical-align:top; width:145px\">Максимальная мощность (входное аудио)</td><td style=\"vertical-align:top; width:145px\">-20 дБВ</td></tr><tr><td style=\"vertical-align:top; width:145px\">Уровень затухания/усиления</td><td style=\"vertical-align:top; width:145px\">- 10 дБ</td></tr></tbody></table>', 27600, '2014-07-01 16:37:13', 146, 'двухканальная радиосистема с двумя ручными передатчиками SM58', 19341, NULL, 124, '\0', ''),
  (20288, 'SHURE BLX288E/B58', '<p><strong>Описание SHURE BLX288E/B58 K3E 606-638 MHz:</strong></p><p>Компания Shure занимается производством профессионального звукового оборудования с 1925г. Является одним из ведущих лидеров на мировом рынке. Продукция торговой марки пользуется заслуженным уважением и популярностью у знаменитых музыкантов, вокальных исполнителей, политиков, крупных звукозаписывающих компаний. Микрофоны Shure идеально адаптированы под условия в разных областях использования: от передачи живого звучания в студии, до всевозможных мероприятий под открытым небом. Долговечность, отличное качество передачи звукового сигнала, надежность – вот важные критерии, которых компания придерживается на протяжении всех лет своего существования.<br></p><p><strong>Особенности системы:</strong></p><p>Радиосистема&nbsp;<strong>Shure BLX288E/B58 K3E 606-638 MHz</strong>&nbsp;– один из ярких примеров адаптирования техники к системе постоянных ежедневных нагрузок. Портативная вокальная система не требует длительного процесса настройки и установки, легка в эксплуатации, обладает безупречной надежностью. Является идеальным вариантом для людей, ценящих свое время. Служит для проведения различных праздников и презентаций, используется в караоке-барах и специализированных ресторанах, где требуется свободное передвижение по залу. Стабильная работа ресивера обеспечивается дополнительной функцией «QuickScan», оперативно предоставляющей самый подходящий открытый канал частоты.&nbsp;<br></p><p><strong>В комплект радиосистемы входят</strong></p><p>• Два портативных BLX2 передатчика с капсюлем микрофона Beta58A<br>• Приемник BLX88<br></p><p><strong>Особенности</strong></p><p><strong style=\"line-height: 1.428571429;\">BLX2 Ручной передатчик:</strong><br></p><p>• Совмещается с моделями микрофонов: Beta 58A, PG58, SM58<br>• Ослабление усиления дБ: -10<br>• Корпус: легкий, но прочный пластик<br></p><p><strong>BLX88 Dual-канальный приемник:</strong></p><p>• Функция «QuickScan» выбор свободной частоты в одно касание (в случае необходимости)<br>• В частотной полосе возможно совмещение до 12 систем (в зависимости от региона)<br>• Выходные разъемы: XLR и 1/4\"<br>• Микропроцессорное управление внутренней антенной (как вариант работы)<br>• Индикатор, показывающий состояние аудио - светодиодный двуцветный:<br>Зеленый: уровень звука в норме<br>Красный: максимально допустимый уровень звука (перегрузка)<br></p><p><strong>Технические характеристики:</strong></p><p>• Совместимые системы в частотной полосе: 12<br>• Автоматическая установка особенностей: группа сканирования / сканирование каналов<br>• Аудио ссылка компандирования<br>• Входящие в комплект антенны: внутренняя антенна<br>• Стойка оборудования: URT2<br>• Корпус: литой ABS<br>• Отображение на дисплее: LED<br>• Приемник дисплея: многоцветный LED и дисплей канала<br>• Аккумулятор: 2AA, выносливость: 14 ч<br>• Места применения: караоке, музыкальные клубы, корпоративы, гостиницы, храмы, студии, общественные учреждения<br></p><p><strong>Детальная спецификация</strong></p><p><strong>Beta58A с ручным передатчиком BLX2:</strong></p><p>• Уровень входного аудиосигнала:&nbsp;<br>Усиление: от 0 дБ до -20 дБВ (max )<br>Усиление: от -10 дБ до -10 дБВ (max)<br>• Вес без батареи: 218 гр.<br>• Выход передатчика ВЧ: 10 мВт, типичный (в зависимости от региона)<br>• Размер/габариты: 224 мм х 53 мм (диаметр)&nbsp;<br>• Диапазон регулировки (усиление) - 10 дБ<br>• Корпус: ABS литой<br>• Питание: 2батареи LR6 AA, 1,5 В, щелочные<br>• Время работы батарей: до 14 часов (щелочная)<br></p><p><strong>BLX88 Dual-канальный приемник:</strong></p><p>• Сопротивление разъема XLR на выходе: 200 Ом; разъем<br>6,35 мм (1/4 \") : 50 Ом<br>• Уровень аудиосигнала на выходе: Ref. +- отклонение 33 кГц с частотой 1 кГц;&nbsp;<br>• Уровень аудиосигнала: XLR разъем: -27 дБВ ( 100 кОм нагрузки)<br>• Уровень аудиосигнала: разъем 6,35 мм (1/4 \"): -13 дБВ ( 100 кОм нагрузки)<br>• Отображение помех (отклонения): &gt; 50 дБ, типичное<br>• Чувствительность РФ: -105 дБм, при 12 дБ SINAD, типичный<br>• Габариты: 40 мм х 388 мм х 116 мм (В х Ш х Г)<br>• Вес: 429 г (15,1 унций)<br>• Корпус: литой ABS<br>• Уровень питания: при постоянном токе: 12-15 В, 160 мА (BLX88, 320 мА), подается с внешнего источника питания (наконечник положительный)</p>', 35500, '2014-07-01 16:44:34', 146, 'двухканальная радиосистема с двумя ручными передатчикакми BETA 58', 19342, NULL, 124, '\0', ''),
  (20289, 'SHURE DMK57-52', '<p>Состоящий&nbsp;из&nbsp;трех&nbsp;микрофонов&nbsp;SM57&nbsp;с&nbsp;креплениями&nbsp;А56D,&nbsp;одного&nbsp;микрофона&nbsp;Beta&nbsp;52&nbsp;&nbsp;<br>и&nbsp;футляра,&nbsp;набор&nbsp;DMK57-52&nbsp;представляет&nbsp;собой&nbsp;полный&nbsp;комплект&nbsp;для&nbsp;&nbsp;<br>озвучивания&nbsp;ударных&nbsp;как&nbsp;на&nbsp;сцене,&nbsp;так&nbsp;и&nbsp;в&nbsp;студии.&nbsp;<br>Самый&nbsp;продаваемый&nbsp;в&nbsp;Америке&nbsp;микрофон&nbsp;SM57&nbsp;уже&nbsp;десятилетиями&nbsp;успешно&nbsp;&nbsp;<br>воспроизводит&nbsp;звуки&nbsp;малого&nbsp;барабана&nbsp;и&nbsp;томов.&nbsp;Великолепный&nbsp;Beta&nbsp;52&nbsp;предназначен&nbsp;&nbsp;<br>для&nbsp;подзвучивания&nbsp;большого&nbsp;барабана&nbsp;и&nbsp;с&nbsp;помощью&nbsp;особого&nbsp;крепления&nbsp;легко&nbsp;&nbsp;<br>устанавливается&nbsp;и&nbsp;надежно&nbsp;фиксируется&nbsp;в&nbsp;необходимом&nbsp;положении.&nbsp;A56D&nbsp;&nbsp;<br>представляет&nbsp;собой&nbsp;универсальную&nbsp;и&nbsp;надежную&nbsp;систему&nbsp;для&nbsp;крепления&nbsp;микрофонов&nbsp;&nbsp;<br>на&nbsp;ударные&nbsp;инструменты.&nbsp;&nbsp;<br>Набор&nbsp;DMK57&nbsp;-&nbsp;это&nbsp;великолепное&nbsp;сочетание&nbsp;высочайших&nbsp;аудио&nbsp;характеристик&nbsp;и&nbsp;&nbsp;<br>приемлемой&nbsp;цены.&nbsp;<br><br></p><p>Страна-производитель:&nbsp;МЕКСИКА</p>', 22500, '2014-07-02 10:15:49', 146, 'универсальный комплект микрофонов для подзвучивания барабанов. В комплекте: 3 х SM57, 1 х BETA52A, 3 х A56D (крепление)', 19343, NULL, 124, '\0', '\0'),
  (20290, 'AMERICAN DJ PINSPOT LED QUAD', '<p>- 1 режим работы (без IR пульта): Fade/Show Mode<br>- 4 режима работы (с использованием IR пульта): Fade Mode, 9 шоу, Смена цвета, Звуковая активация<br>- Диммер 0%-100%<br>- Стробоскоп<br>- Угол луча: 15-градусов<br>- Includes hanging bracket<br>- Срок службы диодов около 10 000 часов<br>- IR пульт в комплектеl<br>- Источник света: 8W Quad (RGBW: 4-в-1) LED<br>- Lux @ 1M: 740 Lux<br>- Потребляемая мощность: 11.4W<br>- Напряжение питания: AC 100 - 240V, 50/60Hz&nbsp;<br>- Габариты(LxWxH): 184 x 99 x 61mm<br>- Вес: 0.5 kg.</p>', 4900, '2014-08-16 10:25:33', 190, 'Яркий светодиодный пинспот RGBW', 19344, NULL, 124, '\0', ''),
  (20291, 'AMERICAN DJ PINSPOT LED', '<p>- Светодиод мощностью 3 Вт</p><p>- Яркий луч белого цвета</p><p>- Срок службы светодиода: 50000 ч.</p><p>- Малая теплоотдача и потребляемая мощность</p><p>- Линза с углом раскрытия луча 12° в комплекте&nbsp;поставки</p><p>- Кронштейн для подвеса в комплекте</p><p>- Рабочее напряжение: 220 В/ 50 Гц</p>', 2300, '2014-08-16 10:26:26', 190, 'Яркий светодиодный пинспот', 19345, NULL, 124, '\0', ''),
  (20292, 'BEHRINGER B205D', '<p>Mногоцелевой активный монитор для вокала, клавишных, мульти-медиа, пресс-конференций, домашней студии звукозаписи и т.д. Мощность: 125 Вт (RMS) Революционная Class-D технология усилителя (потрясающая мощь, невероятные звуковые характеристики и супер-легкий вес Динамик: 5.25\" полноспекторный, премиум-класса неодимовый драйвер Ультра-низкий уровень шума 3-канальный микшер с 3-полосным эквалайзером 2 \"Invisible\"(\"невидимых\") микрофонных предусилителя с фантомным питанием для конденсаторных микрофонов и 1 инструментальный вход (не требуется DI) Выделенный стерео вход для клавиатуры, MP3, CD и т.д. Разъем XLR с переключателем mic/line для связи нескольких мониторов B205D Встроенный лимитер для полного контроля системы и защиты динамика Блок питания: внутренний импульсный (превосходные переходные характеристики и очень низкий расход энергии) Супер-жесткий, ударопрочный корпус со встроенной верхней ручкой</p>', 8100, '2014-08-20 13:14:29', 70, 'Behringer B205D активная АС/монитор 5,25\" 150Вт, микшер, эквалайзер', 19346, NULL, 124, '\0', '\0'),
  (20293, 'TEMPO KS210BK', '<p>Материал - сталь.</p><p>Цвет - черный.</p>', 1700, '2014-07-03 14:05:52', 472, 'Tempo KS210 - Стойка под клавиши с защелкой, двойная рама', 19347, NULL, 124, '\0', ''),
  (20294, 'PROEL SPL152', '<p>Материал - сталь.</p><p>Цвет - черный.</p><p>Высота 56-97 см.<br></p><p>Вес до 70 кг.</p>', 3000, '2014-07-03 14:14:44', 87, 'Proel SPL152 - Стойка под клавиши с защелкой, 2 этажа', 19348, NULL, 124, '\0', ''),
  (20295, 'SHURE ULXD24E/SM58 K51 606 - 670 MHz', '<p>Характеристики:</p><ul><li>Цифровой звук с качеством 24 бит/48 кГц.</li><li>Частотный диапазон 20 Гц – 20 кГц.</li><li>Динамический диапазон &gt; 120 дБ.</li><li>256-битное кодирование AES подходит для любых приложений с повышенными требованиями к безопасности.</li><li>Диапазон настройки до 64 МГц (в зависимости от места использования).</li><li>14 активных передатчиков на один 6-мегагерцовый телевизионный канал.</li><li>Более 60 совместимых каналов на одной полосе частот.</li><li>Потрясающе надежная стабильность сигнала на расстоянии до 100 метров при использовании стандартных входящих в комплект поставки антенн.</li><li>Обнаружение помех и своевременное оповещение оператора, гарантирующие полную уверенность в бесперебойной работе всей системы.</li></ul>', 70000, '2014-07-04 15:43:22', 146, 'цифровая радиосистема с ручным передатчиком SM58', 19349, NULL, 124, '\0', ''),
  (20296, 'Casio CDP-130', '<table style=\"width:671px\"><tbody><tr><th colspan=\"2\" style=\"vertical-align:top\">Основные параметры</th></tr><tr><th style=\"vertical-align:top; width:270px\">Тип инструмента</th><td style=\"vertical-align:top\">цифровое пианино</td></tr><tr><th style=\"vertical-align:top; width:270px\">Обучение</th><td style=\"vertical-align:top\">нет</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Клавиатура</th></tr><tr><th style=\"vertical-align:top; width:270px\">Количество клавиш</th><td style=\"vertical-align:top\">88</td></tr><tr><th style=\"vertical-align:top; width:270px\">Жесткость клавиатуры</th><td style=\"vertical-align:top\">взвешенная</td></tr><tr><th style=\"vertical-align:top; width:270px\">Молоточковая механика</th><td style=\"vertical-align:top\">есть</td></tr><tr><th style=\"vertical-align:top; width:270px\">Размер клавиш</th><td style=\"vertical-align:top\">полноразмерные</td></tr><tr><th style=\"vertical-align:top; width:270px\">Чувствительность клавиатуры к касанию</th><td style=\"vertical-align:top\">есть</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Звуковые контроллеры</th></tr><tr><th style=\"vertical-align:top; width:270px\">Педали</th><td style=\"vertical-align:top\">подключаемые</td></tr><tr><th style=\"vertical-align:top; width:270px\">Правая (damper) педаль</th><td style=\"vertical-align:top\">в комплекте</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Конструкция</th></tr><tr><th style=\"vertical-align:top; width:270px\">Корпус</th><td style=\"vertical-align:top\">компактный</td></tr><tr><th style=\"vertical-align:top; width:270px\">Встроенная акустическая система</th><td style=\"vertical-align:top\">есть</td></tr><tr><th style=\"vertical-align:top; width:270px\">Мощность встроенного усилителя</th><td style=\"vertical-align:top\">2x8 Вт</td></tr><tr><th style=\"vertical-align:top; width:270px\">Размеры (ШxВxГ)</th><td style=\"vertical-align:top\">1322x128x286 мм</td></tr><tr><th style=\"vertical-align:top; width:270px\">Вес</th><td style=\"vertical-align:top\">10.8 кг</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Функции</th></tr><tr><th style=\"vertical-align:top; width:270px\">Количество тембров</th><td style=\"vertical-align:top\">10</td></tr><tr><th style=\"vertical-align:top; width:270px\">Полифония</th><td style=\"vertical-align:top\">48</td></tr><tr><th style=\"vertical-align:top; width:270px\">Автоаккомпанемент</th><td style=\"vertical-align:top\">нет</td></tr><tr><th style=\"vertical-align:top; width:270px\">Арпеджиатор</th><td style=\"vertical-align:top\">нет</td></tr><tr><th style=\"vertical-align:top; width:270px\">Транспонирование</th><td style=\"vertical-align:top\">есть</td></tr><tr><th style=\"vertical-align:top; width:270px\">Метроном</th><td style=\"vertical-align:top\">есть</td></tr><tr><th style=\"vertical-align:top; width:270px\">Количество эффектов</th><td style=\"vertical-align:top\">16</td></tr><tr><th style=\"vertical-align:top; width:270px\">Реверберация</th><td style=\"vertical-align:top\">есть</td></tr><tr><th colspan=\"2\" style=\"vertical-align:top\">Разъемы и интерфейсы</th></tr><tr><th style=\"vertical-align:top; width:270px\">Количество выходов на наушники</th><td style=\"vertical-align:top\">1</td></tr><tr><th style=\"vertical-align:top; width:270px\">Интерфейс USB</th><td style=\"vertical-align:top\">есть</td></tr></tbody></table>', 19000, '2014-08-21 15:37:39', 106, 'Цифровое фортепиано, 88 клавиш, 3 уровня чувствительности клавиатуры, 10 тембров, полифония 48 нот, кнопка HALL – эффект звучания концертного рояля од..', 19350, NULL, 124, '\0', ''),
  (20297, 'INVOTONE IPC1210', '<p>ТЕХНИЧЕСКИЕ ХАРАКТЕРИСТИКИ:<br>Медные проводники 26 AWG = 18 х 0,10 мм (0,14 кв.мм.)<br>Изоляция: PE диаметром 1,25 мм<br>Дренажный провод: луженая медь 24 AWG = 7 х 0,20 мм (0,22 кв.мм.)<br>Оболочка: гибкий ПВХ 60<br>Сопротивление проводника: 125 Ом / км при 20 градусах<br>Проводник / проводник емкость: 45 пФ / м при 1 кГц<br>Рабочая температура: от -20 градусов / +70 градусов<br>Рабочее напряжение: 30 V<br>Цвет: черный<br>Области применения: микшерные соединения - соединения микрофона</p><p>Цена за метр.</p>', 50, '2014-07-09 13:39:59', 474, 'IPC1210 - высококачественный сбалансированный коаксиальный микрофонный кабель с оплеткой из безкислородной меди.', 19352, NULL, 124, '\0', ''),
  (20298, 'AKG IP2', '<table><tbody><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Тип подключения</td><td>с проводом</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Тип наушников</td><td>динамические, закрытые</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Диапазон воспроизводимых частот</td><td>12 — 23500 Гц</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Импеданс</td><td>16 Ом</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Чувствительность</td><td>121 дБ</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Максимальная мощность</td><td>20 мВт</td></tr><tr><td colspan=\"2\"><br></td></tr><tr><th colspan=\"2\">Конструкция</th></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Тип крепления</td><td>без крепления</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Тип кабеля</td><td>симметричный</td></tr><tr><td colspan=\"2\"><br></td></tr><tr><th colspan=\"2\">Подключение</th></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Разъём наушников</td><td>mini jack 3.5 mm</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Длина провода</td><td>1.15 м</td></tr><tr><td colspan=\"2\"><br></td></tr><tr><th colspan=\"2\">Дополнительно</th></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Особенности</td><td>сменные амбушюры</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Количество пар сменных амбушюр в комплекте</td><td>3</td></tr></tbody></table>', 2800, '2014-07-09 13:55:23', 147, 'профессиональные закрытые наушники-вставки с набором анатомических амбушюров, чёрные', 19353, NULL, 124, '\0', ''),
  (20299, 'JBL LSR308', '<p><strong>JBL LSR308</strong>&nbsp;является активным двухполосным студийным монитором, который создан известной американской компанией звуковой аппаратуры JBL. В мониторе используется рупорная технология Image Control Waveguide, являющаяся запатентованным детищем компании JBL. Именно благодаря этой уникальной технологии мониторы данного бренда имеют великолепное звучание, даже в помещениях с очень большой площадью. Модель JBL LSR308 относится к студийным мониторам с магнитным экраном и выдает качественную и точную звуковую картинку с четким воображаемым центром. Данный гаджет считается качественным и бюджетным вариантом для любых студий звукозаписи.</p><p><strong>Технические характеристики:</strong></p><p>Бренд: JBL<br>Модель: LSR308<br>Тип: студийный монитор<br>Рупор: Image Control Waveguide<br>Динамик: 8 дюймов<br>Частота: 37 Гц – 24 кГц<br>Давление (пиковое): 112 дБ</p>', 9600, '2014-08-27 16:39:14', 211, '2-х полосн. активн. студийный монитор 8` с магнитным экраном, 37 Гц-24 кГц, 56 Вт НЧ + 56 Вт ВЧ RMS, балансный XLR/jack. Регуляторы: громкость, ВЧ и НЧ', 19355, NULL, 124, '\0', ''),
  (20486, 'AKG PR4500 HT BD8', '<p>AKG PR4500 HT Set&nbsp; накамерная радиосистема с портативным поясным приемником PR4500 и ручным передатчиком HT4500 с микрофонным капсюлем D5-WL1. Радиосистема обеспечивает непревзойденную простоту использования и превосходное качество звука.&nbsp;&nbsp;</p><p>PR4500 карманный приемник имеет легкий, но металлический корпус и предназначен для установки на различные видеокамеры, цифровые зеркальные фотокамеры или другой передачи A/V с помощью прилагаемого адаптера. Система способна транслировать до 18 каналов одновременно, что помогает повысить мощность сигнала и снижение помех. PR4500 имеет 1/8 \"TRS выход на наушники для мониторинга звука, а также выход XLR.</p><p>HT&nbsp;4500 - профессиональный ручной передатчик в прочном корпусе с микрофонным капсюлем D5-WL1. Ширина диапазона в&nbsp;30 Гц&nbsp;UHF&nbsp;обеспечивает до&nbsp;1200 выбираемых частот, что позволяет быстро настроить многоканальную систему. Подсвечиваемый дисплей позволяет произвести быструю настройку на одну частоту между&nbsp;передатчиком и приемником. Система пилотного тона постоянно посылает на приемник информацию о статусе, включая положение переключателя&nbsp;MUTE и остаточный заряд батареи. Мощность передатчика до&nbsp;50 mW, что обеспечивает&nbsp;максимальную защищенность от выпадения сигнала и интерференций.</p><p>Приемник и передатчик могут получать питание от двух батареек АА либо аккумулятора BP4000. Встроенные контакты позволяют заряжать опциональный батарейный блок&nbsp; BP&nbsp;4000, не вынимая его из корпуса. Часа зарядки хватает&nbsp;на работу в течение 12 часов. На батарейках типа АА продолжительность непрерывной работы составляет до 15 часов.</p><p><strong>Особенности:</strong></p><ul><li>Проверенная технология AKG RF для превосходного звука</li><li>Выход на наушники для мониторинга сигнала</li><li>Автоматическая настройка и сканирование окружающей среды, для быстрой и легкой установки</li><li>До 18 каналов одновременно для максимального числа каналов в пропускной способности</li><li>Работает до 15 часов на батареях АА, 12 часов – на опциональном батарейном комплекте BP 4000, отображая оставшийся заряд батареи с помощью системы Smart Battery Management</li><li>Интегрированные зарядные контакты упрощают зарядку батареек или опционального адаптера</li><li>Система Pilot Tone</li></ul>', 34150, '2014-08-28 12:22:15', 147, 'AKG PR4500 HT BD8 накамерная радиосистема.  1x HT4500 ручной передатчик с динамическим капсюлем D5 WL, 1хPR4500 ENG накамерный приёмник, кабель с разъемом XLR, кабель с разъемом Mini-Jack, 4хАА батареи', 19584, NULL, 124, '\0', ''),
  (20300, 'AKG K67 TIESTO', '<table border=\"0\" cellpadding=\"7\" cellspacing=\"0\" style=\"width:400px\"><tbody><tr><td><strong>Тип</strong>:</td><td>закрытые, динамические</td></tr><tr><td><strong>Чувствительность:</strong></td><td>115dB SPL/V</td></tr><tr><td><strong>Частотный диапазон:</strong></td><td>16 — 24000 Гц</td></tr><tr><td><strong>Импеданс:</strong></td><td>32 Ом</td></tr><tr><td><strong>Максимальная мощность:</strong></td><td>500мВт</td></tr><tr><td><strong>Кабель:</strong></td><td>1.8 м (5.9 футов)&nbsp;</td></tr><tr><td><strong>Разъем:</strong></td><td>позолоченный 3.5mm/6.3 mm jack</td></tr><tr><td><strong>Драйвер:</strong></td><td>40 мм</td></tr></tbody></table>', 3450, '2014-08-28 12:36:50', 147, 'закрытые DJ наушники 18-22000Гц, 32 Ома', 19357, NULL, 124, '\0', ''),
  (20301, 'AKG K271 MKII', '<p><strong><span class=\"marker\">Основные параметры</span></strong></p><p><span class=\"marker\">Вид наушников - мониторные</span></p><p><span class=\"marker\">Тип подключения - с проводом</span></p><p><span class=\"marker\">Тип наушников - динамические, закрытые</span></p><p><span class=\"marker\">Диапазон воспроизводимых частот - 16 — 28000 Гц</span></p><p><span class=\"marker\">Импеданс - 55 Ом</span></p><p><span class=\"marker\">Чувствительность - 91 дБ/мВт</span></p><p><span class=\"marker\">Максимальная мощность - 200 мВт</span></p><p><span class=\"marker\">Коэффициент гармоник - 0.3 %</span></p><p><span class=\"marker\">Вес - 240 г</span></p><p><strong><span class=\"marker\">Конструкция</span></strong></p><p><span class=\"marker\">Тип крепления - оголовье</span></p><p>Тип кабеля - отсоединяемый</p><p>Подключение кабеля - одностороннее</p><p><strong>Подключение</strong></p><p>Разъём наушников - mini jack 3.5 mm</p><p>Форма разъема наушников - прямой</p><p>Переходник 6.3 мм в комплекте - есть</p><p>Позолоченные разъемы - есть</p><p>Длина провода - 3 м</p><p><strong>Дополнительно</strong></p><p>Особенности - провода из бескислородной меди</p><p><strong>Дополнительная информация</strong></p><p>В качестве дополнительной опции к этой модели можно подсоеденить кабель с мини-XLR разъёмом.</p>', 6500, '2014-07-09 15:14:26', 147, 'AKG K271 MKII закрытые студийные наушники с мембранами XXL- Varimotion, 55Ом, 16-28000Гц,', 19358, NULL, 124, '\0', ''),
  (20302, 'JBL CONTROL 14C/T', '<p><strong>Описание</strong></p><p><strong></strong>100мм (4\") мощный НЧ драйвер с полипропиленовым диффузором и резиновым подвесом и19мм (3/4\") купольный твитер с ферромагнитным охлаждением, 74–20000Гц, коническая направленность 120°, 87дБ/1Вт/1м. Тыловой бокс в комплекте, клеммы для коммутации. Трансформатор 25Вт 70В/100В и режим 8Ом (30Вт). Цвет - белый. <br></p><p>&nbsp;В упаковке 2шт.<strong></strong><br></p><p>Цена за 1шт.</p>', 4800, '2014-07-09 15:38:15', 211, 'JBL CONTROL 14C/T Двухлосный 100мм (4\") коаксиальный потолочный громкоговоритель.', 19359, NULL, 124, '\0', ''),
  (20303, 'AKG Stage Pack D5', '<p><strong>ОПИСАНИЕ МОДЕЛИ :</strong></p><p><span style=\"line-height: 1.428571429;\">комплект AKG D5 STAGE PACK входит: микрофон D5 + стойка-журавль + микрофонный шнур 5м</span></p><p>D5 - динамический микрофон для основного и бэк-вокала, позволяющий добиться мощного яркого звука даже на самой шумной сцене. Благодаря своей суперкардиодной направленности микрофон может работать с максимально высокой чувствительностью без обратной связи. Звук, снятый микрофоном D5 – яркий и четкий, – не потеряется даже в самом плотном миксе.<br><br>Это первый микрофон, у которого толщина диафрагмы меняется от краев к центру. Новая технология Varimotion позволяет сделать сбалансированную диафрагму без дополнительных резонаторов, что приводит к качественному скачку в работе микрофона. Двойная виброизоляция надежно защищает микрофон от механического шума, что особенно важно для живых выступлений. Публика будет слышать только то, что должна слышать – ваш голос.<br><br>- Очень прочный вокальный/речевой микрофон<br>- Запатентованная многослойная диафрагма Varimotion<br>- Защитная сетка из проволоки из пружинной стали<br><br>Характеристики AKG D5:<br>Направленность: суперкардиоидная &nbsp;&nbsp; &nbsp;<br>Частотный диапазон: 70 Гц – 20 кГц &nbsp;&nbsp; &nbsp;<br>Чувствительность: 2.6 мВ/Па (-52 дБ) &nbsp;&nbsp; &nbsp;<br>Максимальное звуковое давление: 147/156 дБ (при коэффициенте нелинейных искажений 1/3 %) &nbsp;&nbsp; &nbsp;<br>Соотношение сигнал/шум (при балансном подключении): 76 дБ &nbsp;&nbsp;&nbsp;<br>Сопротивление: &lt;= 600 Ом &nbsp;&nbsp; &nbsp;<br>Рекомендованное сопротивление нагрузки: &gt;= 2000 Ом &nbsp;&nbsp; &nbsp;<br>Разъем: 3-контактный XLR &nbsp;&nbsp; &nbsp;<br>Размеры: длина – 185,2 мм; диаметр – 55 мм</p>', 4300, '2014-07-09 15:48:35', 147, 'AKG Stage Pack D5 комплект: динамический вокальный микрофон D5, кабель XLR-XLR 5м, микрофонная стойка \'журавль\'', 19361, NULL, 124, '\0', ''),
