  (20305, 'Souncraft EFX12', '<p>Микшерная консль со встроенными эффектами Soundcraft EFX12. Секция эффектов аккуратно разместилась в компактном корпусе микшера,…&nbsp;ещё</p><p>Гарантия производителя.</p>', 16800, '2014-08-26 11:04:23', 185, 'Микшерная консль со встроенными эффектами Soundcraft EFX12. Секция эффектов аккуратно разместилась в компактном корпусе микшера,… ещё\r\nГарантия производителя.', 19362, NULL, 124, '\0', ''),
