  (20313, 'Neutrik NP2X-AU-SILENT', '<p>Neutrik NP2X-AU-SILENT разъем Jack 6.3мм с выключателем для подключения без щелчков, золоченые контакты</p>', 400, '2014-07-10 14:06:38', 466, 'Neutrik NP2X-AU-SILENT разъем Jack 6.3мм с выключателем для подключения без щелчков, золоченые контакты', 19373, NULL, 124, '\0', ''),
  (20314, 'Neutrik NC3FXS', '<p>Neutrik NC3FXS кабельный разъем XLR female с выключателем</p>', 500, '2014-07-10 14:18:08', 466, 'Neutrik NC3FXS кабельный разъем XLR female с выключателем', 19375, NULL, 124, '\0', ''),
  (20315, 'Neutrik NL2FC', '<p>Neutrik NL2FC кабельный разъём Speakon, 2-контактный</p>', 150, '2014-07-10 14:22:09', 466, 'Neutrik NL2FC кабельный разъём Speakon, 2-контактный', 19376, NULL, 124, '\0', ''),
  (20316, 'Neutrik NE8MC-B', '<p>Neutrik NE8MC-B кабельный разъем RJ45, с двумя вставками для кабеля от 3.5 — 8мм. Монтируется на готовый кабель, черный корпус</p>', 150, '2014-07-10 14:25:57', 466, 'Neutrik NE8MC-B кабельный разъем RJ45, с двумя вставками для кабеля от 3.5 — 8мм. Монтируется на готовый кабель, черный корпус', 19377, NULL, 124, '\0', ''),
  (20317, 'DIE HARD DH545LU3', '<p>Die Hard– качественный&nbsp;кабель для профессиональной студийной и концертной работы. Этот кабель разработан с соблюдением всех требований и стандартов, возлагаемых на коммутацию данного уровня. Точная передача сигнала – вот главная задача, которую выполняет инструментальный кабель&nbsp;<a data-cke-saved-href=\"http://www.pop-music.ru/catalog.php?brand=292\" href=\"http://www.pop-music.ru/catalog.php?brand=292\">DIE HARD</a>. От точности сигнала зависит многое: и звучание и восприятие соответственно. Не стоит экономить на самом главном для музыканта – на качестве звучания исполняемой им музыки. Используя в своем арсенале продукцию&nbsp;<a data-cke-saved-href=\"http://www.pop-music.ru/catalog.php?brand=292\" href=\"http://www.pop-music.ru/catalog.php?brand=292\">DIE HARD</a>&nbsp;- вы гарантируете точность и качество звучания. При выборе кабеля учитывайте и его длину, так как сигнал поглощается собственным сопротивлением материала, хотя это реально ощутимо на проводах большой длины.<br><strong>Характеристики:</strong>&nbsp;<br>Соединения: JACK STEREO 3,5 мм - 2 JACK MONO 6,3 мм&nbsp;<br>Провод: красная медь&nbsp;<br>Первый экран: алюминиевая фольга&nbsp;<br>Второй экран: спиральная красная медь&nbsp;<br>Изоляция внешняя: 6,0 мм прочный поливинилхлорид и 4,0 мм прочный поливинилхлорид&nbsp;<br>Цвет: черный&nbsp;<br>Длина: 3000 мм</p>', 450, '2014-07-10 15:05:30', 475, 'Die HARD DH545LU3 - Профессиональный аудио кабель, стерео мини 3,5мм джек <-> 2х джек , длина 3м\r\n', 19378, NULL, 124, '\0', ''),
  (20318, 'DIE HARD DH620', '<p>Die HARD DH620 - Проф. инсертный кабель, стерео джек TRS &lt;-&gt; 2х моно джек, длина 0,3 м</p>​', 350, '2014-07-10 15:11:25', 475, 'Die HARD DH620 - Проф. инсертный кабель, стерео джек TRS <-> 2х моно джек, длина 0,3 м\r\n', 19379, NULL, 124, '\0', ''),
  (20319, 'Die HARD DH540LU3', '<p>Die HARD DH540LU3 - Проф. аудио кабель, стерео, 2х джек &lt;-&gt; стерео джек, длина 3 м</p>', 550, '2014-07-10 15:16:54', 475, 'Die HARD DH540LU3 - Проф. аудио кабель, стерео, 2х джек <-> стерео джек, длина 3 м\r\n', 19382, NULL, 124, '\0', ''),
  (20320, 'Die HARD DH540LU5', '<p>Die HARD DH540LU5 - Проф. аудио кабель, стерео, 2х джек &lt;-&gt; стерео джек, длина 5 м</p>', 650, '2014-07-10 15:25:13', 475, 'Die HARD DH540LU5 - Проф. аудио кабель, стерео, 2х джек <-> стерео джек, длина 5 м\r\n', 19382, NULL, 124, '\0', ''),
  (20321, 'DIE HARD DH535LU5', '<p>Die HARD DH535LU5 - Проф. аудио кабель, стерео, 2х джек &lt;-&gt; 2х RCA, длина 5 м</p>​', 800, '2014-07-10 15:28:13', 475, 'Die HARD DH535LU5 - Проф. аудио кабель, стерео, 2х джек <-> 2х RCA, длина 5 м\r\n', 19384, NULL, 124, '\0', ''),
  (20322, 'DIE HARD DH535LU3', '<p>Die HARD DH535LU3 - Проф. аудио кабель, стерео, 2х джек &lt;-&gt; 2х RCA, длина 3 м</p>', 600, '2014-07-10 15:30:55', 475, 'Die HARD DH535LU3 - Проф. аудио кабель, стерео, 2х джек <-> 2х RCA, длина 3 м\r\n', 19385, NULL, 124, '\0', ''),
  (20323, 'Soundcraft MFX12i', '<p>В серии&nbsp;<strong>MFXi&nbsp;</strong>объединены все функциональные возможности популярного микшера Soundcraft MPM™ со встроенным 24-битным цифровым процессором эффектов Lexicon® плюс невысокая цена Soundcraft, компактность и многофункциональность.</p><p>В микшере&nbsp;<strong>Soundcraft MFXi™</strong>&nbsp;использован тот же процессор AudioDNA®, что и в значительной части оборудования Digitech® и Lexicon, в том числе в новом Lexicon MX500. За более чем тридцать пять лет имя Lexicon стало прочно ассоциироваться с лучшими ревербераторами и процессорами, гарантирующими высокое качество, которое обычно не встречается в микшерах данной ценовой категории.</p><p>Секция эффектов установлена в компактный микшерный корпус с 8, 12 или 20, в зависимости от версии, входными моноканалами, 2 стереоканалами, эффекты направляются на каждый канал. 32 эффекта на выбор, функция tap tempo, 3 регулятора параметров эффектов, возможность сохранения пользовательских установок эффектов.</p><p>Soundcraft МFX оснащен высококачественным микрофонным предусилителем GB30 Mic amp, сконструированным к 30-летию компании и использующимся в более крупных профессиональных консолях LX7ii и серий GB. Также Soundcraft МFX предлагает все функциональные возможности Soundcraft MPM, в их числе два конфигурируемых aux посыла, две шины групп, разъемы XLR и jack, входы tape-in и выходы записи на RCA, 3-полосный EQ с параметрической серединой на моно входы, 3-полосный EQ на стерео входы, TRS разъемы на инсертах на всех моно-входах и микс-выходе, десятисегментный светодиодный индикатор и выход на наушники</p><p><strong>Ключевые характеристики:</strong></p><ul><li>Размеры микшеров 8+2, 12+2 и 20+2</li><li>Встроенный 24-битный цифровой процессор эффектов Lexicon</li><li>32 FX установки</li><li>функция tap tempo и возможность сохранения пользовательских установок FX</li><li>1 FX отправляется на каждый канал</li><li>2 конфигурируемых аукс-шины</li><li>2 стерео входа</li><li>2 шины групп</li><li>стерео микс-выход</li><li>2-трековых выход записи</li><li>2-трековый replay с контролем уровня</li><li>Фантомное питание +48V</li><li>Микрофонные предусилители GB30</li><li>Светодиодные индикаторы пиков</li><li>Верхняя граница частот 100 Гц</li><li>Insert point (mono channels)</li><li>3-полосный полупараметрический EQ на моно входах</li><li>3-полосный EQ на стерео входы</li><li>Префейдерный контроль уровня сигнала</li><li>Маршрутизация Mix и групп</li><li>Светодиодная индикация наличия сигнала</li><li>60-ти мм фейдер</li><li>Выходы на наушники и контрольные мониторы</li><li>Монтируемые в рэк модели 8+2 и 12+2 (аксессуары продаются отдельно)</li></ul>', 24000, '2014-07-10 16:29:50', 185, 'Soundcraft MFXi12 микшерный пульт 12 моно (преампы GB серии), 2 стерео, 3 Aux, 2 подгруппы, встроенный процессор эффектов Lexicon', 19386, NULL, 124, '\0', ''),
  (20324, 'Soundcraft MFX8i', '<p><strong>Описание Soundcraft MFX8i:</strong></p><p>Аналоговая микшерная консоль&nbsp;<strong>SOUNDCRAFT MFX8i</strong>&nbsp;представляет собой компактный микшер, оборудованный восьмью моно-, и двумя стерео- каналами. Микшер предназначен для подключения коммутирования самого разного музыкального оборудования, включая стерео цифровые синтезаторы, вокальные микрофоны и многое другое. Микшерная консоль MFX8i выпущена в известной и популярной среди музыкантов серии MFX, в которой объединены все лучшие функциональные возможности известного профессионального микшера Soundcraft MPM. К основным и уникальным особенностям микшера MFX8i можно отнести интегрированный 24(х)-битный цифровой процессор эффектов от компании Lexicon с эффектами профессионального, студийного качества.&nbsp;<br><br>Компактный микшер Soundcraft MFX8i предлагает своим пользователям многофункциональное устройство коммутации музыкальных инструментов, высокое качество звукового сигнала, достаточно невысокую стоимость и функциональность для ежедневного использования!<br></p><p><strong>Основные функциональные особенности микшера Soundcraft MFX8i</strong></p><p>- Современный внешний вид, дизайн и концепция микшера разработаны лучшими инженерами компании Soundcraft.<br>- Микшер предлагает восемь моноканалов высокого разрешения с двумя группами посыла звукового сигнала на внешний или интегрированный процессор эффектов.<br>- Два стереоканала микшера предназначены для подключения роялей, фортепиано и прочих цифровых музыкальных инструментов.&nbsp;<br>- Интегрированный в микшер, 24-битный цифровой процессор эффектов представлен известной компании Lexicon.<br>- Процессор эффектов предлагает воспользоваться 32-мя FX эффектами профессионального качества.&nbsp;<br>- Интегрированная функция TAP TEMPO, возможность для сохранения пользовательских настроек и установок во внутреннюю память.&nbsp;<br>- Микшер оснащен двумя конфигурируемыми шинами AUX для посыла сигнала на разные цифровые и аналоговые устройства.&nbsp;<br>- Воспользуйтесь возможностями двухтрекового выхода для записи общего микса в стерео режиме.&nbsp;<br>- Функция фантомного питания для использования профессиональных конденсаторных микрофонов (+48V).<br>- Микрофонные каналы оборудованы высококачественными предусилителями GB30 студийного уровня.&nbsp;<br>- Каждый из каналов микшера оборудован светодиодными индикаторами пиков.<br>- Полупараметрические полосные эквалайзеры EQ на моно входах микшера.<br>- Комфортная маршрутизация общего звукового сигнала Mix и канальных групп микшера.&nbsp;<br>- Сверхпрочные, 60(ти)-миллиметровые фейдеры дают возможность комфортного управления уровнями громкости каждого из каналов.&nbsp;<br>- Полностью независимые выходы для подключения наушников и контрольные мониторы.<br>- Возможность установки микшера в профессиональную рэковую стойку для максимально комфортного использования.&nbsp;<br>- Прочная металлическая конструкция микшера предназначена для активной, ежедневной эксплуатации даже в самых тяжелых условиях.&nbsp;<br></p><p><strong>Высококачественный аудио процессор (AudioDNA)</strong></p><p>В компактной консоли Soundcraft MFX8i используется точно такой же аудио процессор AudioDNA, как и в большой части профессионального музыкального оборудования компании Digitech и Lexicon. Среди таких устройств известный профессиональным музыкантам цифровой процессор Lexicon MX500. Благодаря использованию нового процессора AudioDNA, имя профессионального оборудования и процессоров Lexicon ассоциируется с самыми лучшими устройствами реверберации и цифровыми процессорами. Теперь эта технология используется и в аналоговых микшерах MFX, что гарантирует пользователям высочайшее качество звучания, которое, как правило, не встречается в микшерах других производителей.&nbsp;<br></p><p><strong>Секция профессиональных эффектов от Lexicon</strong></p><p>Интегрированный процессор цифровых эффектов представлен известной компанией Lexicon. Он предлагает своим пользователям цифровые эффекты высокого качества, которые, как правило, используют в дорогих приборах для профессиональной студийной обработки. Процессор эффектов может работать в стерео режиме на два канала микшера одновременно.&nbsp;<br><br>В общем количестве эффект-процессор от Lexicon предлагает своим пользователям 32 самых лучших эффектов высокопрофессионального уровня. Кроме секции эффектов можно так же воспользоваться функцией tap tempo, что бы в режиме реального времени настраивать ритм выбранного эффекта. В секции эффектов доступны три ручки управления и настройки параметров эффектов. Каждый из выбранных эффектов можно сохранить во внутреннюю память микшера. Сохраненные пресеты можно вызывать, редактировать и заново сохранять, используя функциональные кнопки управления.&nbsp;<br></p><p><strong>Профессиональные микрофонные предусилители GB30</strong></p><p>Каждый из микрофонных каналов микшерной консоли Soundcraft MFX8i оборудован профессиональными микрофонными предусилителями GB30 Mic amp. Эти предусилители были созданы для профессиональных микшеров, к празднованию 30-летия компании. Предусилители GB30 Mic amp известны тем, что они используются в больших профессиональных консолях из серии GB (LX7ii). Они способны качественно усиливать сигнал без потерь основного качества, без искажений и помех.&nbsp;<br></p><p><strong>Технические характеристики микшерной консоли Soundcraft MFX8i</strong></p><p>Тип устройства : микшерная консоль.<br>Спецификация каналов :&nbsp;<br>- Количесвто моноканалов : восемь моноканалов.<br>- Стерео каналы : два стерео канала (стереопары).<br><br>Основные особенности :&nbsp;<br>- Один эффект процессора (FX) на каждый канал микшера.<br>- Конфигурируемые AUX-шины : две.<br>- Система фантомного питания (+48V) : есть.<br>- Стереовходы : два.<br>- Шины групп каналов : две.&nbsp;<br>- Стерео микс-выход : есть.<br>- Светодиодная индикация пиков : есть.<br>- Модель микрофонных предусилителей : GB30.<br>- Двух-трековый REPLAY с контролем уровня : есть.<br>- Двух-трековых выход записи (стерео режим) : есть.<br>- Верхняя граница частот : 100 Гц.<br>- Префейдерный контроль уровня звукового сигнала : есть.<br>- Разрывы Insert на моно каналах : есть.&nbsp;<br>- Трехполосный эквалайзер на стерео входы : есть.<br>- Светодиодная индикация наличия звукового сигнала : есть.<br>- Трехполосный полупараметрический эквалайзер на моно входы : есть.<br>- Маршрутизация основного Mix и групп : есть.<br>- 60-ти миллиметровые фейдеры : каждый канал.&nbsp;<br>- Выходы на наушники и контрольные мониторы : раздельные.<br><br>Спецификация процессора эффектов :&nbsp;<br>- Производитель процессора : Lexicon.<br>- Преобразование : 24(х)-битное, цифровое.<br>- Особенности : интегрированный.<br>- Производитель : Lexicon.<br>- Функция tap tempo : есть, ручная настройка в режиме реального времени.<br>- Возможность сохранения пользовательских установок FX : есть, внутренняя память микшера.<br>- Общее количество пресетов : 32 FX установки.<br><br>Возможность установки в рэк : есть (крепление приобретается отдельно).&nbsp;<br>Габаритные размеры : 403 мм. х 94 мм. х 405 мм.<br>Вес : 4,0 кг.</p>', 21000, '2014-07-10 16:29:04', 185, 'Soundcraft MFXi8 микшерный пульт 8 моно (преампы GB серии), 2 стерео, 3 Aux, 2 подгруппы, встроенный процессор эффектов Lexicon', 19387, NULL, 124, '\0', ''),
  (20325, 'Soundcraft EPM8', '<p><strong>Описание Soundcraft EPM8:</strong></p><p>Микшеры ЕРМ компании Soundcraft – это самый лучший выбор по цене и качеству. Они снабжены всеми необходимыми функциями и последними инструментариями для микширования. При разработке своей продукции компания ориентируется на мнения сторонних мастеров и институтов, с которыми Soundcraft сотрудничает. И результат на лицо! Микшеры ЕРМ узнаваемы с первого взгляда благодаря очень удачному дизайну, какого нет у других производителей. Интерфейс очень удобен и не содержит ничего лишнего. Внутренности микшеров ЕРМ, в частности схемы, такие же, как в консолях более дорого класса. Именно они определяют высокое качество звучания.<br><br>Перед представлением общественности микшеры ЕРМ жестко тестируются. Изучается их поведение при различных нагрузках, при различных внешних условиях среды. При выпуске микшеров этой серии используются самые последние технологии.<br></p><p><strong>Характеристика модели ЕРМ8</strong></p><p>Модель&nbsp;<strong>Soundcraft ЕРМ8</strong>&nbsp;– стильный аналоговый микшер, который во многом похож на пульты серии Soundcraft Spirit E. Отличие заключается лишь в применении предусилителей GB-30. Такие же предусилители установлены в консолях серий GB4, GB8 и LX7II. GB-30 имеют большую разрешающую способность (усиление 55дБ) и перегрузочный запас +22дБ.<br><br>С моделью совместимы любые конденсаторные микрофоны благодаря фантомному питанию 48В. Индикатор PEAK led следит за работой устройства. Он выявляет наличие перегрузок, если таковые есть, и сообщает о них более ярким свечением.<br><br>Микшерный пульт имеет восемь моно выходов и два стерео входа, две AUX-шины, 3-полосный эквалайзер.<br></p><p><strong>Технические параметры:</strong></p><p>- размер микшеров: 8+2;<br>- две конфигурируемых шины AUX;<br>- разъем XLR;<br>- разъем jack;<br>- разъемы TRS;<br>- вход tape-in;<br>- вход для записи на RCA;<br>- трехполосный эквалайзер с параметрической серединой;<br>- двухполосный эквалайзер на выходах;<br>- LED-индикатор с 10-ю сегментами;<br>- система соло;<br>- выход для наушников;<br>- очень просто монтируется в рэк.</p>', 10400, '2014-07-10 16:37:03', 185, 'микшерный пульт, 8моно +2 стерео., микрофонные предусилители GB-30, 2 конфигурируемые аукс-шины, разъёмы XLR и jack, входы tape-in и выходы записи на RCA, 3-полосный EQ с параметрической серединой, 2-полосный EQ на стерео-входах, TRS разъемы на инсертах', 19388, NULL, 124, '\0', ''),
  (20326, 'Electro-Voice Q1212', '<p>Kаждая новая серия усилителей от EV основывается на 60 летнем опыте производства и конструирования. С самого начала Electro-Voice особое внимание уделял музыкальности и надежности своих усилителей. Они во всех режимах эксплуатации обеспечивают максимально чистое звучание. В 1990 г. EV впервые представили легендарную серию усилителей P, которые по сей день являются эталоном как по звуку так и по надежности. Они участвовали в самом крупном в мире концерном туре Rolling Stones и AC/DC. Эта серия производятся по сей день, уже c цифровым модулем управления, позволяющим объединять в единую сеть до двухсот усилителей. В Q серии применена таже философия что и в легендарной \"Р\" серии. Q серию разрабатывала таже группа инженеров, что и серию \"Р\", что является гарантией высокого качества звука и надежности. Усилители выполнены по топологии класса \"Н\", что обеспечивает высокий КПД и как соответствие малый вес и низкое энергопотребление. Все усилители серии Q имеют огромный запас по перегрузке. Музыкальный сигнал \"живой команды\" имеет, как правило, большие значения Пик фактора (отношение пиковой мощности к средней). Для того, что бы весь сигнал передавался без искажений (включая сигналы имеющие большую амплитуду: бас гитары, большого барабана и т.д.) усилитель должен иметь большой запас по перегрузке. Все усилители EV имеют схему позволяющую без искажений передавать кратковременные сигналы с 30% превышением номинальных значений мощности. Далее вступает в действие схема динамического лимитирования, обеспечивающая плавное ограничение сигнала без ступенчатой формы переходных процессов, что опять же, ведет к максимальному снижению нелинейных искажений. При этом, усилители серии Q достаточно безболезненно переносят работу на 2 Ohm.<br>Следует особо отметить, что все усилители серии Q имеют защиту от перегрева, короткого замыкания, обратной ЭДС.<br>Так же одной из изюминок является применение запатентованного EV<br><br><strong>Low-Pass Notch</strong><br>фильтра, использование которого добавляет в сигнал плотный \"толчек\" и артикуляцию \"внизу\", что позволяет, в некоторых случаях, использовать широкополосные АС без дополнительного SUB.<br>На сегодняшний день это однозначно один из лучших усилителей на рынке по соотношению цена/качество, что позволит расширить использование легендарных усилителей от EV c акустическими системами среднего и нижнего ценового диапазона.</p><ul><li>Мощность (1kHz, THD 1%): 1800W/2ohm, 1200W/4ohm, 750W/8ohm</li><li>Мощность (20-20kHz, THD&lt;0,2%): 550W/8ohm, 1100W/4ohm</li><li>Мощность в мосту: 3600W/4ohm, 2400W/8ohm</li><li>Скорость нарастания: &gt;30V/ms</li><li>THD: &lt; 0,03%</li><li>Демпинг фактор 100 Гц / 1000 Гц: &gt; 300 / &gt; 200</li><li>Входной импеданс: 20k ohm</li><li>Отношение сигнал/шум: &gt;110dB</li><li>Размеры (В х Ш х Г): 88.1 х 483 х 422.5 mm</li><li>Вес: 17.7kg</li></ul>', 50000, '2014-08-16 09:55:00', 476, 'ELECTRO-VOICE Q1212 - УСИЛИТЕЛЬ МОЩНОСТИ', 19389, NULL, 124, '\0', ''),
  (20327, 'ORANGE JIM ROOT PPC212', '<p><strong>Orange&nbsp;Jim Root PPC212 Cab</strong>&nbsp;-&nbsp;Гитарный кабинет, подписная модель Jim Root гитариста Slipknot, спецально созданый для головного усилителя&nbsp;<a data-cke-saved-href=\"http://muzkom.com.ua/products/7313\" href=\"http://muzkom.com.ua/products/7313\" target=\"_blank\">Orange&nbsp;Jim Root Terror Head</a><br><br><strong>Характеристики:&nbsp;</strong><br><br>Мощность: 120 watts RMS&nbsp;<br>Импенданс: 16 ohm<br>Динамик: 2 x specially designed Orange 12″&nbsp;<br>Вход: 2 х 1/4″ Input<br><br>Материал корпуса: 13 слойная фанера, 18 мм балтийская береза<br>Корпус - закрытая задняя стенка<br><br>Габариты: 66x53x30&nbsp;cm&nbsp;<br>Вес: 23 кг<br>Цвет корпуса: чёрный</p>', 20500, '2014-07-10 17:15:35', 46, 'гитарный кабинет закрытого типа, 2x12` Orange Special, 120 Вт, 16 Ом, именная модель Jim Root', 19390, NULL, 124, '\0', ''),
  (20328, 'Soundcraft EPM6', '<p><strong style=\"line-height: 1.428571429;\">Технические параметры:</strong><br></p><p>- размер фрейма: 6+2;<br>- 2 aux-шины;<br>- разъемы XLR и джек (металлические);<br>- трехполосный эквалайзер;<br>- двухполосный эквалайзер на стерео входах;<br>- TRS-гнезда;<br>- LED-индикаторы, состоящие из 10 сегментов;<br>- система соло (интуитивная);<br>- разъем для наушников;<br>- легко монтируется в рэк.</p>', 9300, '2014-08-28 11:47:35', 185, 'Микшерный пульт, 6 моно + 2 стерео, микрофонные предусилители GB-30, 2 конфигурируемые аукс-шины, разъёмы XLR и jack, входы tape-in и выходы записи на RCA, 3-полосный EQ с параметрической серединой, 2-полосный EQ на стерео-входах, TRS разъемы на инсертах.', 19391, NULL, 124, '\0', ''),
  (20329, 'Soundcraft EPM12', '<p>Тип: микшерный пульт&nbsp;<br>Входы: 12 моно + 2 стерео&nbsp;<br>Микрофонные предусилители: GB-30&nbsp;<br>Эквалайзер: 3-хполосный&nbsp;&nbsp;<br>Монтируется в рэк<br></p><p><br>Спецификации:<br>2 конфигурируемых аукс-шины<br>разъёмы XLR и jack<br>входы tape-in и выходы записи на RCA<br>3-полосный EQ с параметрической серединой<br>2-полосный EQ на стерео-входах<br>TRS разъемы на инсертах на всех моно-входах и стерео-выходе<br>Десятисегментный светодиодный индикатор<br>Интуитивная система соло<br>Выход на наушники<br></p>', 13200, '2014-08-28 11:48:17', 185, 'Микшерный пульт. 12 моно +2 стерео., микрофонные предусилители GB-30, 2 конфигурируемые аукс-шины, разъёмы XLR и jack, входы tape-in и выходы записи на RCA, 3-полосный EQ с параметрической серединой, 2-полосный EQ на стерео-входах, TRS разъемы на инсертах.', 19392, NULL, 124, '\0', ''),
  (20330, 'SOUNDCRAFT SPIRIT M12', '<h2>Характеристики Soundcraft SPIRIT M12</h2><table><tbody><tr><td colspan=\"3\" style=\"vertical-align:top\"><strong>Общие данные</strong></td></tr><tr><td style=\"vertical-align:top; width:255px\">Тип</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Микшерный пульт</td></tr><tr><td colspan=\"3\" style=\"vertical-align:top\"><strong>Функциональные особенности</strong></td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">12 входных линеек</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Цифровой S/PDIF выход</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Малый шум, малые искажения в микрофонных преампах</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Настоящий \"британский\" эквалайзер с усовершенствованной ВЧ секцией</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Улучшенная архитектура для уменьшения шумов и наводок</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">100 мм фейдеры</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Профессиональное качество различных соединителей</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Переключаемые директ-выходы</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Удобное крепление в рэк</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Директ-выходы ( до или после фейдера ) на всех моно канале</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Кнопки выключения ( мьютирования ) и прослушки на каждом канале</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">4 стерео входа в пультах разных конфигурациц</td></tr><tr><td style=\"vertical-align:top; width:255px\">*</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">4 стерео возврата и возврат на мастер с FX</td></tr></tbody></table>', 30300, '2014-08-28 11:50:49', 185, '20-канальный микшерский пульт, 12 мик/лин. входа 4 стерео канала 3-полосный эквалайзер с параметрическим Mid диапазоном в моно каналах 4 AUX посыла 4 стереовозврата S/PDIF выход RCA входы/выходы на магнитофон direct выходы фейдеры 100мм', 19393, NULL, 124, '\0', ''),
  (20331, 'SOUNDCRAFT SPIRIT M4', '<p>Особенности&nbsp;<br></p><ul><li>4&nbsp;входных линейки</li><li>Цифровой S/PDIF выход</li><li>Малый шум, малые искажения в микрофонных преампах</li><li>Настоящий \"британский\" эквалайзер с усовершенствованной ВЧ секцией</li><li>Улучшенная архитектура для уменьшения шумов и наводок</li><li>100 мм фейдеры</li><li>Профессиональное качество различных соединителей</li><li>Переключаемые директ-выходы</li><li>Удобное крепление в рэк</li><li>Директ-выходы ( до или после фейдера ) на всех моно канале</li><li>Кнопки выключения ( мьютирования ) и прослушки на каждом канале</li><li>4 стерео входа в пультах разных конфигурациц</li><li>4 стерео возврата и возврат на мастер с FX</li></ul>', 20700, '2014-08-28 11:51:27', 185, '12-канальный микшерский пульт, 4 мик/лин. входа 4 стерео канала 3-полосный эквалайзер с параметрическим Mid диапазоном в моно каналах 4 AUX посыла 4 стереовозврата S/PDIF выход RCA входы/выходы на магнитофон direct выходы фейдеры 100 мм', 19394, NULL, 124, '\0', ''),
  (20332, 'SOUNDCRAFT SPIRIT M8', '<ul><li>8 входных линеек</li><li>Цифровой S/PDIF выход</li><li>Малый шум, малые искажения в микрофонных преампах</li><li>Настоящий \"британский\" эквалайзер с усовершенствованной ВЧ секцией</li><li>Улучшенная архитектура для уменьшения шумов и наводок</li><li>100 мм фейдеры</li><li>Профессиональное качество различных соединителей</li><li>Переключаемые директ-выходы</li><li>Удобное крепление в рэк</li><li>Директ-выходы ( до или после фейдера ) на всех моно канале</li><li>Кнопки выключения ( мьютирования ) и прослушки на каждом канале</li><li>4 стерео входа в пультах разных конфигурациц</li><li>4 стерео возврата и возврат на мастер с FX</li></ul>', 24600, '2014-08-28 11:51:59', 185, '16-канальный микшерский пульт, 8 мик/лин. входа 4 стерео канала 3-полосный эквалайзер с параметрическим Mid диапазоном в моно каналах 4 AUX посыла 4 стереовозврата S/PDIF выход RCA входы/выходы на магнитофон direct выходы фейдеры 100 мм', 19395, NULL, 124, '\0', ''),
  (20333, 'Soundcraft MFX20i', '<p><br><br></p><h3>Технические характеристики:</h3><p>• Тип устройства: микшерная консоль<br>• Количество моноканалов: 20<br>• Количество стереовходов: 2<br>• Количество AUX-шин: 2<br>• Процессор эффектов: встроенный, 24-битный, «Lexicon»<br>• Количество FX-установок: 32<br>• Другие коммутационные возможности: стереомикс-выход; 2-трековые выходы для записи; 2-трековый Replay (оснащен контролем уровня), выход для подключения наушников и выход для подключения мониторов<br>• Дополнительные функции: «Tap Tempo» и сохранение пользовательских настроек эффектов<br>• Фантомное питание: есть<br>• Тип микрофонных предусилителей: GB30<br>• Индикация: 10-сегментная светодиодная<br>• Уровень верхней границы частот: 100 Гц<br>• Эквализация: 3-полосный полупараметрический графический эквалайзер на моновходах и 3-полосный графический эквалайзер на стереовходах<br>• Размер фейдера: 60 мм<br>• Монтаж в рэк: возможен<br>• Размеры: 68,8 см х 9,4 см х 40,5 см<br>• Вес: 9,3 кг</p>', 31700, '2014-08-28 11:53:14', 185, 'Компактная микшерная консоль со встроенными эффектами, 20 моноканалов + 2 стерео-канала, 3 аукс, 2 группы, встроенный процессор Lexicon с 32 пресетами и 3-мя регулируемыми параметрами, кнопкой TAP', 19396, NULL, 124, '\0', ''),
  (20334, 'Soundcraft FX16ii', '<p>Особенности</p><ul><li>26 стандартных входов</li><li>16 микрофонных моно входов с высококачественными преампами</li><li>4 стерео возврата</li><li>4 подгруппы с переключениями на мастер выход</li><li>Директ выходы с 1по 16 линейку для многодорожечной записи</li><li>Индивидуально переключаемые директ-выходы либо до-, либо после- фейдера</li><li>Разрывы на всех моно линейках</li><li>Разрыв на мастер-выходе</li><li>Встроенный процессор эффектов Lexicon</li><li>3-х полосный эквалайзер с перестраиваемой серединой</li><li>Обрезной НЧ фильтр ( 100 Гц ) с крутизной среза 18 дБ на октаву для удаления низкочастотного гула</li><li>+48 В фантомное питание</li><li>Канальный выключатель ( Mute )</li><li>10-и сегментный 3-х цветный индикатор</li><li>2 выхода с субгрупп</li><li>Независимый моно мастер выход</li></ul><p>Спецификация<br><br>Частотная характеристика<br><br><br>Mic / Line Input to any Output………………………………………………….. +/-0.5dB, 20Hz – 30kHz<br><br>Коэффициент гармонических искажений<br><br>Mic sens. –30dBu, +14dBu @ Mix output………………………………………….….&lt; 0.009% @ 1kHz<br><br>Уровень шума</p><ul><li>Mic Input E.I.N (maximum gain)………………………..…………………….. &lt; - 129dBu (150 source)</li><li>Aux, Mix and masters (@max, faders down)……………………………………&lt;-80dBu -90dB</li></ul><p>Взаимное проникновение между каналами</p><ul><li>Channel Mute……………………………………………………………………………….. &gt; 96dB</li><li>Fader Cut-off (rel 0 mark) ………………………………………………………………….. &gt; 90dB</li><li>Routing Isolation…………………………………………………………………………... &gt; 90dB</li><li>Aux Send Pots offness………………………………………………………………….. &gt; 84dB</li></ul><p>Эквалайзер</p><ul><li>HF………………………………………………………………………………….12kHz, ±15dB, Q=1.5</li><li>MF………………………………………………………………………………. 240Hz - 64kHz, ±15dB</li><li>LF……………………………………………………………………………………80Hz, ±15dB, Q=1.5</li></ul><p>Индикация</p><ul><li>Два трехцветных 10-сегментных индикатора на mix, submix, control room или 2-track уровни</li><li>Индикация пиков (PPM)</li></ul><p>Мощность 42W<br><br>Условия эксплуатации</p><ul><li>Температурный диапазон ………………………………………………………………..-10^(o)C to +30^(o)C</li><li>Относительная влажность ……………………………………………………………………..0% to 80%</li></ul><p>Спецификация вход / выход<br><br>Уровни</p><ul><li>Микрофонный вход…………………………………………………………………………….+22dBu max</li><li>Линейный вход……………………………………………………………………………&gt;+30 dBu max</li><li>Стерео возврат………………………………………………………………………&gt;+30 dBu max</li><li>Выходы………………………………………………………………...+22dBu max.,+4 dBu nominal</li></ul><p>Импеданс</p><ul><li>Микрофонный вход ……………………………………………………………………………………1.8k</li><li>Все остальные входы………………………………………………………………………………...&gt; 10k</li><li>Выход на наушники………………………………………………………………………………………75</li><li>Все остальные выходы………………………………………………………………………………..&lt; 75</li></ul><p><br>Размеры и вес<br><br>Высота………………………………………………………………………148мм<br><br>Ширина</p><ul><li>Без рековых креплений ……………………………………………………………………………444мм</li><li>С рековыми креплениями …………………………………………………………………………482мм</li></ul><p><br>Глубина 442мм Подходит в рек 10U<br><br>Вес включая блок питания…………………………………………………………………………11.2кг</p>', 33200, '2014-08-28 11:53:59', 185, 'Микшер 16 мик/лин. входов 2 подгруппы, 3-полосный эквалайзер с параметрическим Mid диапазоном в моно каналах 2-полосный эквалайзер в стерео каналах встроенный процессор эффектов 16 заводских + 16 пользовательских 3 AUX посыла 4 стереовозврата.', 19397, NULL, 124, '\0', ''),
  (20335, 'Soundcraft MPMi 12/2', '<p><span style=\"line-height: 1.428571429;\">Технические характеристики:</span></p><p>12 входных моно каналов</p><p>Качественная сборка и отличные аудио характеристики</p><p>2 стерео входа</p><p>2 шины групп</p><p>Выход Stereo Mix</p><p>2-трековый выход записи</p><p>2-трековый вход replay с контролем уровня</p><p>3 конфигурируемых шины Aux</p><p>Фантомное питание +48V</p><p>Микрофонные предусилители GB30</p><p>Светодиодные индикаторы пиков</p><p>Верхняя граница частот 100 Гц</p><p>Инсерты на моно каналах</p><p>3-полосный полупараметрический эквалайзер на моно входах</p><p>3-полосный эквалайзер на стерео входах</p><p>Префейдерный контроль уровня сигнала</p><p>Маршрутизация Mix и групп</p><p>Светодиодная индикация наличия сигнала</p><p>Высококачественные 60-ти мм фейдеры</p><p>Выходы на наушники и контрольные мониторы</p><p>Монтируемый в рэк (аксессуары приобретаются отдельно)</p><p>Встроенный универсальный БП</p><p><br></p><p><br></p><p>Шум (22Hz-22kHz полоса пропускания измерения)&nbsp;</p><p>Mic EIN @ max усиление, импеданс источника 150 ohms -128dBu&nbsp;</p><p>Mix @max, фейдеры в нижнем положении &lt;-85dBu&nbsp;</p><p>Перекрестные помехи (typ. @ 1kHz)&nbsp;</p><p>мьютирование канала &gt;93dB&nbsp;</p><p>отсечка фейдера (rel +10 mark) &gt;93dB&nbsp;</p><p>Aux send pot offness &gt;83dB&nbsp;</p><p>Частотная характеристика&nbsp;</p><p>Mic/Line вход на любой выход +/- 0.5dB 20Hz - 20kHz THD+Шум&nbsp;</p><p>Микрофонное усиление 30dB, -20dBu вход выход микса, фейдер max @ 1kHz &lt;0.004 %&nbsp;</p><p>Импедансы входа и выхода Микрофонный вход 2.4k&nbsp;</p><p>Линейный вход 11k&nbsp;</p><p>Стерео вход 100k&nbsp;</p><p>Выходы 75&nbsp;</p><p>Уровни входного и выходного сигналов&nbsp;</p><p>Максимальный уровень микрофонного входного сигнала +16dBu&nbsp;</p><p>Максимальный уровень линейного входного сигнала +30dBu&nbsp;</p><p>Максимальный уровень стереофонического входного сигнала +30dBu&nbsp;</p><p>Максимальный уровень выходного сигнала микса +20dBu&nbsp;</p><p>Головные телефоны (@ 200) 300mW EQ&nbsp;</p><p>Диапазоны EQ (Монофонический вход) +/- 15dB&nbsp;</p><p>Lo 80Hz&nbsp;</p><p>Mid (swept) 150Hz - 3,5kHz&nbsp;</p><p>Hi 12kHz&nbsp;</p><p>Q 1.5&nbsp;</p><p>Диапазоны EQ (стереофонический вход) +/- 15dB&nbsp;</p><p>Lo 60Hz&nbsp;</p><p>Hi 7kHz</p>', 19900, '2014-08-28 11:55:10', 185, '12 входных моно каналов, 2 входных стерео-линейки, 2 шины групп, 3 настраиваемых аукс-посыла. На каждой моно-линейке 3-полосный эквалайзер с полупараметрическойсерединой, 60-мм фейдер, insert-разрыв. На стерео-входах - 3 полосные эквалайзеры.', 19398, NULL, 124, '\0', ''),
  (20336, 'Soundcraft MPMi 20/2 ', '<strong></strong><p><strong>Технические характеристики:</strong></p><ul><li>Тип: микшерный пульт</li><li>Входы и выходы: 20 моно входов, 2 стерео входа, 2 шины групп, выход Stereo Mix, 2-трековый выход записи, 2-трековый вход replay с контролем уровня, 3 конфигурируемых шины Aux</li><li>Частотный диапазон: 20 Гц – 20 кГц (+/-0.5 дБ)</li><li>Микрофонные предусилители: GB30</li><li>Эквализация: 3-полосный полупараметрический эквалайзер на моно входах, 3-полосный эквалайзер на стерео входах</li><li>Фейдеры: 60 мм</li><li>Габаритные размеры: 688 х 405 х 94 мм</li><li>Вес (с упаковкой и аксессуарами): 11 кг</li></ul><p><strong>Особенности</strong></p><ul><li>Фантомное питание +48 В</li><li>Микрофонные предусилители GB30</li><li>Светодиодные индикаторы пиков</li><li>Верхняя граница частот 100 Гц</li><li>Инсерты на моно каналах</li><li>3-полосный полупараметрический эквалайзер на моно входах</li><li>3-полосный эквалайзер на стерео входах</li><li>Префейдерный контроль уровня сигнала</li><li>Маршрутизация Mix и групп</li><li>Светодиодная индикация наличия сигнала</li><li>Высококачественные 60-мм фейдеры</li><li>Выходы на наушники и контрольные мониторы</li><li>Монтируемый в рэк (аксессуары продаются отдельно)</li><li>Встроенный универсальный БП</li></ul><p><br></p>', 28000, '2014-08-28 11:55:51', 185, 'Микшерная консоль, 20 моно каналов, 2 стерео канала, 2 группы, 3 AUX', 19399, NULL, 124, '\0', ''),
  (20337, 'ROXTON MZ-120', '<p>Трансляционный музыкальны усилитель&nbsp;ROXTON MZ-120&nbsp;используются для построения систем оповещения и музыкальной трансляции на базе дополнительного оборудования. Данный усилитель предназначен для микширования и усиления звукового сигнала с целью его дальнейшей трансляции на громкоговорители.&nbsp;<br>К блоку&nbsp;ROXTON MZ-120&nbsp;может быть подключено до 5-ти источников аудио сигнала, 3 микрофонных и 2 линейных входа. Уровни линейных и микрофонных входов регулируются при помощи ручек на передней панели. Выходной каскад усилителя содержит трансформатор, который дополнительно повышает напряжение усиленного сигнала до 100В. Это необходимо для минимизации потерь в линии. В усилитель встроен селектор на 6 зон. К высоковольтным выводам селектора усилителя необходимо подключать только специализированные громкоговорители, содержащие трансформатор.&nbsp;<br>Кроме высоковольтных, усилитель&nbsp;ROXTON MZ-120&nbsp;также имеет \"низкоомные\" выводы, для подключения стандартных акустических систем.&nbsp;<br>Общая регулировка усиления осуществляется при помощи регулятора на передней панели блока.&nbsp;<br>В усилитель&nbsp;ROXTON MZ-120&nbsp;встроен музыкальный модуль, снабженный FM-тюнером, цифровым дисплеем и аудио декодером, поддерживающем форматы mp3, WMA. Модуль снабжен дополнительными разъемами для установки USB/SD/MIMC-карт. Выбор и управление музыкальными источниками, осуществляется как с самого прибора, так и при помощи пульта дистанционного управления.<br>Питание усилителя осуществляется от переменного напряжения 220В. Конструктивно блок выполнен в настольном исполнении.</p><table style=\"width:543px\"><tbody><tr><th colspan=\"2\" style=\"background-color:rgb(52, 74, 124)\"><p><br></p></th></tr><tr><td style=\"vertical-align:top\"><p><span style=\"line-height: 1.428571429; background-color: transparent;\"></span><strong>Основные характеристики</strong></p><p><span style=\"line-height: 1.428571429; background-color: transparent;\">Напряжение питания</span><br></p></td><td style=\"vertical-align:top\"><p><span style=\"line-height: 1.428571429; background-color: transparent;\"></span><br></p><p><span style=\"line-height: 1.428571429; background-color: transparent;\">АС 220-240В, 50 Гц</span><br></p></td></tr><tr><td style=\"vertical-align:top\">Выходная мощность</td><td style=\"vertical-align:top\">120 Вт</td></tr><tr><td style=\"vertical-align:top\">Максимальная выходная мощность</td><td style=\"vertical-align:top\">180 Вт</td></tr><tr><td style=\"vertical-align:top\">Потребляемая мощность</td><td style=\"vertical-align:top\">240 Вт</td></tr><tr><td style=\"vertical-align:top\">Выходной сигнал (напряжение/сопротивление)</td><td style=\"vertical-align:top\">100В,70В~4-16 Ом</td></tr><tr><td style=\"vertical-align:top\">Частотный диапазон</td><td style=\"vertical-align:top\">100 Гц - 16к Гц</td></tr><tr><td style=\"vertical-align:top\">Коэффициент гармоник</td><td style=\"vertical-align:top\">менее 0.1%</td></tr><tr><td style=\"vertical-align:top\">Отношение сигнал/шум MIC</td><td style=\"vertical-align:top\">более 66 дБ</td></tr><tr><td style=\"vertical-align:top\">Отношение сигнал/шум AUX</td><td style=\"vertical-align:top\">более 70 дБ</td></tr><tr><td style=\"vertical-align:top\">Уровень на микрофонном входе 1,2,3</td><td style=\"vertical-align:top\">6 мВ / 600 Ом</td></tr><tr><td style=\"vertical-align:top\">Уровень сигнала на линейном входе 1,2</td><td style=\"vertical-align:top\">250 мВ / 10 кОм</td></tr><tr><td style=\"vertical-align:top\">Уровень сигнала на линейном выходе</td><td style=\"vertical-align:top\">0 дБ ~1В / 600 Ом</td></tr><tr><td style=\"vertical-align:top\">Мьютирование</td><td style=\"vertical-align:top\">0~-30дБ</td></tr><tr><td style=\"vertical-align:top\">Защита по выходу</td><td style=\"vertical-align:top\">перегрузка, КЗ</td></tr><tr><th colspan=\"2\" style=\"background-color:rgb(52, 74, 124)\"><br></th></tr><tr><td style=\"vertical-align:top\"><p><strong>Прочие характеристики</strong></p><p>Температура функционирования<br></p></td><td style=\"vertical-align:top\"><p><br></p><p>+10°C +35°C<br></p></td></tr><tr><td style=\"vertical-align:top\">Относительная влажность</td><td style=\"vertical-align:top\">не более 90 %</td></tr><tr><td style=\"vertical-align:top\">Габаритные размеры</td><td style=\"vertical-align:top\">440 x 92 x 330 мм</td></tr><tr><td style=\"vertical-align:top\">Вес</td><td style=\"vertical-align:top\">12 кг</td></tr><tr><td style=\"vertical-align:top\">Другие наименования модели</td><td style=\"vertical-align:top\"><a data-cke-saved-href=\"http://www.escortpro.ru/304-1_roxton-mz120.htm\" href=\"http://www.escortpro.ru/304-1_roxton-mz120.htm\">Roxton MZ120</a></td></tr></tbody></table>', 12500, '2014-07-21 11:54:18', 250, 'Усилитель трансляционный музыкальный зональный 120 Вт, mp3/USB-проигрыватель, FM-тюнер, 6 зон, 3 микрофонных и 2 линейных входа, пульт ДУ, настольное исполнение', 19400, NULL, 124, '\0', ''),
  (20340, 'ROXTON MS-40TB', '<p>ROXTON MS-40TB&nbsp;- двухполосная акустическая система 40/20/10/5 Вт и 8 Ом, кронштейн для крепления.</p><p>Достоинством данной системы является сочетание хороших акустических характеристик с эргономикой и удобством монтажа. Система выполнена из первичного пластика, имеет дополнительную защитную металлическую сетку. Высокое качество звучания достигается за счет двух полосного исполнения, усиленного встроенным фазоинвертором и пассивным разделительным фильтром. При помощи регулятора расположенного на задней панели, можно установить необходимый режим (низкоомный, трансформаторный) работы и выходную мощность. Акустический кабель подключается к удобным винтовым зажимам.</p><p>Громкоговоритель ROXTON MS-40TB монтируется на стене при помощи П-образного металлического кронштейна.</p><p>Функциональные особенности:</p><ul><li>Настенное двухполосное исполнение</li><li>Встроенный трансформатор</li><li>ВЧ твиттер</li><li>Пассивный фильтр</li><li>Регулятор режима / мощности</li><li>Интерьерный дизайн</li><li>Пластиковый корпус</li><li>Металлическая сетка</li><li>Металлический кронштейн</li><li>Винтовые терминальные зажимы</li></ul>', 2150, '2014-07-21 12:40:52', 250, 'ROXTON MS-40TB - двухполосная акустическая система 40/20/10/5 Вт и 8 Ом, кронштейн для крепления.', 19406, NULL, 124, '\0', ''),
  (20341, 'ROXTON MS-40TW', '<p>ROXTON MS-40TW&nbsp;- двухполосная акустическая система 40/20/10/5 Вт и 8 Ом, кронштейн для крепления.</p><p>Достоинством данной системы является сочетание хороших акустических характеристик с эргономикой и удобством монтажа. Система выполнена из первичного пластика, имеет дополнительную защитную металлическую сетку. Высокое качество звучания достигается за счет двух полосного исполнения, усиленного встроенным фазоинвертором и пассивным разделительным фильтром. При помощи регулятора расположенного на задней панели, можно установить необходимый режим (низкоомный, трансформаторный) работы и выходную мощность. Акустический кабель подключается к удобным винтовым зажимам.</p><p>Громкоговоритель ROXTON MS-40TW монтируется на стене при помощи П-образного металлического кронштейна.</p><p>Функциональные особенности:</p><ul><li>Настенное двухполосное исполнение</li><li>Встроенный трансформатор</li><li>ВЧ твиттер</li><li>Пассивный фильтр</li><li>Регулятор режима / мощности</li><li>Интерьерный дизайн</li><li>Пластиковый корпус</li><li>Металлическая сетка</li><li>Металлический кронштейн</li><li>Винтовые терминальные зажимы</li></ul>', 2150, '2014-07-21 12:43:45', 250, 'ROXTON MS-40TW - двухполосная акустическая система 40/20/10/5 Вт и 8 Ом, кронштейн для крепления.', 19408, NULL, 124, '\0', ''),
  (20342, 'YAMAHA PSR E443', '<p>PSR-E443 имеет много новых функций и возможностей, среди которых удобные и полезные для обучения Portable Grand и Yamaha Education Suite (Y.E.S.). Любители музыкальных экспериментов и выступлений по достоинству оценят контроллеры, позволяющие изменять эффекты и применять фильтры в реальном времени. Новые стили подойдут для композиций самых разных жанров. Простота интерфейса и привлекательный дизайн - отличительные черты инструмента. PSR-E443 имеет функцию паттернов, которая позволит Вам ощутить себя диджеем, используя множество лупов (сэмплов) и битов для создания динамичной музыки. А с помощью специальных контроллеров Вы сможете легко и быстро управлять эффектами, что создает безграничные просторы для творчества.<br><br>Новинка имеет два специальных контроллера, которые позволяют использовать эффекты и применять фильтры в реальном времени, что сближает PSR-E443 с профессиональными синтезаторами. Использование колеса Pitch Bend поможет \"оживить\" звучание таких тембров, как саксофон и труба.<br><br>PSR-E443 предоставляет 750 качественных тембров акустических и электронных музыкальных инструментов, созданных с использованием усовершенствованной системы записи сэмплов. Встроенная двухполосная акустическая система обеспечивает объемное звучание с насыщенным басом. Теперь Вы сможете подобрать аккомпанемент, идеально подходящий к выбранной композиции. С усовершенствованной функцией арпеджио играть стало значительно легче.<br><br>Используйте систему Yamaha Education Suite (Y.E.S.) для комфортного и продуктивного обучения. С этой функцией Вы сможете самостоятельно научиться играть, вне зависимости от первоначального уровня подготовки. Имеются пошаговые уроки для левой, правой руки, а также для игры двумя руками.<br><br>Кнопка Portable Grand при одном лишь нажатии обеспечивает живой реалистичный звук рояля. Эта функция автоматически выбирает настройки, подходящие для игры тембром фортепиано. Наличие входа AUX открывает новые возможности для музыкального творчества, позволяя подключать «минусовки» и играя под аккомпанемент любимых мелодий. А наличие USB порта позволяет загружать и сохранять свои песни и переносить данные из/в компьютер.<br><br>Клавиатура: 61 клавиша органного типа&nbsp;<br>Контроллеры: колесо Pitch Bend, ручки&nbsp;<br>Дисплей: ЖК, 92 х 42 мм в подсветкой&nbsp;<br>Полифония: 32&nbsp;<br>Генератор тона: AWM Stereo Sampling&nbsp;<br>Пресеты: 206 + 462 XGlite + 23 Drum/SFX Kits + 40 Arpeggiо&nbsp;<br>Эффекты: Reverb 9 типов, Chorus 4 типа, Master EQ 5 типов, Harmony 26 типов, Ultra-Wide Stereo 3 типа&nbsp;<br>Функции: наложение, режим дует, режим разделения, арпеджио (150 типов)<br>Стили аккомпанемента: 186&nbsp;<br>Музыкальная база: 305&nbsp;<br>Число песен: 100&nbsp;<br>Запись: 10 песен, 6 треков&nbsp;<br>Обучающая функция: прослушивание, хронометраж, ожидание, повтор, словарь аккордов&nbsp;<br>Память: 1,54 Мб&nbsp;<br>Разъемы: DC IN 12V, выходы для наушников и сустейн педали, USB&nbsp;<br>Динамики: 12 см х 2 + 3 см х 2 2,5Вт+2,5Вт&nbsp;<br>Питание: адаптор (PA-150/PA-150A/5D) или 6 АА батарейки&nbsp;<br>Потребление питания: 16 Вт&nbsp;<br>Функция авто отключения питания&nbsp;<br>Размеры: 946 х 140 х 402 мм&nbsp;<br>Вес: 6,8 кг&nbsp;<br>Аксессуары: пюпитр</p>', 16500, '2014-07-29 10:43:58', 4, 'Yamaha PSR E443 - синтез. с автоакком.,61кл/32полиф/ 482темб/106ст/ 102песни/MIDI/YES5/Flash/Есть БП', 19413, NULL, 124, '\0', ''),
  (20343, 'CASIO CDP-230R BK', '<p>Casio CDP-230RBK отличается гармоничным сочетанием звучания классического инструмента и дополнительными возможностями, за которые ценят современные синтезаторы.</p><p>88 взвешенных клавиш позволяют полноценно заниматься музыкой тем, кто выбрал классический стиль, — переход на обычный инструмент не станет для них стрессом. Возможность изменения настроек CDP-230RBK, различные цифровые эффекты, функции аккомпанемента, три уровня чувствительности клавиатуры, 200 стилей, 700 тембров, редактор стилей, поддержка карт SD/SDHC — это далеко не все, чем может вас удивить это цифровое пианино.</p><p>Новая модель CDP-230R удовлетворит любой запрос самого взыскательного музыканта. С улучшенными тембрами струнных инструментов, взвешенной молоточковой клавиатурой и качественным звуком процессора AHL, это цифровое пианино - мечта любого исполнителя! CDP-230R содержит впечатляющий набор функций, а также широкий набор цифровых эффектов. Инновационная функция \"Эффект концертного зала\" позволит вам ощутить себя играющим на большой сцене: нажатие на кнопку добавит к тембру рояля акустический отзвук концертного зала, подчеркивая аутентичность вашего исполнения. С помощью редактора ритмов, части из различных ритмов могут быть объединены и отредактированы. Вдохновляйтесь и вдохновляйте!</p><p><strong>Отличительная черта</strong></p><p>&nbsp;&nbsp;&nbsp; 88 взвешенных клавиш<br>&nbsp;&nbsp;&nbsp; New: Кнопка Hall Effect: эффект концертного зала одним нажатием<br>&nbsp;&nbsp;&nbsp; New: Улучшенная акустическая система 2 x 8 Вт<br>&nbsp;&nbsp;&nbsp; 700 AHL тембров<br>&nbsp;&nbsp;&nbsp; 200 ритмов<br>&nbsp;&nbsp;&nbsp; Пошаговая система обучения<br>&nbsp;&nbsp;&nbsp; Арпеджиатор<br>&nbsp;&nbsp;&nbsp; редактор стилей<br>&nbsp;&nbsp;&nbsp; Музыкальные предустановки<br>&nbsp;&nbsp;&nbsp; Функция семплирования&nbsp;<br>&nbsp;&nbsp;&nbsp; Настройка звукоряда<br>&nbsp;&nbsp;&nbsp; Функция музыкального развития<br>&nbsp;&nbsp;&nbsp; функция Справочника аккордов<br>&nbsp;&nbsp;&nbsp; Кнопка переключения фортепиано / органа<br>&nbsp;&nbsp;&nbsp; Подключи и работай USB/Расширение песен<br>&nbsp;&nbsp;&nbsp; Аудио вход<br>&nbsp;&nbsp;&nbsp; разъем для карты SD&nbsp;<br>&nbsp;&nbsp;&nbsp; Вход микрофона (Mic in)<br>&nbsp;&nbsp;&nbsp; метроном<br>&nbsp;&nbsp;&nbsp; Колесо Pitch Bend<br>&nbsp;&nbsp;&nbsp; Улучшенная акустическая система 2 x 8 Вт<br>&nbsp;&nbsp;&nbsp; Деревянная стойка дополнительно<br><br><strong>Характеристики:</strong><br><br>Количество и тип клавиш: 88<br>Механика: Взвешенная молоточковая<br>Поверхность клавиатуры: Качественный синтетический материал<br>Чувствительность к касанию: 3 уровня<br>Звуковой источник: AHL Двухэлементный)<br>Количество встроенных тембров: 700 тембров<br>Наложение тембров/Разделение клавиатуры: Да/Да<br>Полифония (максимально): 48<br>Стереосэмплированные тембры рояля: Да<br>Реверберация: 10<br>Хорус: 5<br>Количество встроенных композиций: 152<br>Загружается дополнительно (пользовательские композиции): 10 композиций (макс.) 320 Кб<br>Октавный перенос: ± 2 октавы<br>Регулировка настройки: A4 = 415,5 Гц - 440,0 Гц - 465,9 Гц<br>Колесо Pitch Bend: да<br>Метроном: 0, 2, 3, 4, 5, 6 долей, диапазон темпа: от 20 до 255<br>Педали: SP-3 (демпфер, назначаемая)<br>MIDI: Да<br>USB-порт: Да<br>Наушники: 1, стандартный стерео-джек<br>Педаль: 1, стандартный джек<br>Карты памяти SD: SD или SDHC, до 32 Гб<br>Линейный вход: Стерео мини-джек<br>Микрофонный вход: Стандартный джек<br>Размер динамиков: 12 см x 6 см x 2<br>Усиление: 2 x 8 Вт<br>Количество встроенных стилей: 200<br>Музыкальные предустановки: 305<br>Настройка «в одно касание»: 200<br>Пользовательские стили (редактор стилей): 10<br>Автогармонизация: 12 типов<br>Арпеджиатор: 90 типов<br>Регистрационная память (предустановки x банки): 32 (4 x 8)<br>Кнопка «Фортепиано/орган»: Да<br>Партии для обучения: Правая/левая/вместе<br>Функция обучения: Да<br>Записывающее устройство: 6 дорожек x 5 композиций, 1 обучающая композиция<br>Приблизительный объем данных: До 12 000 нот<br>Дисплей: ЖК с подсветкой<br>Функция сэмплирования: Да (макс. 10 секунд)<br>Звуковой вход для сэмплирования: Микрофонный вход<br>Размеры (Ш x Г x В): 1322 x 286 x 129 мм (без стойки)<br>Со стойкой (приобретается отдельно): 1322 x 373 x 753 мм<br>Вес: 12.0 кг (без стойки)<br>В комплекте: Адаптер (AD-A12150LW), педаль SP-3, нотный сборник, пюпитр<br>Цвет: черный</p>', 27500, '2014-07-21 13:02:13', 106, 'Тип: компактное цифровое пианино \r\nКоличество клавиш: 88 клавиш, фортепианного типа \r\nПолифония: 48 нот \r\nКоличество тембров: 700 встроенных тембров \r\nЭффекты: Reverb 10 типа, хорус 5 \r\nКомпозиции: 10 пользовательских + 152 встроенных композиций \r\nИнтерфейс: выходы для наушников и сустейн педали, MIDI, USB, аудио вход, вход для микрофона \r\nЦвет: чёрный', 19415, NULL, 124, '\0', '\0'),
  (20344, 'CASIO CDP-230R SR', '<p>Casio CDP-230RSR отличается гармоничным сочетанием звучания классического инструмента и дополнительными возможностями, за которые ценят современные синтезаторы.</p><p>88 взвешенных клавиш позволяют полноценно заниматься музыкой тем, кто выбрал классический стиль, — переход на обычный инструмент не станет для них стрессом. Возможность изменения настроек CDP-230RSR, различные цифровые эффекты, функции аккомпанемента, три уровня чувствительности клавиатуры, 200 стилей, 700 тембров, редактор стилей, поддержка карт SD/SDHC — это далеко не все, чем может вас удивить это цифровое пианино.</p><p>Новая модель CDP-230R удовлетворит любой запрос самого взыскательного музыканта. С улучшенными тембрами струнных инструментов, взвешенной молоточковой клавиатурой и качественным звуком процессора AHL, это цифровое пианино - мечта любого исполнителя! CDP-230R содержит впечатляющий набор функций, а также широкий набор цифровых эффектов. Инновационная функция \"Эффект концертного зала\" позволит вам ощутить себя играющим на большой сцене: нажатие на кнопку добавит к тембру рояля акустический отзвук концертного зала, подчеркивая аутентичность вашего исполнения. С помощью редактора ритмов, части из различных ритмов могут быть объединены и отредактированы. Вдохновляйтесь и вдохновляйте!</p><p><br></p><p><strong>Отличительная черта</strong></p><p>&nbsp;&nbsp;&nbsp; 88 взвешенных клавиш<br>&nbsp;&nbsp;&nbsp; New: Кнопка Hall Effect: эффект концертного зала одним нажатием<br>&nbsp;&nbsp;&nbsp; New: Улучшенная акустическая система 2 x 8 Вт<br>&nbsp;&nbsp;&nbsp; 700 AHL тембров<br>&nbsp;&nbsp;&nbsp; 200 ритмов<br>&nbsp;&nbsp;&nbsp; Пошаговая система обучения<br>&nbsp;&nbsp;&nbsp; Арпеджиатор<br>&nbsp;&nbsp;&nbsp; редактор стилей<br>&nbsp;&nbsp;&nbsp; Музыкальные предустановки<br>&nbsp;&nbsp;&nbsp; Функция семплирования&nbsp;<br>&nbsp;&nbsp;&nbsp; Настройка звукоряда<br>&nbsp;&nbsp;&nbsp; Функция музыкального развития<br>&nbsp;&nbsp;&nbsp; функция Справочника аккордов<br>&nbsp;&nbsp;&nbsp; Кнопка переключения фортепиано / органа<br>&nbsp;&nbsp;&nbsp; Подключи и работай USB/Расширение песен<br>&nbsp;&nbsp;&nbsp; Аудио вход<br>&nbsp;&nbsp;&nbsp; разъем для карты SD&nbsp;<br>&nbsp;&nbsp;&nbsp; Вход микрофона (Mic in)<br>&nbsp;&nbsp;&nbsp; метроном<br>&nbsp;&nbsp;&nbsp; Колесо Pitch Bend<br>&nbsp;&nbsp;&nbsp; Улучшенная акустическая система 2 x 8 Вт<br>&nbsp;&nbsp;&nbsp; Деревянная стойка дополнительно</p><p><br><strong>Характеристики:</strong><br><br>Количество и тип клавиш: 88<br>Механика: Взвешенная молоточковая<br>Поверхность клавиатуры: Качественный синтетический материал<br>Чувствительность к касанию: 3 уровня<br>Звуковой источник: AHL Двухэлементный)<br>Количество встроенных тембров: 700 тембров<br>Наложение тембров/Разделение клавиатуры: Да/Да<br>Полифония (максимально): 48<br>Стереосэмплированные тембры рояля: Да<br>Реверберация: 10<br>Хорус: 5<br>Количество встроенных композиций: 152<br>Загружается дополнительно (пользовательские композиции): 10 композиций (макс.) 320 Кб<br>Октавный перенос: ± 2 октавы<br>Регулировка настройки: A4 = 415,5 Гц - 440,0 Гц - 465,9 Гц<br>Колесо Pitch Bend: да<br>Метроном: 0, 2, 3, 4, 5, 6 долей, диапазон темпа: от 20 до 255<br>Педали: SP-3 (демпфер, назначаемая)<br>MIDI: Да<br>USB-порт: Да<br>Наушники: 1, стандартный стерео-джек<br>Педаль: 1, стандартный джек<br>Карты памяти SD: SD или SDHC, до 32 Гб<br>Линейный вход: Стерео мини-джек<br>Микрофонный вход: Стандартный джек<br>Размер динамиков: 12 см x 6 см x 2<br>Усиление: 2 x 8 Вт<br>Количество встроенных стилей: 200<br>Музыкальные предустановки: 305<br>Настройка «в одно касание»: 200<br>Пользовательские стили (редактор стилей): 10<br>Автогармонизация: 12 типов<br>Арпеджиатор: 90 типов<br>Регистрационная память (предустановки x банки): 32 (4 x 8)<br>Кнопка «Фортепиано/орган»: Да<br>Партии для обучения: Правая/левая/вместе<br>Функция обучения: Да<br>Записывающее устройство: 6 дорожек x 5 композиций, 1 обучающая композиция<br>Приблизительный объем данных: До 12 000 нот<br>Дисплей: ЖК с подсветкой<br>Функция сэмплирования: Да (макс. 10 секунд)<br>Звуковой вход для сэмплирования: Микрофонный вход<br>Размеры (Ш x Г x В): 1322 x 286 x 129 мм (без стойки)<br>Со стойкой (приобретается отдельно): 1322 x 373 x 753 мм<br>Вес: 12.0 кг (без стойки)<br>В комплекте: Адаптер (AD-A12150LW), педаль SP-3, нотный сборник, пюпитр<br>Цвет: серебристый</p>', 27500, '2014-07-21 13:07:43', 106, 'Тип: компактное цифровое пианино \r\nКоличество клавиш: 88 клавиш, фортепианного типа \r\nПолифония: 48 нот \r\nКоличество тембров: 700 встроенных тембров \r\nЭффекты: Reverb 10 типа, хорус 5 \r\nКомпозиции: 10 пользовательских + 152 встроенных композиций \r\nИнтерфейс: выходы для наушников и сустейн педали, MIDI, USB, аудио вход, вход для микрофона\r\nЦвет: серебристый', 19416, NULL, 124, '\0', '\0'),
  (20345, 'CASIO PX-150 BK', '<p>Новый РХ-150 выражает значительный шаг в продолжении эволюции линии цифровых пианино Privia. Комбинация нового действия клавиатуры и нового мощного звукового процессора, обеспечивает новый уровень деталей, нюансов и выразительности в легковесном и стильном дизайне.</p><p>Премированный звук Privia теперь значительно улучшен. Новый РХ-150 использует память более чем трех предыдущих поколений для более натурального тона фортепиано. Новый запатентованный звуковой источник \"AiR\" (акустический и интеллектуальный резонатор) обеспечивает непревзойденный реализм и детализацию. Это устройство предоставляет гладкую динамику для значительной выразительности и мощного исполнения. Для большего реализма создан новый симулятор демпфера, который предоставляет богатый звук струнных, когда используется педаль сустейна.</p><p>РХ-150 характеризуется новыми модернизированными 88 клавишами с трех сенсорным взвешенным молоточковым действием клавиатуры. Это новое действие характеризуется новой имитацией эбеновых и слоновой кости клавиш для невероятной чувствительности и тремя сенсорами захвата динамики исполнения с беспрецедентной скоростью и точностью. Скорость отличается размером движения молоточков относительно к скорости нажатия, эта синхронность обеспечивает окончательный тон в звуковом впечатлении.</p><p>В дополнение к рояльным звукам РХ-150 имеет много других звуков инструментов, включая струнные, орган, электро пианино и бас инструменты. Пианино имеет способность разделять и наслаивать, позволяя проигрывать бас левой рукой и иметь два слоя тонов в правой. Дует режим позволяет разделять клавиатуру на две равных, давая возможность студенту и учителю использовать пианино одновременно. Двух трековое записывающее устройство может записывать и воспроизводить Ваши практические занятия и выступления. Педаль SP-33 обеспечивает ту же самую функциональность трех педалей как и в рояле.</p><p>Casio продолжает традицию \"класс совместимости\" USB подключения. Это позволяет использовать пианино с Mac или Windows компьютерами без необходимости в загрузке драйверов. Класс совместимость USB MIDI также позволяет использовать цифровые пианино Privia как контроллер Apple iPad.&nbsp;<br><br><strong>Технические характеристики:&nbsp;</strong><br><br>Трех сенсорное взвешенное молоточковое действие&nbsp;<br>Эбеновая и слоновой кости чувствительность клавиш&nbsp;<br>3 уровневая чувствительность нажатия клавиш&nbsp;<br>Звуковой источник AiR (акустический и интеллектуальный резонатор)&nbsp;<br>Полифония: 128&nbsp;<br>Встроенные тона: 18, дует режим, слои, разделение&nbsp;<br>Симуляторы: молоточки, демпфер&nbsp;<br>Эффекты:&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Reverb: 4&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Chorus: 4&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Brilliance: -3 ~ 0 ~ +3&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;DSP&nbsp;<br>Перемещение: 25 шагов (-12 полутонов ~ 0 ~ +12 полутонов)&nbsp;<br>Управление настройки: A4 = 415.5Hz ~ 440.0Hz ~ 465.9Hz&nbsp;<br>Музыкальная библиотека: 60 предустановленных, 10 пользовательских и 900КВ&nbsp;<br>Функция обучения&nbsp;<br>Метроном&nbsp;<br>Установка: 20 ~ 255BPM&nbsp;<br>Запись в реальном времени, 2 трека, 1 песня&nbsp;<br>Педаль: SP-3 (включена), SP-33 (дополнительно)&nbsp;<br>Разъемы: USB, PHONES / OUTPUT&nbsp;<br>Динамики: 13 х 6 см (2)&nbsp;<br>Усилители: 8W + 8W&nbsp;<br>Питание: DC 12 V, блок питания AD-A12150LW&nbsp;<br>Авто выключение&nbsp;<br>Потребляемая мощность: 18Вт&nbsp;<br>Совместимая стойка: CS-67P&nbsp;<br>Размеры: 1,322 х 286 х 135 мм&nbsp;<br>Вес: 11 кг</p>', 25500, '2014-07-21 13:12:33', 106, 'Тип: цифровое пианино \r\nКоличество клавиш: 88 клавиш, 3 уровня чувствительности, откл. \r\nПолифония: 128 нот \r\nКоличество тембров: 18 встроенных тембров \r\nЭффекты: Reverb 4, хорус 4, DSP \r\nКомпозиции: 10 пользовательских + 60 встроенных композиций \r\nИнтерфейс: выходы для наушников, педали и блока педалей, USB', 19417, NULL, 124, '\0', '\0'),
  (20346, 'CASIO PX-150 WE', '<p>Новый РХ-150 выражает значительный шаг в продолжении эволюции линии цифровых пианино Privia. Комбинация нового действия клавиатуры и нового мощного звукового процессора, обеспечивает новый уровень деталей, нюансов и выразительности в легковесном и стильном дизайне.</p><p>Премированный звук Privia теперь значительно улучшен. Новый РХ-150 использует память более чем трех предыдущих поколений для более натурального тона фортепиано. Новый запатентованный звуковой источник \"AiR\" (акустический и интеллектуальный резонатор) обеспечивает непревзойденный реализм и детализацию. Это устройство предоставляет гладкую динамику для значительной выразительности и мощного исполнения. Для большего реализма создан новый симулятор демпфера, который предоставляет богатый звук струнных, когда используется педаль сустейна.</p><p>РХ-150 характеризуется новыми модернизированными 88 клавишами с трех сенсорным взвешенным молоточковым действием клавиатуры. Это новое действие характеризуется новой имитацией эбеновых и слоновой кости клавиш для невероятной чувствительности и тремя сенсорами захвата динамики исполнения с беспрецедентной скоростью и точностью. Скорость отличается размером движения молоточков относительно к скорости нажатия, эта синхронность обеспечивает окончательный тон в звуковом впечатлении.</p><p>В дополнение к рояльным звукам РХ-150 имеет много других звуков инструментов, включая струнные, орган, электро пианино и бас инструменты. Пианино имеет способность разделять и наслаивать, позволяя проигрывать бас левой рукой и иметь два слоя тонов в правой. Дует режим позволяет разделять клавиатуру на две равных, давая возможность студенту и учителю использовать пианино одновременно. Двух трековое записывающее устройство может записывать и воспроизводить Ваши практические занятия и выступления. Педаль SP-33 обеспечивает ту же самую функциональность трех педалей как и в рояле.</p><p>Casio продолжает традицию \"класс совместимости\" USB подключения. Это позволяет использовать пианино с Mac или Windows компьютерами без необходимости в загрузке драйверов. Класс совместимость USB MIDI также позволяет использовать цифровые пианино Privia как контроллер Apple iPad.&nbsp;<br><br><strong>Технические характеристики:&nbsp;</strong><br><br>Трех сенсорное взвешенное молоточковое действие&nbsp;<br>Эбеновая и слоновой кости чувствительность клавиш&nbsp;<br>3 уровневая чувствительность нажатия клавиш&nbsp;<br>Звуковой источник AiR (акустический и интеллектуальный резонатор)&nbsp;<br>Полифония: 128&nbsp;<br>Встроенные тона: 18, дует режим, слои, разделение&nbsp;<br>Симуляторы: молоточки, демпфер&nbsp;<br>Эффекты:&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Reverb: 4&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Chorus: 4&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Brilliance: -3 ~ 0 ~ +3&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;DSP&nbsp;<br>Перемещение: 25 шагов (-12 полутонов ~ 0 ~ +12 полутонов)&nbsp;<br>Управление настройки: A4 = 415.5Hz ~ 440.0Hz ~ 465.9Hz&nbsp;<br>Музыкальная библиотека: 60 предустановленных, 10 пользовательских и 900КВ&nbsp;<br>Функция обучения&nbsp;<br>Метроном&nbsp;<br>Установка: 20 ~ 255BPM&nbsp;<br>Запись в реальном времени, 2 трека, 1 песня&nbsp;<br>Педаль: SP-3 (включена), SP-33 (дополнительно)&nbsp;<br>Разъемы: USB, PHONES / OUTPUT&nbsp;<br>Динамики: 13 х 6 см (2)&nbsp;<br>Усилители: 8W + 8W&nbsp;<br>Питание: DC 12 V, блок питания AD-A12150LW&nbsp;<br>Авто выключение&nbsp;<br>Потребляемая мощность: 18Вт&nbsp;<br>Совместимая стойка: CS-67P&nbsp;<br>Размеры: 1,322 х 286 х 135 мм&nbsp;<br>Вес: 11 кг</p>​', 25500, '2014-07-21 13:14:52', 106, 'Тип: цифровое пианино \r\nКоличество клавиш: 88 клавиш, 3 уровня чувствительности, откл. \r\nПолифония: 128 нот \r\nКоличество тембров: 18 встроенных тембров \r\nЭффекты: Reverb 4, хорус 4, DSP \r\nКомпозиции: 10 пользовательских + 60 встроенных композиций \r\nИнтерфейс: выходы для наушников, педали и блока педалей, USB\r\n', 19418, NULL, 124, '\0', '\0'),
  (20347, 'CASIO PX-A100 BE', '<p>В новых моделях присутствуют 10 уникальных рояльных звучаний, а также 10 вариантов акустики лучших мировых концертных площадок&nbsp;<br><br>ТОКИО, 20 Августа 2013 года — сегодня компания Casio Computer Co., Ltd., анонсирует выпуск двух новых моделей цифровых пианино Privia, приуроченных к 10ти летнему юбилею выхода в свет первого инструмента Privia (24 октября 2003 года). В новых моделях присутствуют 10 уникальных звучаний рояля, а также 10 вариантов акустики лучших мировых концертных площадок.&nbsp;<br><br>Компактные, стильные и легкие, цифровые пианино Privia предназначены обеспечивать выразительность и экспрессию акустического инструмента. С 2003 года, серия Privia получила популярность у весьма широкого круга людей, расширив тем самым границы существующего рынка цифровых музыкальных инструментов. Начиная с 2012 года, все пианино серии Privia оснащены новейшим процессором AiR Sound Source,* воспроизводящим всю естественность и насыщенность звучания рояля&nbsp;<br>* сокращение от Multi-dimensional Morphing AiR (Акустический Интеллектуальный Резонатор)&nbsp;<br><br>Представляя новые модели - Privia PX-A100 и PX-A800 — компания Casio в очередной раз расширяет привычные границы цифрового инструмента, предлагая исполнителю новые уникальные возможности. Эти новые инструменты прекрасно сочетают в себе весь накопленный ранее опыт предыдущих моделей вместе с инновационными технологиями – именно то, что обычно и ожидают от серии Privia.&nbsp;<br><br>С 10 предустановленными тембрами различных роялей, исполнитель может получить удовольствие от игры в разнообразных музыкальных стилях, таких как классика, джаз, рок, поп или танцевальная музыка. Более того, встроенный эмулятор акустических пространств позволяет насладиться эффектом присутствия на 10ти различных концертных площадках – известных концертных залах, стадионах или даже в кафедральном соборе, придавая восхитительные, как никогда, ощущения.<br><br>Обе новых модели расширяют границы общепринятого облика инструмента. Компактная модель PX-A100 имеет покрытие «металлик», причем можно выбрать между красным и голубым металликом. Кабинетная модель PX-A800 имеет уникальный цвет натурального дуба и оснащена откидывающейся верхней крышкой.&nbsp;<br>Позиционируя 10-ти летний юбилей, как очередную отправную точку серии Privia, Casio стремится к расширению рынка цифровых пианино, предлагая все новые варианты исполнения и реализуя новые уникальные концепции звучания.&nbsp;<br></p><p><strong>Основные возможности</strong>&nbsp;<br><br><strong>10 тембров концертного рояля</strong><br><br>Обе модели имеют 10 тембров концертных роялей, относящихся к различным музыкальным стилям: классике, року, джазу, поп-музыке, и танцевальной музыке. Также доступны восемь новых тембров, включая электропиано, джазовый орган, церковный орган, и струнный ансамбль, которые позволяют исполнять произведения в широком спектре жанров, используя только один инструмент.&nbsp;<br><br><strong>Эмулятор акустических пространств с 10 вариантами концертных залов</strong>&nbsp;<br><br>Компания Casio применила цифровые технологии для эмуляции различных вариантов концертной акустики. Это дает исполнителю возможность окунуться в атмосферу известных концертных залов, соборов, или стадионов, в таких городах как Амстердам, Берлин, Лондон, Лос Анджелес, Нью-Йорк, Париж, Сидней, и Вена.&nbsp;<br><br><strong>Многомерный источник звукового морфинга AiR*</strong>&nbsp;<br><br>Компания Casio разработала Многомерный источник звукового морфинга AiR, чтобы безупречно воспроизводить натуральные изменения тона, громкости и тембра концертного рояля от момента взятия ноты, сквозь замечательный сустейн, к исчезающему послезвучию. Даже длина отзвука может контролироваться, как и в акустическом пианино, с помощью силы нажатия.&nbsp;<br>Исполнители также могут контролировать сустейн замечательно резонирующих тонов, в соответствии со стилем исполнения, используя встроенную функцию струнного резонанса, которая воспроизводит естественные послезвучия каждой из 88 клавиш инструмента, а также «Демпферный резонанс» - функцию, которая имитирует эффект резонанса деки при нажатой педали демпфера.&nbsp;<br>* Акустический и Интеллектуальный резонатор&nbsp;<br><br><strong>Струнный резонанс (доступен только в модели PX-A800)&nbsp;</strong><br><br>Функция струнного резонанса воспроизводит натурально звучащие призвуки и обертона концертного рояля, демонстрируя разницу в резонансах каждой из 88 клавиш, также как и разницу в звучании одиночной ноты или аккорда. Все изменения соотносятся с силой нажатия.&nbsp;<br><br><strong>Усовершенствованная 3-х сенсорная взвешенная молоточковая клавиатура (Tri-sensor Scaled Hammer Action Keyboard II)</strong><br><br>- Усовершенствованная взвешенная молоточковая клавиатура от CASIO распознаёт качество нажатия, используя 3 сенсора на каждую клавишу, тем самым воссоздавая механику взятия нот как у акустического рояля.&nbsp;<br>- Функция отклика молоточка воссоздает атаку на ноту в зависимости от силы удара и регистра клавиатуры.&nbsp;<br>- Черные и белые клавиши инструмента выглядят, и тактильно напоминают настоящую слоновую кость и черное дерево. .&nbsp;<br>- Функция туше-контроллер воспроизводит изменения в тембре, согласно тому, как быстро снимается нота (доступно только в PX-A800).&nbsp;<br><br><strong>Открывающаяся верхняя крышка и эмуляция угла раскрытия «крыла» рояля&nbsp;</strong><br>(доступно только в PX-A800)<br><br>Верхняя крышка модели PX-A800 может быть открыта и закрыта, позволяя получить широкую палитру тембра рояля при игре. Инструмент также имеет функцию эмуляции угла раскрытия крышки (крыла) рояля. Эта функция точно имитирует изменения, привносимые в звук концертного рояля углом раскрытия его крышки (крыла), который может быть установлен по желанию исполнителя в 4 различных положения.&nbsp;<br>* Настройки функции эмуляции положения крышки рояля остаются без изменений, вне зависимости от того, открыта ли верхняя крышка инструмента, или закрыта.&nbsp;<br><br><strong>Широкий диапазон функций для любого стиля исполнения</strong>&nbsp;<br><br>? Музыкальная библиотека из 60 композиций предоставленная для прослушивания и занятий&nbsp;<br>? Функция дуэта устанавливает идентичные звуковысотные диапазоны для левой и правой части клавиатуры так, что два человека могут играть в одном и том же регистре&nbsp;<br>? Функция наложения позволяет двум звукам быть объединенными в один тембр.&nbsp;<br>? Функция разделения клавиатуры позволяет двум различным тембрам быть назначенными на нижнюю и верхнюю части клавиатуры&nbsp;<br>? Максимальная полифония в 256 нот (доступно только в PX-A800) гарантирует, что на практике вы не столкнётесь с исчезанием звучащих нот, даже когда пьеса требует большого количества нажатий на педаль.&nbsp;<br>? Функция аудио-записи даёт возможность сохранять ваши исполнения на USB флеш носитель в формате 44.1 кГц *.WAV (доступно только в PX-A800).&nbsp;<br><br></p>', 29000, '2014-07-21 13:23:28', 106, 'Тип: цифровое пианино \r\nКоличество клавиш: 88 клавиш, 3 уровня чувствительности, откл. \r\nПолифония: 128 нот \r\nКоличество тембров: 18 встроенных тембров \r\nЭффекты: Эмулятор акустических пространств, хорус 4, DSP \r\nКомпозиции: 10 пользовательских + 60 встроенных композиций \r\nИнтерфейс: выходы для наушников, демпфер педали и блока педалей, USB \r\nЦвет: Голубой металлик', 19419, NULL, 124, '\0', '\0'),
