епринятого облика инструмента. Компактная модель PX-A100 имеет покрытие «металлик», причем можно выбрать между красным и голубым металликом. Кабинетная модель PX-A800 имеет уникальный цвет натурального дуба и оснащена откидывающейся верхней крышкой.&nbsp;<br>Позиционируя 10-ти летний юбилей, как очередную отправную точку серии Privia, Casio стремится к расширению рынка цифровых пианино, предлагая все новые варианты исполнения и реализуя новые уникальные концепции звучания.&nbsp;</p><p><strong>Основные возможности</strong>&nbsp;<br><br><strong>10 тембров концертного рояля</strong><br><br>Обе модели имеют 10 тембров концертных роялей, относящихся к различным музыкальным стилям: классике, року, джазу, поп-музыке, и танцевальной музыке. Также доступны восемь новых тембров, включая электропиано, джазовый орган, церковный орган, и струнный ансамбль, которые позволяют исполнять произведения в широком спектре жанров, используя только один инструмент.&nbsp;<br><br><strong>Эмулятор акустических пространств с 10 вариантами концертных залов</strong>&nbsp;<br><br>Компания Casio применила цифровые технологии для эмуляции различных вариантов концертной акустики. Это дает исполнителю возможность окунуться в атмосферу известных концертных залов, соборов, или стадионов, в таких городах как Амстердам, Берлин, Лондон, Лос Анджелес, Нью-Йорк, Париж, Сидней, и Вена.&nbsp;<br><br><strong>Многомерный источник звукового морфинга AiR*</strong>&nbsp;<br><br>Компания Casio разработала Многомерный источник звукового морфинга AiR, чтобы безупречно воспроизводить натуральные изменения тона, громкости и тембра концертного рояля от момента взятия ноты, сквозь замечательный сустейн, к исчезающему послезвучию. Даже длина отзвука может контролироваться, как и в акустическом пианино, с помощью силы нажатия.&nbsp;<br>Исполнители также могут контролировать сустейн замечательно резонирующих тонов, в соответствии со стилем исполнения, используя встроенную функцию струнного резонанса, которая воспроизводит естественные послезвучия каждой из 88 клавиш инструмента, а также «Демпферный резонанс» - функцию, которая имитирует эффект резонанса деки при нажатой педали демпфера.&nbsp;<br>* Акустический и Интеллектуальный резонатор&nbsp;<br><br><strong>Струнный резонанс (доступен только в модели PX-A800)&nbsp;</strong><br><br>Функция струнного резонанса воспроизводит натурально звучащие призвуки и обертона концертного рояля, демонстрируя разницу в резонансах каждой из 88 клавиш, также как и разницу в звучании одиночной ноты или аккорда. Все изменения соотносятся с силой нажатия.&nbsp;<br><br><strong>Усовершенствованная 3-х сенсорная взвешенная молоточковая клавиатура (Tri-sensor Scaled Hammer Action Keyboard II)</strong><br><br>- Усовершенствованная взвешенная молоточковая клавиатура от CASIO распознаёт качество нажатия, используя 3 сенсора на каждую клавишу, тем самым воссоздавая механику взятия нот как у акустического рояля.&nbsp;<br>- Функция отклика молоточка воссоздает атаку на ноту в зависимости от силы удара и регистра клавиатуры.&nbsp;<br>- Черные и белые клавиши инструмента выглядят, и тактильно напоминают настоящую слоновую кость и черное дерево. .&nbsp;<br>- Функция туше-контроллер воспроизводит изменения в тембре, согласно тому, как быстро снимается нота (доступно только в PX-A800).&nbsp;<br><br><strong>Открывающаяся верхняя крышка и эмуляция угла раскрытия «крыла» рояля&nbsp;</strong><br>(доступно только в PX-A800)<br><br>Верхняя крышка модели PX-A800 может быть открыта и закрыта, позволяя получить широкую палитру тембра рояля при игре. Инструмент также имеет функцию эмуляции угла раскрытия крышки (крыла) рояля. Эта функция точно имитирует изменения, привносимые в звук концертного рояля углом раскрытия его крышки (крыла), который может быть установлен по желанию исполнителя в 4 различных положения.&nbsp;<br>* Настройки функции эмуляции положения крышки рояля остаются без изменений, вне зависимости от того, открыта ли верхняя крышка инструмента, или закрыта.&nbsp;<br><br><strong>Широкий диапазон функций для любого стиля исполнения</strong>&nbsp;<br><br>? Музыкальная библиотека из 60 композиций предоставленная для прослушивания и занятий&nbsp;<br>? Функция дуэта устанавливает идентичные звуковысотные диапазоны для левой и правой части клавиатуры так, что два человека могут играть в одном и том же регистре&nbsp;<br>? Функция наложения позволяет двум звукам быть объединенными в один тембр.&nbsp;<br>? Функция разделения клавиатуры позволяет двум различным тембрам быть назначенными на нижнюю и верхнюю части клавиатуры&nbsp;<br>? Максимальная полифония в 256 нот (доступно только в PX-A800) гарантирует, что на практике вы не столкнётесь с исчезанием звучащих нот, даже когда пьеса требует большого количества нажатий на педаль.&nbsp;<br>? Функция аудио-записи даёт возможность сохранять ваши исполнения на USB флеш носитель в формате 44.1 кГц *.WAV (доступно только в PX-A800).&nbsp;</p>', 29000, '2014-07-21 13:25:17', 106, 'Тип: цифровое пианино \r\nКоличество клавиш: 88 клавиш, 3 уровня чувствительности, откл. \r\nПолифония: 128 нот \r\nКоличество тембров: 18 встроенных тембров \r\nЭффекты: Эмулятор акустических пространств, хорус 4, DSP \r\nКомпозиции: 10 пользовательских + 60 встроенных композиций \r\nИнтерфейс: выходы для наушников, демпфер педали и блока педалей, USB \r\nЦвет: Красный металлик', 19420, NULL, 124, '\0', '\0'),
  (20349, 'INVOLIGHT LED MH250S', '<p>Вращающаяся LED голова спот<br>Источник света – 225 Вт белый LED&nbsp;<br>Управление - DMX-512, 16 каналов<br>ЖК дисплей<br>2 колеса цвета, эффект радуги<br>2 колеса гобо: статичные и вращающиеся гобо&nbsp;<br>3-х фасетная призма, вращение, изменение направления вращения<br>Шторка - 0-20Hz<br>Электронный диммер (0-100%)<br>Моторизованный фокус<br>Вращение Pan: 540/360/180 град., 8/16 bit<br>автоматическая коррекция<br>Tilt: 270/180/90 град., 8/16 bit<br>автоматическая коррекция&nbsp;<br>Master/Slave, звуковая активация<br>Питание: 100-240 В, 50-60 Гц, 422 Вт<br></p><p><span style=\"line-height: 1.428571429;\">Размеры: 400х520х320 мм</span></p><p>Вес: 18,5 кг<br></p>', 79500, '2014-07-21 17:28:11', 286, 'Involight LED MH250S - LED вращающаяся голова, белый светодиод 225 Вт, DMX-512', 19421, NULL, 124, '\0', ''),
  (20351, 'YAMAHA STAGEPAS400i', '<ul><li>Выходная мощность 400 Вт (200 Вт + 200 Вт);</li><li>8-дюймовый низкочастотный динамик и 1-домовый высокочастотный компрессионный динамик;</li><li>Отсоединяемый 8-канальный микшер (4 моно/линейных входа + 4 моно/2 стерео линейных входа);</li><li>USB-подключение iPod/ iPhone;</li><li>Мастер-эквалайзер EQ™, управляемый одной ручкой с функцией поднятия нижних частот;</li><li>Высококачественная цифровая реверберация SPX (4 типа с управлением параметром);</li><li>Встроенный подавитель акустической обратной связи;</li><li>Двухполосный канальный эквалайзер с великолепным звучанием;</li><li>Переключаемые режимы входов стерео/моно;</li><li>Входы Hi-Z (с высоким сопротивлением);</li><li>Фантомное питание;</li><li>Выходы на мониторы и сабвуфер;</li><li>Дополнительный ножной выключатель ревербератора.</li></ul>', 33000, '2014-08-23 13:41:24', 4, 'звукоусилительный комплект: активные акустические мониторы 2x200 Вт с 8-канальным микшером и усилителем', 19423, NULL, 1884815, '\0', '\0'),
  (20352, 'INVOLIGHT UV PRO400', '<p>Мощный ультрафиолетовый светильник с широким углом раскрытия<br>Лампа: UV400 Вт E40&nbsp;<br>Питание: 220 В, 50 Гц<br>Размер: 450x320x170 мм<br>Вес: 7 кг<br></p>', 4700, '2014-08-13 10:43:43', 286, 'Involight UV PRO400 - СВЕТИЛЬНИК ультрафиолетовый , 400Вт (цена без лампы', 19424, NULL, 1884815, '\0', ''),
  (20353, 'INVOLIGHT UV PRO400 LAMP', '<p>Involight UV PRO400 - ЛАМПА ультрафиолетовая, 400Вт, E40</p>', 1300, '2014-08-13 10:46:49', 286, 'Involight UV PRO400 - ЛАМПА ультрафиолетовая, 400Вт, E40', 19425, NULL, 1884815, '\0', ''),
  (20354, 'CHAUVET-DJ Radius 2.0', '<p><strong>CHAUVET Radius 2.0</strong>&nbsp;представлен в известной серии светодиодных многолучевых эффектов, которые выпускает известный производитель, компания CHAUVET. Этот производитель стал известным и востребованным практически с первого момента появления своей продукции, которое произошло в 80-х годах. Светодиодный многолучевой эффект CHAUVET Radius 2.0, как и многие другие эффекты этого производителя, являются одними из самых востребованных и продаваемых на настоящий момент. Все современные световые эффекты CHAUVET предлагают своим пользователям высокое качество, разнообразие эффектов и предельно простую эксплуатацию на протяжении продолжительного времени.&nbsp;<br><strong style=\"line-height: 1.428571429;\"></strong><br></p><p><strong style=\"line-height: 1.428571429;\">Основные функциональные особенности светодиодного эффекта CHAUVET Radius 2.0</strong><br></p><p>- Светодиодный многолучевой эффект Radius 2.0 имеет современный дизайн и сверхпрочную конструкцию корпуса, которые были разработаны лучшими конструкторами компании CHAUVET.<br>- Специальная конструкция электроники обладает минимальным потреблением энергии и предельно низкой теплоотдачей.&nbsp;<br>- Конструкция Radius 2.0 имеет пять сверх ярких светодиодов, позволяющих воспроизводить самые разные световые эффекты.&nbsp;<br>- Особенная конструкция и устройство эффекта обладают минимальным выделением тепловой энергии и предельно низким энергопотреблением.&nbsp;<br>- Конструкция светового эффекта оборудована универсальными креплениями для подвеса на рамах и стальных тросах.&nbsp;<br>- Благодаря использованию ультра-мощных светодиодов, эффект гарантирует пользователям максимальное время эксплуатации светового эффекта.&nbsp;<br>- В конструкции светового эффекта используется специальный подвижный механизмом для четкой настройки угла поворота с ручной фиксацией положения.&nbsp;<br>- Полное функциональное взаимодействие и возможность коммутации с световыми устройствами LED Mushroom и Kinta X.<br>- Кроме своего основного предназначения, эффект Radius 2.0 может быть использован в качестве лучевого и контр-светового эффекта.<br>- Поддержка самых разных режимов работы, среди которых автоматические режимы без использования каких-либо внешних устройств управления.&nbsp;<br>- Эффект обладает предельно широким углом раскрытия в 155 градусов, что дает возможность широкого охвата эффектом.&nbsp;<br>- Корпус светодиодного эффекта Radius 2.0 изготовлен из особого сплава металла.&nbsp;<br>- Возможность функционального взаимодействия с другими моделями световых эффектов в паре.<br>- Разнообразные режимы работы и возможность параллельного соединения с эффектами в режиме ведомы\\ведущий (Master\\Slave).<br>- В конструкции устройства использованы качественные компоненты электроники и сверхпрочный материал корпуса.&nbsp;<br>- Достаточно компактный дизайн и внутренняя конструкция эффекта предполагают разностороннее использование, как в малых и небольших аудиториях, так и в музыкальных клубах и концертных залах.&nbsp;<br><br></p><p><strong>Максимум возможностей по доступной цене</strong><br></p><p><strong></strong><span style=\"line-height: 1.428571429;\">Светодиодный многолучевой эффект Radius 2.0 предлагает своим пользователям прекрасное сочетание самых разнообразных световых эффектов в сочетании с компактностью и легким весом. Благодаря достаточно компактным размерам, Radius 2.0 можно использовать не только в стационарных, но и передвижных световых инсталляциях. Предлагая большое количество ярких и интересных эффектов, Radius 2.0 обладает достаточно небольшой ценой по сравнению с многими конкурирующими моделями световых эффектов.&nbsp;</span></p><p><br></p><p><strong>Богатый набор самых разных функций и возможностей для любых мероприятий</strong></p><p>Несмотря на то, что светодиодный эффект Radius 2.0 представлен на рынке светового оборудования достаточно недавно, эффект этого устройства является достаточно востребованным. Обладая богатым набором режимов работы, Radius 2.0 часто используется в музыкальных и ночных клубах, световых шоу, театрах и домах творчества.&nbsp;<br><br>Светодиодный эффект Radius 2.0 предлагает отличное сочетание оригинальных и разнообразных световых эффектов с предельно простым управлением и приемлемой ценой среди других конкурирующих моделей. Многие световые эффекты CHAUVET опционально оборудованы дополнительными режимами эффектов Strobo и Blackout. Radius 2.0 имеет поддержку управления посредством популярного протокола DMX с тремя каналами. Кроме всего, световой эффект можно использовать как устройство контрового и лучевого эффекта.<br><br></p><p><strong>Широкий угол раскрытия и мощный световой поток</strong></p><p>Эффект оборудован пятью яркими светодиодами красного, зеленого, синего, белого, зеленого и янтарного цвета (1 red, 1 green, 1 blue, 1 white, 1 amber). Мощность каждого из светодиодов составляет 3 Вт. Максимальный угол раскрытия Radius 2.0 составляет 155 градусов, что позволяет охватывать большие площади.&nbsp;<br><br></p><p><strong>Использование автоматического режима</strong></p><p>&nbsp;Эффект Radius 2.0 предлагает несколько режимов работы, предназначенных для самых разных мероприятий. Эффект может работать совершенно независимо в автономном режиме. Автоматический режим не требует использования внешних контроллеров и устройств управления. В этом режиме функции светового эффекта активируются в момент начала звучания музыки. Для активации используется встроенный микрофон, чувствительность работы которого можно вручную настроить, используя ручку Sensativity.&nbsp;<br><br></p><p><strong>Соединяйте в цепь сразу нескольких световых эффектов&nbsp;</strong></p><p>Электронная схема эффекта Radius 2.0 предусматривает возможности для работы устройства как независимо, так и в совокупности с параллельно подключёнными 20\\37 световыми эффектами. Для коммутации с другими световыми эффектами в Radius 2.0 предусмотрены два режима работы. Эффект может выступать в качестве ведущего (Master) или ведомого (Slave) устройства в цепи.&nbsp;<br><br>При соединении нескольких эффектов в одну параллельную цепь Вы получите максимально насыщенный и плотный световой поток. Все разнообразие световых эффектов может работать по одной схеме. Такая схема подключения может оригинально украсить любое музыкальное шоу или концерт, театральное представление и музыкальный перформанс, а так же самые разные сценические постановки.&nbsp;<br><br></p><p><strong>Предельно низкое энергопотребление с минимальным выделением тепловой энергии&nbsp;</strong></p><p>Radius 2.0 отвечает всем современным требованиям электропитания и безопасности. Конструкция эффекта представляет собой прочный металлический корпус, который защищает все компоненты электроники. Номинальное потребление энергии электроникой устройства составляет всего лишь 52 Вт. Схемотехника устройства имеет минимальные выделения тепловой энергии при достаточно низком энергопотреблении, благодаря чему Radius 2.0 можно использовать круглосуточно без опасений за перегрев внутренних компонентов. Все эти характеристики делают световой эффект одним из лучших для стационарных установок.&nbsp;<br><br></p><p><strong>Разнообразные схемы электрического питания&nbsp;</strong></p><p>Электроника светодиодного многолучевого эффекта позволяет использовать разные режимы электропитания. Интегрированный адаптер питания имеет функцию автоматического приключения для разных режимов в диапазоне 100 - 240 Вольт (переменный ток – 50\\60 Гц).&nbsp;<br><br></p><p><strong>Технические характеристики светодиодного эффекта Radius 2.0</strong></p><p>Тип устройства : светодиодный многолучевой эффект.&nbsp;<br>Световые источники : пять ультра ярких светодиода.<br>Спецификация светодиодов : красный, зеленый, синий, белый, зеленый, янтарный (1 red, 1 green, 1 blue, 1 white, 1 amber).<br>Мощность светодиодов : 3 Вт (каждый).<br>Угол раскрытия эффекта : 155 градусов.<br>DMX управление : есть.<br>Количесвто каналов DMX : 3 канала DMX.&nbsp;<br><br>Световые секции : несколько секций.<br>Сертификат СЕ : есть.<br>Контроллеры : индивидуальные контроллеры в каждой секции.&nbsp;<br>Особенности и взаимодействие : возможность объединения с приборами Kinta X, LED Mushroom (опционально на некоторых устройствах CHAUVET).<br><br>Режимы коммутации с другими эффектами :&nbsp;<br>- Возможность последовательного питания других эффектов и устройств : есть.<br>- Параллельное подключение : до 20\\37 динамических устройств одновременно.&nbsp;<br><br>Управление и режимы работы эффекта :&nbsp;<br>- Режимы Master-Slave (ведущий и ведомый) : есть.<br>- Автоматический режим : звуковая активация, встроенные программы.<br>- Управление и настройка отдельной ручкой Sensativity.<br>- Режим Strobo (опционально на некоторых эффектах CHAUVET).&nbsp;<br>- Режим Blackout (опциональный на некоторых эффектах CHAUVET).).<br><br>Питание устройства : 110 – 240 В, 50\\60 Гц.<br>Переключение питания : автоматическое.&nbsp;<br>Максимальное потребление энергии : до 52 Ватт.<br>Материал корпуса : металлический корпус.&nbsp;<br><br>Способы крепления :&nbsp;<br>- Универсальное крепление на рамы, тросы, подвесы.&nbsp;<br>- Установка нескольких приборов с регулируемой скобой (X-BRACKET).<br>- Регулируемый, фиксируемый угол наклона : есть.<br>Габаритные размеры : (Д) 268 мм. х (Ш) 330 мм. х (В) 243 мм.<br>Вес : 2,8 кг.</p>', 7500, '2014-08-23 13:40:16', 477, 'светодиодный многолучевой эффект. 5х3Вт светодиодов, угол раскрытия 155град, управление DMX/auto/music, 3 канала DMX, универсальный блок питания 100-240В, потребление до 52Вт, вес 2,8кг, ДШВ 268х330х243мм.', 19426, NULL, 1884815, '\0', '\0'),
  (20355, 'CHAUVET-DJ 6 Spot', '<p><strong>CHAUVET 6 Spot</strong>&nbsp;представляет собой комплект из 6 прозрачных светодиоидных профильных прожекторов, расположенных на перекладине. В каждом прожекторе находится 1 трехцветный светодиод с мощностью 3Вт, при смещении образующие 7 цветов. Продолжительность «жизни» светодиодных источников составляет более 50 000ч с сохранением не менее 70% светового потока. Каждый прожектор управляется отдельно при помощи поворотной головки и раскрывается лучом с углом в 11градусов.<br><br><br></p><p><strong>Задняя часть перекладины имеет:&nbsp;</strong></p><p>DMX вход и DMX выход<br>микрофон<br>светодиодный дисплей (панель управления)<br>регулировку микрофона<br>штатив для крепления ручки<br>патрон плавкого предохранителя<br>разъем для подключения питания<br>Автоматическое переключение диапазонов питания в пределах 100-240 В переменного тока и частоты 50/60 Гц.<br><br></p><p><strong>Передняя часть перекладины состоит из:</strong></p><p>двух гнезд крепления по бокам панели<br>регулирующих ручек для прожекторов<br>висячих зажимов для точечного монтажа<br>монтажных разъемов для укрепления кронштейна.<br><br></p><p><strong>Преимущества системы</strong></p><p>Благодаря множеству вариантов крепления, небольшим габаритам и дизайну панели 6 SPOT быстро и с легкостью устанавливается в любом помещении. Может использоваться как дополнительное устройство для комплекта 4Play. Для этого 4 прожектора на перекладине устанавливаются на основную штангу штатива ниже Т-образной перекладины. Есть возможность объединить эл.питание до 20 прожекторов в «цепь».<br>Система управляется при помощи педального контроллера, через 8 DMX каналов управления или при помощи встроенных программ, в т.ч. и с звуковой активацией.<br>Автоматизированные программы имеют легкий доступ и приспособлены для создания синхронизированных шоу в режиме ведущий/ведомый. Вся система размещается в удобном транспортировочном чехле.<br><br></p><p><strong>Технические характеристики:</strong></p><p>8 DMX каналов<br>DMX разъемы: 3-контактный XLR<br>Источник света: 6 светодиодов (трехцветный RGB) 3 Вт (ресурс не менее 50 000ч. с сохранением до 70% светового потока)<br>Скорость стробирования от 0 до 30 Гц<br>Угол раскрытия каждого прожектора 11 градусов&nbsp;<br>Освещенность: 192 лк на 2м. дистанции<br>Подходит для установки на штатив Размер: от 1 до 1,4 в (26 до 37) мм&nbsp;<br>Возможность подключения в «цепь»: 20 единиц 120В; 33 единицы 230&nbsp;<br>Входящее напряжение: от 100 до 240В переменного тока, 50/60 Гц (с автоматическим выбором режима питания)&nbsp;<br>Мощность: 52 Вт, 0,4 A при 120В, 60 Гц&nbsp;<br>Мощность: 57 Вт, 0,2 A при 230В, 50 Гц&nbsp;<br>Вес: 4,6 кг.<br>Размер и габариты: 35,5 х 2,2 х 6,5 в (902 х 56 х 165) мм<br></p>', 12800, '2014-08-23 13:40:52', 477, 'комплект из 6 профильных прожекторов на 3Вт RGB светодиодах смонтированных на Т-образной перекладине. Управление: педальный контроллер, DMX - 8каналов, встроенные программы, угол раскрытия прожекторов 11град, универсальный блок питания 100-240В, потребление до 57Вт, вес 4,6кг, ДШВ 902х56х165мм.\r\n', 19427, NULL, 1884815, '\0', '\0'),
  (20356, 'PRO SVET PSL-LED Fire Balls', '<p>Светодиодный эффект: 3 (3 в 1) RGB светодиода 3W, смена цвета, постоянное вращение с одной скоростью,64 ярких острых луча. Габариты:560x230x295 мм. Энергопотребление:18W. Вес:4,9 кг</p><p>​</p>', 4700, '2014-08-23 13:41:58', 478, 'Светодиодный эффект: 3 (3 в 1) RGB светодиода 3W, смена цвета, постоянное вращение с одной скоростью,64 ярких острых луча. Габариты:560x230x295 мм. Энергопотребление:18W. Вес:4,9 кг\r\n', 19430, NULL, 1884815, '\0', '\0'),
  (20357, 'ATLASER AQUARIUS I', '<p><strong></strong>Профессиональный твердотельный лазер с диодной накачкой.<br><strong>Цвета излучения:</strong>&nbsp;зеленый (532 nm / 40 mW), красный (650 nm / 120 mW).<strong>&nbsp;<br>Общая мощность излучения:</strong>&nbsp;160 mW.&nbsp;<strong>Оптическая система:</strong>&nbsp;две стеклянные оптические дифракционные решётки.&nbsp;<strong>Класс:</strong>&nbsp;3b.<br><strong>Режимы работы:</strong>&nbsp;DMX (5 каналов), звуковая активация, режим Master/Slave.<strong>Оптимальная площадь:</strong>&nbsp;50-100 кв. метров.&nbsp;<strong>Габариты:</strong>&nbsp;120 х 100 х 260 мм.&nbsp;<strong>Вес:</strong>&nbsp;2,5 кг. &nbsp; &nbsp;</p>', 5500, '2014-08-13 11:24:00', 479, 'Профессиональный твердотелый лазер с диодной накачкой. Три цвета излучения: красный (650 nm), зеленый (532 nm) ( основные), желтый (смешанный). \r\nОбщая мощность излучения: 160 mW\r\nПрофессиональный твердотельный лазер с диодной накачкой.\r\nЦвета излучения: зеленый (532 nm / 40 mW), красный (650 nm / 120 mW). \r\nОбщая мощность излучения: 160 mW.\r\nОптическая система: две стеклянные оптические дифракционные решётки.\r\nКласс: 3b.\r\nРежимы работы: DMX (5 каналов), звуковая активация, режим Master/Slave.\r\nОптимальная площадь: 50-100 кв. метров.', 19431, NULL, 1884815, '\0', ''),
  (20359, 'SHURE SLX24E/SM58', '<p><strong>SHURE SLX24E/58 L4E</strong>&nbsp;638 - 662 MHz – это профессиональная двухантенная радиосистема. Данная радиосистема является вокальной, имеет капсюль микрофона SM58, а также сканер и возможность переключения частот.<br><br>Радиосистема SHURE SLX24E/58 L4E 638 - 662 MHz обладает огромными возможностями! Она подходит для решения широкого спектра задач, от простейших аудио инсталляций до сложных музыкальных выступлений.<br><br>Данная беспроводная радиосистема обладает превосходным звучанием. Запатентованная технология Audio Reference Companding обеспечивает абсолютное качество радиопередачи, чистую и четкую передачу звука. Технологии радио компандирования (сжатия аудиоданных, передача которых осуществляется) – это стандартные технологии, используемые повсеместно. Их ограничивает заданный поток аудиокомпрессии. В отличие от них, технология Audio Reference Companding работает, используя схему переменного коэффициента сжатия. Данная технология обеспечивает не только чистый звук, с полным отсутствием шума, но также улучшенное качество аудиопередачи в целом. Настройка и использование радиосистемы SHURE SLX24E/58 L4E 638 - 662 MHz чрезвычайно удобны. Интуитивно понятный и простой интерфейс обеспечивает легкую работу.&nbsp;<br><br>Профессиональная вокальная радиосистема SHURE SLX24E/58 L4E 638 - 662 MHz сочетает в себе опыт и непревзойденное качество легендарной компании SHURE, использование передовых технологий, широкие функциональные возможности и удобство использования. Данная радиосистема является отличным выбором для любого исполнителя: как для начинающего, так и для опытного.&nbsp;<br><br><strong style=\"line-height: 1.428571429;\">Особенности SHURE SLX24E/58 L4E 638 - 662 MHz:</strong><br></p><p>-Используется технология Audio Reference Companding.<br>-Подбор частоты происходит автоматически.<br>-До 12 систем в одновременной работе в UHF диапазоне.<br>-Приемник с передатчиком синхронизируются автоматически.<br>-Радиоприемник имеет надежный металлический корпус.<br>-Антенны: съемные.</p>', 29000, '2014-08-14 12:11:01', 146, 'профессиональная двухантенная `вокальная` радиосистема с капсюлем микрофона SM58, сканер частот', 19433, NULL, 1884815, '\0', ''),
  (20364, 'Behringer UB1204FX-PRO', '<p>Малошумящий 12-канальный микшерный пульт с 2/2 шинами 4 моноканала с IMP &lt;невидимым микрофонным предусилителем&gt;, разрывами и фантомным питанием. 2 стерео канала с высоким запасом по перегрузке. 2 субгруппы с одним фейдером, 2 посыла и 2 стерео возврата aux Ползунковые регуляторы громкости Динамический диапазон 130 дб диапазон изменения громкости 60 дб. Коэффициент нелинейных искажений: менее 0,0007% в диапазоне 20-20000 гц Эффективно, музыкально звучащий 3-полосный эквалайзер на каждом канале и фильтр НЧ на всех моно каналах 24-битовый цифровой процессор эффектов c 99 эффектами Диапазон регулировки эквалайзера: Low- 80 гц + 15 дб Mid - 2,5 кГц + 15 дб High - 12 кГц + 15 дб Выносной импульсный блок питания Размеры: 97x247x334 мм Вес: 2,6 кг СПИСОК ЭФФЕКТОВ: Cathedral, Plate, Concert, Stage,Room,Studio,Small Hals, Ambience, Early Reflection, Spring Reverb, Gate Reverb. Chorus,Flanger,Phaser,Rotary Speaker . Delay. Chorus &amp; Reverb, Flanger &amp; Reverb, Phaser &amp; Reverb, Rotary Speaker &amp; Reverb. Delay &amp; Reverb, Delay &amp; Chorus, Delay &amp; Flanger. Compressor, Expander, Gate, Ultramizer ,Ultrabass,Panner, Exciter, Auto Filter, Tube Distortion ,Guitar Amplifer,Vinylazer, Test Tone.</p>', 6700, '2014-09-01 09:28:13', 70, 'Компактный малошумящий микшерный пульт (4 моновхода, 2 стереовхода, 2 AUX-шины, процессор эффектов, встроенный импульсный блок питания)', 19318, NULL, 1884815, '\0', ''),
  (20541, 'Rode M2', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>RØDE M2 является сценическим воплощением многолетнего опыта по созданию студийных конденсаторных микрофонов и продолжением развития линейки сценических микрофонов вслед за моделью S1.<br><br>Объединяя качество студийного микрофона с антивибрационной системой подвеса капсуля и защитой от обратной связи, M2 будет великолепным дополнением к парку сценических микрофонов.</p><ul><li>Сценический конденсаторный микрофон</li><li>Супер кардиоидная диаграмма направленности устраняет обратную связь</li><li>Переключатель вкл./выкл.</li><li>Прочный металлический корпус</li><li>Пониженная чувствительность к электромагнитным наводкам</li><li>Низкая чувствительность к касаниям корпуса микрофона</li><li>Разработан и произведен в Австралии</li><li><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Ручной</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Суперкардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>35..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-44</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>141</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>50</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>71</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>23</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Суперкардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>187 x 47 x 47</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>308<br><br></td></tr></tbody></table></li></ul></td></tr></tbody></table>', 3250, '2014-09-01 15:47:08', 153, 'Rode M2 - Суперкардиоидный конденсаторный микрофон для \"живых\" выступлений с выключателем.', 19642, NULL, 124, '\0', ''),
  (20367, 'Behringer UB1202FX', '<p>Сверхмалошумящая ULN схемотехника, максимально возможная динамика, сверхпрозрачный звук 4 новых микрофонных предусилителя студийного класса IMP (\"Invisible\" Mic Preamps), обеспечивающих: 130 дБ динамический диапазон для входных сигналов с качеством 24 бит/192 кГц широкий диапазон усиления (60 дБ) минимально возможный коэффициент нелинейных искажений 0,0007% (20 Гц-20 кГц) Встроенный 24-битный цифровой стерео эффект-процессор, предлагающий 100 великолепных пресетов, в т.ч. реверберация, хорус, фленджер, задержка, корректор высоты тона, а также мультиэффекты Эффективный музыкальный 3-полосный эквалайзер и переключаемый обрезной НЧ фильтр на всех моноканалах Высокотехнологичные операционные усилители 4580 (преемник 4560) обеспечивающие минимальный уровень шума и искажений Светодиодные индикаторы пиков во всех моноканалах 12 симметричных линейных входов с большой динамикой, плюс переключатели уровня +4/-10 во всех стереоканалах Регулятор посыла на внутренний и/или внешний процессор эффектов в каждом канале Выходы основного микса, плюс отдельные мониторные выходы, выходы для наушников и СD-/Tape-рекордеров СD/магнитофонные входы, назначаемые на выход основного микса или мониторы/наушники Отключаемое фантомное питание +48 В для конденсаторных микрофонов Износостойкий 60-мм логарифмический фейдер Alps® и герметичные потенциометры Внешний блок питания, обеспечивающий превосходные переходные характеристики и бесшумное неокрашенное звуковоспроизведение и быстрый отклик Высококачественные компоненты и исключительно надёжная конструкция гарантируют долгий срок службы<br></p>', 4050, '2014-08-15 17:11:16', 70, 'Behringer UB1202FX - микшер , 4 микр.+ 2 лин.стерео,3-полосный эквалайзер', 19440, NULL, 1884815, '\0', ''),
  (20366, 'Behringer UB1002FX', '<p>Сверхмалошумящая ULN схемотехника, максимально возможная динамика, сверхпрозрачный звук 2 новых микрофонных предусилителя студийного класса IMP (\"Invisible\" Mic Preamps), обеспечивающих: 130 дБ динамический диапазон для входных сигналов с качеством 24 бит/192 кГц широкий диапазон усиления (60 дБ) минимально возможный коэффициент нелинейных искажений 0,0007% (20 Гц-20 кГц) Встроенный 24-битный цифровой стерео эффект-процессор, предлагающий 100 великолепных пресетов, в т.ч. реверберация, хорус, фленджер, задержка, корректор высоты тона, а также мультиэффекты Эффективный музыкальный 3-полосный эквалайзер и переключаемый обрезной НЧ фильтр на всех моноканалах Высокотехнологичные операционные усилители 4580 (преемник 4560) с минимальным уровнем собственного шума и искажений Светодиодные индикаторы пиков во всех моноканалах Регулятор посыла на внутренний и/или внешний процессор эффектов в каждом канале 10 линейных входов с большой динамикой, плюс переключатели уровня +4/-10 во всех стереоканалах Выходы основного микса, плюс отдельные мониторные выходы, выходы для наушников и СD/стереомагнитофона СD/магнитофонные входы, назначаемые на выход основного микса или мониторы/наушники Отключаемое фантомное питание +48 В для конденсаторных микрофонов Износостойкий 60-мм логарифмический мастер-фейдер Alps® и герметичные потенциометры Внешний блок питания, обеспечивающий превосходные переходные характеристики и бесшумное неокрашенное звуковоспроизведение и быстрый отклик Высококачественные компоненты и исключительно надёжная конструкция гарантируют долгий срок службы<br></p>', 4000, '2014-08-15 17:06:30', 70, 'Сверхкомпактный малошумящий  микшер , 2 микр.предусил, 4 стереопары', 19439, NULL, 1884815, '\0', ''),
  (20370, 'INVOLIGHT SM1000', '<p>Генератор снега<br>Управление: проводной пульт<br>Емкость бака: 5 л<br>Питание: 230 В, 50 Гц<br>Потребляемая мощность: 1000 Вт<br>Габариты: 540х250х290 мм<br>Вес: 12 кг<br></p>', 7400, '2014-08-16 10:23:18', 286, 'Involight SM1000 - генератор снега 1000 Вт', 19444, NULL, 1884815, '\0', ''),
  (20371, 'INVOLIGHT DL100', '<p>Пульт управления DMX приборами&nbsp;<br>Количество каналов: 192 канала (12 приборов по 16 каналов)<br>Память: 6 чейзов по 30 банков (в одном банке 8 сцен)&nbsp;<br>Управление: восемь фейдеров, LED дисплей, фейдер \"time control\", \"BLACKOUT\", MIDI<br>Встроенный микрофон&nbsp;<br>Переключатель полярности DMX сигнала<br>Питание: DC 9-12 Вт, 300 мА&nbsp;<br>Габариты: 482х132х70 мм&nbsp;<br>Вес: 2,5 кг</p>', 7300, '2014-08-19 16:10:24', 286, 'Involight DL100 - пульт управления DMX приборами 192 канала (1', 19447, NULL, 124, '\0', ''),
  (20372, 'ROSS DMX CONTROL 1216', '<p>Пульт управления DMX 512<br>192 DMX канала<br>Управление 12 приборами по 16 канала каждый<br>30 банков по 8 программируемых сцен<br>16 фейдеров для управления каналами<br>Midi контроль&nbsp;<br>Запись до 6 программируемых чейзов<br>с регулировкой времени и скорости<br>LED дисплей<br>Встроенный микрофон&nbsp;<br>Автоматический режим&nbsp;<br>DMX входной разъем: XLR3M<br>DMX выходной разъем: XLR3F<br>Разъем USB для лампы подсветки<br>Потребляемая мощность: DC 9-12V 300mA&nbsp;<br>Размеры (мм): 482X133X75мм<br>Вес нетто 2,2 кг</p>', 5200, '2014-08-19 16:14:44', 480, 'Пульт управления DMX 512\r\n192 DMX канала\r\nУправление 12 приборами по 16 канала каждый\r\n30 банков по 8 программируемых сцен\r\n16 фейдеров для управления каналами\r\nMidi контроль ', 19448, NULL, 124, '\0', ''),
  (20373, 'AKG K240 MKII', '<p>Динамические наушники полуоткрытого типа AKG K240 MKII благодаря большим амбушюрам circum-aural и самоподстраиваемому оголовью создают комфортные ощущения даже при многочасовой работе в студии. В модели используется диафрагма Varimotion. 2 отсоединямых кабеля (прямой и витой) и 2 пары амбушюров (велюровые и из искусственной кожи) создают дополнительное удобство при использовании наушников. Разработанные для профессиональной работы в студии K240 MKII также отлично подходят и для домашнего прослушивания музыки. Частотный диапазон составляет 15 Гц – 25 кГц, импеданс – 55 Ом. Благодаря уникальной гибкой конструкции ди-джеи могут использовать эту модель в своей работе.</p><p>Технические характеристики</p><ul><li>Тип наушников: динамические, полуоткрытые</li><li>Амбушюры: Circum-aural; велюровые и из искусственной кожи</li><li>Диапазон воспроизводимых частот: 15 Гц – 25 кГц</li><li>Чувствительность: 94 дБ</li><li>Мощность: 200 мВт</li><li>Импеданс: 55 Ом</li><li>Кабель: отсоединяемый, из бескислородной меди; прямой – 3 м, витой – 5 м</li><li>Разъём: позолоченный миниджек (3.5 мм)</li><li>Вес (без кабеля): 240 г</li><li>Аксессуары: позолоченный переходник “миниджек-джек” (6.3 мм, с резьбой); 2 пары амбушюров; 2 кабеля</li></ul>', 5500, '2014-08-28 12:40:13', 147, 'AKG K240 MKII полуоткрытые студийные наушники 55Ом, 15-25000Гц, с мембранами XXL- Varimotion, кабели EK500 и EK300 в комплекте', 19449, NULL, 124, '\0', ''),
  (20374, 'AKG K121', '<p><strong>Технические характеристики:</strong></p><p>Тип:&nbsp;полуоткрытые, динамические наушники.<br></p><p>Tип амбрушур: Supra Aural&nbsp;<br>Уровень звукового давления 101 дБ&nbsp;<br>Диапазон воспроизводимых частот 18.....22,500 Гц&nbsp;<br>Номинальный импеданс&nbsp; 55 Ом&nbsp;<br>Максимальная входная мощность 200 мВт&nbsp;<br>Кабель 3 м&nbsp;<br>Штекер 3,5/6,3 мм&nbsp;<br>Дизайн Черный/Золотой&nbsp;<br>Вес (без кабеля) 220 гр.<br></p>', 3500, '2014-08-23 14:12:20', 147, 'AKG K121 полуоткрытые студийные наушники, 55 Oм, 18-22500 Гц, кабель 3м', 19450, NULL, 124, '\0', ''),
  (20375, 'AKG K44 V2', '<p>Эти мониторные наушники обладают отличными характеристики по сравнению с наушниками того же ценового диапазона других производителей. Результаты тестирования показали, что&nbsp;<strong>AKG K44</strong>&nbsp;обеспечивают отменное качество звука как в области высоких так и низких частот. Наушники AKG K44 очень легки, изготовлены из высокопрочного пластика, уникальное исполнение, наличие самоналаживающейся ленты дужки и одностороннего шнура обеспечивает повышенную комфортность. Увеличенные мембраны позволяют получить особомощный, глубокий бас и высокие частоты ну просто волшебной чистоты<br><br><strong>Описание:</strong></p><p>Универсальные наушники&nbsp;<br>Тип: закрытые, динамические&nbsp;<br>Тип амбушюра: supraaural&nbsp;<br>Частотный диапазон: 18-20000 Гц&nbsp;<br>Чувствительность: 115 дБ&nbsp;<br>Мощность: 200 мВт&nbsp;<br>Импеданс: 32 Ом&nbsp;<br>Коэффициент гармонических искажений: &lt;1%&nbsp;<br>Разъемы: миниджек/переходник на джек: 3,5 мм/6,3 мм&nbsp;<br>Кабель: 2,5 м&nbsp;<br>Вес: 190 г&nbsp;<br>Разъем: 3.5 мм стереоджэк + переходник c 3.5 мм до 6.3 мм&nbsp;<br>Вес 190 г</p>​', 1200, '2014-08-23 14:18:08', 147, 'AKG K44 V2  наушники закрытые 18-20000Гц, 32 Ома, кабель 2,5 м', 19451, NULL, 124, '\0', ''),
  (20376, 'AKG K77', '<p>Динамические наушники закрытого типа с охватывающими амбушюрами (тип circumaural) предлагают отличное соотношение цены и качества. Темно-синие наушники K77 с удобными амбушюрами из искусственной кожи не только прекрасно выглядят, но и удобно сидят. Предназначены для звукозаписи и прослушивания музыки в домашних условиях.</p><p><strong>Технические характеристики:</strong></p><p>Тип: Динамические наушники закрытого типа с охватывающими амбушюрами<br>Частотный диапазон: 18 - 20000 Гц,&nbsp;<br>Максимальная входная мощность: 200 мВт<br>Чувствительность: 115 Дб/В<br>Импеданс: 32 Ом.&nbsp;</p>', 1800, '2014-08-23 16:11:14', 147, 'AKG K77 наушники закрытые 18-20000Гц, 32 Ом. Кабель 2,5м', 19452, NULL, 124, '\0', ''),
  (20377, ' WMS40 Mini2 Instrumental Set', '<p>WMS40 Mini2&nbsp;Instrumental Set BD ISM2/3&nbsp;– инструментальная радиосистема, гарантирующая превосходный звук и легка в использовании при непобедимом соотношении цена/качество. Система включает SR 40 Mini2 приемник, два РТ 40 Mini поясных передатчика, два инструментальных кабеля, универсальный блок питания с US/UK/EU адаптерами и две АА батарейки.</p><p><strong>SR 40 Mini2&nbsp;</strong>имеет удобные функции и позволяет работать двум каналам одновременно. Уникальная HDAP технология гарантирует лучшие возможности и самый реалистичный звук в любое время. SR 40 Mini2 приемник предусматривает три светодиода для каналов 1 и 2, индикатор вкл/выкл, силы приема сигнала и ограничения сигнала. Регулятор громкости устанавливает уровень ¼\" выходного джека. Каждый приемник поставляется универсальным блоком питания с 12В режимом переключения и с US/UK/EU адаптерами.</p><p><strong>PT 40 Mini&nbsp;</strong>– поясной передатчик самый маленький и легкий передатчик в этом классе. Надежный мини XLR выход позволяет подключать любой совместимый миниатюрный микрофон. Батарейка передатчика может работать в течение 30 часов, что сокращает частоту замены и экономит деньги.&nbsp;<br><br><strong>Характеристики PT 40 Mini:&nbsp;</strong><br>Переносной частотный диапазон: 660 – 865 MHz, 1 установленная частота&nbsp;<br>Полоса пропускания: 40 HZ – kHz&nbsp;<br>Соотношение сигнал/шум: 110 дБ&nbsp;<br>Выходная мощность: 10 mW&nbsp;<br>T.H.D. ≤ 0,8%&nbsp;<br>Питание: 2 х АА батарейки&nbsp;<br>Размеры: 60 х 75,5 х 30 мм&nbsp;<br>Вес: 60 г</p>', 8300, '2014-08-23 16:19:02', 147, 'AKG WMS40 Mini2 Instrumental Set BD ISM2/3 инструментальная радиосистема с приёмником SR40 Mini Dual и двумя портативными передатчиками\r\n', 19453, NULL, 124, '\0', ''),
  (20378, 'AKG WMS40 Mini Vocal Set', '<p><strong>AKG WMS 40 Mini Vocal Set</strong>&nbsp;гарантирует прекрасный звук и простоту использования при непревзойденном соотношении цены и качества. Уникальная технология HDAP (High Definition Audio Performance) гарантирует лучший из возможного, самый реалистичный звук в любое время.<br><br>Ресивер AKG SR 40 Mini имеет три светодиодных индикатора статуса, в числе которых статус вкл./выкл. (ON/OFF), сила принимаемого сигнала (RF OK) и аудио клиппинг (AF CLIP). Регулятор управления громкостью (VOLUME) устанавливает уровень громкости разъема 1/4\'’. Входящий в комплект поставки блок питания с переключаемыми режимами работает при любом напряжении от 110 до 240 вольт переменного тока. Имеются также адаптеры для европейского, американского стандартов и стандарта Великобритании.<br><br>Шершавый переносной микрофон HT 40 Mini имеет переключатель режимом вкл./выкл./блокировка звука (ON/OFF/MUTE) и головку из твердой металлической сетки, защищающую элемент кардиоидного динамического микрофона. Срок службы батареи микрофона впечатляет: 30 часов от одной батарейки AA. Это срок службы батареек у всех моделей серии WMS 40, что исключает необходимость замены батареек и экономит ваши деньги.&nbsp;<br><br><strong>Система включает в себя</strong><br><br>• Ресивер SR 40 MINI – 1 шт.<br>• Переносной микрофон HT 40 MINI – 1 шт.<br>• Универсальный блок питания с переходниками под европейский и американский стандарты, а также для стандарта Великобритании – 1 шт.&nbsp;<br>• Щелочная батарейка AA – 1 шт.<br><br><strong>СВОЙСТВА ВОКАЛЬНОЙ РАДИОСИСТЕМЫ AKG WMS 40 MINI<br></strong><br>• До 30-ти часов работы от одной батарейки AA<br>• Подключи и работай<br>• Совместимость с AKG MicroMics<br>• Самый легкий и маленький микрофон в своем классе<br></p>', 5000, '2014-08-23 16:34:45', 147, 'AKG WMS40 Mini Vocal Set BD ISM1 вокальная радиосистема с приёмником SR40 Mini и ручным передатчиком с капсюлем D88', 19454, NULL, 124, '\0', ''),
  (20379, 'AKG C547 BL', '<p>AKG C547BL микрофон граничного слоя конденсаторный гиперкардиоидный в противоударном корпусе, разъём XLR, с адаптером фантомного питания 9-52В, частотный диапазон 30-18000Гц, чувствительность 8,5мВ/Па, эквивалентный уровень шума 22Дб-А, сигнал/шум 72дБ-А, рекомендованная нагрузка 1000Ом, цвет тёмно-серый, в комплекте ветрозащита W547</p>', 15650, '2014-08-28 12:46:31', 147, 'AKG C547 BL микрофон граничного слоя конденсаторный гиперкардиоидный в противоударном корпусе, разъём XLR, 30-18000Гц, 8,5мВ/Па', 19455, NULL, 124, '\0', ''),
  (20380, 'AKG C562 CM', '<p>AKG C562 CM мини-микрофон, монтируемый в поверхность, всенаправленный, разъём XLR, с адаптером фантомного питания 9-52В, частотный диапазон 20-20000Гц, чувствительность 25мВ/Па, эквивалентный уровень шума 16дБ-А, сигнал/шум 78дБ-А, рекомендованная нагрузка 2000Ом, цвет&nbsp; матовый никелированный</p>', 7050, '2014-08-28 12:49:25', 147, 'AKG C562 CM мини-микрофон, монтируемый в поверхность, всенаправленный, разъём XLR,  20-20000Гц, 25мВ/Па', 19456, NULL, 124, '\0', ''),
  (20381, 'AKG CBL99', '<p>AKG CBL99 микрофон граничного слоя конденсаторный всенаправленный (аналог C542BL), разъём XLR, фантомное питание 9-52В, частотный диапазон 20-20000Гц, чувствительность 20мВ/Па, эквивалентный уровень шума 16дБ-А, сигнал/шум 78дБ-А, рекомендованная нагрузка 2000Ом, цвет чёрный</p>', 4850, '2014-08-28 12:56:09', 147, 'AKG CBL99 микрофон граничного слоя конденсаторный всенаправленный (аналог C542BL), разъём XLR, 20-20000Гц,  20мВ/Па', 19457, NULL, 124, '\0', ''),
  (20382, 'AKG D12VR', '<p>AKG D12VR микрофон с большой диафрагмой для бас-барабана динамический кардиоидный, разъём XLR, частотный диапазон 17-17000Гц, чувствительность1,2мВ/Па, импеданс 200Ом, рекомендованная нагрузка 1000Ом, цвет матовый чёрный</p>', 14950, '2014-08-28 12:56:36', 147, 'AKG D12VR микрофон с большой диафрагмой для бас-барабана динамический кардиоидный, разъём XLR, 17-17000Гц, 1,2мВ/Па', 19458, NULL, 124, '\0', ''),
  (20383, 'AKG D230', '<p>AKG D230&nbsp; микрофон репортёрский динамический всенаправленный, разъём XLR, частотный диапазон 40-20000Гц, чувствительность 2,5мВ/Па, импеданс 320Ом, рекомендованная нагрузка 1000Ом, встроенная ветрозащита, в комплекте адаптер для стойки SA44, цвет чёрный</p>', 6350, '2014-08-28 12:57:04', 147, 'AKG D230  микрофон репортёрский динамический всенаправленный, разъём XLR, 40-20000Гц, 2,5мВ/Па, встроенная ветрозащита, в комплекте адаптер для стойки', 19459, NULL, 124, '\0', ''),
  (20384, 'AKG D40', '<p>AKG D40 микрофон для духовых, барабанов, перкуссии и гитарных комбо&nbsp; динамический кардиоидный, разъём XLR, частотный диапазон 75-17000Гц, чувствительность 2,2мВ/Па, импеданс 200Ом, рекомендованная нагрузка 2000Ом, в комплекте чехол и адаптер H440, цвет тёмно-серый</p>', 3945, '2014-08-28 12:57:32', 147, 'AKG D40 микрофон для духовых, барабанов, перкуссии и гитарных комбо динамический кардиоидный, разъём XLR, 75-17000Гц, 2,2мВ/Па', 19460, NULL, 124, '\0', ''),
  (20385, 'Soundcraft GB2-16', '<p>GB2 - это последнее дополнение к серии GB, оснащенное 4 шинами групп, сконфигурированными как 2 стерео подгруппы, и интегрированной матрицей 6 x 2.</p><p>Предназначенный для инсталляций и аудио-визуальных применений, которым не требуется функциональность, обеспечиваемая GB4 или GB8. GB2 возможен с фреймами на 16, 24 или 32 моно входа, каждый с 2 стерео входами по умолчанию. Каждый вход оснащен высококачественным микрофонным предусилителем GB30 Mic Pre и эквалайзером GB30 аналогичным GB4 и GB8, вместе с 6 шинами Aux.</p><p>Четыре подгруппы организованы как две стерео-пары с уникальной возможностью настройки ширины стереосигнала по всему стерео-миксу. Настройки панорамы канала удерживаются на выходах групп, в то время, как степень стерео разделения шины mix настраивается независимо от полного стерео до моно.</p><p>GB2 также имеет 2 входных стерео канала с раздельными микрофонным и линейным входами. При обычном использовании, микрофонные входы перенаправляются на локальный канал, а линейные входы функционируют как стерео возвраты на шину mix.</p>', 62900, '2014-08-28 12:02:33', 185, 'Soundcraft GB2-16 - микшерный пульт, 16 моно, 2 стерео, 6 Aux, 4 подгруппы, матрица 6x2, TRS директ-выходы на каждом моно канале. 12-сегментная LED индикация. БП встроенный', 19461, NULL, 1884815, '\0', ''),
  (20386, 'AKG D5', '<p>AKG D5 микрофон сценический вокальный динамический суперкардиоидный, разъём XLR, частотный диапазон 70-20000Гц, чувствительность 2,6мВ/Па, импеданс 600Ом, рекомендованная нагрузка 2000Ом, в комплекте чехол и адаптер для стойки SA61, цвет тёмно-серый</p>', 4500, '2014-08-28 12:57:57', 147, 'AKG D5 микрофон сценический вокальный динамический суперкардиоидный, разъём XLR, 70-20000Гц, 2,6мВ/Па', 19463, NULL, 124, '\0', ''),
  (20387, 'AKG D5S', '<p>AKG D5S микрофон сценический вокальный динамический суперкардиоидный, с выключателем, разъём XLR, частотный диапазон 70-20000Гц, чувствительность 2,6мВ/Па, импеданс 600Ом, рекомендованная нагрузка 2000Ом, в комплекте чехол и адаптер для стойки SA61, цвет тёмно-серый</p>', 4550, '2014-08-28 12:58:25', 147, 'AKG D5S микрофон сценический вокальный динамический суперкардиоидный, с выключателем, разъём XLR, 70-20000Гц, 2,6мВ/Па', 19463, NULL, 124, '\0', ''),
  (20388, 'AKG D55S', '<p>AKG D55S микрофон сценический вокальный динамический кардиоидный, с выключателем, разъём мини-джек, частотный диапазон 70-18000Гц, чувствительность 2,5мВ/Па, импеданс 600Ом, рекомендованная нагрузка 2000Ом, встроенный кабель 5м, цвет чёрный</p>', 1650, '2014-08-28 12:58:57', 147, 'AKG D55S микрофон сценический вокальный динамический кардиоидный, с выключателем, разъём мини-джек, 70-18000Гц, 2,5мВ/Па, встроенный кабель 5м', 19465, NULL, 124, '\0', ''),
  (20389, 'AKG D7S', '<p>AKG D7S микрофон вокальный класса Hi-End для сцены и записи в студии динамический суперкардиоидный, с выключателем,&nbsp; разъём XLR, частотный диапазон 70-20000Гц, чувствительность 2,6мВ/Па, импеданс 600Ом, рекомендованная нагрузка 2000Ом, встроенная ветрозащита, в комплекте чехол и адаптер для стойки SA61, цвет тёмно-серый</p>', 7100, '2014-08-28 12:59:26', 147, 'AKG D7S микрофон вокальный класса Hi-End для сцены и записи в студии динамический суперкардиоидный, с выключателем, разъём XLR, 70-20000Гц, 2,6мВ/Па', 19466, NULL, 124, '\0', ''),
  (20390, 'Soundcraft GB2R-12', '<p><strong>Характеристики Soundcraft GB2R-12</strong></p><p><strong>Общие данные</strong><br>Тип - Микшерный пульт<br><strong>Функциональные особенности</strong><br>* - 19” микшер, монтируемый в рэк-стойку<br>* - 12 каналов, 2 стерео-канала<br>* - Поворотная секция разъемов для доступа сверху или сзади<br>* - 8 шин<br>* - Микрофонный предусилитель GB30 и прецизионный эквалайзер на входах<br>* - Отключаемое фантомное питания +48В на каждом микрофонном входе<br>* - 100Гц ВЧ-фильтр<br>* - Прямые выходы на каждом канале<br>* - 100-мм фейдеры<br>* - Стерео выход Mix Output и отдельный выход Mono Sum<br>* - Выход Record<br>* - Встроенный универсальный импульсный БП<br></p>', 49900, '2014-08-28 12:03:42', 185, 'Soundcraft GB2R-12 - микшер рэковый 12 моно, 2 стерео, 6 Aux, 2 подгруппы. TRS директ-выходы на каждом моно канале. 12-сегментная LED индикация. БП встроенный', 19467, NULL, 1884815, '\0', ''),
  (20391, 'AKG D77S', '<p>AKG D77S микрофон вокальный/инструментальный динамический, кардиоидный, с выключателем, разъём XLR, частотный диапазон 40-20000Гц, чувствительность 2,5мВ/Па, импеданс 600Ом, рекомендованная нагрузка 2000Ом, в комплекте чехол, адаптер для стойки SA44 и кабель 5м, цвет чёрный</p>', 2525, '2014-08-28 12:59:53', 147, 'AKG D77S микрофон вокальный/инструментальный динамический, кардиоидный, с выключателем, разъём XLR, 40-20000Гц, 2,5мВ/Па, в комплекте кабель 5м', 19470, NULL, 124, '\0', ''),
  (20392, 'Soundcraft GB2R-16', '<p>Популярная серия микшерных пультов Soundcraft GB получила пополнение в лице микшера Soundcraft GB2R.</p><p>Данный 19”, монтируемый в рэк-стойку микшер создан специально для небольших инсталляций в церквях и на концертных площадках или для небольших портативных PA-систем. Он также хорошо подходит для студий вещания, где его высокое качество и функциональность позволят занять свое место.</p><p><br>Как обычно в консолях Soundcraft, основное внимание было уделено простоте работы, четкой и интуитивной раскладке и найлучшим характеристикам звука. Soundcraft GB2R унаследовал микрофонный предусилитель GB30 и эквалайзер GB30 от консолей GB4 и GB8.</p><p><br>Каждый вход оснащен pre/post переключаемым прямым выходом для записи или посылов эффектов, а встроенный универсальный блок питания позволяет обойтись без лишней коммутации.</p><p><strong>Основные функции:</strong></p><p>19” микшер, монтируемый в рэк-стойку<br>16-канальная версия с 16 моно входами, выходами стерео Mix и Mono Sum, и 6 выходами Aux. - Итого входов на микс: 22<br>Поворотная секция разъемов для доступа сверху или сзади<br>8 шин<br>Микрофонный предусилитель GB30 и прецизионный эквалайзер на входах<br>Отключаемое фантомное питания +48В на каждом микрофонном входе<br>100Гц ВЧ-фильтр<br>Прямые выходы на каждом канале<br>100-мм фейдеры<br>Стерео выход Mix Output и отдельный выход Mono Sum<br>Выход Record<br>Встроенный универсальный импульсный БП</p>', 49900, '2014-08-28 12:04:41', 185, 'Soundcraft GB2R-16 - рэковая микшерная консоль 16 моно-каналов, 2 стерео, поворотная коммутационная панель, 6 ауксов, директ выходы на каждом канале', 19471, NULL, 1884815, '\0', ''),
  (20393, 'AKG D770', '<p>AKG D770 микрофон&nbsp; вокальный/инструментальный динамический кардиоидный, разъём XLR, частотный диапазон 60-20000Гц, чувствительность2,2мВ/Па, импеданс 600Ом, рекомендованная нагрузка 2000Ом, в комплекте чехол и адаптер для стойки SA44, цвет чёрный</p>', 3185, '2014-08-28 13:00:23', 147, 'AKG D770 микрофон вокальный/инструментальный динамический кардиоидный, разъём XLR, 60-20000Гц, 2,2мВ/Па', 19473, NULL, 124, '\0', ''),
  (20394, 'AKG D88S', '<p>AKG D88S микрофон сценический вокальный динамический суперкардиоидный, с выключателем, разъём XLR, частотный диапазон 40-20000Гц, чувствительность 2,5мВ/Па, импеданс 580Ом, рекомендованная нагрузка 2000Ом, в комплекте адаптер для стойки SA44 и кабель 5м, цвет чёрный</p>', 2600, '2014-08-28 13:01:03', 147, 'AKG D88S микрофон сценический вокальный динамический суперкардиоидный, с выключателем, разъём XLR, 40-20000Гц, 2,5мВ/Па, в комплекте кабель 5м', 19475, NULL, 124, '\0', ''),
  (20395, 'AKG P2', '<table cellspacing=\"0\" border=\"0\"><tbody><tr><td colspan=\"2\">AKG P2 микрофон для озвучивания басовых инструментов и комбо динамический кардиоидный, разъём XLR, частотный диапазон 20-16000Гц, чувствительность 2,5мВ/Па, импеданс 400Ом, рекомендованная нагрузка 2000Ом, в комплекте чехол, цвет чёрный</td></tr></tbody></table>', 3650, '2014-08-28 13:01:36', 147, 'AKG P2 микрофон для озвучивания басовых инструментов и комбо динамический кардиоидный, разъём XLR, 20-16000Гц, 2,5мВ/Па', 19476, NULL, 124, '\0', ''),
  (20396, 'AKG P3S', '<p>AKG P3S микрофон вокальный/инструментальный динамический кардиоидный, с выключателем, разъём XLR, частотный диапазон 40-20000Гц, чувствительность 2,5мВ/Па, импеданс 600Ом, рекомендованная нагрузка 2000Ом, металлический корпус, цвет чёрный, встроенная ветрозащита, в комплекте чехол и адаптер для стойки SA45</p>', 1845, '2014-08-28 13:02:02', 147, 'AKG P3S микрофон вокальный/инструментальный динамический кардиоидный, с выключателем, разъём XLR, 40-20000Гц, 2,5мВ/Па', 19477, NULL, 124, '\0', ''),
  (20397, 'AKG P4', '<p>AKG P4 динамический микрофон, спроектированный для озвучивания барабанов и перкуссии, духовых инструментов и гитарных комбоусилителей<br>• Характеристики, приспособленные для нейтральной передачи звучания инструментов<br>• Встроенный переходник для стойки и установочный кронштейн&nbsp;<br>• Прочный полностью металлический корпус, выдерживающий обычно грубое использование на сцене<br>• Катушка подавления фона от сети переменного тока отклоняет шумы ЭМС<br>• В комплект поставки входит кейс для транспортировки<br><br><strong>СПЕЦЕФИКАЦИИ МИКРОФОНА AKG P4:</strong><br><br>• Кардиоидная диаграмма направленности<br>• Частотный диапазон от 20 до 16000 Гц<br>• Чувствительность 2,5 мВ/Па<br>• Максимальный уровень звукового давления 157 Дб SPL<br>• Рекомендуемый импеданс нагрузки &gt;= 2,000 Ом<br></p>', 2700, '2014-08-28 13:02:36', 147, 'AKG P4  динамический микрофон для озвучивания барабанов, перкуссии и комбо', 19478, NULL, 124, '\0', ''),
  (20398, 'AKG P5', '<p><strong>P5&nbsp;</strong>- это динамический портативный микрофон для лид-вокалистов. Кардиоидная диаграмма направленности высшего качества гарантирует достижение максимального гейна, прежде чем микрофон «заведется». Это делает работу с микрофоном в миксе простой и комфортной.<br><br><br><strong>ОСОБЕННОСТИ</strong><br><br>- кардиоидная диаграмма направленности высшего качества, спроектированная для лид-вокала.&nbsp;<br><br>- шероховатая защитная сетчатая пластина с дополнительной внутренней защитой.&nbsp;<br><br>- литой металлический корпус<br><br>- поставляется с держателем для микрофона (крепеж для стойки) и с сумкой с застежкой на молнии&nbsp;<br><br><strong>ТЕХНИЧЕСКИЕ ХАРАКТЕРИСТИКИ</strong><br><br>Диаграмма направленности: суперкардиоидный<br><br>Диапазон частот: 40-20000Гц<br><br>Чувствительность: 2,5мВ/Па<br><br>Максимальный уровень звукового давления: 144 Дб&nbsp;<br><br>Рекомендуемый импеданс нагрузки: &gt;= 2,000 Ом<br><br></p>', 2050, '2014-08-28 13:05:05', 147, 'AKG P5  динамический вокальный суперкардиоидный микрофон', 19480, NULL, 124, '\0', ''),
  (20399, 'AKG P5S', '<p><strong>Описание AKG P5S:</strong></p><p>P5S - это динамический портативный микрофон для лид-вокалистов. Кардиоидная диаграмма направленности высшего качества гарантирует достижение максимального гейна, прежде чем микрофон «заведется». Это делает работу с микрофоном в миксе простой и комфортной.<br><br>Предлагаемая модель имеет переключатель вкл./выкл.<br><br><strong>ОСОБЕННОСТИ</strong><br><br>- кардиоидная диаграмма направленности высшего качества, спроектированная для лид-вокала.&nbsp;<br><br>- шероховатая защитная сетчатая пластина с дополнительной внутренней защитой.&nbsp;<br><br>- литой металлический корпус<br><br>- поставляется с держателем для микрофона (крепеж для стойки) и с сумкой с застежкой на молнии&nbsp;<br><br><strong>ТЕХНИЧЕСКИЕ ХАРАКТЕРИСТИКИ</strong><br><br>Диаграмма направленности: суперкардиоидный<br><br>Диапазон частот: 40-20000Гц<br><br>Чувствительность: 2,5мВ/Па<br><br>Максимальный уровень звукового давления: 144 Дб&nbsp;<br><br>Рекомендуемый импеданс нагрузки: &gt;= 2,000 Ом</p>', 2250, '2014-08-28 13:05:38', 147, 'AKG P5S  динамический вокальный суперкардиоидный микрофон с выключателем', 19481, NULL, 124, '\0', ''),
  (20400, 'Soundcraft LX7ii-16', '<p><strong></strong><strong></strong><strong></strong><strong>Описание модели </strong>:<br></p><p><strong>Область применения:</strong><br>Для гастролирующих групп<br>Небольшие инсталляции<br>Малые концертные залы<br>Использование в храмах, церквях и театрах<br>Живая и студийная запись</p><p><strong>Особенности</strong>:<br>100 мм фейдеры<br>+48 В фантомное питание<br>16,24 и 32 входные линейки<br>Всего 40 входов (включая стерео линейки и возвраты)<br>Фильтр НЧ с крутизной среза 18 дБ на октаву<br>6 дополнительных посылов, 4 из них переключаемые<br>до или после фейдера<br>Разрывы на групповых и мастер секциях<br>12-и сегментный индикатор уровня<br>Встроенный блок питания<br>Микрофонные преампы новой разработки GB3 по технологиям серии МН3<br>Новая схематехника четырехполосных эквалайзеров по технологии серии МН3</p><p><strong>Спецификация</strong></p><p><strong>Частотная характеристика</strong></p><p>20Hz - 20kHz, +0 /-1dB</p><p>Коэффициент гармонических искажений</p><p>Mic sens. -30dBu, +20dBu at all outputs. : &lt;0.006% @ 1kHz</p><p>Уровень шума<br>Measured RMS, 22Hz to 22kHz Bandwidth<br>Mic Input E. I. N @ unity gain: : &lt;- 128dBu (150 source)<br>Mix Output, 40 inputs routed to mix : : &lt;-82dBu<br>Group Outputs: : &lt;-83dBu<br>Aux Outputs: : &lt;-80dBu<br>Matrix Outputs: : &lt;-89dBu &lt;-85dBu</p><p>Взаимное проникновение между каналами<br>Input Channel muting: &lt;-97dB<br>Input fader cutoff:&lt;-95dB<br>Input pan pot isolation: &lt;-77dB<br>Mix routing isolation: &lt;-97dB<br>Group routing isolation: &lt;-97dB<br>Adjacent channel isolation: &lt;-99dB<br>Group-Mix crosstalk: &lt;-89dB<br>Aux send off:&lt;-84dB<br>Matrix send off:&lt;-93dB<br>Typical CMRR at max gain @ 1kHz:80dB</p><p>Пропускной фильтр ВЧ (Моно вход)</p><p>100Hz, 18dB/octave</p><p>Эквалайзер (Моно вход)<br>HF:13kHz, +15dB, 2nd order shelving<br>Hi-Mid: 550Hz - 13kHz, +15dB, Q = 1.5<br>Lo-Mid: :80Hz - 1.9kHz, +15dB, Q =1.5<br>LF: :80Hz, +15dB, 2nd order shelving</p><p>Индикация<br>Входные каналы: SinТрехцветный 4-сегментный индикатор<br>Выходные каналы:7 трехцветных 12-сегментных индикатора</p><p>Мощность<br>Питание (внутренний блок) 85V-270V переменного тока, 50/60Hz универсальный вход<br>Потребление: менее 150W</p><p>Условия эксплуатации<br>Температурный диапазон: -10^(o) C to +30^(o) C<br>Относительная влажность:0% to 80%</p><p>Спецификация вход / выход</p><p>Уровни<br>Микрофонный вход: +15dBu max<br>Линейный вход: +30dBu max<br>Стерео входы и возвраты инсертов: +20dBu max.<br>Все выходы: : : +20dBu max.<br>Номинальный рабочий уровень : :0dBu<br>Мощность выхода на наушники:2 x 250mW в 200 наушники</p><p>Вход и выход</p><p>Импеданс<br>Микрофонный вход :2k<br>Линейные входы и стерео возвраты:&gt;10k<br>Возврат инсерта входного канала:5k (с EQ, в худшем случае 1,8k)<br>Mix, Group, Aux, Matrix и директ-выходы:150<br>Посылы инсертов: 75<br>Рекомендуемый импеданс на наушники: :50-600</p><p>Размеры и вес</p><p>Высота</p><p>Для всех размеров :164мм</p><p>Ширина<br>16 каналов:653мм<br>24 канала: :856мм<br>32 канала:1059мм</p><p>Глубина</p><p>Для всех размеров:503мм</p><p>Вес<br>16 каналов :18.2кг<br>24 канала : :21.8кг<br>32 канала : :25.4кг</p>', 45900, '2014-08-28 12:05:44', 185, 'Soundcraft LX7ii-16 микшер 16 моно, 2 стерео (на поворотной ручке), 6 Aux, 4 подгруппы. TRS директ-выходы на каналах 1-8. 12-сегментная LED индикация. БП встроенный', 19482, NULL, 1884815, '\0', ''),
