  (20402, 'AKG Rhythm Pack', '<p><strong>AKG Rhythm Pack<br></strong></p><p>Тип набора : комплект микрофонов для ударных инструментов.<br>Спецификация : озвучивание акустических барабанов, духовых инструментов, гитарных и бас-гитарных усилителей.<br>Тип микрофонов : динамические микрофоны.<br>Диаграмма направленности микрофонов : кардиоидная направленность.<br>Защитные решетки микрофонов : сталь, черный цвет.<br>Состав комплекта микрофонов :<br>- Микрофон AKG D 112 : количество – 1 микрофон, спецификация - бас-бочка, басовый усилитель;<br>- Микрофон AKG C 430 : количество – 2 микрофона, спецификация - микрофонов для оверхэдов;<br>- Микрофон AKG D 40 : количество - 3 микрофона, спецификация – том \\ рабочий барабан, гитарные усилители;<br>- Поп-фильтры : два фильтра, черный цвет;<br>- Крепежные зажимы : зажимы H 440 - 3 шт., держатель микрофонов – 3 шт.;<br>- Жесткий транспортировочный кейс : 1 кейс.<br>Частотный диапазон микрофонов : от 75 Гц до 20,000 Гц.<br>Номинальная чувствительность : 4 мV/Па (- 48 dBV).<br>Максимальные показатели SPL при 1/3 проц. КНИ : 144 \\ 156 дБ SPL.<br>Эквивалентные уровни шумов а: 18 дБ – A.<br>Рабочий импеданс : &lt; 200 Ом.<br>Рекомендуемое производителем сопротивление нагрузки : &gt; 2,000 Ом.<br>Коммутационные разъемы : 3-пиновый XLR разьем на каждом микрофоне.<br>Цвет микрофонов : черный цвет.<br>Производитель : компания AKG, Австрия.<br><br></p>', 21750, '2014-08-28 13:06:27', 147, 'AKG Rhythm Pack студийный набор микрофонов для барабана: D112, 3x D40, 2x C430', 19485, NULL, 124, '\0', ''),
  (20403, 'Soundcraft LX7ii-32', '<p>Область применения<br>Для гастролирующих групп<br>Небольшие инсталляции<br>Малые концертные залы<br>Использование в храмах, церквях и театрах<br>Живая и студийная запись<br>Особенности<br>100 мм фейдеры<br>+48 В фантомное питание<br>16,24 и 32 входные линейки<br>Всего 40 входов (включая стерео линейки и возвраты)<br>Фильтр НЧ с крутизной среза 18 дБ на октаву<br>6 дополнительных посылов, 4 из них переключаемые<br>до или после фейдера<br>Разрывы на групповых и мастер секциях<br>12-и сегментный индикатор уровня<br>Встроенный блок питания<br>Микрофонные преампы новой разработки GB3 по технологиям серии МН3<br>Новая схематехника четырехполосных эквалайзеров по технологии серии МН3<br>Спецификация</p><p>Частотная характеристика</p><p>20Hz - 20kHz, +0 /-1dB</p><p>Коэффициент гармонических искажений</p><p>Mic sens. -30dBu, +20dBu at all outputs. : &lt;0.006% @ 1kHz</p><p>Уровень шума<br>Measured RMS, 22Hz to 22kHz Bandwidth<br>Mic Input E. I. N @ unity gain: : &lt;- 128dBu (150 source)<br>Mix Output, 40 inputs routed to mix : : &lt;-82dBu<br>Group Outputs: : &lt;-83dBu<br>Aux Outputs: : &lt;-80dBu<br>Matrix Outputs: : &lt;-89dBu &lt;-85dBu<br>Взаимное проникновение между каналами<br>Input Channel muting: &lt;-97dB<br>Input fader cutoff:&lt;-95dB<br>Input pan pot isolation: &lt;-77dB<br>Mix routing isolation: &lt;-97dB<br>Group routing isolation: &lt;-97dB<br>Adjacent channel isolation: &lt;-99dB<br>Group-Mix crosstalk: &lt;-89dB<br>Aux send off:&lt;-84dB<br>Matrix send off:&lt;-93dB<br>Typical CMRR at max gain @ 1kHz:80dB<br>Пропускной фильтр ВЧ (Моно вход)</p><p>100Hz, 18dB/octave</p><p>Эквалайзер (Моно вход)<br>HF:13kHz, +15dB, 2nd order shelving<br>Hi-Mid: 550Hz - 13kHz, +15dB, Q = 1.5<br>Lo-Mid: :80Hz - 1.9kHz, +15dB, Q =1.5<br>LF: :80Hz, +15dB, 2nd order shelving<br>Индикация<br>Входные каналы: SinТрехцветный 4-сегментный индикатор<br>Выходные каналы:7 трехцветных 12-сегментных индикатора<br>Мощность<br>Питание (внутренний блок) 85V-270V переменного тока, 50/60Hz универсальный вход<br>Потребление: менее 150W<br>Условия эксплуатации<br>Температурный диапазон: -10^(o) C to +30^(o) C<br>Относительная влажность:0% to 80%<br>Спецификация вход / выход</p><p>Уровни<br>Микрофонный вход: +15dBu max<br>Линейный вход: +30dBu max<br>Стерео входы и возвраты инсертов: +20dBu max.<br>Все выходы: : : +20dBu max.<br>Номинальный рабочий уровень : :0dBu<br>Мощность выхода на наушники:2 x 250mW в 200 наушники<br>Вход и выход</p><p>Импеданс<br>Микрофонный вход :2k<br>Линейные входы и стерео возвраты:&gt;10k<br>Возврат инсерта входного канала:5k (с EQ, в худшем случае 1,8k)<br>Mix, Group, Aux, Matrix и директ-выходы:150<br>Посылы инсертов: 75<br>Рекомендуемый импеданс на наушники: :50-600<br>Размеры и вес</p><p>Высота</p><p>Для всех размеров :164мм</p><p>Ширина</p><p>16 каналов:653мм<br>24 канала: :856мм<br>32 канала:1059мм<br>Глубина</p><p>Для всех размеров:503мм</p><p>Вес<br>16 каналов :18.2кг<br>24 канала : :21.8кг<br>32 канала : :25.4кг</p>', 73500, '2014-08-28 12:07:14', 185, 'Soundcraft LX7ii-32 микшер 32 моно, 2 стерео (на поворотной ручке), 6 Aux, 4 подгруппы. TRS директ-выходы на каналах 1-24. 12-сегментная LED индикация. БП встроенный', 19486, NULL, 1884815, '\0', ''),
  (20404, 'AKG C1000S', '<p>Благодаря гибкости своей работы, этот доступный по цене конденсаторный микрофон может быть использован на сцене и в студии. Где-то есть фантомное питание, где-то нет. В некоторых случаях требуется кардиоидная характеристика, в других - более узкая направленность, позволяющая уменьшить боковую чувствительность и возможность \"завязки\" микрофона. Конечно, во всех случаях пригодится способность работать с высоким уровнем звукового давления без искажений, высокая чувствительность и расширенный частотный диапазон. AKG C1000S предоставляет все эти возможности, и тысячи профессионалов звуковой индустрии не без оснований полагаются на этот микрофон. Входящий в комплект поставки преобразователь направленности РРС 1000 позволяет быстро изменять ее от кардиоидной до гиперкардиоидной. Питанием для С1000S может служить батарея 9 В или внешний источник. Выключатель позволяет избежать нежелательных шумов при установке включенного микрофона. Адаптер РВ 1000 создает подъем от 3 до 5 дБ в области от 5 кГц до 9 кГц. Прочная конструкция позволяет использовать AKG С1000S на гастролях, а чистое звучание и низкий уровень собственного шума делают его идеальным для работы в домашних- и project-студиях.</p><p>Спецификация<br><br></p><ul><li>Направленность: кардиоида, гиперкардиоида</li><li>Частотный диапазон: 50 Гц - 20 кГц</li><li>Чувствительность на 1 кГц: 6 мВ/Па (-44.4 дБВ)</li><li>Максимальный уровень звукового давления: при 0.5 % искажений, 137 дБ SPL</li><li>Эквивалентный уровень шума: 20 дБ-А</li><li>Соотношение сигнал/шум: 74 дБ-А</li><li>Импеданс: 200 Ом</li><li>Рекомендованная нагрузка: &gt; 2000 Ом</li><li>Питание: 9-52 В фантомное питание согласно норме DIN 45596 или с помощью батареи 9 В</li><li>Потребление тока: &lt; 2 мА</li><li>Разъём: 3–польный XLR</li><li>Внешний вид: серо-серебряный</li><li>Размеры: 34 (Ø) х 220 мм</li><li>Вес: 225 г</li><li>Прилагаемые аксессуары: РРС 1000, РВ 1000, W 1000, SA 43</li><li>Рекомендуемые аксессуары: PF 100, MK 9/10, B 18</li><li>Комплектация: держатель и колпачок ветрозащиты</li><li><br></li></ul>', 6520, '2014-08-28 13:06:55', 147, 'AKG C1000S электретный микрофон \'Швейцарский нож\', кардиоида/суперкардиоида, питание - фантом / 2x\"AA\" батареи. Цвет Черный.', 19487, NULL, 124, '\0', ''),
  (20405, 'Soundcraft Si Expression 2', '<p><strong>Soundcraft Si Expression 2</strong> представляет собой 24-канальный цифровой микшер, который использует новейшие DSP и компонентные технологии, чтобы предоставить вам невероятно мощную цифровую консоль, которая также экономически эффективна.<br>Expression 2 содержит 24 микрофонных предусилителей, 4 линейных входа, 4 стерео возврата внутреннего FX, AES и 64x64 слот расширения, чтобы использовать все 66 каналов обработки ввода. Каждый входной канал обработки выделен обработке для фильтра высоких частот, gate, входной задержки, четырех полосный эквалайзер и компрессор. Чтобы держать все это под контролем, есть комплексная система автоматизации с 4 mute группами и FaderGlow, чтобы осветить ваш путь.<br>14 AUX/групп, которые также могут быть сконфигурированы как 14 моно-миксов, или 8 моно и 6 стерео. Наряду с bus и матрицей микса, вы получаете еще 4 шины микса для внутренних процессоров Lexicon. Каждый bus имеет компрессор, 4-полосный эквалайзер, BSS графический эквалайзер и задержку, которые доступны все время.<br>Выходные соединения имеют 16 линейных выходов, выход для наушников, выход на монитор, AES выход и 64x64 слот. Четыре стерео Lexicon FX процессора основанных на популярной модели MX400. Процессоры предоставят вам тонны звуков, tap-tempo keys, и всё это вы можете настроить под собственные параметры. Все FX являются аппаратными поэтому использование этих эффектов не повлияет на другие виды обработки в любом случае, и все ваши динамики будут по-прежнему доступны.<br>Прямая стабилизация усиления, которая предохраняет усиление микрофона от воздействия прямого выравнивания. Безопасность блокировки позволяет заблокировать все консоли или даже выбранные элементы. Назначаемые уровни фейдера позволяют настраивать четыре слоя фейдера. С помощью функции копирования и вставки можно копировать целые каналы, группы, миксы, или Lexicon эффекты.<br>С One Touch Easy Mix, (Totem), вы можете с помощью одной клавиши смешать AUX, FX или bus матрицы.<br>FaderGlow освещает функции с четко различимыми цветами для FX, Stereo, связанных Mono, GEQ, POST Fade Aux, и PRE Fade Aux так что вы сможете легко определить их в темноте.</p><p><strong>Особенности Soundcraft Si Expression 2 Digital Live.</strong><br>Запатентованная система FaderGlow.<br>14 миксов / до 8 моно + 6 стерео посылов.<br>4 стерео матрицы.<br>LCR выходы.<br>4-полосный эквалайзер с параметрической серединой и разверткой фильтров высоких частот.<br>Динамика на каждом входе и выходе.<br>4 назначаемых точки вставки.<br>4 процессора Lexicon.<br>30 Band BSS графический эквалайзер на всех bus, матрицах и основных элементах.<br>User Profile Lockout-Идеально подходит для церквей, школ, студий и т.д.<br>Копирование, вставка и редактирование.<br>1 слот расширения для AES / EBU, МАДИ, Aviom или Cobranet I / O.<br>Off Line редактор.<br>VISI IPad Control Software</p><p><strong>Технические характеристики</strong>:<br>24 моно микрофонных входа.<br>4 line входа.<br>Цветной сенсорный экран.<br>66 каналов для микс возможностей.<br>AES вход/выход.<br>Графический эквалайзер на каждом bus.<br>20 подгрупп/aux bus.<br>4 FX bus.<br>8 матричных bus.<br>4 стерео Lexicon процессора эффектов.<br>Дилей на входах и выходах.<br>4 группы приглушения.<br>Моторизированные 16 х 100 мм фейдеры с FaderGlow.<br>Размеры: 716 х 520 х 168 мм.<br>Вес: 15.5 кг.</p>', 115300, '2014-08-28 12:08:28', 185, 'Soundcraft Si Expression 2 - цифровой микшер, 24 мик/лин XLR входа, 16 XLR выходов, 4 лин. TRS входа, AES вх/вых, 4 проц. эффектов, Word Clock, MIDI вх/вых, слот для карт расширения. 22 фэйдера в одном слое. HiQnet Ethernet порт. БП встроенный', 19488, NULL, 1884815, '\0', ''),
  (20406, 'AKG C411PP', '<p>Сверхлегкий вибрационный датчик AKG C411PP - конденсаторный преобразователь для инструментов. Весящий всего 18 грамм, этот сверхлегкий конденсаторный датчик идеален для акустической гитары, мандолины, скрипки и большинства других струнных инструментов. C411PP дает чистый и неокрашенный звук без изменения баланса инструментов. Установить C 411PP на бридж, рядом с бриджем или куда угодно на инструменте очень легко, благодаря не царапающему поверхность, многоразовому, не содержащему растворителя крепежу на «жидкой резине».<br><br>Эта версия – сверхлегкий вибрационный датчик C 411PP с разъемом XLR для использования с внешними системами фантомного питания посредством кабеля. Для универсального фантомного питания от 9 вольт до 52 вольт к вашим услугам 3-метровый, намертво прикрепленный соединительный кабель с адаптером фантомного питания и встроенным коннектором XLR.<br><br><strong>ОСНОВНЫЕ СВОЙСТВА МИКРОФОНА ДЛЯ СТРУННЫХ ИНСТРУМЕНТОВ AKG C411PP:</strong><br><br>• Надежный вибрационный датчик для снятия звука с инструментов на сцене<br>• Частотная характеристика, приспособленная для снятия звука акустической гитары, банджо, цитры и смычковых струнных инструментов<br>• Крепится на «жидкой резине», что позволяет устанавливать датчик прямо на инструменте<br>• Чехол для микрофона входит в комплект поставки<br><span style=\"line-height: 1.428571429;\">Страна-производитель:&nbsp;АВСТРИЯ</span><br></p><p><br></p>', 5185, '2014-08-28 13:07:30', 147, 'AKG C411PP микрофон для струнных инструментов, крепится к поверхности на \'жидкой резине\', XLR-разъём', 19490, NULL, 124, '\0', ''),
  (20407, 'Soundcraft Si Expression 3', '<p><strong>Soundcraft Si Expression 3</strong> представляет собой 32-канальный цифровой микшер, который использует новейшие DSP и компонентные технологии.</p><p>Мощный процессор DSP обеспечивает 4-полосный параметрический эквалайзер, задержки, гейты и компрессоры на каждом входе; параметрический и 30-полосный графический эквалайзер, компрессор и задержки на всех выходах, а также 4 устройства стереоэффектов Lexicon, которыми можно пользоваться одновременно.</p><p>Expression 3 содержит 32 микрофонных предусилителя, 4 линейных входа, 4 стерео возврата внутреннего FX, AES и 64x64 слот расширения, чтобы использовать все 66 каналов обработки ввода. Выходные соединения имеют 16 линейных выходов, выход для наушников, выход на монитор, AES выход и 64x64 слот. Для полного контроля предусмотрена комплексная система автоматизации с 4 mute группами и FaderGlow. 14 AUX/групп, которые также могут быть сконфигурированы как 14 моно-миксов, или 8 моно и 6 стерео. Наряду с bus и матрицей микса, вы получаете еще 4 шины микса для внутренних процессоров Lexicon.</p><p>Дистанционное управление Soundcraft ViSi Remote позволяет дистанционно управлять консолью с iPad.</p><p>FaderGlow — запатентованная технология, которая автоматически подсвечивает конкретные фейдеры в различные цвета в зависимости от их назначения, позволяя сосредоточиться на мишировании.</p><p>Прямая стабилизация усиления предохраняет усиление микрофона от воздействия прямого выравнивания. Безопасность блокировки позволяет заблокировать все консоли или даже выбранные элементы. Назначаемые уровни фейдера позволяют настраивать четыре слоя фейдера. С помощью функции копирования и вставки можно копировать целые каналы, группы, миксы, или Lexicon эффекты.</p><p>С One Touch Easy Mix, (Totem), вы можете с помощью одной клавиши смешать AUX, FX или bus матрицы.</p><p><strong>Функциональные особенности:</strong><br>32 фейдера<br>Свободно назначаемые фейдерные слои позволяют размещать входы и выходы в любом месте на любом слое, упрощая контроль над микшированием наиболее важных каналов<br>Запатентованная система FaderGlow<br>14 миксов / до 8 моно + 6 стерео посылов<br>4 стерео матрицы<br>LCR выходы<br>4-полосный эквалайзер с параметрической серединой и разверткой фильтров высоких частот<br>Динамика на каждом входе и выходе<br>4 назначаемых точки вставки<br>4 процессора Lexicon<br>Консоль можно расширить до 66 входов на микс, подключив любой коммутационный бокс Soundcraft, или путем подключения дополнительных входов через MADI или AES/EBU<br>30-полосный BSS графический эквалайзер на всех bus, матрицах и основных элементах<br>Возможность копирования, вставки и редактирования<br>1 слот расширения для AES / EBU, MADI, Aviom или Cobranet I / O<br>Off Line редактор<br>Дистанционное управление VISI IPad Control Software<br>Цветной сенсорный экран</p>', 148800, '2014-08-28 12:09:11', 185, 'Soundcraft Si Expression 3 цифровой микшер, 32 мик/лин XLR входа, 16 XLR выходов, 4 лин. TRS входа, AES вх/вых, 4 проц. эффектов, Word Clock, MIDI вх/вых, слот для карт расширения. 30 фэйдеров в одном слое. HiQnet Ethernet порт. БП встроенный', 19491, NULL, 1884815, '\0', ''),
  (20408, 'AKG C417PP', '<p>Петличный микрофон серии MicroMic - достойный вклад AKG в коллекцию миниатюрных недорогих \"петличек\". С 417 - самый крохотный из них, и его цена тоже самая низкая среди конкурентов. Он обладает круговой характеристикой направленности и широкой полосой рабочих частот. Звучание необычайно открытое и естественное, частотная характеристика по оси направленности - линейная, что идеально для одновременной работы с несколькими микрофонами.</p><p>Спецификация<br><br>Направленность: круговая<br>Частотный диапазон: 20 Гц - 20 кГц<br>Чувствительность: 10 мВ/Па, (-40 дБВ)&nbsp;<br>Максимальный уровень звукового давления: при 1/3 % искажений, 118/126 дБ SPL<br>Эквивалентный уровень шума: 32 дБ-А<br>Соотношение сигнал/шум: 60 дБ-А<br>Ослабление звукового сигнала:&nbsp;<br>Фильтр НЧ: -<br>Импеданс: 200 Ω<br>Питание: 9-52 В фантомное питание согласно норме DIN 45596 или с В 29 источником фантомного питания на батарейках<br>Потребление тока: Разъём: C 417 имеет 3-польный XLR, С 417 L - 3-польный мини XLR, С 417 B-lock: 1/8\" джек, С 417/WL 900 2-х польный специальный разъём<br>Длина кабеля: 3 м, модификация WL-1,5 м<br>Внешний вид: матово-чёрный или бежевый<br>Размеры: 7,5 (Ø) х 15 мм<br>Вес, чистый/с упаковкой: 8 г/220 г<br>Прилагаемые аксессуары: W 407, Н 40/1, Н 41<br>Рекомендуемые аксессуары: МРА II, для С 416 B-lock, B 29Комплектация<br><br>Система поставляется в разных конфигурациях, в т. ч. телесного цвета, со множеством соединительных переходников разной длины и формата. В комплекте с каждым С 417 пользователь получает два держателя-\"\"клипсы\"\" и колпачки ветрозащиты.</p><p>Подробное описание<br><br>Петличный микрофон с круговой направленностью. Области применения: на клипсе для лектора (свобода рук), театр, сценическое озвучивание. Частотный диапазон: 20 Гц - 20 кГц, чувствительность на 1 кГц: 10 мВ/Па,импеданс: 200 Ом, размеры: Ø, 7,5 х 15 мм, кабель 1,5 м,вес: 8 г, без кабеля. Аксессуары: ветрозащита, крепеж.</p><p><br></p>', 4600, '2014-08-28 13:08:10', 147, 'AKG C417PP петличный всенаправленный микрофон с адаптером фантомного питания в разъёме XLR. Цвет черный.', 19492, NULL, 124, '\0', ''),
  (20409, 'Soundcraft Si Performer 2', '<p>Новые консоли построены на базе линейки Si Compact и похожи на нее внешне. Но при этом новые модели обеспечивают почти в два раза большую мощность DSP и лучшую функциональность. Встроенный модуль ввода-вывода (I/O) не разочарует: модель Si Performer 2 имеет 24 микрофонных входа и восемь линейных, а Performer Si 3 - 32 микрофонных и восемь линейных входов плюс четыре возвратных FX-канала. Наличие двух слотов для опциональных плат расширения (CobraNet, AVIOM или AES) позволяет расширить количество микшерных входов до 80 для любой из консолей линейки.</p><p>Уникальная интеграция DMX512-порта предоставляет возможность управления светом. Первая версия ПО для консолей предусматривает четыре мастера сцены (A-D) с назначенными слейв-каналами, индивидуальные интенсивность цвета или параметры задаются на слейв-фейдерах с мастер-фейдером уровня, который сам по себе может быть назначен на любой из основных фейдер-слоев для одновременного доступа к уровням аудио и освещения. Для автоматизации процесса DMX-настройки могут быть сохранены вместе с аудионастройками в \"снимке\" системы, и при необходимости восстановлены автоматически одним нажатием кнопки или с помощью внешней MIDI-команды. Также из \"снимка\" можно выбрать лишь параметры аудио или освещения.</p><p>Si Performer - многофункциональная аудиоконсоль с полностью параметрическим 4-полосным эквалайзером на всех входных каналах (в стандартной комплектации) и графическим BSS-эквалайзером на всех выходных шинах. Вкупе с уже стандартными фильтрами, гейтами, а также компрессорами и задержками на всех входах и выходах, новинка эквивалентна стойке из более чем 220 процессоров.</p><p>Из 14 миксов можно сконфигурировать в различных комбинациях моно и стерео до 27 микс-шин. Эти шины дополняются четырьмя мартичными стерео-миксами, четырьмя выделенными FX-шинами, и тремя мастер-шинами, которые предоставляют LCR-режим.</p><p>Кроме того, пользователю доступно восемь групп VCA и восемь групп Mute. Каждый канал имеет экран, который отображает такие данные как название канала, назначения, АЧХ эквалайзера и DMX-данные, а также уровень сигнала. Коснолями Si Performer можно управлять удаленно при помощи iPad и приложения Soundcraft ViSi.</p><p><br><strong>Спецификация:</strong><br>24 микрофонных входа и восемь линейных.<br>микширование до 80 каналов.<br>четырех полосный параметрический эквалайзер на входные каналы и шины (с переключением bell / shelf на ВЧ и НЧ).<br>8 VCA групп.<br>8 Mute групп.<br>20 шин микс, плюс 4 процессора эффектов, 8 матриц и LCR.<br>возможность назначать поверхности - микширование входных и выходных каналов, DMX мастеры на любые поверхности.<br>режим LCR панорамирование.<br>возможность назначать инсерты.<br>цветная подсветка LCD дисплеев для конкретных каналов, графических эквалайзеров и идентификации шин / режимов.<br>протокол DMX512 с его функциональными возможностями.<br>DMX функции доступны с помощью набора ALT фейдерный банков и могут контролировать фейдерами до 30-ти DMX адресов.</p>', 310900, '2014-08-28 12:10:05', 185, 'Soundcraft Si Performer 2 цифровой микшер, 8 VCA групп, DMX выход, 24 мик/лин XLR входа, 16 XLR выходов, 8 лин. TRS входов, AES вх/вых, 4 проц. эффектов, Word Clock, MIDI вх/вых, 2 слота для карт расширения. 22 фэйдера в одном слое. HiQnet Ethernet порт. БП встроенный', 19493, NULL, 1884815, '\0', ''),
  (20410, 'AKG C430', '<p>AKG C430 – это высокопроизводительный конденсаторный микрофон, разработанный для подзвучивания тарелок и подвесной подзвучки. Частотная характеристика&nbsp;<strong>AKG C430</strong>&nbsp;обеспечивает уникальный четкий звук, который в большинстве случаев отбивает потребность в приобретении внешних эквалайзеров.<br><br>С учетом его компактных габаритов, микрофон можно с легкостью разместить в любых условиях без ущерба для качества звучания. При помощи прилагаемого в комплекте адаптера SA60, микрофон легко поддается монтажу на любые микрофонные стойки серийного производства.<br><br>Как видите, покупка AKG C430 – дело не только верное, но еще и выгодное. Благодаря ему Вы не только получите качественный звук, но и сможете избежать лишних трат на сопровождающее оборудование. Именно благодаря этому AKG C430 заслуживает, как минимум, самое пристальное внимание.<br></p><p><strong>Особенности AKG C430</strong></p><p>• Чрезвычайно компактные размеры – низкопрофильная конструкция для критических, оптически сложных ситуаций<br>• Кардиоидный конденсаторный капсюль, обеспечивающий детальный съем всех индивидуальных тембров<br>• Фирменный капсюль AKG, сделанный в Вене и обеспечивающий легендарное звучание<br>• Фантомное питание + питание от батарей<br>• Монтажный адаптер SA60 для безопасной установки на стойках любых типов<br></p><p><strong>Технические характеристики AKG C430</strong></p><p>-Диапазон частот: от 20 до 20000 Гц<br>-Чувствительность 7 мВ / Па<br>-Эквивалентный уровень шума: 33 дБ-А<br>-Сигнал-шум: 61 дБ-A<br>-Электрическое сопротивление: 200 Ом&nbsp;<br>-Рекомендуемое сопротивление нагрузки: 2000 Ом<br>-Напряжение: 9 до 52 В<br>-Ток: 2 мА<br>-Аудио выход: 3-контактный, сбалансированный XLR<br>-Цвет: матовый черный<br>-Длина микрофона: 79 мм<br>-Диаметр микрофона: 19 мм<br>-Вес: 23 г<br></p><p>Страна-производитель:&nbsp;АВСТРИЯ</p>', 6350, '2014-08-28 13:08:36', 147, 'AKG C430 микрофон \'Overhead Master\' компактный конденсаторный кардиоидный, 20-20000Гц, 7Мв/Па. Цвет черный.', 19495, NULL, 124, '\0', ''),
  (20411, 'AKG C451B', '<p>Капсюль новой версии установлен непосредственно на предусилитель, что предотвращает появление механических проблем при закреплении капсюля на корпус. Благодаря применению предельно легкой диафрагмы, новый C 451 B почти полностью нечувствителен к механическим шумам. Цельнометаллический корпус микрофона обеспечивает превосходную защиту от взаимодействия с электромагнитными полями, что придает корпусу особую прочность, которая позволяет достичь прекрасных результатов даже в самых тяжелых условиях.&nbsp;<br>С 451В очень точно передает все богатство звукового диапазона от таких сложных источников, как барабаны, тарелки и перкуссия. Прозрачность звука, устойчивость к перегрузкам и электрическим замыканиям делают микрофон С 451В достойным преемником оригинала, а инженерные разработки, примененные в данной модели, являются основанием для создания новой легенды.&nbsp;<br><br>Подробное описание<br><br>Основные характеристики:</p><ul><li>Акустические характеристики аналогичны модели СК1;</li><li>Прочная конструкция;</li><li>Осевая кардиоидная направленность;</li><li>Предельно точная передача сигнала;</li><li>Бестрансформаторная схемотехника, предотвращающая искажение на низких частотах;</li><li>Защита против статических зарядов и электромагнитных полей;</li><li>Переключатель чувствительности –10Дб и –20Дб;</li><li>Переключаемый фильтр ВЧ (12Дб/октаву, при 75 Гц или 150 Гц);</li><li>Фантомное питание 12В - 48В;</li><li>Комплектуется схемой частотных характеристик;</li><li>Комплектуется держателем SA 40 и ветрозащитой W 90.</li></ul>', 15500, '2014-08-28 13:08:59', 147, 'AKG C451B инструментальный конденсаторный микрофон класса \'Premium\' с малой мембраной . 20—20000Гц, 9мВ/Па. Кардиоида', 19496, NULL, 124, '\0', ''),
  (20412, 'Soundcraft Si Performer 3', '<p>Новые консоли построены на базе линейки Si Compact и похожи на нее внешне. Но при этом новые модели обеспечивают почти в два раза большую мощность DSP и лучшую функциональность. Встроенный модуль ввода-вывода (I/O) не разочарует: модель Si Performer 2 имеет 24 микрофонных входа и восемь линейных, а Performer Si 3 - 32 микрофонных и восемь линейных входов плюс четыре возвратных FX-канала. Наличие двух слотов для опциональных плат расширения (CobraNet, AVIOM или AES) позволяет расширить количество микшерных входов до 80 для любой из консолей линейки.</p><p>Уникальная интеграция DMX512-порта предоставляет возможность управления светом. Первая версия ПО для консолей предусматривает четыре мастера сцены (A-D) с назначенными слейв-каналами, индивидуальные интенсивность цвета или параметры задаются на слейв-фейдерах с мастер-фейдером уровня, который сам по себе может быть назначен на любой из основных фейдер-слоев для одновременного доступа к уровням аудио и освещения. Для автоматизации процесса DMX-настройки могут быть сохранены вместе с аудионастройками в \"снимке\" системы, и при необходимости восстановлены автоматически одним нажатием кнопки или с помощью внешней MIDI-команды. Также из \"снимка\" можно выбрать лишь параметры аудио или освещения.</p><p>Si Performer - многофункциональная аудиоконсоль с полностью параметрическим 4-полосным эквалайзером на всех входных каналах (в стандартной комплектации) и графическим BSS-эквалайзером на всех выходных шинах. Вкупе с уже стандартными фильтрами, гейтами, а также компрессорами и задержками на всех входах и выходах, новинка эквивалентна стойке из более чем 220 процессоров.</p><p>Из 14 миксов можно сконфигурировать в различных комбинациях моно и стерео до 27 микс-шин. Эти шины дополняются четырьмя мартичными стерео-миксами, четырьмя выделенными FX-шинами, и тремя мастер-шинами, которые предоставляют LCR-режим.</p><p>Кроме того, пользователю доступно восемь групп VCA и восемь групп Mute. Каждый канал имеет экран, который отображает такие данные как название канала, назначения, АЧХ эквалайзера и DMX-данные, а также уровень сигнала. Коснолями Si Performer можно управлять удаленно при помощи iPad и приложения Soundcraft ViSi.</p><p><br><strong>Особенности:</strong><br>32 микрофонных и восемь линейных входов плюс четыре возвратных FX-канала.<br>микширование до 80 каналов.<br>четырех полосный параметрический эквалайзер на входные каналы и шины (с переключением bell / shelf на ВЧ и НЧ).<br>8 VCA групп.<br>8 Mute групп.<br>20 шин микс, плюс 4 процессора эффектов, 8 матриц и LCR.<br>возможность назначать поверхности - микширование входных и выходных каналов, DMX мастеры на любые поверхности.<br>режим LCR панорамирование.<br>возможность назначать инсерты.<br>цветная подсветка LCD дисплеев для конкретных каналов, графических эквалайзеров и идентификации шин / режимов.<br>протокол DMX512 с его функциональными возможностями.<br>DMX функции доступны с помощью набора ALT фейдерный банков и могут контролировать фейдерами до 30-ти DMX адресов.</p>', 373900, '2014-08-28 12:10:42', 185, 'Soundcraft Si Performer 3 цифровой микшер, 8 VCA групп, DMX выход, 32 мик/лин XLR входа, 16 XLR выходов, 8 лин. TRS входов, AES вх/вых, 4 проц. эффектов, Word Clock, MIDI вх/вых, 2 слота для карт расширения. 30 фэйдеров в одном слое. HiQnet Ethernet порт. БП встроенный', 19498, NULL, 1884815, '\0', ''),
  (20413, 'Soundcraft Si Performer 3', '<p>Новые консоли построены на базе линейки Si Compact и похожи на нее внешне. Но при этом новые модели обеспечивают почти в два раза большую мощность DSP и лучшую функциональность. Встроенный модуль ввода-вывода (I/O) не разочарует: модель Si Performer 2 имеет 24 микрофонных входа и восемь линейных, а Performer Si 3 - 32 микрофонных и восемь линейных входов плюс четыре возвратных FX-канала. Наличие двух слотов для опциональных плат расширения (CobraNet, AVIOM или AES) позволяет расширить количество микшерных входов до 80 для любой из консолей линейки.</p><p>Уникальная интеграция DMX512-порта предоставляет возможность управления светом. Первая версия ПО для консолей предусматривает четыре мастера сцены (A-D) с назначенными слейв-каналами, индивидуальные интенсивность цвета или параметры задаются на слейв-фейдерах с мастер-фейдером уровня, который сам по себе может быть назначен на любой из основных фейдер-слоев для одновременного доступа к уровням аудио и освещения. Для автоматизации процесса DMX-настройки могут быть сохранены вместе с аудионастройками в \"снимке\" системы, и при необходимости восстановлены автоматически одним нажатием кнопки или с помощью внешней MIDI-команды. Также из \"снимка\" можно выбрать лишь параметры аудио или освещения.</p><p>Si Performer - многофункциональная аудиоконсоль с полностью параметрическим 4-полосным эквалайзером на всех входных каналах (в стандартной комплектации) и графическим BSS-эквалайзером на всех выходных шинах. Вкупе с уже стандартными фильтрами, гейтами, а также компрессорами и задержками на всех входах и выходах, новинка эквивалентна стойке из более чем 220 процессоров.</p><p>Из 14 миксов можно сконфигурировать в различных комбинациях моно и стерео до 27 микс-шин. Эти шины дополняются четырьмя мартичными стерео-миксами, четырьмя выделенными FX-шинами, и тремя мастер-шинами, которые предоставляют LCR-режим.</p><p>Кроме того, пользователю доступно восемь групп VCA и восемь групп Mute. Каждый канал имеет экран, который отображает такие данные как название канала, назначения, АЧХ эквалайзера и DMX-данные, а также уровень сигнала. Коснолями Si Performer можно управлять удаленно при помощи iPad и приложения Soundcraft ViSi.</p><p><br><strong>Особенности:</strong><br>32 микрофонных и восемь линейных входов плюс четыре возвратных FX-канала.<br>микширование до 80 каналов.<br>четырех полосный параметрический эквалайзер на входные каналы и шины (с переключением bell / shelf на ВЧ и НЧ).<br>8 VCA групп.<br>8 Mute групп.<br>20 шин микс, плюс 4 процессора эффектов, 8 матриц и LCR.<br>возможность назначать поверхности - микширование входных и выходных каналов, DMX мастеры на любые поверхности.<br>режим LCR панорамирование.<br>возможность назначать инсерты.<br>цветная подсветка LCD дисплеев для конкретных каналов, графических эквалайзеров и идентификации шин / режимов.<br>протокол DMX512 с его функциональными возможностями.<br>DMX функции доступны с помощью набора ALT фейдерный банков и могут контролировать фейдерами до 30-ти DMX адресов.</p>', 373900, '2014-08-27 12:45:24', 185, 'Soundcraft Si Performer 3 цифровой микшер, 8 VCA групп, DMX выход, 32 мик/лин XLR входа, 16 XLR выходов, 8 лин. TRS входов, AES вх/вых, 4 проц. эффектов, Word Clock, MIDI вх/вых, 2 слота для карт расширения. 30 фэйдеров в одном слое. HiQnet Ethernet порт. БП встроенный', 19498, NULL, 1884815, '\0', '\0'),
  (20414, 'AKG C5', '<p>AKG C5 - конденсаторный вокальный микрофон для сценического использования. Кардиоидная направленность микрофона, оптимизированная для работы с системами персонального мониторинга, позволяет работать с максимальной чувствительностью без обратной связи. Позолоченное покрытие корпуса капсюля надежно защищает его от влаги и коррозии, что гарантирует надежную и качественную работу микрофона. Контакты разъема XLR имеют также золотое покрытие 24 карата. Прочная защитная сетка из пружинной стали и виброзащита для повышенной надежности&nbsp;<br><strong>Технические характеристики</strong><br><br>Направленность: кардиоидная<br>Частотный диапазон: 65 Гц- 20 кГц<br>Чувствительность: 4 мВ/Па<br>Максимальный уровень звукового давления: 140/145 дБ (при нелинейных искажениях 1%/3%)<br>Соотношение сигнал/шум: 69 дБ<br>Сопротивление: 200 Ом<br>Рекомендованное сопротивление нагрузки: &gt; 2000 Ом<br>Потребляемый ток: 4.3 мА<br>Напряжение питания: 9 – 52 В<br>Разъем: 3-контактный XLR<br>Отделка: матовый темно-синий<br>Вес: 345 г<br></p>', 6700, '2014-08-28 13:09:28', 147, 'AKG C5 конденсаторный кардиоидный вокальный микрофон, 65-20000Гц, 4мВ/Па', 19497, NULL, 124, '\0', ''),
  (20415, 'AKG C518M', '<p>Миниатюрный кардиоидный микрофон для барабанов и перкуссии. Кардиоидная направленность снижает чувствительность микрофона к звукам соседних инструментов. Струбцина с длинным ходом позволяет фиксировать микрофон на ободе любых барабанов и перкуссии. Виброизоляция капсюля гарантирует отсутствие механических шумов. Шарнирное крепление с фиксатором позволяет зафиксировать держатель капсюля под любым нужным углом. Модель C518M оснащена отключаемым фильтром НЧ, что расширяет сферу применения микрофона.&nbsp;<br>Уникальный адаптер A400 позволяет укрепить микрофон непосредственно на передатчиках серий WMS.<br><br>- Миниатюрный микрофон на струбцине с виброзащищенным капсюлем&nbsp;<br>- Идеально подходит для барабанов и перкуссии&nbsp;<br>- Специальный адаптер для крепления на передатчики серии WMS&nbsp;<br>- Отсоединяющийся микрофонный кабель&nbsp;<br>- Длинный ход струбцины&nbsp;<br><br>Спецификация:</p><ul><li>Направленность: кардиоидная</li><li>Частотный диапазон: 60 Гц – 20 кГц</li><li>Чувствительность 5 мВ/Па</li><li>Максимальный уровень звукового давления: 130/132 дБ (при коэффициенте нелинейных искажений 1/3 %).</li><li>Уровень собственных шумов: 31 дБ</li><li>Соотношение сигнал/шум: 63 дБ</li><li>Сопротивление: &lt; 200 Ом</li><li>Рекомендованное сопротивление нагрузки: &gt;2000 Ом</li><li>Потребляемый ток: &lt; 2 мА.</li><li>Разъем: 3-котактный мини- XLR</li><li>Шнур: 1.5 м.</li><li>Внешний вид: черный матовый</li><li>Размеры: длина - 200 мм (без струбцины), максимальная ширина – 47 мм.</li><li>Вес: 220 г (микрофон со шнуром)</li><li>Вес с упаковкой: 450 г.</li></ul>', 7950, '2014-08-28 13:09:49', 147, 'AKG C518M микрофон для барабанов с креплением на обод, кардиоидный, XLR-разъём с адаптером фантомного питания.', 19499, NULL, 124, '\0', ''),
  (20416, 'AKG C519M', '<p><span style=\"line-height: 1.428571429;\">AKG C519M имеет следующие особенности:</span><br></p><ul><li>миниатюрный гибкий держатель gooseneck для точной регулировки положения микрофона.</li><li>в комплект входит специальный адаптер для работы с карманными передатчиками AKG.</li><li>отсоединяющийся микрофонный кабель.</li><li>гибкий подвес микрофона для надежной защиты от шумов.</li></ul><p>Микрофон C519 укрепляется на раструбе тромбона, саксофона, трубы или любого другого духового инструмента (например, диджериду). Кардиоидная направленность микрофона позволяет использовать его рядом с мониторами без опасности «завязки», а благодаря линейной АЧХ он очень точно и чисто передает звучание любого инструмента. Наконец, микрофон C519 дает свободу передвижения музыкантам духовой секции.</p><p>Микрофон C519 М снабжен встроенным отключаемым фильтром НЧ, который помогает подобрать наиболее подходящую инструменту АЧХ. Специальный адаптер A 400 позволяет соединить микрофон с карманным передатчиком одной из радиосистем AKG.</p><p>Питание производится от внешнего стандартного источника фантомного питания.</p><p>Технические характеристики</p><ul><li>Направленность: кардиоидная</li><li>Частотный диапазон: 60 Гц – 20 кГц</li><li>Чувствительность 5 мВ/Па</li><li>Максимальный уровень звукового давления: 130/132 дБ (при коэффициенте нелинейных искажений 1/3 %)</li><li>Уровень собственных шумов: 31 дБ</li><li>Соотношение сигнал/шум: 63 дБ</li><li>Сопротивление: &lt; 200 Ом</li><li>Рекомендованное сопротивление нагрузки: &gt;2000 Ом</li><li>Потребляемый ток: &lt; 2 мА</li><li>Источник фантомного питания: блок питания B 29 L; адаптер MPA V L или передатчики серии AKG WMS.</li><li>Разъем: 3-котактный мини- XLR</li><li>Шнур: 1.5 м</li><li>Внешний вид: черный матовый</li><li>Размеры: длина - 213 мм (без прищепки), максимальная ширина – 47 мм</li><li>Вес: C519M – 195г; C519ML – 85 г (микрофон и шнур)</li><li>Вес с упаковкой: C519M – 430г; C519ML – 310 г</li></ul><p>Стандартные аксессуары:</p><ul><li>Адаптер A400 для присоединения к передатчику AKG PT 40 или PT 400</li><li>Футляр для микрофона</li><li>W44 – ветрозащита</li><li><br></li></ul>', 7730, '2014-08-28 13:10:17', 147, 'AKG C519M микрофон для духовых инструментов на \'прищепке\', разъем XLR с адаптером фантомного питания.', 19500, NULL, 124, '\0', ''),
  (20417, 'AKG C520', '<p>Вокальный конденсаторный микрофон для радиосистем с регулируемым оголовьем с L-разъемом. Идеальный выбор для солистов, поющих клавишников, барабанщиков, гитаристов и танцоров, которым нужна свобода движений.</p><p>Функциональные особенности</p><p>Высококачественная регулируемая головная гарнитура с конденсаторным микрофоном для точной передачи вокала&nbsp;<br>Максимально широкий динамический диапазон&nbsp;<br>Кардиоидная направленность – эффективная защита от посторонних шумов<br>Гибкое крепление позволяет точно подобрать положение микрофона относительно рта исполнителя<br>Держатель микрофона может быть укреплен на оголовье слева или справа по желанию Гибкий подвес значительно снижает уровень механических шумов<br>Эффективная защита от влаги обеспечивает надежную работу микрофона и продолжительный срок службы<br>C520 L работает с источником фантомного питания B 29 L, с передатчиками серий AKG WMS или адаптером MPA V L для внешнего источника фантомного питания</p><p>Спецификация</p><p><br></p><p><br></p><ul><li>Направленность: кардиоида</li><li>Частотный диапазон: 60 Гц – 20 кГц</li><li>Чувствительность: 5 мВ/Па (-46 дБ/В)</li><li>Максимальный уровень звукового давления: 130 дБ/132 дБ при нелинейных искажениях 1%/3% .</li><li>Эквивалентный уровень шума: 32 дБ – А</li><li>Соотношение сигнал/шум: 63 дБ</li><li>Сопротивление: 200 Ом</li><li>Рекомендованное сопротивление нагрузки: 2 кОм</li><li>Питание: 9 – 52 В</li><li>Источники фантомного питания: DIN 45596, питание от батарей через B 29 L или от передатчика</li><li>Разъем: 3-польный мини XLR</li><li>Кабель: 1.5 м.</li><li>Внешний вид: черный матовый</li><li>Размеры: длина – 195 мм . (только микрофон); максимальный диаметр – 134 мм</li><li>Вес: 26 г</li><li><br></li></ul>', 6880, '2014-08-28 13:10:41', 147, 'AKG C520 вокальный микрофон с оголовьем, с адаптером фантомного питания в разъёме XLR, 5 мВ/Па. Цвет черный.', 19501, NULL, 124, '\0', ''),
  (20418, 'AKG C535EB', '<p>Этот микрофон обладает ясным, открытым звучанием лучших студийных конденсаторных микрофонов AKG. Диапазон от 7 до 12 кГц \"приподнят\" на 2 дБ для выделения вокала в миксе. Встроенный переключатель позволяет корректировать выходной уровень и параметры среза по НЧ для разных исполнителей (-14 дБ, Bass-Roll-off, Bass-Cut). Bass-Cut, имеющий более крутой срез, подавляет механический шум, более пологий срез Bass-Roll-off придаёт звуку очень приятное звучание при озвучивании музыкальных инструментов. С 535 ЕВ требуется фантомное питание 9-52 В.</p><p>Спецификация<br><br>Направленность: кардиоидная<br>Частотный диапазон: 20 Гц - 20 кГц<br>Чувствительность: 7 мВ/Па, (-63 дБВ)&nbsp;<br>Максимальный уровень звукового давления: при 1 % искажений, 130 дБ SPL<br>Эквивалентный уровень шума: 32,4 дБ-А<br>Соотношение сигнал/шум: 21 дБ-А<br>Ослабление звукового сигнала: -14 дБ<br>Фильтр НЧ: 12 дБ/октаву при 100 Гц<br>Импеданс: 200 Ом<br>Питание: 9-52 В фантомное питание согласно норме DIN 45596<br>Потребление тока: &lt;1 мА<br>Разъём: 3-польный XLR<br>Внешний вид: матово-чёрный<br>Размеры: 46 (Ø) х 184 мм<br>Вес: 245 г</p>', 11150, '2014-08-28 13:11:07', 147, 'AKG C535EB классический микрофон для озвучивания вокала и инструментов на сцене и записи в студии. Кардиоида. 7мВ/Па', 19502, NULL, 124, '\0', ''),
  (20419, 'AKG C568B', '<p>С 568 ЕВ Микрофон типа \"пушка\"<br>Узкая, точная направленность и широкий частотный диапазон - идеальные качества для микрофона, применяемого с системами звукоусиления, в театре и кинопроизводстве. За счет малого веса и компактности, С 568 ЕВ идеально подходит для установки прямо на съемочную камеру. С 568 ЕВ работает по принципам преобразования градиента давления и интерференции. Ниже 500 Гц он функционирует как гиперкардиоидный конденсаторный микрофон, выше этой частоты благодаря акустической интерференционной трубке направленность микрофона расширяется. Подключаемый фильтр низких частот эффективно подавляет грохот и задувы с добротностью 12 дБ/октаву на частоте 150 Гц. В прочном цельнометаллическом корпусе помещается встроенный предусилитель. Требуется источник фантомного питания 9-52 В.</p><p>Спецификация<br><br>Направленность: гипекардиоида / лепесток остро направленный<br>Частотный диапазон: 20 Гц - 20 кГц<br>Чувствительность: 11 мВ/Па, (-39 дБВ)&nbsp;<br>Максимальный уровень звукового давления: при 0,5 % искажений, 128 дБ SPL<br>Эквивалентный уровень шума: 20 дБ-А<br>Соотношение сигнал/шум: 76 дБ-А<br>Ослабление звукового сигнала:&nbsp;<br>Фильтр НЧ: 12 дБ/октаву при 120 Гц<br>Импеданс: 600 Ω<br>Рекомендованная нагрузка: &gt;2000 Ω<br>Питание: 9-52 В фантомное питание согласно норме DIN 45596<br>Потребление тока: &lt;2мА<br>Разъём: 3 –польный XLR<br>Внешний вид: матово-чёрный<br>Размеры: 20 (Ø) х255 мм<br>Вес, чистый/с упаковкой: 160 г/715 г</p>', 16150, '2014-08-28 13:11:35', 147, 'AKG C568B конденсаторный микрофон \"компактная пушка\", гиперкардиоида, 20—20000Гц, 11мВ/Па. В комплекте: SA60 + W98', 19503, NULL, 124, '\0', ''),
  (20420, 'Soundcraft CSB-C5', '<p><strong>Общие параметры</strong><br>Тип коммутационный рэк (4U).<br>Микрофонные/линейные входы 32 мик/лин входа<br>Линейные выходы 16<br>Встроенные БП 2<br>Интерфейс Два Cat5 MADI для связи с микшером Vi, Si серии.<br></p>', 175000, '2014-08-28 12:18:31', 185, 'Soundcraft CSB-C5 коммутационный рэк (4U). 32 мик/лин входа, 16 лин. выходов. 2 встроенных БП. Два Cat5 MADI интерфейса связи с микшером Vi, Si серии', 19504, NULL, 1884815, '\0', ''),
  (20421, 'Soundcraft CSB+AES-C5', '<p>Комутационный рэк Soundcraft Compact Stage Box AES-C5.</p><p>Compact Stagebox предлагает множество входов и выходов в 4U стойко-места. Модульная единица полностью конфигурируемая, но предлагается со стандартной конфигурацией на 32 входа, 8 выходов, 8 каналов AES/EBU и 2 разьема для стандарта Studer D21m карты ввода/вывода. D21m - архитектура ввода/вывода для Studer так же как Soundcraft цифровые системы смешивания и делает возможным связь с большинством популярных цифровых форматов, включая CobraNet®, AVIOM A-Net®16, Ethersound, ADAT и RockNet. MADI, делающий запись интерфейса, может также быть приспособлен к щелям расширения.</p><p>Возможно оборудовать Compact Stagebox модулем на 16 XLR канала вместо модуля выходов, обеспечивая 48 входов. В этом случае аналоговый или AES выходы могли быть полученными на соединителях D-типа через карты D21m, приспособленные к слотам расширения.</p><p>Так же как карта D21m, Compact Stagebox использует те же самые модули ввода/вывода как в пульте Soundcraft Vi1, и в результате возможно переместить или разделить модули между пультом и stagebox. Например, 8 линий out/AES от Stagebox могли быть приспособлены к пульту Vi1 вместо 16 канальной карты выходов. Альтернативно, входные модули могут быть заменены модулями выхода, если требуется большие количества выходов.</p><p>Спецификация Soundcraft COMPACT STAGEBOX:<br>Compact Stagebox связан с пультом , используя или Cat-5 или Optical-fibre MADI. Версия Cat5: E947.350000 Оптическая версия: E947351000.<br>К Compact Stagebox прилагается два электропитания, термостатически управляемый вентилятор охлаждения и светодиодные датчики для контроля. 8 канальный интерфейс GPIO.<br>Compact Stagebox идеальный вариант для владельцев пультов Vi Серии как способ расширения входной способности, расширяясь до 96 аналоговых входов от отдаленного stageboxes, или как помощник для Vi1 и Si пультов, обеспечивающих хорошую отдаленную способность ввода/вывода в соединении с дополнительными интерфейсными платами MADI, доступными для пультов.</p><p>Характеристики:<br>Коммутационный рэк (4U).<br>32 мик/лин входа.<br>8 лин. выходов.<br>4 пары AES выходов.<br>2 встроенных БП.<br>Два Cat5 MADI интерфейса связи с микшером Vi, Si серии.</p>', 175000, '2014-08-28 12:19:03', 185, 'Soundcraft CSB+AES-C5 коммутационный рэк (4U). 32 мик/лин входа, 8 лин. выходов, 4 пары AES выходов. 2 встроенных БП. Два Cat5 MADI интерфейса связи с микшером Vi, Si серии', 19505, NULL, 1884815, '\0', ''),
  (20422, 'AKG C577WR', '<ul><li><strong>AKG C577WR</strong><br></li><li>Направленность: круговая;</li><li>Частотный диапазон: 20 Гц - 20 кГц;</li><li>Чувствительность: 8 мВ/Па, (-42 дБВ);</li><li>Максимальный уровень звукового давления: при 3 % искажений, 133 дБ SPL;</li><li>Соотношение сигнал/шум: &gt;68 дБ-А;</li><li>Импеданс: &lt;400 br=\"\"&gt;Рекомендованная нагрузка: &gt;2000 Ω;</li><li>Питание: 9-52 В фантомное питание согласно норме DIN 45596;</li><li>Потребление тока: &lt;0,6 br=\"\"&gt;Разъём: 3-польный XLR;</li><li>Длина кабеля: 3 м;</li><li>Внешний вид: матово-черный;</li><li>Размеры: 5,5 (Ø) х 14 мм;</li><li>Вес, чистый/с упаковкой: 0,4 г/146 г;</li></ul>', 12450, '2014-08-28 13:12:04', 147, 'AKG C577WR  петличный микрофон, XLR-разъём, цвет черный', 19506, NULL, 124, '\0', ''),
  (20423, 'AKG P170', '<p><br></p><table cellpadding=\"0\" cellspacing=\"0\" style=\"width:287px\"><tbody><tr><td><p>Тип</p></td><td><p>конденсаторный</p></td></tr><tr><td><p>Вид</p></td><td><p>инструментальный</p></td></tr><tr><td><p>Материал корпуса</p></td><td><p>металл</p></td></tr><tr><td><p>Направленность</p></td><td><p>кардиоидная</p></td></tr><tr><td><p>Нижняя граница част. диапазона &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p></td><td><p>20 Гц</p></td></tr><tr><td><p>Верхняя граница част. диапазона</p></td><td><p>20 000 Гц</p></td></tr><tr><td><p>Соотношение сигнал/шум</p></td><td><p>73 дБ</p></td></tr><tr><td><p>Чувствительность</p></td><td><p>12 мВ/Па</p></td></tr><tr><td><p>Импеданс</p></td><td><p>200 Ом</p></td></tr><tr><td><p>Подключение</p></td><td><p>3-pin XLR</p></td></tr><tr><td><p>Питание</p></td><td><p>44 - 52 V</p></td></tr><tr><td><p>Длина</p></td><td><p>160 мм</p></td></tr><tr><td><p>Вес</p></td><td><p>130 г</p></td></tr></tbody></table>', 3950, '2014-08-28 13:12:34', 147, 'AKG P170  конденсаторный кардиоидный микрофон с мембраной 1/2\", 20-20000Гц, 12мВ/Па, SPL135/155дБ', 19507, NULL, 124, '\0', ''),
  (20424, 'JBL EON305', '<p>Основные параметры<br>Тип концертная, пассивная, фазоинверторного типа<br>Акустическое излучение монополярная<br>Состав комплекта 1 громкоговоритель</p><p>Характеристики<br>Количество полос 2<br>Мощность 250 Вт<br>Максимальная мощность 1000 Вт<br>Диапазон воспроизводимых частот 38-20000 Гц (-10 дБ)</p><p>Подключение<br>Разъем для подключения к усилителю мощности Speakon</p><p>Излучатели<br>Тип излучателей динамические<br>ВЧ-излучатель 25.4 мм, рупор<br>НЧ-излучатель 380 мм</p><p>Дополнительно<br>Размеры (ШхВхГ) 438x685x366 мм<br>Вес 15 кг<br>Дополнительная информация комбо-разъем Speakon/jack 6.3, возможность параллельного подключения акустики; диапазон воспроизводимых частот 50-18000 Гц (±3 дБ)</p>', 14100, '2014-08-28 11:04:30', 211, 'JBL EON305 - пассивная 2-полосная акустическая система. НЧ - 15\" , ВЧ -1\" неодимовый компрессионный драйвер, Мощность - 250Вт, 8Ом, 38— 20кГц, 5 x M10 точек подвеса, удобные ручки для транспортировки, ударопрочный полимерный корпус, 15кг', 19508, NULL, 1884815, '\0', ''),
  (20425, 'JBL EON315', '<p>Основные параметры<br>Тип концертная, активная, фазоинверторного типа<br>Акустическое излучение монополярная<br>Состав комплекта 1 громкоговоритель</p><p>Характеристики<br>Количество полос 2<br>Мощность 280 Вт<br>Максимальная мощность 560 Вт<br>Диапазон воспроизводимых частот 50-18000 Гц (+/— 3дБ)<br>Частота кроссовера 1.8 кГц</p><p>Усилитель<br>Раздельное усиление НЧ и ВЧ (Bi-amping) есть<br>Интерфейсы линейный вход, балансный вход, линейный выход</p><p>Подключение<br>Разъем для подключения к усилителю мощности jack 6.3 мм</p><p>Излучатели<br>Тип излучателей динамические<br>ВЧ-излучатель 25.4 мм, полимер<br>НЧ-излучатель 380 мм</p><p>Конструкция<br>Материал корпуса пластик</p><p>Дополнительно<br>Защита от перегрузки есть<br>Размеры (ШхВхГ) 438x685x366 мм<br>Вес 15.9 кг<br>Дополнительная информация возможность установки на стойку или подвес, совмещённый разъём — балансный XLR/джек 6.3мм, эквалайзер: НЧ +3 дБ @ 150 Hz, ВЧ +2.5 дБ @ 4 kHz, отключаемый фильтр — обрез частот ниже 120 Гц для использования с сабвуфером</p>', 17190, '2014-08-28 11:09:08', 211, 'JBL EON315 активная 2-полосная акустическая система. НЧ - 15\" 220Вт, ВЧ - 1\" неодимовый компрессионный драйвер 60Вт , 5 x M10 точек подвеса, ударопрочный полимерный корпус 15.9кг', 19510, NULL, 1884815, '\0', ''),
  (20426, 'AKG CGN321STS', '<p>AKG CGN321STS настольный 30см. конденсаторный кардиоидный микрофон типа Gooseneck на металлической подставке с программируемым переключателем. Позолоченные контакты разъема XLR. Цвет чёрный.</p><ul><li>Настольный конденсаторный микрофон на подставке с кнопкой, длина 30 см, функция кнопки программируется.</li><li>Этот профессиональный микрофон разработан специально для неопытных ораторов, которые говорят в микрофон с самых разных углов.</li><li>Микрофон оснащен исключительно прочным выключателем, способный выдерживать более 25000 циклов переключения.</li></ul><p><br><strong>Основные особенности:</strong>&nbsp;<br><br></p><ul><li>30 см микрофон гусиная шея.</li><li>Выключатель с программируемыми функциями.</li><li>Индикация светодиодов показывает режим работы микрофона.</li><li>Тяжелая металлическая подставка.</li><li>Позолоченные разъемы.</li></ul><p><br><strong>Технические характеристики:</strong>&nbsp;<br><br></p><ul><li>Тип: Конденсаторный.</li><li>Направленность: кардиоидная.</li><li>Частотный диапазон: 70 Гц - 18 кГц.</li><li>Max. SPL: 125 dB.</li><li>Сопротивление: 600 Ом.</li><li>Встроенный 3-pin XLR.</li><li>Длина: 300 мм.</li></ul>', 8550, '2014-08-28 13:13:14', 147, 'AKG CGN321STS  настольный 30см. конденсаторный кардиоидный микрофон типа Gooseneck на металлической подставке с программируемым переключателем. Позолоченные контакты разъема XLR. Цвет чёрный.', 19511, NULL, 124, '\0', ''),
  (20427, 'AKG CGN521STS', '<p>AKG CGN521STS настольный 50см. конденсаторный кардиоидный микрофон типа Gooseneck на металлической подставке с программируемым переключателем. Позолоченные контакты разъема XLR. Цвет чёрный.</p><ul><li>Настольный конденсаторный микрофон на подставке с кнопкой, длина 50 см, функция кнопки программируется.</li><li>Этот профессиональный микрофон разработан специально для неопытных ораторов, которые говорят в микрофон с самых разных углов.</li><li>Микрофон оснащен исключительно прочным выключателем, способный выдерживать более 25000 циклов переключения.</li></ul><p><br><strong>Основные особенности:</strong>&nbsp;<br><br></p><ul><li>50 см микрофон гусиная шея.</li><li>Выключатель с программируемыми функциями.</li><li>Индикация светодиодов показывает режим работы микрофона.</li><li>Тяжелая металлическая подставка.</li><li>Позолоченные разъемы.</li></ul><p><br><strong>Технические характеристики:</strong>&nbsp;<br><br></p><ul><li>Тип: Конденсаторный.</li><li>Направленность: кардиоидная.</li><li>Частотный диапазон: 70 Гц - 18 кГц.</li><li>Max. SPL: 125 dB.</li><li>Сопротивление: 600 Ом.</li><li>Вес: 960 г.</li><li>Встроенный 3-pin XLR.</li><li>Длина: 500 мм.</li></ul>', 9150, '2014-08-27 13:20:40', 147, 'AKG CGN521STS настольный 50см. конденсаторный кардиоидный микрофон типа Gooseneck на металлической подставке с программируемым переключателем. Позолоченные контакты разъема XLR. Цвет чёрный.', 19512, NULL, 124, '\0', '\0'),
  (20428, 'JBL EON615', '<p>EON 615 – новая серия колонок от JBL – очередной рывок технологий, еще один шаг к лучшему звуку.</p><p>Без компромиссов!<br>Без исключений!<br>Где угодно и как угодно!</p><p>Инженеры JBL переосмыслили вопрос создания акустических систем и отлично выполнили свою задачу – колонки серии JBL EON 615, как всегда доступны, автономны и портативны. А еще сконструированы и применены:<br>- новый волновод;<br>- новый динамический громкоговоритель (динамик);<br>- DSP EQ, дистанционно управляемый по Bluetooth-каналу.</p><p>Полный рестайлинг серии JBL EON это синтез многолетнего опыта и новейших технологических тенденций - форма и материал акустического кабинета (корпуса колонки), технологичный дизайн динамика и простота в использовании, которые обеспечивают выход на новый качественный уровень.<br>JBL позиционирует новую серию, как простые в использовании портативные акустические системы с качеством звука, соответствующим уровню студийных мониторов, идеально подходящие для повседневных нужд прокатчиков и активно выступающих музыкантов.</p><p>Ключевые преимущества JBL EON615</p><p>Продуманный дизайн<br>Методики компрессионного литья и механической формовки корпуса позволила оптимизировать конструкцию для создания идеального внутреннего резонанса, что, в свою очередь, создает эффект большего объема акустического кабинета при том, что в сравнении со старыми моделями реальные габариты колонки остались почти неизменными.<br>Новое расположение ручек делает удобной переноску. Да, кстати, их теперь 4!<br>В корпус интегрированы элементы жесткого крепежа для точной посадки или подвеса колонок. Улучшенные ножки делают удобным как хранение и транспортировку, так и установку колонной, в положении сценического монитора и прочих конфигурациях.</p><p>Новый волновод<br>Высочайшее качество звука колонок серии EON600 – результат кардинального изменения формы волновода динамика. Инженеры JBL тестировали характеристики высоких и низких частот, излучаемых динамическими громкоговорителями с 36 точек, а на основании результатов разработали уникальные волноводы с динамической кривизной для обоих звуковых компонентов.<br>Специфически гофрированная форма диффузора не только воспроизводит более полный спектр частот, но и позволяет звуковой волне раскрываться по панораме на 90°, обеспечивая мягкость, чистоту и качество во всей зоне покрытия.</p><p>Система BLUETOOTH-управления JBL EON 615<br>Нужна точная настройка, а к колонке не добраться?<br>Инженеры JBL разработали BLUETOOTH 4.0-совместимый интерфейс, работающий на устройствах под управлением iOS и Android.<br>Значительно упростилась настройка громкости, появилась возможность настройки программного 5-полосного параметрического эквалайзера, сохранение и загрузка созданных именно вами пресетов.<br>Правда неплохо? А раньше пришлось бы лезть к колонке!</p><p>Спецификации JBL EON615<br>2-полосная акустическая bass-reflex система<br>НЧ динамик 15 дюймов.<br>Встроенный усилитель 1000Вт (2 x 500Вт) класс D<br>Звуковое давление (макс.) 127 дБ.<br>Частотный диапазон: 50,8 Гц - 20 кГц.<br>Покрытие: 90 ° х 50 °.<br>Интерфейс для Android и iOS.<br>Регуляция громкости, настройка эквалайзера через Bluetooth Smart Ready 4.0.<br>Сохранение и вызов пресетов.<br>Сигнальный процессор 32 бит.<br>Габариты: 708,025 х 428,625. х 368,3 мм.<br>Вес: 17, 69 кг.</p>', 25000, '2014-08-27 13:21:41', 211, 'JBL EON615 активная 2-полосная акустическая система. 1000Вт (2х500Вт усилитель класса D), макс SPL 129дБ,  возможность управлением через Bluetooth, 18кг	\r\n', 19513, NULL, 1884815, '\0', '\0'),
  (20429, 'AKG CGN99 C/L', '<p>Кардиоидная характеристика направленности&nbsp;<br>Длина «гусиной шеи» 30 см&nbsp;<br>Угол приема звукового сигнала 125°&nbsp;<br>Легко подсоединяется благодаря разъему XLR&nbsp;<br><br>Кардиоидная характеристика направленности особенно популярна благодаря своей универсальности. Угол приема звукового сигнала 125° подойдет для неопытных или слишком активных ораторов, часто забывающих говорить прямо в микрофон. Длина держателя и гибкая секция обеспечивают удобство в любой ситуации. Возможны различные варианты установки, например крепление на кафедре или на столе, в набор аксессуаров входят детали крепления.&nbsp;<br><br>Спецификация</p><ul><li>Характеристика направленности: кардиоидная;</li><li>Частотный диапазон: 17-18000 Гц;</li><li>Чувствительность: 18 мВ/Пa (-35 дБВ);</li><li>Макс. уровень звукового давления: 125 дБ;</li><li>Эквивалентный уровень шума: 21 дБ-A;</li><li>Соотношение сигнал/шум: 73 дБ;</li><li>Рекомендованная нагрузка: &gt;2000 Ом;</li><li>Питание: 9-52 В фантомного питания согл. DIN 45596;</li><li>Разъем: 3-конт. разъем XLR;</li><li>Внешний вид: Черный матовый;</li><li>Размеры: диаметр 13.5x380 мм;</li><li>Вес чистый/с упаковкой: 160/480 г.</li></ul>', 4900, '2014-08-28 13:13:58', 147, 'AKG CGN99 C/L   50см конденсаторный микрофон типа Gooseneck, кардиоидный, с адаптером фантомного питания с разъемом XLR.', 19516, NULL, 124, '\0', ''),
  (20430, 'AKG CGN99 C/S', '<p>Кардиоидная характеристика направленности особенно популярна благодаря своей универсальности. Угол приема звукового сигнала 125° подойдет для неопытных или слишком активных ораторов, часто забывающих говорить прямо в микрофон. Длина держателя и гибкая секция обеспечивают удобство в любой ситуации. Возможны различные варианты установки, например крепление на кафедре или на столе, в набор аксессуаров входят детали крепления.&nbsp;<br><br><strong>Спецификация</strong>&nbsp;<br><br>Характеристика направленности: кардиоидная&nbsp;<br>Частотный диапазон: 17-18000 Гц&nbsp;<br>Чувствительность: 18 мВ/Пa (-35 дБВ)&nbsp;<br>Макс. уровень звукового давления: 125 дБ&nbsp;<br>Эквивалентный уровень шума: 21 дБ-A&nbsp;<br>Соотношение сигнал/шум: 73 дБ&nbsp;<br>Импеданс: &lt;600 Ом&nbsp;<br>Рекомендованная нагрузка: &gt;2000 Ом&nbsp;<br>Питание: 9-52 В фантомного питания согл. DIN 45596&nbsp;<br>Потребление тока: &lt;3 мA&nbsp;<br>Разъем: 3-конт. разъем XLR&nbsp;<br>Внешний вид: Темно-серый матовый&nbsp;<br>Размеры: диаметр 13.5x380 мм&nbsp;<br>Вес чистый/с упаковкой: 160/480 г</p>', 4850, '2014-08-28 13:14:43', 147, 'AKG CGN99 C/S   30см конденсаторный микрофон типа Gooseneck, кардиоидный, с адаптером фантомного питания с разъемом XLR.', 19516, NULL, 124, '\0', ''),
  (20431, 'JBL JRX118SP/230', '<p>JBL JRX118SP – компактный сабвуфер, оборудованный массивным 18-дюймовым вуфером и встроенным усилителем мощностью 300 Вт (пиковая 500 Вт). Кабинет имеет корпус фазоинверторного типа из MDF толщиной 19 мм (отделан черным ковролином), защитная решетка из перфорированного стального листа (окрашены порошковым способом), ручки для переноски.<br>Есть стереокроссовер (пропускающий фильтр низких частот 100 Гц, 24 дБ/окт), фильтр ультранизких частот (25 Гц, 18 дБ/окт), защита от перегрузки, 2 симметричных линейных входа (XLR), вход для усиленного сигнала (джек), 2 выхода (XLR), позволяющие снимать сигналы линейного уровня для активных средне-высокочастотных сателлитных систем как параллельно входным разъемам, так и через пропускающие фильтры высоких частот, регулятор уровня, индикаторы наличия сигнала и перегрузки, переключатель полярности. Имеется возможность суммирования стереоканалов.</p><p>Технические характеристики:<br>Тип: напольная акустическая система;<br>Собственное усиление: активная;<br>Акустическое оформление: фазоинверторного типа;<br>Акустическое излучение: монополярная;<br>Назначение: сабвуфер;<br>количество полос: 1;<br>Состав комплекта: 1 громкоговоритель;<br>Мощность: 300 Вт;<br>Тип излучателей: динамические;<br>НЧ-излучатель: вуфер 18\";<br>Частотный диапазон: 38 – 300 Гц (+/-3 дБ);<br>Максимальный уровень звукового давления: 123 дБ (+/-3 дБ);<br>Коэффициент гармонических искажений: менее 0.2%;<br>Импеданс: 4 Ом;<br>Частота кроссовера: 300 Гц;<br>Регулировка частоты кроссовера: есть;<br>Корпус: MDF, 19 мм;<br>Ручки для переноски: есть;<br>Размеры (Ш х В х Г): 597 x 516 x 597 мм;<br>Вес: 40.4 кг.</p><p>Характеристики JBL JRX118SPОбщие данные<br>Тип - Активная акустическая система<br>Состав комплекта - 1 громкоговоритель<br>Характеристики<br>Мощность - 300 Вт<br>Импеданс - 4 Ом<br>Диапазон воспроизводимых частот - 38-300 Гц<br>Частота кроссовера - 300<br>Регулировка частоты кроссовера - есть<br>Излучатели<br>Тип излучателей - динамические<br>НЧ-излучатель - 457 мм<br>Дополнительно<br>Размеры (ШхВхГ) - 597x516x597 мм<br>Вес - 40.4 кг</p>', 26990, '2014-08-28 11:10:44', 211, 'JBL JRX118SP/230 активный сабвуфер 300/500Вт, 1х18\", макс. SPL 123дБ. Разъемы Speakon и Jack, стакан 36мм, корпус МДФ 19мм, ковровое покрытие, 597x516x597мм, 40,4кг', 19517, NULL, 1884815, '\0', ''),
  (20432, 'AKG CGN99 H/L', '<p>AKG CGN99 H/L &nbsp; 50см конденсаторный микрофон типа Gooseneck, гиперкардиоидный, с адаптером фантомного питания с разъемом XLR.<br></p>', 4890, '2014-08-28 13:15:11', 147, 'AKG CGN99 H/L   50см конденсаторный микрофон типа Gooseneck, гиперкардиоидный, с адаптером фантомного питания с разъемом XLR.', 19519, NULL, 124, '\0', ''),
  (20433, 'AKG CGN99 H/S', '<p>Гиперкардиоидная направленность и узкий угол приема звукового сигнала - 95° - наилучший выбор для ситуаций, когда шум распространяется со всех сторон, люди говорят в микрофон с большого расстояния или несколько человек используют один микрофон.&nbsp;<br>Гибкое соединение обеспечивает поворот «гусиной шеи» в любом направлении. Возможны различные варианты установки, например крепление на кафедре или на столе, с возможностью фиксации.&nbsp;<br><br>Характеристика направленности: гиперкардиоидная&nbsp;<br>Частотный диапазон: 50-19000 Гц&nbsp;<br>Чувствительность: 12 мВ/Пa (-38 дБ В)&nbsp;<br>Макс. уровень звукового давления: 125 дБ&nbsp;<br>Эквивалентный уровень шума: 21 дБ-A&nbsp;<br>Соотношение сигнал/шум: 73 дБ&nbsp;<br>Импеданс: &lt;600 Ом&nbsp;<br>Рекомендованная нагрузка: &gt;2000 Ом&nbsp;<br>Питание: 9-52 В фантомного питания согл. DIN 45596&nbsp;<br>Потребление тока: &lt;3 мА&nbsp;<br>Разъем: 3-конт. разъем XLR (папа)&nbsp;<br>Внешний вид: Темно-серый матовый&nbsp;<br>Размеры: диаметр 13.5x580 мм&nbsp;<br>Вес чистый/с упаковкой: 170/500 г<br></p>', 4850, '2014-08-28 13:15:40', 147, 'AKG CGN99 H/S   30см конденсаторный микрофон типа Gooseneck, гиперкардиоидный, с адаптером фантомного питания с разъемом XLR.', 19519, NULL, 124, '\0', ''),
  (20434, 'JBL JRX215', '<p>Описание JBL JRX215:<br>Двухполосная пассивная акустическая система JBL JRX215</p><p>Хороший звук, это залог успеха. Если во время выступления артиста или группы звучит глухой и нечитаемый звук, зрители могут уйти из зала, даже если на сцене выступает звезда. Добиться хорошей акустики вполне возможно с помощью двухполосной пассивной акустической системы JBL JRX215. Выпуская этот вариант, производитель учел все варианты для обеспечения хорошего звука для любой аудитории. Его главным достоинством является компактность, легкость и возможность подключения сабвуфера. Такая колонка разработана специально для отличного звука при выступления в живую и проведения мониторинга на сценах.</p><p>Функциональные особенности JBL JRX215</p><p>Акустическая система имеет 15 дюймовый низкочастотный динамик. При частоте диапазона в 41Гц-20Гц, выходящий звук идет реальный и неискаженный. Система имеет удачное крепление стакан, размером в 36мм, имеет два варианта наклона для колонки, которая находиться в вертикальном положении. Это позволяет использовать в комплекте сабвуфер, который усилит мощность звука.</p><p>Система имеет высокочастотный рассеиватель, благодаря которому, обеспечивается равномерное распределение звука на диапазоне высокой частоты, по всей зоне действия акустики, при этом уменьшается искажение звука и выравнивается АЧХ.</p><p>Корпус модели изготовлен из высококачественно МДФ. Он обладает высокой прочностью, что позволяет использовать систему длительное время и при этом без усилий устанавливать ее в помещении любого типа. Состав корпуса продуман до мелочей. Качественный материал МДФ шириной в 19 мм, клей и крепежные составляющие, совсем не портят, а наоборот увеличивают прочность основной конструкции и улучшают выходной низкочастотный диапазон.</p><p>Если не выключен основной драйвер, система SonicGuard™, защитит драйвер высокой частоты от воздействия избыточной мощности. Перфорированная защитная сетка выполнена в современном стиле из прочного стального материала. Она имеет отверстия в форме шестиугольника, которые защищают динамики от любых повреждений.<br>Для удобного перемещения системы в любое место, предусмотрены встроенные крепкие стальные ручки. Компактные размеры 460x699x432 мм, дают возможность установить колонку на любой поверхности, а общий вес в 27,4 кг, позволяет с легкость перевозить аппарат в любом транспорте.<br>Низкочастотный драйвер изготовлен по новейшим технологиям и имеет ленточную звуковую катушку.</p><p>Применение и легкость в использовании</p><p>Акустическая система JBL JRX215 применяется в концертных залах, музыкальных площадках, а так же для обеспечения хорошего чистого звука на различных массовых мероприятиях. В использовании система очень проста, все необходимые разъемы для подключения дополнительных устройств, расположены в удобных местах. Фронтальный тип системы и напольная конструкция, позволяет размещать ее в любом месте. Качественные внутренние составляющие и практичный корпус черного цвета, устойчивы к воздействиям температуры и обеспечивают профессиональное качество в работе.</p><p>Технические характеристики</p><p>Модель JBL JRX215:<br>• Монополярное акустическое излучение;<br>• Один громкоговоритель;<br>• Две полосы;<br>• Мощность: 250Вт;<br>• Максимальная мощность: 1000Вт;<br>• Мощность усилителя 250-500Вт;<br>• Чувствительность 99Дб;<br>• Импеданс 8 Ом;<br>• Диапазон воспроизводимых частот 53-19000 Гц (-10 дБ);<br>• Разъем для подключения к усилителю мощности: Speakon;<br>• Тип излучателей - динамические;<br>• ВЧ-излучатель: рупор;<br>• НЧ-излучатель: 381 мм.</p>', 10970, '2014-08-28 11:11:55', 211, 'JBL JRX215 - пассивная 2-полосная акустическая система, 250/1000Вт, 8Ом, НЧ-1х15\", ВЧ-1\", макс. SPL 129дБ, рекомендуемая мощность усилителя 250-500Вт на 8Ом. Разъемы Speakon и Jack, стакан с двойным углом 36мм, корпус МДФ 19мм, ковровое покрытие, 699x460x432мм, 27,4кг', 19520, NULL, 1884815, '\0', ''),
  (20435, 'AKG CHM99 Black', '<p>&nbsp;Тип: динамический микрофон<br>• Специфика: подвесной<br>• Направленность диаграммы: кардиоидная<br>• Угол наклона: 125 градусов<br>• Частотный диапазон: от 70 до 18 000 Гц<br>• Чувствительность: 18 mV/PA<br>• Уровень звукового давления, максимальный: 125 дБ<br>• Уровень шума, эквивалентный: меньше 21 дБ<br>• Сигнал/шум: больше 73 дБ<br>• Импеданс: меньше или равно 600 Ом<br>• Сопротивление нагрузки, рекомендованное: больше или равно 2 000 Ом<br>• Фантомное питание: от 9 до 52 В<br>• Потребляемый ток: меньше 3 мА<br>• Разъемы: 3-pin XLR<br>• Особенности: подвес из пружинной стали, который обеспечивает оптимальную направленность<br>• Рекомендации к применению: наружное наблюдение; лекции; конференции; культовые сооружения<br>• Цвет: Черный<br>• Размеры: 13,5 мм х 55 мм<br>• Вес: 480 г<br><br></p>', 4250, '2014-08-28 13:17:23', 147, 'AKG CHM99 Black черный конденсаторный кардиоидный подвесной микрофон, кабель 10м с разъемом XLR', 19522, NULL, 124, '\0', ''),
  (20436, 'JBL JRX218S', '<p>Сабвуфер пассивный JBL JRX218S.</p><p>Пассивный сабвуфер, который обеспечит Вас профессиональным выступлением по доступной цене. Инженеры JBL пересмотрели каждый элемент конструкции акустической системы, сохранили все, что делает звук динамика лучшим в своём классе и переработали некоторые элементы. Для повышения эффективности и мощности сабвуфера JRX218S снабжен массивным 18 \"вуфером с 3\" звуковой катушкой. Номинальная мощность 350 Вт и 1400 пиковая.<br>Мощность: 350 Вт / 1400 Вт.<br>Номинальный импеданс: 4Ом.<br>Рекомендованная мощность усилителя: 350 Вт до 700 Вт в 4Ом.<br>максимальное звуковое давление 133 дБ.<br>корпус MDF 19 мм.<br>стойка SS3-BK.<br>Габариты (В x Ш x Г): 605 x 508 x 551 мм.<br>Вес: 32.2 Кг.<br>НЧ драйвер: JBL 2043-G.<br>Входные разъёмы: Neutrik® Speakon® NL-4 (x1); .25 in TS phone jack (x1); parallel.</p>', 17450, '2014-08-28 11:15:05', 211, 'JBL JRX218S  - пассивный сабвуфер 350/1400Вт, 1х18\", 4Ом, макс. SPL 133дБ, рекомендуемая мощность усилителя 350-700Вт на 4Ом. Разъемы Speakon, стакан 36мм, стойка SS3-BK, корпус МДФ 19мм, ковровое покрытие, 605x508x551мм, 32,2кг', 19523, NULL, 1884815, '\0', ''),
  (20437, 'AKG CHM99 White ', '<p>&nbsp;Тип: динамический микрофон<br>• Специфика: подвесной<br>• Направленность диаграммы: кардиоидная<br>• Угол наклона: 125 градусов<br>• Частотный диапазон: от 70 до 18 000 Гц<br>• Чувствительность: 18 mV/PA<br>• Уровень звукового давления, максимальный: 125 дБ<br>• Уровень шума, эквивалентный: меньше 21 дБ<br>• Сигнал/шум: больше 73 дБ<br>• Импеданс: меньше или равно 600 Ом<br>• Сопротивление нагрузки, рекомендованное: больше или равно 2 000 Ом<br>• Фантомное питание: от 9 до 52 В<br>• Потребляемый ток: меньше 3 мА<br>• Разъемы: 3-pin XLR<br>• Особенности: подвес из пружинной стали, который обеспечивает оптимальную направленность<br>• Рекомендации к применению: наружное наблюдение; лекции; конференции; культовые сооружения<br>• Цвет: белый<br>• Размеры: 13,5 мм х 55 мм<br>• Вес: 480 г<br><br></p>', 4250, '2014-08-28 13:17:58', 147, 'AKG CHM99 White белый конденсаторный кардиоидный подвесной микрофон, кабель 10м с разъемом XLR', 19525, NULL, 124, '\0', ''),
  (20438, 'JBL JRX225', '<p>Описание JBL JRX225:<br>JBL JRX225 – это портативный пассивный усилитель с двусторонней связью, оснащенный двумя 15-дюймовыми динамиками и предназначенный как для сценического использования, так и простого воспроизведения музыки.<br>Если эта характеристика примерно соответствует тому, что Вы ищете, то для принятия положительного решения Вам хватит лишь списка основных возможностей JBL JRX225. Этот усилитель воистину способен удовлетворить широчайший спектр звуковых запросов потенциальных покупателей, что сейчас и следует конкретизировать.</p><p>Особенности JBL JRX225<br>• Двойные низкочастотные динамики с 64мм / 2,5-дюймовой лентой окантовки звуковой катушки, обеспечивающей большую площадь поперечного сечения провода в зазоре голосовой катушки в сравнении с проволочными конструкциями, для большей эффективности и коммутируемой мощности<br>• JBL 2414H-C – 25мм / 1-дюймовая полимерная диафрагма компрессионного динамика, улучшающая производительность системы на высоких частотах, а также ее надежность<br>• Усовершенствованная сетевая топология перекрестной конструкции формирует частотную характеристику и обеспечивает когерентное сложение в области перекрещивания<br>• Конструкция \"Quasi 3-Way\" обеспечивает дополнительные басы, для которых JBL JRX225 и предназначена, причем без ущерба для производительности в критическом среднем диапазоне. Верхний сабвуфер генерирует средние и низкие частоты, нижний же сосредоточен исключительно на басах. Редукция в отмене средней фазы существенно улучшает качество звука и зоны охвата.<br>• Высоковольтные конденсаторы и индукторы с массивными ядрами большими сеченифми проводов дают возможность разделительному фильтру обрабатывать высокую мощность без подавления<br>• Высокочастотный волновод Progressive Transition обеспечивает превосходный контроль охвата, снижает искажение и смягчает частотную характеристику<br>• Прочный, акустически превосходный корпус изготовлен из 19 мм / 0,75-дюймового МДФ-накладки с использованием новаторских адгезивов и механической технологии крепежа для обеспечения выдающейся стойкости и повышения производительности низких частот<br>• SonicGuard защищает высокочастотный динамик от избытков энергии без перерывов в работе<br>• Нерезонирующие, полностью стальные ручки<br>• Привлекательная 18-мерная перфорированная стальная решетка, защищающая компоненты устройства от повреждений.</p><p>Все вышесказанное вкупе являет собой высококачественный продукт, который обязательно удовлетворит Ваши потребности. Один из лучших вариантов пассивных усилителей в данной ценовой категории (если не лучший) – это JBL JRX225. Во всех отношениях.</p><p>Технические характеристики JBL JRX225</p><p>-Номинальная мощность: 500 Вт / 2000 Вт<br>-Частотный диапазон: (-10 дБ) 36 Гц - 19 кГц<br>-Частотный отклик: (± 3 дБ) 45 Гц - 16 кГц<br>-Чувствительность: (1 м) 100 дБ УЗД (1w/1m)<br>-Номинальный импеданс: 4 Ом<br>-Рекомендуемая мощность усилителя: 500 Вт до 1000 Вт на 4 Ом<br>-Максимальный уровень звукового давления: 133 дБ<br>-Частота разделения: 2 кГц<br>-Размеры: 1092х464х426 мм / 43х18,3х16,8 дюймов<br>-Вес: 42,6 кг / 94 фунтов<br>-Высокочастотный динамик: JBL 2414H-С 25 мм (1 дюйм)<br>-Низкочастотный динамик: JBL M128 (2 шт)<br>-Входные разъемы: Neutrik Speakon NL-4 (x1), 0,25-дюймовый TS джек (x1), параллельный вход</p>', 16500, '2014-08-28 11:15:38', 211, 'JBL JRX225 - пассивная 2-полосная акустическая система, 500/2000Вт, 4Ом, НЧ-2х15\", ВЧ-1\", макс. SPL 133дБ, рекомендуемая мощность усилителя 500-1000Вт на 4Ом. Разъемы Speakon и Jack, корпус МДФ 19мм, ковровое покрытие, 1092x464x432мм, 42,6кг', 19526, NULL, 1884815, '\0', ''),
  (20439, 'JBL Control 23T-WH', '<p>Описание JBL CONTROL 23T WH:<br>JBL CONTROL 23T WH - новая компактная акустическая система. Эта модель способна на многое, мощность в 50 Вт в сочетании с качественным НЧ динамиком способны создать незабываемую звуковую атмосферу.</p><p>Рупорный твитер с титановым напылением обеспечит естественное и чистое звучание музыкальных композиций. JBL CONTROL 23T WH поможет вам в озвучивании среднечастотных и высокочастотных диапазонов звука. Она прекрасно подходит для использования в помещениях, которые ограничены в пространстве.</p><p>Данная версия акустической системы имеет встроенный трансформатор для использования в линейно-распределительных системах. Эту установку можно с легкостью использовать совместно с сабвуфером JBL, что позволит озвучивать широкий диапазон звучания. Эргономичный дизайн в сочетании с многофункциональностью JBL CONTROL 23T WH приятно порадуют даже самых скрупулезных музыкальных гурманов.</p><p>Преимущества JBL CONTROL 23T WH</p><p>1. Высококачественное воспроизведение звука<br>2. Мощная установка<br>3. Широкий диапазон рабочих частот<br>4. Компактные размеры<br>5. Небольшой вес системы поможет с легкостью транспортировать акустическую систему<br>6. Качественные НЧ и ВЧ динамики<br>7. Корпус сделан из высокопрочного и ударостойкого материала<br>8. Прост в эксплуатации<br>9. Надежен в работе</p><p>Технические характеристики:</p><p>1. Частотный диапазон – 100-21000 Гц<br>2. Дисперсия (ном) - 90° x 90°(Гор. x Верт.)<br>3. Чувствительность системы - 86 дБ 1 Вт/1 м<br>4. Мощность (ном) – 25 Вт<br>5. Мощность (программная) – 50 Вт<br>6. Сопротивление – 8 Ом<br>7. Выводы трансформаторные - 100 В, 10 Вт, 5 Вт<br>8. Динамики - НЧ - 3.5\" (88 мм), ВЧ - 0.5\" (13 мм)<br>9. Материал корпуса – полистерол<br>10. Габаритные размеры – 193х140х111 мм (ВхШхГ)<br>11. Масса – 1,8 кг</p>', 4680, '2014-08-28 11:16:29', 211, 'JBL Control 23T-WH компактная трансформаторная 2-полосная АС, корпус пластиковый, динамик 3,5\". Мощность трансформатора 5Вт/70В, 10Вт/100В. Поворотный кронштейн в комплекте. Всепогодное исполнение. Цвет белый', 19528, NULL, 1884815, '\0', ''),
  (20440, 'JBL Control 25AV', '<p>Описание JBL CONTROL 25AV WH:</p><p>JBL Control 25AV – это двухканальный 200-ваттный стационарный монитор, который дает гладкое, высоко детализированное аудио с невероятной полнотой охвата. С его стойкой работой и при 70-тивольтовой и 100-вольтовой распределительной линии, видео-экранированный Control 25AV идеален для владельцев маленьких клубов и ресторанов, которые ищут монитор с компактным, ненавязчивым дизайном и надежностью, необходимой для использования и внутри помещения, и снаружи.</p><p>ОСНОВНЫЕ СВОЙСТВА ДВУХПОЛОСНОГО МОНИТОРА JBL CONTROL 25AV:</p><p>• Мощность: 200 Вт<br>• Динамик: 5 1/4’’, с полипропиленовым покрытием<br>• Высокочастотный динамик: 3/4\'’, титановый<br>• Экранированный для использования поблизости с видеомониторами<br>• Металлическая защитная решетка для неблагоприятных условий окружения<br>• 60-тиваттный трансформатор для 70-тивольтовых и 100-вольтовых линий, при 8 Ом<br>• В комплект входит незаметное оборудование для крепления<br>• Высокочастотная «пищалка» 100° x 100°<br>• Защита от перегрузов Sonicguard</p>', 6980, '2014-08-28 11:16:56', 211, 'JBL Control 25AV - компактная трансформаторная 2-полосная АС, корпус пластиковый, динамик 5,25\". Програмная мощность 200Вт, 8Ом, мощность трансформатора 60Вт/30Вт/15Вт/7,5Вт. Переключатель режимов 8Ом/70В/100В. Всепогодное исполнение. В комплекте поворотный кронштейн и защитный кожух MTC-PC. Цвет черный', 19530, NULL, 1884815, '\0', ''),
  (20441, 'JBL Control 25T', '<p>Акустическая система Control 25 укомплектована низкочастотным динамиком (5.3\") и высокочастотным рупорным твиттером с титановым напылением и имеет мощность 150 Вт. Данная широкополосная система обеспечивает прекрасные динамические характеристики с плавным ослаблением низкочастотного диапазона ниже 80 Гц и может применяться в звукоусиливающих системах концертных площадок средних масштабов. Версия Control 25T предусматривает многовыходной рансформатор для работы в линейно-распределительных системах.</p><p>Технические характеристики<br>Частотный диапазон: 80 Гц -15 кГц<br>Номинальная дисперсия: 90° x 90° (Гор. x Верт.)<br>Чувствительность: 88 дБ (1 Вт/1 м)<br>Номинальная мощность: 75 Вт<br>Программная мощность: 150 Вт<br>Трансформаторные выводы: 100 В: 30, 15, 7.5 Вт; 70.7 В: 30, 15, 7.5, 3.7 Вт<br>Драйверы: НЧ - 5.3\" (135 мм), ВЧ - 0.75\" (19 мм)<br>Материал корпуса: удоропрочный полистерол<br>Цвет корпуса: черный<br>Габариты (В x Ш x Г): 236 x 188 х 149 мм<br>Вес: 3.6 кг</p>', 5980, '2014-08-28 11:17:31', 211, 'JBL Control 25T компактная трансформаторная 2-полосная АС, корпус пластиковый, динамик 5,25\". Мощность трансформатора 30Вт/15Вт/7,5Вт/3,7Вт. Всепогодное исполнение. Поворотный кронштейн в комплекте. Цвет черный', 19531, NULL, 1884815, '\0', ''),
  (20442, 'AKG C214', '<p><span style=\"line-height: 1.428571429;\">Микрофон с большой диафрагмой C214 разрабатывался при содействии ведущих звукоинженеров, долгое время использующих микрофоны C 12, C 12 A, C 414 EB, C 414 B-ULS, C 414 B-TL II и C 414 XL II. В микрофоне С 214 применены отобранные вручную компоненты высочайшего класса, которые гарантируют его безотказную и качественную работу в самых трудных условиях в течении многих лет.</span><br></p><p>Примененная в микрофоне новая электронная схема позволяет достичь максимального динамического диапазона и ровной АЧХ. Низкий уровень собственных шумов и высокий уровень максимального звукового давления дают динамический диапазон 143 дБ. Конструкция капсюля исключает замыкание мембраны с задним электродом даже при максимально высоком звуковом давлении. Мембрана позолочена только с внешней стороны, обратная сторона, которая может соприкасаться с задним электродом, изолирована.</p><p>Полностью металлический корпус обеспечивает хорошую защиту от радиопомех – таким образом, микрофон может использоваться на радиостанциях, совместно с радиосистемами и другими средствами связи.</p><p>Микрофон С 214 оснащен двумя переключателями:</p><p>1. Переключатель чувствительности позволяет снизить чувствительность микрофона на 20 дБ когда необходимо записывать без искажений особо громкие инструменты.</p><p>2. Вибрации или ветер могут вызвать искажения в низкочастотном диапазоне. Фильтр ВЧ позволяет значительно снизить уровень этих искажений, ослабляя чувствительность микрофона на частотах ниже 160 Гц на 6 дБ на октаву. Кроме того эта функция снижает так называемый «эффект близости», который возникает при записи источника звука с расстояния менее 20 см.</p><p>Микрофону требуется фантомное питание 12-52 В по стандарту IEC 61938</p><p>Используйте только соответствующие стандарту IEC источники фантомного питания, подключайте микрофон только качественным кабелем соединения выполняйте только качественным кабелем с разъемами, соответствующими стандарту IEC 268-12. Это необходимое условие долгой и надежной работы прибора.</p><p>Технические характеристики</p><ul><li>Направленность: кардиоидная</li><li>Частотный диапазон: 20 Гц – 20 кГц</li><li>Чувствительность – 20 мВ/Па</li><li>Максимальный уровень звукового давления: 136/156 дБ (0/-20 дБ) при кэффициенте нелинейных искажений 0.5%</li><li>Соотношение сигнал/шум: 81 дБ</li><li>Переключение уровня чувствительности: 0/-20 дБ</li><li>Фильтр ВЧ: 160 Гц. 6 дБ/Окт</li><li>Сопротивление: &lt;= 200 Ом</li><li>Рекомендованное сопротивление нагрузки: &gt;= 1000 Ом</li><li>Напряжение питания: 12-52 В по стандарту IEC 61938</li><li>Потребляемый ток: &lt; 2 мА</li><li>Динамический диапазон: 123/143 дБ (0/-20 дБ)</li><li>Разъем: 3-контактный XLR</li><li>Внешний вид: матовый серый</li><li>Габариты: 160×55 мм</li><li>Вес: 280 г</li><li>Вес с упаковкой: 1450 г</li></ul>', 15450, '2014-08-28 13:19:02', 147, 'AKG C214 конденсаторный кардиоидный микрофон с 1\" мембраной. 20-20000Гц, 20мВ/Па, цвет черный.', 19532, NULL, 124, '\0', ''),
  (20443, 'AKG C214ST', '<p><span style=\"line-height: 1.428571429;\">С 214 – менее дорогая альтернатива хай-энд модели С 414. Он сделан по комбинированной технологии. Двойной капсуль, подобный С 414 и патентованная технология Black-Plate, все это делает звук данной модели похожим на С 414 B-XLS. Подобно С 414, С 214 прекрасно справляется с высоким давлением медных духовых инструментов или гитарных усилителей и в то же время способен уловить нюансы дыхания вокала и оттенки оркестрового звука. Помимо этого микрофон имеет аттенюатор чувствительности -20дБ, переключатель ФНЧ в элегантном, но прочном корпусе. Дополнительные характеристики: встроенный подвес, двойная экранирующая сетка для снижения радиочастотных помех, не влияющая на акустические свойства. Схемотехника С 214 обеспечивает мощный выходной сигнал с минимальным уровнем шума. XLR-разъем с золотым покрытием обеспечивает передачу сигнала без потерь. С 214 поставляется в комплекте с металлическим кейсом, поп-фильтром и виброзащитным подвесом.</span><br></p><p>• Микрофон с легендарной 1” диафрагмой и классическим звучанием большой диафрагмы</p><p>• Очень широкий динамический диапазон (до 156дБ, ультранизкий уровень шумов)</p><p>• Прочное «туровое» исполнение</p><p>• Встроенный подвес диафрагмы для уменьшения механического шума</p><p>• Переключаемый аттенюатор 20дБ и переключатель ФНЧ</p><p>• Двойная экранирующая решетка для фильтрации радиочастотных</p><p>помех не влияющая на акустические параметры</p><p>• Цельнометаллический литой корпус с защитой от царапин и ударов</p><p>• Виброзащитный подвес H85 «паук» в комплекте</p><p>• Металлический футляр в комплекте</p><p>• Разработан и сделан в Австрии</p><p>• Диаграмма направленности: кардиоида</p><p>• Частотный диапазон: от 20 до 20,000 Гц</p><p>• Чувствительность: 20 мV/Па (-34 dBV)</p><p>• Максимальный SPL при 3% КНИ: 135/156 дБ</p><p>• Эквивалентный уровень шума (IEC 60268-4): 3 дБ-A</p><p>• Соотношение сигнал/шум (A-взвешенное): 81 дБ</p><p>• Контур предослабления: 20 дБ (переключается вручную)</p><p>• Низкочастотный обрезной фильтр: 6 дБ/октава на 160 Гц</p><p>• Импеданс: &lt;200 Ом</p><p>• Рекомендуемое сопротивление нагрузки: &gt;1000 Ом</p><p>• Питание: от 12 до 52В</p><p>• Потребление питания: &lt;2мА</p><p>• Динамический диапазон: 123-143 дБ (0/-20дБ, А-взвешенное)</p><p>• Разъем: 3-пиновый XLR</p><p>• Покрытие: матовое серо-голубое</p><p>• Размеры: 160 x 56 мм</p><p>• Вес нетто/брутто: 280 г/1450 г</p>', 33450, '2014-08-28 13:19:35', 147, 'AKG C214ST подобранная стереопара микрофонов C214', 19533, NULL, 124, '\0', ''),
  (20444, 'JBL Control 25T-WH', '<p>Акустическая система Control 25 укомплектована низкочастотным динамиком (5.3\") и высокочастотным рупорным твиттером с титановым напылением и имеет мощность 150 Вт. Данная широкополосная система обеспечивает прекрасные динамические характеристики с плавным ослаблением низкочастотного диапазона ниже 80 Гц и может применяться в звукоусиливающих системах концертных площадок средних масштабов. Версия Control 25T предусматривает многовыходной рансформатор для работы в линейно-распределительных системах.</p><p>Технические характеристики<br>Частотный диапазон: 80 Гц -15 кГц<br>Номинальная дисперсия: 90° x 90° (Гор. x Верт.)<br>Чувствительность: 88 дБ (1 Вт/1 м)<br>Номинальная мощность: 75 Вт<br>Программная мощность: 150 Вт<br>Трансформаторные выводы: 100 В: 30, 15, 7.5 Вт; 70.7 В: 30, 15, 7.5, 3.7 Вт<br>Драйверы: НЧ - 5.3\" (135 мм), ВЧ - 0.75\" (19 мм)<br>Материал корпуса: удоропрочный полистерол<br>Цвет корпуса: белый<br>Габариты (В x Ш x Г): 236 x 188 х 149 мм<br>Вес: 3.6 кг</p>', 5980, '2014-08-28 11:17:54', 211, 'JBL Control 25T-WH компактная трансформаторная 2-полосная АС, корпус пластиковый, динамик 5,25\". Мощность трансформатора 30Вт/15Вт/7,5Вт/3,7Вт. Всепогодное исполнение. Поворотный кронштейн в комплекте. Цвет белый', 19534, NULL, 1884815, '\0', ''),
  (20445, 'AKG C3000', '<p>Высококачественный универсальный конденсаторный микрофон, прекрасно подходит для использования музыкантами в условиях студии. Наиболее хорошо справляется с задачами записи вокала (как соло, так и хора), духовых, акустических струнных, электрогитар, а также записи ударных. Такая универсальность достигается использованием в конструкции модели большой миларовой диафрагмы, а также благодаря кардиоидной диаграмме направленности. Промимо всего прочего, микрофон обладает особо прочным корпусом и требует 9-52 В питание.<br><br><strong>Технические характеристики:</strong></p><p><span style=\"line-height: 1.428571429;\">Направленность: кардиоидная</span><br></p><p>Частотный диапазон: 20 Гц - 20 кГц<br>Чувствительность: 25 мВ/Па; (-32 дБВ)<br>Максимальный уровень звукового давления: при 0,5 % искажений, 140 дБ /150 дБ SPL&nbsp;<br>Эквивалентный уровень шума: 14 дБ-А<br>Соотношение сигнал/шум: 80 дБ-А<br>Ослабление звукового сигнала: -10 дБ, переключаемое<br>Фильтр НЧ: 6 дБ/октаву, ниже 500 Гц&nbsp;<br>Импеданс: 200 Ω<br>Рекомендованная нагрузка: &gt;1000 Ω<br>Питание: 9-52 В фантомное питание согласно норме DIN 45596<br>Потребление тока: &lt;2мА<br>Разъём: 3 –польный XLR<br>Длина кабеля: -<br>Внешний вид: серо-серебряный&nbsp;<br>Размеры: 53 (Ø) х162 мм&nbsp;<br>Вес, чистый/с упаковкой: 320 г/950 г&nbsp;</p>', 9150, '2014-08-28 13:21:11', 147, 'AKG C3000 конденсаторный кардиоидный микрофон с 1\" мембраной . Обрезной фильтр НЧ - 500Гц, 6дБ на октаву. Цвет черный.  Держатель H85 в комплекте.', 19535, NULL, 124, '\0', ''),
  (20446, 'JBL Control 30', '<p>Функциональные особенности<br>Расширенный диапазон частот, чрезвычайно гладкая частотная характеристика.<br>Конструкция, полностью пригодная к использованию вне помещений, включая материал WeatherMax™.<br>ВЧ покрытие 120° x 110°<br>150-ваттный трансформатор для линий 70 или 100 В, с 8 Вт thru.<br>Схема защиты от перегрузок SonicGuard™.<br>Компоненты: 10-дюймовый НЧ вуфер со стекловолоконным/кевларовым диффузором и неодимовым магнитом, коаксиальный 5-дюймовый СЧ с диффузором из анодированного алюминия, и 1-дюймовый компрессионный драйвер с титановой диафрагмой.<br>Включает элементы крепления InvisiBall™, плюс десять 6-мм точек крепления для подвешивания и опциональной U-скобы.<br>Герметичная крышка панели входов и входные контакты с резьбовым зажимом.</p><p>Технические характеристики<br>Тип: напольная, пассивная акустическая система<br>Акустическое оформление: фазоинверторного типа<br>Акустическое излучение: монополярная<br>Назначение: мониторный громкоговоритель<br>Количество полос: 3<br>Состав комплекта: 1 громкоговоритель<br>Номинальная дисперсия(Гор. x Верт.): 120° x 110°<br>Номинальная мощность: 250 Вт<br>Программная мощность: 500 Вт<br>Трансформаторные выводы: 100 В: 150, 75, 38 Вт; 70.7 В: 150, 75, 38, 19 Вт<br>Тип излучателей: динамические<br>ВЧ-излучатель: 1\" (25 мм), купол, титан<br>СЧ-излучатель: 5\" (127 мм), конус, алюминий<br>НЧ-излучатель: 10\" (254 мм), полипропилен<br>Рекомендуемая мощность усилителя: 10 - 250 Вт<br>Чувствительность: 93 дБ (1 Вт /1 м)<br>Максимальное давление (mSPL): 117 дБ @ 1м<br>Импеданс: 8 Ом<br>Диапазон воспроизводимых частот: 38 Гц – 17 кГц<br>Корпус: ударопрочный полистерол<br>Съемная решетка: есть<br>Крепления для монтажа: есть<br>Возможность установки вне помещения: есть<br>Отделка: черный<br>Размеры (Ш х В х Г): 372 x 593 x 345 мм<br>Вес: 18.9 кг</p>', 23000, '2014-08-28 11:18:27', 211, 'JBL Control 30 - трансформаторная 3-полосная АС, корпус пластиковый, НЧ 10\" Kevlar, СЧ-ВЧ коаксиальные 5\"+ 1\" компрессионный драйвер. Программная мощность 500Вт, 120х110 град., 4Ом, мощность трансформатора 150Вт/75Вт/38Вт/19Вт. Переключатель режимов 4Ом/70В/100В. Всепогодное исполнение. Встроенные точки подвеса М6. В комплекте база для кронштейна InvisiBall и защитный кожух для коммутационной панели. 593x372x345мм, 20,3кг. Цвет черный', 19536, NULL, 1884815, '\0', ''),
  (20447, 'AKG P220', '<p>AKG P220 конденсаторный кардиоидный микрофон, мембрана 1\", 20-20000Гц, 18мВ/Па, SPL до 155дБ, SH300 \"паук\", кейс</p>', 9150, '2014-08-28 13:21:55', 147, 'AKG P220 конденсаторный кардиоидный микрофон, мембрана 1\", 20-20000Гц, 18мВ/Па, SPL до 155дБ, SH300 \"паук\", кейс', 19539, NULL, 124, '\0', ''),
  (20448, 'AKG P420', '<p>AKG P420 &nbsp;конденсаторный микрофон, 3 диаграммы напр., &nbsp;20-20000Гц, 28мВ/Па, SPL до155дБ, SH300 \"паук\", кейс<br></p>', 11200, '2014-08-27 14:46:07', 147, 'AKG P420  конденсаторный микрофон, 3 диаграммы напр.,  20-20000Гц, 28мВ/Па, SPL до155дБ, SH300 \"паук\", кейс', 19540, NULL, 124, '\0', '\0'),
  (20449, 'JBL Control 30-WH', '<p>Характеристики JBL Control 30 WHОбщие данные<br>Тип - напольная, пассивная, фазоинверторного типа<br>Акустическое излучение - монополярная<br>Назначение - мониторный громкоговоритель<br>Состав комплекта - 1 громкоговоритель<br>Характеристики<br>Количество полос - 3<br>Рекомендуемая мощность усилителя - 10-250 Вт<br>Чувствительность - 93 дБ<br>Импеданс - 8 Ом<br>Диапазон воспроизводимых частот - 38-17000 Гц<br>Излучатели<br>Тип излучателей - динамические<br>ВЧ-излучатель - 25 мм, купол, титан<br>СЧ-излучатель - 127 мм, конус, алюминий<br>НЧ-излучатель - 254 мм, полипропилен<br>Конструкция<br>Съемная решетка - есть<br>Крепления для монтажа - есть<br>Дополнительно<br>Возможность установки вне помещения - есть<br>Варианты отделки - черный, белый<br>Размеры (ШхВхГ) - 372x593x345 мм<br>Вес - 18.9 к<br></p>', 23000, '2014-08-28 11:18:51', 211, 'JBL Control 30-WH трансформаторная 3-полосная АС, корпус пластиковый, НЧ 10\" Kevlar, СЧ-ВЧ коаксиальные 5\"+ 1\" компрессионный драйвер. Программная мощность 500Вт, 120х110 град., 4Ом, мощность трансформатора 150Вт/75Вт/38Вт/19Вт. Переключатель режимов 4Ом/70В/100В. Всепогодное исполнение. Встроенные точки подвеса М6. В комплекте база для кронштейна InvisiBall и защитный кожух для коммутационной панели. 593x372x345мм, 20,3кг. Цвет белый', 19541, NULL, 1884815, '\0', ''),
  (20450, 'JBL Control SB-2', '<p>Сабвуфер Control SB-2 выполнен в дизайне, обеспечивающем более разборчивое и чистое звучание по сравнению с традиционными конструкциями субвуферов. Control SB-2 может использоваться для озвучивания низкочастотного диапазона левого и правого каналов в стереофонических системах с сохранением разделения каналов. Низкочастотный динамик сабвуфера (10\") имеет двойную звуковую катушку и оптимизирован для совместного использования с акустическими системами серий JBL Control Contractor.</p><p>Функциональные особенности<br>Компоненты: 10-дюймовый преобразователь с двойной звуковой катушкой.<br>Стерео входы с хай-пасс выходами для сателлитных громкоговорителей.<br>Конструкция бандпасс со слотовой вентиляцией.<br>Дополняет системы серии Control Contractor.<br>Высокая чувствительность: 100 дБ (1 Вт/1 м).</p><p>Технические характеристики<br>Тип: напольная<br>Акустическое оформление: фазоинверторного типа<br>Назначение: сабвуфер<br>Количество полос: 1<br>Состав комплекта: 1 громкоговоритель<br>НЧ-излучатель: 10\" (250 мм)<br>Частотный диапазон: 38 Гц - 160 Гц<br>Чувствительность: 100 дБ 1 Вт /1м (в углу), 97 дБ 1Вт/1м (у стены)<br>Номинальная мощность: 170 Вт (каждый вход ) x 2<br>Программная мощность: 340 Вт (оба входа)<br>Номинальное сопротивление: 8 Ом (каждый вход)<br>Трансформаторные выводы: 100 В, 70.7 В<br>Материал корпуса: ДСП<br>Частота кроссовера: 160 Гц Control<br>Габариты (В x Ш x Г): 394 x 585 х 343 мм<br>Вес: 19.1 кг</p>', 13480, '2014-08-28 11:19:16', 211, 'JBL Control SB-2 компактный сабвуфер, BandPass, 10\" динамик с двухсекционной катушкой. Корпус МДФ, трапециевидной формы. Программная мощность 340Вт, 8Ом, 38Гц–160Гц, Встроенный кроссовер со стерео входом и выходами на сателлиты', 19542, NULL, 1884815, '\0', ''),
  (20451, 'AKG K141 MKII', '<p>Динамические полуоткрытые наушники&nbsp;AKG K141 MKII&nbsp;являются облегченной версией топовой модели K240 MKII, но с амбушюрами типа supra-aural («лежат на ухе»). Диафрагма Varimotion, самоподстраиваемое оголовье, две пары амбушюров (велюровые и из искусственной кожи), два типа отсоединяемых кабелей – это стандарт серии MKII. Разработанные для профессионального использования, наушники K 141 MK II идеальны для работы в звукозаписывающей студии.</p><p>Наушники оснащены уникальной системой Varimotion и XXL-мембранами с пониженным импедансом для достижения высокой чувствительности и более мощного звука. Овальная форма амбюшуров в сочетании с полуоткрытой конструкцией обеспечивает точное воспроизведение. Наушники имеют легкий вес и удобны в применении.</p><p><strong>Технические характеристики:</strong></p><p>Тип: динамические&nbsp;<br>Дизайн: полуоткрытые&nbsp;<br>Амбушюры: Supra-aural; велюровые и из искусственной кожи&nbsp;<br>Диапазон воспроизводимых частот: 18 – 24.000 Гц&nbsp;<br>Чувствительность: 101дБ SPL /мВ&nbsp;<br>Максимальная входная мощность: 200мВт&nbsp;<br>Импеданс: 55 Ом&nbsp;<br>Коэффициент гармонических искажений: менее 0,4%&nbsp;<br>Кабель: отсоединяемый, из бескислородной меди; прямой – 3м, витой – 5 м&nbsp;<br>Разъем: позолоченный миниджек (3,5 мм), позолоченный переходник на джек (6,3 мм) (с резьбой)&nbsp;<br>Аксессуары: позолоченный переходник “миниджек-джек”; две пары амбушюров; два кабеля&nbsp;<br>Вес: (без кабеля): 225 г</p>', 5000, '2014-08-28 13:22:27', 147, 'AKG K141 MKII  полуоткрытые студийные наушники 55Ом, 18-24000Гц, с мембранами XXL- Varimotion, кабели EK500 и EK300 в комплекте', 19544, NULL, 124, '\0', ''),
  (20452, 'AKG K171 MKII', '<p>Закрытые наушники для радиовещания и ди-джеев<br>Профессиональная модель, специально предназначенная для мониторинга звука в шумных условиях. Это легкие, исключительно прочные, удобные в обращении наушники. Они сочетают преимущества закрытого акустического оформления и комфорт накладных амбушюр. Высокий уровень редукции внешних шумов, мощный звук и удобство использования – вот за что эту модель так ценят диджеи. Она также идеально подходит для профессионального использования на радио и телевидении.<br>Тип наушников:n закрытые, динамические<br>Частотный диапазон: 18-26000 Гц<br>Чувствительность: 94 дБ<br>Мощность: 200 мВт<br>Импеданс: 55 Ом<br>Разъем: позолоченный миниджек (3,5 мм), позолоченный переходник на джек (6,3 мм) (с резьбой)<br>Кабель: 3 м, отсоединяемый с разъемом мини-XLR, 99,99% бескислородная медь, дополнительно - витой кабель EK500S<br>Вес: 200 г<br></p>', 4800, '2014-08-28 13:22:55', 147, 'AKG K171 MKII  закрытые студийные наушники с мембранами XXL- Varimotion, 55Ом, 18-26000Гц, кабели EK500 и EK300 в комплекте.', 19545, NULL, 124, '\0', ''),
  (20453, 'AKG K181 DJ', '<table><tbody><tr><th colspan=\"2\">Основные параметры</th></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Вид наушников</td><td>мониторные</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Тип подключения</td><td>с проводом</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Тип наушников</td><td>динамические, закрытые</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Диапазон воспроизводимых частот</td><td>5 — 30000 Гц</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Импеданс</td><td>42 Ом</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Чувствительность</td><td>120 дБ/В</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Максимальная мощность</td><td>3500 мВт</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Вес</td><td>280 г</td></tr><tr><td colspan=\"2\"><br></td></tr><tr><th colspan=\"2\">Конструкция</th></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Тип крепления</td><td>оголовье</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Конструкция</td><td>складная</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Тип кабеля</td><td>отсоединяемый</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Подключение кабеля</td><td>одностороннее</td></tr><tr><td colspan=\"2\"><br></td></tr><tr><th colspan=\"2\">Подключение</th></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Разъём наушников</td><td>mini jack 3.5 mm</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Переходник 6.3 мм в комплекте</td><td>есть</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Длина провода</td><td>1.8 м</td></tr><tr><td colspan=\"2\"><br></td></tr><tr><th colspan=\"2\">Дополнительно</th></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Особенности</td><td>провода из бескислородной меди</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Чехол/футляр в комплекте</td><td>есть</td></tr><tr><td style=\"vertical-align:bottom; white-space:nowrap\">Дополнительная информация</td><td>Дополнительно: входящий в комплект кабель можно заменить витым с разъемом mini-XLR. Переключатель низких частот (bass boost). Переключатель Stereo/Mono.</td></tr></tbody></table>', 5400, '2014-08-28 13:23:21', 147, 'AKG K181 DJ  наушники 5-30000Гц, 42Ома, переключатели: НЧ, стерео/моно', 19546, NULL, 124, '\0', ''),
  (20454, 'JBL Control CRV', '<p>JBL Control CRV - всепогодный громкоговоритель в форме сектора кольца.<br>Акустическая система уникального современного трехмерного дизайна. Система имеет весьма стильный вид и гибка в использовании. Низкоомный режим включения либо через встроенный трансформатор 70/100В. Система защищена от влаги для работы на улице. Много вариантов монтажа, широкий диапазон конфигураций и, как следствие, огромное количество вариантов инсталляции с точки зрения зоны покрытия, монтажа и внешнего вида.<br>Кабинеты комбинируются в полукруглые или полностью круглые кластеры.</p><p>Технические характеристики:</p><p><br>• Размеры: 2 х 4`<br>• Сектора кольца: 90 град.<br>• Частотный диапазон: 80 Гц - 20 кГц<br>• Мощность: 75 Вт (пик 300 Вт)<br>• 70-100 В<br>• Импеданс: 4 Ом<br>• Цвет: черный</p><p><br></p>', 7490, '2014-08-28 11:19:47', 211, 'JBL Control CRV компактная АС, полукруглый пластиковый корпус, два динамика 4\". Программная мощность 150Вт, 4Ом, мощность трансформатора 30Вт/15Вт/7,5Вт/3,8Вт. Переключатель режимов 4Ом/70В/100В. Всепогодное исполнение. В комплекте кронштейн. Цвет черный', 19547, NULL, 1884815, '\0', ''),
  (20455, 'AKG K20', '<ul><li>Тип: динамические</li><li>Чувствительность: 102 дБ</li><li>Частотный диапазон: 18 Гц - 20000 Гц</li><li>Номинальный импеданс: 32 Ом</li><li>Максимум входная мощность: 100 мВт</li><li>Кабель: односторонний, 100 см</li><li>Разъем: 3,5 мм стерео разъем</li><li>Размеры: 160 х 135 х 60 мм</li><li>Вес : 119 г</li></ul>', 2860, '2014-08-28 13:23:45', 147, 'AKG K20  наушники конференционные, 18-20000 Гц, 32 Ом, разъем \'мини-джек\', мягкие амбушюры K20 ear pads в комплекте', 19552, NULL, 124, '\0', ''),
  (20456, 'JBL Control CRV-WH', '<p>JBL Control CRV-WH - всепогодный громкоговоритель в форме сектора кольца.<br>Акустическая система уникального современного трехмерного дизайна. Система имеет весьма стильный вид и гибка в использовании. Низкоомный режим включения либо через встроенный трансформатор 70/100В. Система защищена от влаги для работы на улице. Много вариантов монтажа, широкий диапазон конфигураций и, как следствие, огромное количество вариантов инсталляции с точки зрения зоны покрытия, монтажа и внешнего вида.<br>Кабинеты комбинируются в полукруглые или полностью круглые кластеры.</p><p>Технические характеристики:</p><p><br>• Размеры: 2 х 4`<br>• Сектора кольца: 90 град.<br>• Частотный диапазон: 80 Гц - 20 кГц<br>• Мощность: 75 Вт (пик 300 Вт)<br>• 70-100 В<br>• Импеданс: 4 Ом<br>• Цвет: белый</p>', 7490, '2014-08-28 11:20:18', 211, 'JBL Control CRV-WH компактная трансформаторная АС, полукруглый пластиковый корпус, два динамика 4\". Программная мощность 150Вт, 4Ом, мощность трансформатора 30Вт/15Вт/7,5Вт/3,8Вт. Переключатель режимов 4Ом/70В/100В. Всепогодное исполнение. В комплекте кронштейн. Цвет белый', 19553, NULL, 1884815, '\0', ''),
  (20457, 'AKG K712PRO', '<p>Открытые наушники AKG K712 PRO.</p><p>Референсные открытые наушники для прослушивания, сведения и мастеринга. Накладные наушники гарантируют максимальный комфорт при длительной работе, обеспечивая при этом объемный и воздушный звук. Эти наушники имеют оголовье из мягкой кожи для легкой и удобной посадки. AKG K712 PRO поставляются с профессиональным miniXLR-разъемом для быстрой замены кабеля. Также имеется дополнительный спиральный кабель и сумка для переноски.</p><ul><li>Тип наушников: открытые.</li><li>Диапазон частот: 10 Гц...39,8 кГц.</li><li>Чувствительность: 105 дБ.</li><li>Максимальная входная мощность: 200 мВт.</li><li>Номинальное сопротивление: 62 Ом.</li><li>Амбушюры: велюр.</li><li>Съемный кабель.</li><li>Длина кабеля: 3 м.</li><li>Штекер: 1/4\" и 1/8\".</li><li>Вес: 235 г.</li></ul>', 14700, '2014-08-28 13:24:16', 147, 'AKG K712PRO референсные открытые наушники, 62Ом, 10 - 39800 Гц', 19555, NULL, 124, '\0', ''),
  (20458, 'JBL Control 42C', '<p>JBL Control 42C представляет собой компактный сателлитный громкоговоритель для размещения на потолке. Вы можете использовать его с потолочным сабвуфером 40 CST. Эта комбинация обеспечит вам мощную звуковую подачу и широкий диапазон частот.<br>Вы можете купить JBL Control 42C в нашем Интернет-магазине. Вы точно оцените небольшие размеры данной модели и превосходный звук, который отлично подойдёт для систем сабвуфер-сателлит. Элегантный дизайн сателлита позволяет разместить его практически в любом интерьере.<br></p><p>Основные характеристики<br>Компонент 2.5\" СЧ/ВЧ драйвер<br>Частотный диапазон 160 Гц - 20 кГц<br>Мощность 30 Вт програм.,15 Вт розовый шум<br>Чувствительность 82 дБ, 1 Вт, 1 м<br>Покрытие 160° коническое<br>Номинальный импеданс 16 Ом<br>Размеры(диаметр x глубина) 127 x 97 мм<br>Аксессуары в комплекте Решетка</p>', 2980, '2014-08-28 11:21:00', 211, 'JBL Control 42C ультра-компактная СЧ/ВЧ потолочная АС (используется с сабвуферами Control 50S/T или 40CS/T). ШП динамик 2,5\", 140-20000Гц, 30Вт program, 16Ом, 82дБ/1Вт/1м, коническая направленность 160°. Габариты 127 (диаметр)х94мм, диаметр выреза в потолке 104мм. вес единицы 0,7кг, вес упаковки 2кг (пара)', 19556, NULL, 1884815, '\0', ''),
  (20459, 'AKG K81 DJ', '<p>Качественные диджейские наушники для работы в небольших клубах. Благодаря 3-мерному складному механизму наушники K81 DJ очень удобны. Высокий уровень выходного сигнала обеспечивает впечатляющую громкость, а защита от внешнего шума гарантирует отчетливую слышимость даже слабого сигнала. Наушники K81 DJ компактно складываются и могут храниться в специальном чехле. Имеется стерео адаптер (3,5/6,3 мм).</p><p>Функциональные особенности</p><p>Трехмерный осевой складной механизм для простоты обращения и удобства. Сложенные в тонкий футляр, K81 DJ готовы к использованию в любое время&nbsp;<br>Высокий уровень звукового давления: для любого мероприятия, в любой обстановке. Легендарное качество звука AKG&nbsp;<br>Закрытая конструкция: изолирующие ушные чаши ослабляют фоновый шум, делая четко различимыми даже самые тихие моменты&nbsp;<br>Максимальная прочность&nbsp;<br>Фиксируемое регулируемое оголовье&nbsp;<br>Заменяемые амбушюры</p><p>Технические характеристики</p><p>Вид наушников: мониторные&nbsp;<br>Тип подключения: с проводом&nbsp;<br>Тип наушников: динамические, закрытые&nbsp;<br>Тип крепления: оголовье&nbsp;<br>Конструкция: складная&nbsp;<br>Подключение кабеля: двухстороннее&nbsp;<br>Диапазон воспроизводимых частот: 16 Гц – 24 кГц&nbsp;<br>Импеданс: 32 Ом&nbsp;<br>Максимальный уровень звукового давления: 115 дБ/В&nbsp;<br>Максимальная мощность: 2000 мВт&nbsp;<br>Разъем: mini jack 3.5 mm&nbsp;<br>Длина провода: 2,5 м&nbsp;<br>Переходник 6.3 мм в комплекте: есть&nbsp;<br>Вес (без кабеля): 150 г&nbsp;<br>Особенности: провода из бескислородной меди, сменные амбушюры</p>', 1820, '2014-08-28 13:24:43', 147, 'AKG K81 DJ  наушники складные для DJ 16-24000Гц, 32Ома', 19558, NULL, 124, '\0', ''),
  (20460, 'AKG K99', '<p>Динамические наушники полуоткрытого типа с&nbsp;охватывающими амбушюрами (тип circumaural) из&nbsp;мягкой искусственной кожи предоставляют пользователю потрясающее качество. Разработаны для использования с&nbsp;mp3- и&nbsp;CD-плеерами и&nbsp;ноутбуками. Частотный диапазон&nbsp;— 18 - 22000&nbsp;Гц,&nbsp;максимальная входная мощность&nbsp;— 200&nbsp;мВт, импеданс&nbsp;— 32&nbsp;Ом.</p><p><strong>Особенности наушников AKG K 99 :</strong></p><p>Тип: Динамические наушники полуоткрытого типа<br>Частотный диапазон: 18 - 22000 Гц,&nbsp;<br>Максимальная входная мощность: 200 мВт<br>Чувствительность: 112 Дб/В<br>Импеданс: 32 Ом.&nbsp;<br>Идеально подходят для использования с компьютером, mp3-плеером или синтезатором.</p>', 2000, '2014-08-28 13:25:07', 147, 'AKG K99 наушники полуоткрытые 18-22000Гц, 32 Ом.Кабель 3м', 19559, NULL, 124, '\0', ''),
  (20461, 'AKG K812PRO', '<p>Наушники<strong>&nbsp;AKG K812</strong>&nbsp;имеют габаритные 53-мм драйверы, благодаря алюминиевой звуковой катушке с медным покрытием, способны производить самый широкий динамический диапазон среди наушников AKG. Комфорт при работе с данными наушниками позволяет буквально часами работать в студии не снимая их, мягкие амбюшуры и невероятно удобное регулируемое оголовье, позволяют наушникам и ушам слиться в одно целое!</p><p>Директор по маркетингу и развитию продуктов AKG Кент Айверсон, сказал: «AKG K812 являются не только нашими новейшими референсными наушниками, они стали вершиной технологических инноваций, к которой мы стремились в течение 65 лет. K812 являются результатом интенсивной 5-летней программы исследований и разработок, нацеленной на создание наушников, близких к идеалу».</p><p><strong>Технические характеристики:</strong></p><ul><li>Тип наушников: открытые.</li><li>Частотный диапазон: 5 Гц - 54000 Гц.</li><li>Чувствительность: 110 дБ SPL/V.</li><li>Максимальная входная мощность: 300 мВт.</li><li>Импеданс: 36 Ом.</li><li>Отсоединяемый от наушников кабель.</li><li>Длинна кабеля: 3 метра.</li><li>Сьемные заменяемые амбюшуры.</li><li>Наушники не складываются.</li></ul>', 58000, '2014-08-28 13:25:37', 147, 'AKG K812PRO референсные открытые наушники, 36Ом, 5-54000Гц, кабель 3м', 19560, NULL, 124, '\0', ''),
  (20462, 'JBL Control 19CST', '<p>Модель JBL CONTROL 19 CST представляет собой 8\\\"\"\"\" сабвуфер с установкой потолочного типа и 70V/100V трансформаторными кранами, составляющий пару. Это устройство имеет уникальный дизайн. Встроенные камеры и линейный динамический порт позволяю данной модели сабвуфера иметь все для мощного низкочастотного вещания в компактном корпусе. В результате его использования вы получаете абсолютную точность воспроизведения, высокий уровень качества звука для музыкальных приложений в молельных домах, музеях, торговых и офисных помещениях.</p><p>Ключевые особенности модели сабвуфера JBL CONTROL 19 CST представлены:<br>Компактностью для потолочного монтажа;<br>Длинными экскурсиями;<br>Драйвером 8\\\"\"\"\" и 70V трансформатором;<br>Трансформаторными кранами 70V, включающими 60/30/15/7.5W;<br>Трансформаторными кранами 100V, включающими только 60/30/15W;<br>Вложенными палатами и дизайном для высокой производительности в наиболее компактном корпусе, увеличивающими систему полного диапазона без необходимости использования внешнего кроссовера или специального усиления;<br>Линейным динамическим дизайном порта для жесткого и расширенного низкочастотного воспроизведения;<br>Защитой от перегрузки «SonicGuard», позволяющей создавать более высокие операционные уровни без искажений и повышать надежность и долгосрочность использования системы;<br>Полным комплектом для упрощенной установки и размещения громкоговорителей.<br>Технические характеристики:<br>Тип сабвуфера: пассивный;<br>Диапазон частот (воспроизводимых): 42 Гц - 200 Гц, -10 дБ;<br>Питание (мощность): 200 ватт (непрерывная);<br>Уровень звукового давления (максимальный SPL): 115 дБ при 1 м;<br>Сопротивление: 8 Ом;<br>Чувствительность: SPL 95 дБ, 1 Вт при 1 м;<br>Кроссовер: отсутствует;<br>Драйвер: восьмидюймовый полипропиленовый диффузор с w/1.5\\\"\"\"\" и формованной алюминиевой катушкой;<br>Корпус (материал): формованная сталь (Backcan);<br>Отражатель / колесный диск: пожаробезопасность UL94V-0, средний полистирол;<br>Крепление: съемный блок разъемов с винтовыми клеммами (находится внизу);<br>Входы: х 2;<br>Выходы Loop-Thru: х 2;<br>Внешние размеры (высота х диаметр): 345 мм х 345 мм;<br>Потолочная сторона корпуса (от передней до задней части): 318 мм;<br>Вес (1 шт.): 6,3 кг.</p>', 9380, '2014-08-28 11:21:37', 211, 'JBL Control 19CST потолочный трансформаторный сабвуфер, динамик 8\". Мощность трансформатора 60Вт/30Вт/15Вт/7,5Вт. Защитная решетка и элементы для монтажа в комплекте', 19561, NULL, 1884815, '\0', ''),
  (20463, 'JBL Control 24CT Micro', '<p>Характеристики JBL CONTROL 24СT MICROОбщие данные<br>Тип - Коаксиальная двухполосная акустическая система<br>Частотный диапазон ( - 10dB ) - 85 Гц - 25 кГц<br>Номинальная дисперсия - 150° (коническая) (Гор. x Верт.)<br>Чувствительность - 86 дБ 1Вт/1м<br>Максимальное звуковое давление (mSPL)<br>* - 24C Micro - 98 дБ @ 1 м<br>* - 24CT Micro - 94 дБ @ 1 м<br>Номинальная мощность - 15 Вт<br>Программная мощность - 30 Вт<br>Номинальное сопротивление - 8 Ом ( 24С Micro )<br>Трансформаторные выводы<br>* - 100 В - 24CT Micro - 8,4,2,1,Вт<br>* - 24CT MicroPlus - 25,12 Вт 70,7 В<br>* - 24CT Micro - 8,4,2,1, 0.5 Вт<br>* - 24CT MicroPlus - 25,12,6 Вт<br>Громкоговорители<br>НЧ - 4.5\" ( 115 мм )<br>ВЧ - 0.5\" ( 12 мм )<br>Материал корпуса - формованная сталь<br>Габариты ( высота x диаметр ) - 106 x 195 мм<br>Вес ( нетто ) 24C Micro - 1.6 кг<br></p>', 3370, '2014-08-28 11:22:14', 211, 'JBL Control 24CT Micro потолочная трансформаторная 2-полосная АС, динамик 4\". Мощность трансформатора 8Вт/4Вт/2Вт/1Вт. Угол излучения 150°. Защитная решетка и элементы для монтажа в комплекте', 19562, NULL, 1884815, '\0', ''),
  (20464, 'AKG DMS TETRAD Performer Set', '<p>AKG DMSTetrad - это профессиональная цифровая беспроводная микрофонная система, рабочий диапазон которой - 2,4 ГГц. С этой системой пользователь получает некомпрессированную передачу сигнала с линейной АЧХ. А 128-битное AES-шифрование может предотвратить прослушивание звуковых сигналов.</p><p>Встроенный 4-х канальный микшер подает смикшированный сигнал 4 каналов на балансный выход MIX приемника.</p><p><strong>Особенности:</strong></p><ul><li>Система работает в диапазоне 2.4 ГГц.</li><li>Встроенный 4-х канальный микшер.</li><li>Некомпрессированная передача сигнала студийного качества с линейной АЧХ.</li><li>128-битное AES-шифрование.</li></ul><p><strong>Технические характеристики:</strong></p><ul><li>Частотный диапазон: динамической выбор частоты (DFS) в диапазоне 2.4 ГГц ISM.</li><li>Мах каналов: 4.</li><li>Шифрование: 128 Bit AES.</li><li>ВЧ выход: Max. 100 mW.</li><li>Защиты от интерференции: переключаемый.</li><li>Аудио кодирование: некомпрессия, цифровое, 48 кГц 24 bit.</li><li>Звуковой диапазон: 20 – 20,000 Гц (± 3 дБ).</li><li>Размеры: стандартный размер рэка 19”.</li></ul>', 25100, '2014-08-28 13:26:26', 147, 'AKG DMS TETRAD Performer Set цифровая радиосистема: 1 четырёхканальный приёмник DSR Tetrad, 1 поясной передатчик DPT TETRAD, 1 микрофон C111 LP, гитарный кабель MK/GL в комплекте', 19563, NULL, 124, '\0', ''),
  (20465, 'AKG DMS TETRAD Vocal Set ', '<p>AKG DMSTetrad - это профессиональная цифровая беспроводная микрофонная система, рабочий диапазон которой - 2.4 ГГц. С этой системой пользователь получает некомпрессированную передачу сигнала с линейной АЧХ. А 128-битное AES-шифрование может предотвратить прослушивание звуковых сигналов.</p><p>Встроенный 4-х канальный микшер подает смикшированный сигнал 4 каналов на балансный выход MIX приемника.</p><p><strong>Особенности AKG DMSTETRAD:</strong></p><ul><li>Система работает в диапазоне 2.4 ГГц.</li><li>Вроенный 4-х канальный микшер.</li><li>Некомпрессированная передача сигнала студийного качества с линейной АЧХ.</li><li>128-битное AES-шифрование.</li></ul><p>Комплект&nbsp;<strong>DMSTetrad Vocal Set</strong>&nbsp;включает приемник DSRTetrad и ручной передатчик DHTTetrad P5 с динамическим микрофонным капсюлем.</p><p><strong>Технические характеристики:</strong></p><ul><li>Частотный диапазон: динамической выбор частоты (DFS) в диапазоне 2.4 ГГц ISM.</li><li>Мах каналов: 4.</li><li>Шифрование: 128 Bit AES.</li><li>ВЧ выход: Max. 100 мВ.</li><li>Защиты от интерференции: переключаемый.</li><li>Аудио кодирование: некомпрессия, цифровое, 48 кГц 24 bit.</li><li>Звуковой диапазон: 20 – 20,000 Гц (± 3 дБ).</li><li>Размеры: стандартный размер рэка 19”.</li></ul>', 25150, '2014-08-28 13:26:53', 147, 'AKG DMS TETRAD Vocal Set цифровая вокальная радиосистема: 1 четырёхканальный приёмник DSR Tetrad, 1 ручной передатчик DHT Tetrad P5  с капсюлем Perception', 19564, NULL, 124, '\0', ''),
  (20466, 'JBL Control 24CT', '<p>JBL CONTROL 24СT является коаксиальной двухполосной потолочной системой для инсталляции в панели (70 В/100 В трансформаторная версия). В системе имеется коаксиально установленные 4\" вуфер и 3/4\" твитер, покрытие которого сделано из титана, они обеспечивают звуковоспроизведение высокого качества в довольно широкой рабочей зоне.</p><p>Защита от перегрузки, большой запас мощности, сверхвысокая чувствительность - это только несколько особенностей потолочной системы JBL CONTROL 24СT. Поставляются она в виде законченного комплекта, в себя включают фронтальную решетку, встроенную коробку, а еще имеется комплект для подвесной установки.</p><p>Новаторской конструкцией, имеющей такие характеристики, как уникальный дифракционный рупор и титановое покрытие твитеров, обеспечивается равномерное широкое раскрытие по всей рабочей зоне с такими.</p><p>Быстрота и легкость отличают процесс установки этих систем. В комплект с системой входят скобы, чтобы ее можно было устанавливать на фальшпотолки. Удерживается система при помощи надежной монтажной оснастки, допускающей их вращение или дальнейшую фиксацию.</p><p>На съемный разъем заведены входы, его возможно предварительно распаять, это даст возможность сокращать время, необходимое на подключение. Высококачественные встроенные трансформаторы необходимы для использования в линейных распределенных конфигурациях 70 В и 100 В. На передней стороне системы можно выбрать входы с трансформаторами.</p><p>Основные параметры<br>Тип встраиваемая, пассивная, закрытого типа<br>Акустическое излучение монополярная<br>Подключение<br>Разъем для подключения к усилителю мощности пружинный<br>Конструкция<br>Материал корпуса пластик<br>Съемная решетка есть<br>Характеристики<br>Количество полос 2<br>Мощность 15 Вт<br>Максимальная мощность 30 Вт<br>Чувствительность 86 дБ<br>Максимальное звуковое давление 102 дБ SPL<br>Импеданс 16 Ом<br>Диапазон воспроизводимых частот 80-20000 Гц (-10 дБ)<br>Частота кроссовера 3.5 кГц<br>Излучатели<br>Тип излучателей динамические<br>ВЧ-излучатель 19 мм, титан<br>НЧ-излучатель 100 мм, полипропилен<br>Дополнительно<br>Размеры (ШхВхГ) 195x195x200 мм<br>Вес 3.5 кг<br>Установочное отверстие 168 мм<br>Установочная глубина 184 мм<br>Дополнительная информация встроенный трансформатор 70/100 В</p>', 4500, '2014-08-28 11:22:49', 211, 'JBL Control 24CT потолочная трансформаторная 2-полосная АС, динамик 4\". Мощность трансформатора 30Вт/15Вт/7,5Вт/3,7Вт. Угол излучения 130°. Защитная решетка и элементы для монтажа в комплекте', 19561, NULL, 1884815, '\0', ''),
  (20467, 'AKG Perception Wireless 45 Pres Set BD M', '<p>Радиосистема с портативным передатчиком, 4-8 каналов+петличный микрофон CK99.</p><ul><li>Быстрое подключение (Plug &amp; Play).</li><li>8 часов работы от одной батареи AA.</li><li>Работа от батареи или аккумулятора.</li><li>до 8 радиоканалов.</li><li>Совместим со всеми микрофонами AKG MicroMics.</li><li>Индикатор уровня заряда батареи.</li></ul>', 9880, '2014-08-28 13:27:30', 147, 'AKG Perception Wireless 45 Pres Set BD M радиосистема для презентатора 1хSR45 стационарный приёмник, 1хPT45 поясной передатчик, 1хCK99L петличный микрофон, универсальный б/п, 1хАА батарея.', 19565, NULL, 124, '\0', ''),
  (20468, 'JBL Control 24CT MicroPlus', '<p>Описание JBL CONTROL 24CT MICROPLUS:<br>Компания JBL Professional выпустила еще одну интересную модель потолочной системы, которая идеально подходит для создания музыкального фона в помещении или озвучивания объявлений.<br>JBL CONTROL 24CT MICROPLUS представляет собой коаксильную 2-полосную систему, которая легко инсталлируется в панель. Она обеспечивает высокий уровень выходной мощности и предоставляет Вам новые возможности для озвучивания.</p><p>Высокий уровень защиты и оперативная установка</p><p>Данная модель имеет защиту от перегрузок, специальную защитную решетку и комплект подвесного монтажа. Именно поэтому сразу после приобретения JBL CONTROL 24CT MICROPLUS Вы сможете в считанные минуты произвести установку системы и начать использовать все ее возможности.<br>К тому же система укомплектована особой оснасткой, которая позволит надежно закрепить колонки в любом месте, которое Вы выберите, и вращать их или зафиксировать в нужном положении.</p><p>Обновления для хорошего звука</p><p>Систему снабдили твитерами с титановым покрытием и уникальной дифракционно-рупорной системой, благодаря этим новаторским разработкам обеспечено отличное качество звучание во всей зоне, которая охвачена действием JBL CONTROL 24CT MICROPLUS.<br>Говоря конкретнее, за надежную работу системы отвечает 4,5-дюймовый низкочастотный динамик с графитовым дифузором, который специально отлили под давлением, и 0,5-дюймовый твитер из поликарбоната.<br>Зона покрытия системы составляет 150 градусов. Благодаря специальному разделительному фильтру Вы получаете равномерное покрытие по указанной области.<br>У JBL CONTROL 24CT MICROPLUS есть встроенный 25-ваттный мультиотводный трансформатор для работы в линиях 70/100 В. Выбор выводов трансформатора осуществляется на фронтальной стороне колонок.</p><p>И еще несколько приятных деталей</p><p>Съемный разъем, к которому присоединены входы, можно распаять до инсталляции колонки, а это существенно уменьшит время на подключение.<br>Высочайшее качество, адекватная цена и гарантия надежности работы – все это Вы получаете вместе с подвесной системой JBL CONTROL 24CT MICROPLUS.</p><p>Технические характеристики:</p><p>• Тип: акустическая система<br>• Особенности: потолочная, для установки в панель<br>• Количество полос: 2<br>• Частотный диапазон: от 80 Гц до 25 000 Гц<br>• Мощность, номинальная: на линии 70 В: 25 Вт, 12 Вт и 6 Вт; на линии 100 В: 25 Вт, 12 Вт и 6 Вт<br>• Уровень звукового давления, максимальный: 99 дБ<br>• Чувствительность: 85 дБ<br>• Драйверы: ВЧ – 0,5-дюймовый поликарбонатный твитер: НЧ – 4,5-дюймовый графитовый IMG и 1-дюймовая звуковая катушка.<br>• Дисперсия, номинальная: 150 градусов, коническая<br>• Особенности: защитная решетка и направляющие для быстрой установки системы<br>• Размеры: 10,6 см х 19,5 см х 10 см<br>• Вес: 1,6 кг<br>• Комплект крепления: поставляется вместе с устройством</p>', 5000, '2014-08-28 11:30:02', 211, 'JBL Control 24CT MicroPlus потолочная трансформаторная 2-полосная АС, динамик 4\". Мощность трансформатора 25Вт/12Вт/6Вт. Угол излучения 150°. Защитная решетка и элементы для монтажа в комплекте', 19566, NULL, 1884815, '\0', ''),
  (20469, 'JBL Control 26C', '<p>Технические характеристики<br>Частотный диапазон (- 10 дБ): 75 Гц - 20 кГц<br>Номинальная дисперсия: 110° (коническая) (Гор. x Верт.)<br>Чувствительность: 89 дБ (1 Вт/1 м)<br>Максимальное звуковое давление (mSPL): 107 дБ<br>Номинальная мощность: 70 Вт<br>Программная мощность: 140 Вт<br>Номинальное сопротивление: 16 Ом<br>Громкоговорители: НЧ - 6.5\" (165 мм), ВЧ - 0.75\"(19 мм)<br>Материал корпуса: формованная сталь<br>Габариты (высота x диаметр): 210 x 252 мм<br>Вес: 3.4 кг<br></p>', 5480, '2014-08-28 11:31:15', 211, 'JBL Control 26C потолочная 2-полосная АС, динамик 6\". Программная мощность 150Вт, 16Ом. Угол излучения 100°. Защитная решетка и элементы для монтажа в комплекте', 19567, NULL, 1884815, '\0', ''),
  (20470, 'JBL Control 26CT', '<p>Технические характеристики:</p><p>Частотный диапазон ( - 10dB )75 Гц - 20 кГц<br>Номинальная дисперсия - 110° (коническая)(Гор. x Верт.)<br>Чувствительность - 89 дБ 1Вт/1м<br>Максимальное звуковое давление (mSPL) - 107 дБ @ 1м<br>Номинальная мощность - 70 Вт<br>Программная мощность - 140 Вт<br>Номинальное сопротивление - 16 Ом ( 26С )<br>Трансформаторные выводы - 100 В : 26CT - 60, 30, 15 Вт, 70,7 В : 26CT - 60, 30, 15, 7.5 Вт<br>Громкоговорители - НЧ : 6.5\"( 165 мм ), ВЧ : 0.75\"( 19 мм )<br>Материал корпуса - формованная сталь<br>Габариты ( высота x диаметр ) - 210 x 252 мм<br>Вес ( нетто ) - 4.2<br></p>', 6390, '2014-08-28 11:31:58', 211, 'JBL Control 26CT потолочная трансформаторная 2-полосная АС, динамик 6\". Мощность трансформатора 60Вт/30Вт/15Вт/7,5Вт. Угол излучения 100°. Защитная решетка и элементы для монтажа в комплекте', 19568, NULL, 1884815, '\0', ''),
  (20471, 'JBL CONTROL 12C/T-BK', '<p>Потолочная акустическая система JBL Control 12C/T.</p><p>Технические характеристики:<br>Тип: потолочная акустическая система.<br>Динамик: 3\".<br>Мощность: 70/100В - 15Вт.<br>Сопротивление: 8Ом - 20Вт.<br>частотный диапазон: 68 Гц – 17 кГц.<br>Звуковой охват: 130°.</p><p>Control 12 CT является акустической двухполосной системой коаксиального типа, представляет собой полнодиапазонный потолочный громкоговоритель, состоящий из 3\"-го конусовидного высокотехнологичного драйвера и купольного 19-тимиллиметрового твиттера, который имеет жидкостное охлаждение, и установлен в вентилируемой части системы. Внешний корпус сделан из материалов UL94-5HB и UL94-V0, устойчивых к излучению ультрафиолета, а также их можно перекрашивать в любой другой цвет. На задней панели заранее имеется крепеж для настенного монтажа, тем самым появляется возможность быстрой и легкой установки устройства.</p><p>Работает система в диапазоне частот 38 Гц-20кГц. В акустической системе программная мощность составляет 20 Ватт. Небольшие размеры системы, составляющие - в диаметре 196 миллиметров и в глубину 138 миллиметр, при весе всего 1,6 килограмма, дают возможность легко размещать систему. В любом окружении быть незаметными динамикам позволяет нейтральный дизайн.</p><p>К особенностям Control 12 CT можно отнести:</p><p>-Корпус сделан из материалов, устойчивых к излучению ультрафиолета;<br>-Дизайн нейтральный;<br>-Для настенного монтажа прикреплен крепеж на задней панели.</p><p>Основные параметры<br>Тип акустическая система потолочная<br>Мощность RMS 20Вт, программная 40Вт<br>Излучатель 3\'<br>Импеданс 8 Ом<br>Чувствительность 84 dB<br>Частотный диапазон 95 Гц – 15 кГц<br>Размеры 196x138 мм<br>Вес 1,6 кг</p>', 3700, '2014-09-18 15:18:17', 211, 'JBL CONTROL 12C/T-BK потолочная АС, динамик 3\". Мощность 70/100В - 15Вт. 8Ом - 20Вт черная', 19569, NULL, 1884815, '\0', ''),
  (20472, 'JBL CONTROL 12C/T', '<p>Control 12 CT является акустической двухполосной системой коаксиального типа, представляет собой полнодиапазонный потолочный громкоговоритель, состоящий из 3\"-го конусовидного высокотехнологичного драйвера и купольного 19-тимиллиметрового твиттера, который имеет жидкостное охлаждение, и установлен в вентилируемой части системы. Внешний корпус сделан из материалов UL94-5HB и UL94-V0, устойчивых к излучению ультрафиолета, а также их можно перекрашивать в любой другой цвет. На задней панели заранее имеется крепеж для настенного монтажа, тем самым появляется возможность быстрой и легкой установки устройства.</p><p>Работает система в диапазоне частот 38 Гц-20кГц. В акустической системе программная мощность составляет 20 Ватт. Небольшие размеры системы, составляющие - в диаметре 196 миллиметров и в глубину 138 миллиметр, при весе всего 1,6 килограмма, дают возможность легко размещать систему. В любом окружении быть незаметными динамикам позволяет нейтральный дизайн.</p><p>К особенностям Control 12 CT можно отнести:</p><p>-Корпус сделан из материалов, устойчивых к излучению ультрафиолета;<br>-Дизайн нейтральный;<br>-Для настенного монтажа прикреплен крепеж на задней панели.</p><p>Основные параметры<br>Тип акустическая система потолочная<br>Мощность RMS 20Вт, программная 40Вт<br>Излучатель 3\'<br>Импеданс 8 Ом<br>Чувствительность 84 dB<br>Частотный диапазон 95 Гц – 15 кГц<br>Размеры 196x138 мм<br>Вес 1,6 кг</p>', 3700, '2014-09-18 15:18:50', 211, 'JBL CONTROL 12C/T потолочная АС, динамик 3\". Мощность 70/100В - 15Вт. 8Ом - 20Вт белая', 19570, NULL, 1884815, '\0', ''),
  (20473, ' JBL CONTROL 16C/T', '<p>Описание JBL Control 16CT</p><p>JBL Control 16CT - это двухполосная акустическая система коаксиального типа, являющаяся потолочным полнодиапазонным громкоговорителем, состоящим из 6.5-ти дюймового конусовидного высокотехнологичного драйвера и купольного твиттера, размером 19 миллиметров, с жидкостным охлаждением, он находится в вентилируемом участке системы. Корпус системы сделан из материалов UL94 -5HB и UL94-V0, она достаточно устойчивы к излучению от ультрафиолета, а при желании могут быть перекрашены в другие цвета. На задней панели заранее есть прикрепленный крепеж для монтажа на стену, это даст возможность быстро и без труда легко установить данное устройство.</p><p>Частотный диапазон системы равен 62 Гц-20кГц. Программная мощность этой акустической системы равняется 50 Ватт. Глубина системы составляет 225 миллиметров, диаметр 253 миллиметров, вес 3,4 килограмма, за счет этого всего систему легко разместить где будет удобно. За счет нейтрального дизайна динамики в любом окружении будут незаметными.</p><p>Особенности JBL Control 16CT:</p><p>- Корпус выполнен из материалов, устойчивых к ультрафиолетовому излучению;<br>- Дизайн нейтральный;<br>- Для настенного монтажа на заднюю панель изначально прикреплен крепеж.</p><p>Основные параметры<br>Тип акустическая система потолочная<br>Мощность RMS 50Вт, программная 100Вт<br>Излучатель 6,5\'<br>Импеданс 8 Ом<br>Чувствительность 91 dB<br>Частотный диапазон 62 Гц – 20 кГц<br>Размеры 253x225 мм<br>Вес 3,4 кг</p>', 6700, '2014-08-28 11:34:18', 211, 'JBL Control 16С/Т - акустическая система, 2-полосная потолочная коаксиальная, RMS 50Вт, программ. 100Вт, 6,5\', 8 Ом или трансформатор, 91 dB чувств. 110 град раскрытие', 19571, NULL, 1884815, '\0', ''),
  (20474, 'JBL LSR4326PAK', '<p>Характеристики JBL LSR4326PAKОбщие данные<br>Тип - концертная, активная, фазоинверторного типа<br>Акустическое излучение - монополярная<br>Назначение - мониторный громкоговоритель<br>Характеристики<br>Количество полос - 2<br>Мощность - 220 Вт<br>Диапазон воспроизводимых частот - 47-22000 Гц (-3 дБ)<br>Частота кроссовера - 2.4 кГц<br>Усилитель<br>Раздельное усиление НЧ и ВЧ (Bi-amping) - есть<br>Интерфейсы - линейный вход x2, балансный вход x2, коаксиальный вход<br>Излучатели<br>Тип излучателей - динамические<br>ВЧ-излучатель - 25 мм купол, шёлк<br>НЧ-излучатель - 159 мм целлюлоза<br>Конструкция<br>Материал корпуса - пластик<br>Крепления для монтажа - есть<br>Магнитная защита - есть<br>Дополнительно<br>Защита от перегрузки - есть<br>Варианты отделки - чёрный<br>Размеры (ШхВхГ) - 236x387x262 мм<br>Вес - 12.7 кг<br>Дополнительная информация - мощность усилителя НЧ - 150 Вт, ВЧ - 70 Вт, цифровые входы/выходы - AES/EBU XLR, S/PDIF RCA, аналоговые входы - XLR, 6.3 мм джек, RMC mic, переключатель чувствительности, RJ-45 вход/выход, USB интерфейс<br></p>', 45900, '2014-08-28 11:35:36', 211, 'JBL LSR4326PAK комплект мониторов Stereo включает JBL LSR4326P 2шт, набор аксессуаров LSR4300KIT', 19572, NULL, 1884815, '\0', ''),
  (20475, 'AKG Perception Wireless 45 Vocal Set BD B2', '<p>Радиосистема с ручным вокальным передатчиком Perception HT45. 4 - 8 частот в одном диапазоне.</p><p>Системы серии Perception обеспечивают великолепный звук и удивительно просты в использовании.</p><p>Система включает в себя приемник SR45 и и ручной передатчик HT45, US/UK/EU адаптер, SA 45 адаптери одну батарейку АА.</p><p>SR45&nbsp; оснащен выходами XLR и 1/4\" jack, а также системами контроля громкости и шумоподавления.</p><p>Решетка из особой пружинной стали на передатчике защищает от всех лишних шумов, возникающих при работе на сцене, а кардиоидная направленность обеспечиваеь отличное звучание голоса еще до всякой обработки.</p><p>Отличительные особенности:</p><ul><li>8 каналов, частотный шаг 30 МГц.</li><li>8 часов работы с одной батарейкой АА.</li><li>Полный контроль на ручном передатчике.</li><li>Индикатор уровня заряда батареи.</li><li>Бесшумный on/off/mute переключатель на ручном передатчике.</li><li><br></li></ul>', 7780, '2014-08-28 13:28:32', 147, 'AKG Perception Wireless 45 Vocal Set BD B2 вокальная радиосистема. 1хHT45 ручной передатчик с динамическим капсюлем, 1хSR45 стационарный приёмник. Универсальный б/п, держатель микрофона, 1хАА батарея', 19573, NULL, 124, '\0', ''),
  (20476, 'JBL LSR4328P', '<p>Характеристики JBL LSR4328PОбщие данные<br>Тип - Студийный монитор<br>Акустическое излучение - монополярная<br>Назначение - мониторный громкоговоритель<br>Характеристики<br>Количество полос - 2<br>Мощность - 220 Вт<br>Диапазон воспроизводимых частот - 50-20000 Гц (+/-1.5 дБ)<br>Усилитель<br>Раздельное усиление НЧ и ВЧ (Bi-amping) - есть<br>Интерфейсы - балансный вход, коаксиальный вход<br>Излучатели<br>Тип излучателей - динамические<br>ВЧ-излучатель - 25 мм<br>НЧ-излучатель - 203 мм<br>Конструкция<br>Материал корпуса - MDF<br>Толщина стенок колонки - 15 мм<br>Дополнительно<br>Размеры (ШхВхГ) - 267x438x269 мм<br>Вес - 15 кг<br>Дополнительная информация -</p><p> мощность усилителя НЧ - 150 Вт, ВЧ - 70 Вт.<br></p>', 34000, '2014-08-28 11:36:22', 211, 'JBL LSR4328P монитор активный 2-полосный студийный 8\" с технологией RMC. Усилитель НЧ 150Вт, ВЧ 70Вт. 43—22кГц. Входы: аналог XLR, AES/EBU вх/вых, S/PDIF вх/вых, вход для измерительного микрофона. CAT5 для сети HiQnet Network, USB порт управления. Кнопки управления на лицевой панели. 438x267x269мм, 13,1кг', 19574, NULL, 1884815, '\0', ''),
  (20477, 'AKG Perception Wireless 45 Vocal Set BD C1', '<p>Радиосистема с ручным вокальным передатчиком Perception HT45. 4 - 8 частот в одном диапазоне.</p><p>Системы серии Perception обеспечивают великолепный звук и удивительно просты в использовании.</p><p>Система включает в себя приемник SR45 и и ручной передатчик HT45, US/UK/EU адаптер, SA 45 адаптери одну батарейку АА.</p><p>SR45&nbsp; оснащен выходами XLR и 1/4\" jack, а также системами контроля громкости и шумоподавления.</p><p>Решетка из особой пружинной стали на передатчике защищает от всех лишних шумов, возникающих при работе на сцене, а кардиоидная направленность обеспечиваеь отличное звучание голоса еще до всякой обработки.</p><p>Отличительные особенности:</p><ul><li>8 каналов, частотный шаг 30 МГц.</li><li>8 часов работы с одной батарейкой АА.</li><li>Полный контроль на ручном передатчике.</li><li>Индикатор уровня заряда батареи.</li><li>Бесшумный on/off/mute переключатель на ручном передатчике.</li><li><br></li></ul>', 7780, '2014-08-28 13:29:06', 147, 'AKG Perception Wireless 45 Vocal Set BD C1 вокальная радиосистема. 1хHT45 ручной передатчик с динамическим капсюлем, 1хSR45 стационарный приёмник. Универсальный б/п, держатель микрофона, 1хАА батарея.', 19575, NULL, 124, '\0', ''),
  (20478, 'AKG Perception Wireless 45 Vocal Set BD D', '<p>Радиосистема с ручным вокальным передатчиком Perception HT45. 4 - 8 частот в одном диапазоне.</p><p>Системы серии Perception обеспечивают великолепный звук и удивительно просты в использовании.</p><p>Система включает в себя приемник SR45 и и ручной передатчик HT45, US/UK/EU адаптер, SA 45 адаптери одну батарейку АА.</p><p>SR45&nbsp; оснащен выходами XLR и 1/4\" jack, а также системами контроля громкости и шумоподавления.</p><p>Решетка из особой пружинной стали на передатчике защищает от всех лишних шумов, возникающих при работе на сцене, а кардиоидная направленность обеспечиваеь отличное звучание голоса еще до всякой обработки.</p><p>Отличительные особенности:</p><ul><li>8 каналов, частотный шаг 30 МГц.</li><li>8 часов работы с одной батарейкой АА.</li><li>Полный контроль на ручном передатчике.</li><li>Индикатор уровня заряда батареи.</li><li>Бесшумный on/off/mute переключатель на ручном передатчике.</li></ul>', 7780, '2014-08-28 13:29:35', 147, 'AKG Perception Wireless 45 Vocal Set BD D вокальная радиосистема. 1хHT45 ручной передатчик с динамическим капсюлем, 1хSR45 стационарный приёмник. Универсальный б/п, держатель микрофона, 1хАА батарея.', 19575, NULL, 124, '\0', ''),
  (20479, 'JBL LSR6325P-1', '<p>JBL LSR6325P-1 является современным монитором, в него были вложены все нужные технологические инновации, позволяющие минимизировать специфические проблемы акустики. В данной модели регулятор громкости распологается на передней панели, тем самым существенно облегчается доступ к системе. С легкостью можно найти точки для монтажа как в вертикальном, так и горизонтальном положении, находящиеся на корпусе. У JBL LSR6325P-1 корпус сделан из алюминия и покрыт темным графитовым, который является радиатором для усилителей и драйверов. Стоит заметить, что при использовании данной модель вместе с сабвуфером LSR6312SP получается не только полнодиапазонная, а также и компактная контрольная система.</p><p>К особенностям JBL LSR6325P-1 можно отнести:</p><p>Монитор высококачественный, имеет два усилителя и фирменный преобразователь.<br>Схемой коррекции акустики помещения RMC™ обеспечивается электронный контроль звучания мониторов в помещении. Набор средств для калибровки входит в комплект поставки.<br>Технология Differential Drive® имеет динамическое торможение, с его помощью увеличивается низкочастотный диапазон и снижается компрессия.<br>Есть 2 встроенных усилителя, имеющие заводские настройки чувствительности.<br>Высокочастотный композитный преобразователь, имеющий титановое напылением, во взаимосвязи со сфероидальным волноводом, сечением которого эллиптическое, позволяют с большой точностью контролировать направленность звуковых волн.<br>Твиттер экранирован магнитно, это дает возможность свести к самому минимуму все помехи, которые возникают от видео мониторов, находящихся по близости.<br>Внутренняя перегородка уменьшает резонанс корпуса и сделана из материала высокой плотности.<br>За счет конструкции фазоинвертора, имеющего линейное открытие динамики, снижается компрессия воздуха и устраняется турбулентность.<br>В корпусе удобные монтажные опоры, прочностью корпуса повышенная.<br>На корпусе есть ручки, которые облегчают перенос монитора.</p><p>Технические характеристики:</p><p>Тип полочная, активная, фазоинверторного типа<br>Акустическое излучение монополярная<br>Назначение мониторный громкоговоритель<br>Излучатели<br>Тип излучателей динамические<br>ВЧ-излучатель 25.4 мм, купол, титан<br>НЧ-излучатель 133.4 мм<br>Дополнительно<br>Варианты отделки черный<br>Размеры (ШхВхГ) 173x269x241 мм<br>Вес 7.7 кг<br>Характеристики<br>Количество полос 2<br>Максимальная мощность 150 Вт<br>Конструкция<br>Материал корпуса алюминий<br>Крепления для монтажа есть</p>', 16700, '2014-08-28 11:37:19', 211, 'JBL LSR6325P-1 монитор активный 2-полосный студийный 5\", ВЧ 1\" в волноводе EOS. Вход XLR, RCA. Корпус алюминиевый литой, 4 точки крепления кронштейна, 269х173х241мм, 7,7кг', 19576, NULL, 1884815, '\0', ''),
  (20480, 'AKG Perception Wireless 45 Sports Set BD B1', '<p>AKG Perception Wireless 45 Sports Set BD B1 радиосистема с микрофоном с оголовьем C544L, 1хSR45 стационарный приёмник, 1хPT45 поясной передатчик, универсальный б/п, 1хАА батарея<br></p>', 11200, '2014-08-28 13:30:55', 147, 'AKG Perception Wireless 45 Sports Set BD B1 радиосистема с микрофоном с оголовьем C544L, 1хSR45 стационарный приёмник, 1хPT45 поясной передатчик, универсальный б/п, 1хАА батарея', 19577, NULL, 124, '\0', ''),
  (20481, 'JBL MSC1', '<p>JBL MSC1 является универсальным контроллером для студийных мониторов, у которого есть функция коррекции сигнала. Диапазон частот равняется: +0 / -0,5 дБ, 20 Гц - 20 кГц. D/A и A/D преобразователи: 24 бит.</p><p>JBL MSC1 можно назвать ключом к мониторинговой системе. Ведь эта модель представляет собой контроллер монитора, тем самым это даст Вам возможность с легкостью переключаться между двумя наборами студийных мониторов, а в придачу еще большое количество абсолютно новых функций. Если Вы отдадите предпочтение контроллеру JBL MSC1, тогда сможете получить технологию коррекции режима и измерительный микрофон. Данное устройство также имеет выбор входного / B / C для общего Pro Control мониторинга с MSC1.</p><p>JBL MSC1 предоставит Вам ряд новейших возможностей. Данная модель даст Вам нужную «мониторную полосу» функций, доступных в больших микшерных пультах. Так как акустика в помещении играет немалую роль в том, какой именно звук мы слышим, поэтому в JBL MSC1 имеется максимально усовершенствованные технологии коррекции. В итоге Вы получите гармоничное звучание, оно сможет удивить как Вас, так и вашу аудиторию!</p><p>Для предоставления Вам возможности создавать самые лучшие миксы в любом удобном месте, разработчики JBL создали технологию RMC, используемую в своих довольно известных студийных мониторах ЛСР серии. однако они решили не останавливаться на том, чего достигли. Они создали MSC1 со следующим поколением RMC, который способен работать в абсолютно любом помещении.</p><p>Нет разницы, какая модель акустической системы у Вас есть, Вы все равно сможете получать прекрасно настроенный и калиброванный звук, дающий Вам возможность делать Ваши самые лучшие миксы.</p><p>MSC1 может контролировать мониторинг 3ех стерео-источников ввода, источниками могут быть: электронный музыкальный инструмент, компьютерная рабочая станция, микшерный пульт, MP3 или CD-плеер.</p><p>Характеристики<br>* - Мастеровой регулятор громкости.<br>* - Выбор акустической системы A/B.<br>* - Выбор входного источника звука A/B/C.<br>* - Выход на сабвуфер с регулятором громкости и возможностью выбора частот кроссовера.<br>* - Эквалайзер низкочастотного и высокочастотного диапазона.<br>* - Выход на наушники с отдельным регулятором громкости.<br>* - Функция Mute для мониторов.<br>* - Кнопка включения функции RMC On/Bypass.<br>* - Регулируемая чувствительность входа с индикатором наличия сигнала и перегрузки.<br>* - Совместимость с любой мониторной системой.</p><p>S / N, динамический диапазон 110 дБ типично, А-взвешенный, 20 Гц - 20 кГц<br>Частотный диапазон +0 / -0,5 дБ, 20 Гц - 20 кГц</p>', 13000, '2014-08-28 11:38:36', 211, 'JBL MSC1 контроллер универсальный для студийных мониторов. Произвольное переключение 3х стерео входов на 2 пары акустических систем + 1 сабвуфер. Регулировка уровня. Выход на наушники. Функция настройки под акустические свойства помещения. В комплекте измерительный микрофон и ПО для автоматической калибровки мониторов', 19578, NULL, 1884815, '\0', ''),
  (20482, 'AKG Perception Wireless 45 Pres Set BD U1', '<p>AKG Perception Wireless 45 Pres Set BD U1 радиосистема для презентатора 1хSR45 стационарный приёмник, 1хPT45 поясной передатчик, 1хCK99L петличный микрофон, универсальный б/п, 1хАА батарея.<br></p>', 9780, '2014-08-28 13:31:28', 147, 'AKG Perception Wireless 45 Pres Set BD U1 радиосистема для презентатора 1хSR45 стационарный приёмник, 1хPT45 поясной передатчик, 1хCK99L петличный микрофон, универсальный б/п, 1хАА батарея.', 19579, NULL, 124, '\0', ''),
  (20483, 'AKG Perception Wireless 45 Instr Set BD A', '<p>AKG Perception WMS45 instrumental set идеальна для весьма широкого спектра применения.</p><p>Состоит из приемникаSR45 и карманного передатчика PT45, самого маленького и легкого в своем классе.</p><p>Систему можно использовать с большим колическтвом миниатюрных микрофонов AKG.</p><p>В составе: универсальный адаптер US/UK/EU, кабель MKG&nbsp;L с&nbsp; разъемом&nbsp; 1/4 jack и переходником mini XLR, батарейка АА.</p><p>В комбинации с C 519 ML&nbsp; подходит также для духовых инструментов.</p><p>Основные характеристики</p><ul><li>8 частот в одном диапазоне, с частотным шагом 30мГц.</li><li>8 часов работы с одной батарейкой АА.</li><li>Совместим с AKG MicroMics.</li><li>Индикатор уровня заряда батареи.</li><li>Самый маленький и легкий карманный передатчик в своем классе.</li><li>Дополнен кабелем MKG&nbsp;L для прямого соединения с электро- или бас-гитарой.</li></ul>', 8520, '2014-08-28 13:31:56', 147, 'AKG Perception Wireless 45 Instr Set BD A инструментальная радиосистема. 1хSR45 стационарный приёмник, 1хPT45 поясной передатчик, гитарный кабель MK GL, универсальный б/п, 1хАА батарея.', 19580, NULL, 124, '\0', ''),
  (20484, 'JBL LSR305', '<p><br></p><p>Двухполосный активный монитор ближнего поля JBL LSR305 представлен компанией JBL на международной музыкальной выставке NAMM 2013. Студийный монитор является представителем серии JBL LSR3, которая включает в себя достаточно недорогие активные мониторы ближнего поля LSR305 и LSR308. В конструкции монитора использована новейшая запатентованная технология рупорных звуковых излучателей - Image Control Waveguide.</p><p>Новая технология предназначен для того, что бы получать высококачественное звучание в помещениях любой акустической сложности и размера. Если Вы желаете купить активные студийные мониторы, JBL LSR305 предложит отличное звуковое и функциональное решение для бюджетной и полупрофессиональной студии звукозаписи.</p><p>Основные особенности монитора JBL LSR305</p><p>- Современный дизайн и концепция, разработанные инженерами компании JBL.<br>- Максимально точная звуковая картина с точным звуковым центром.<br>- Четка передача низко- и высокочастотного спектра благодаря особой конструкции звуковых излучателей.<br>- Акустический кабинет фазоинверторного типа с выходом низкочастотного излучателя на задней панели.<br>- Большой низкочастотный вуфер (127 мм.) помогает воспроизводить максимально глубокое звучание низкочастотного спектра.<br>- Мощность интегрированного усилителя и сбалансированные динамики позволяют получать равномерное звучание даже в достаточно больших акустических помещениях.<br>- Использование новейшей запатентованной технологии рупорных излучателей - Image Control Waveguide от JBL.<br>- Широкий диапазон воспроизводимых частот от 43 Гц до 24 кГц.<br>- Высокочастотный драйвер, размером 25 мм., способен воспроизводить кристально прозрачные высокие частоты.<br>- Раздельная система усиления НЧ - 41 Ватт (Класс D) и ВЧ - 41 Ватт (Класс D) для четкой передачи звучания всего спектра звуковых частот.<br>- Различные варианты входной коммутации, включающие в себя балансные разьемы XLR и TRS.<br>- Возможность использования различных схем электропитания (100 - 240 В, 50/60 Гц).<br>- Небольшой вес, благодаря которому монитор легко транспортировать.<br>- Особенное строение акустического кабинета, позволяющее использовать горизонтальную и вертикальную установку.</p><p>Особенности строения рупорных излучателей</p><p>В конструкции монитора использованы новые рупорные излучатели Image Control Waveguide, которые были разработаны специально для флагманской модели профессиональных студийных мониторов. Теперь все особенности и преимущества этой технологии используются и в доступной по цене модели студийных мониторов JBL LSR305.</p><p>Легендарные высокочастотные преобразователи от JBL</p><p>Высокочастотный динамик специально разработан и изготовлен в виде неодимового ВЧ-твиттера. Эта технология применена для того, что бы воспроизводить кристально прозрачные высокие частоты во всем звуковом спектре.</p><p>Запатентованная система Slip Stream для глубокого звучания низких частот</p><p>Эта система разработана для того, что бы в звучании низкочастотного спектра НЧ вуфер мог воспроизводить невероятно глубокие басы независимо от общей громкости акустической системы. Применение новейших технологий в электронике и конструкции монитора позволило обеспечить пользователей впечатляюще глубокими басами, звучащими даже за пределами человеческого слуха.</p><p>Секция дополнительных частотных фильтров LF и HF Trim</p><p>Студийный монитор, кроме ручки настройки уровня звукового сигнала, так же предлагает воспользоваться системой дополнительных фильтров. Пользователи могут переключать частоту среза высоких и низких частот переключателями LF и HF Trim. Срез низкочастотного спектра составляет + 2 дБ, 0 и -2 дБ, срез высокочастотного фильтра + 2 дБ, 0 и -2 дБ. Используя эти фильтры можно настроить корректное звучание монитора практически под любой тип помещения.</p><p>Технические характеристики:</p><p>Тип устройства : монитор студийный<br>Электроника : активная<br>Особенности : монитор ближнего поля<br>Тип акустического кабинета : фазоинверторный тип<br>Диапазон воспроизводимых частот : 43 Гц - 24 кГц<br>Звуковое давление : 108 дБ (SPL-C-Weighted)<br>Максимальный уровень входного сигнала : +23 дБм<br>Схема защиты электроники : активная схема<br>- Электромагнитное экранирование : есть (можно устанавливать около компьютерных дисплеев)</p><p>Мощность : 80 Ватт (суммарная)<br>- Система усиления : раздельная<br>- НЧ усилитель мощности : 41 Ватт, класс D<br>- ВЧ усилитель мощности : 41 Ватт, Класс D</p><p>Спецификация динамиков :<br>- Размер НЧ динамика : 127 мм. (5\")<br>- Размер ВЧ драйвера : 25 мм. (1\")</p><p>Дополнительные органы настройки :<br>- Ручка настройки уровня сигнала : Volume (задняя панель)<br>- Фильтр LF Trim : диапазон + 2 дБ, 0, -2 дБ<br>- Фильтр HF Trim : + 2 дБ, 0, -2 дБ<br>- Кнопка Вкл.\\Выкл. питания : задняя панель</p><p>Коммутация : 1 x XLR, 1 x TRS (балансные разьемы)<br>Питание устройства : 100 - 240 В (переменный ток), 50/60 Гц<br>Габаритные размеры : (В) 298 мм. (Ш) 238 мм. x (Г) 251 мм<br>Комплект поставки : один монитор<br>Вес : 4.6 кг</p>', 6400, '2014-08-28 11:39:12', 211, 'JBL LSR305 монитор активный 2-полосный студийный 5\". Усилители D-класса: НЧ 41Вт, ВЧ 41Вт. 43—24кГц. Входы XLR, 1/4″ TRS. Корпус МДФ 15мм, 298x238x251мм, 4,6кг', 19581, NULL, 1884815, '\0', ''),
  (20485, 'AKG Perception Wireless 45 Instr Set BD C1', '<p>AKG Perception WMS45 instrumental set идеальна для весьма широкого спектра применения.</p><p>Состоит из приемникаSR45 и карманного передатчика PT45, самого маленького и легкого в своем классе.</p><p>Систему можно использовать с большим колическтвом миниатюрных микрофонов AKG.</p><p>В составе: универсальный адаптер US/UK/EU, кабель MKG&nbsp;L с&nbsp; разъемом&nbsp; 1/4 jack и переходником mini XLR, батарейка АА.</p><p>В комбинации с C 519 ML&nbsp; подходит также для духовых инструментов.</p><p>Основные характеристики</p><ul><li>8 частот в одном диапазоне, с частотным шагом 30мГц.</li><li>8 часов работы с одной батарейкой АА.</li><li>Совместим с AKG MicroMics.</li><li>Индикатор уровня заряда батареи.</li><li>Самый маленький и легкий карманный передатчик в своем классе.</li><li>Дополнен кабелем MKG&nbsp;L для прямого соединения с электро- или бас-гитарой.</li></ul>', 8520, '2014-08-28 13:32:25', 147, 'AKG Perception Wireless 45 Instr Set BD C1 инструментальная радиосистема. 1хSR45 стационарный приёмник, 1хPT45 поясной передатчик, гитарный кабель MK GL, универсальный б/п, 1хАА батарея', 19583, NULL, 124, '\0', ''),
  (20487, 'JBL PRX412M', '<p>JBL PRX412M портативная двухполосная акустическая система, НЧ-динамик 12\".<br>Тип системы: пассивный;<br>Мощность: 300Вт/600Вт/1200Вт (продолжительная/программная/пиковая);<br>Частотный диапазон 50Hz - 19 kHz;<br>Чувствительность 126dB SPL;<br>Номинальное сопротивление 8 Ом;<br>Номинальная мощность 300 Вт;<br>Покрытие Duraflex™, стальная решетка 16 Ga, 12 точек подвеса М10;<br>Габариты (В х Ш х Г): 577мм x 353мм x 400мм;<br>Вес: 17.5 кг.<br></p>', 24400, '2014-08-28 11:40:26', 211, 'JBL PRX412M 2-полосная пассивная мониторная/FOH 12\" АС; 300Вт/600Вт/1200Вт, 8Ом, 126дБ Maximum SPL, Покрытие DuraFlex, двойной 36мм \"стакан\", 12 M10 точек подвеса. Вес 17,5кг', 19585, NULL, 1884815, '\0', ''),
  (20488, 'AKG PR4500 PT BD4', '<p>AKG PR4500 PT Set - накамерная радиосистема с портативными приемником PR4500 и передатчиком PT4500, петличным микрофоном CK99 L. Радиосистема обеспечивает непревзойденную простоту использования и превосходное качество звука.</p><p>PR4500 карманный приемник имеет металлический, но легкий корпус и предназначен для установки на различные видеокамеры, цифровые зеркальные фотокамеры или другой передачи A/V с помощью прилагаемого адаптера. Система способна транслировать до 18 каналов одновременно, что помогает повысить мощность сигнала и снижение помех. PR4500 имеет 1/8 \"TRS выход на наушники для мониторинга звука, а также выход XLR.</p><p>PT4500 - портативный передатчик с прочным литым магниевым корпусом. УКВ диапазон, шириной 30 МГц обеспечивает до 1200 селектируемых частот, а несколько банков предустановленных частот для различных стран облегчают настройку многоканальных систем. Дисплей с фоновой подсветкой упрощает настройку передатчика на ту же частоту, что и приемник. Система пилотного тона постоянно передает данные о состоянии передатчика, включая положение выключателя MUTE и оставшийся заряд батареи, на ресивер. Мощность передатчика&nbsp;составляет 50 мВт для достижения максимальной устойчивости к интерференции и выпадениям. 3-пиновый разъем мини-XLR с изменяемыми параметрами чувствительности совместим с любыми портативными инструментами и микрофонами AKG в любых приложениях. Опциональный дистанционный выключатель mute позволяет пользователю отключать передатчик без необходимости нащупывать выключатель на корпусе, если передатчик спрятан в одежде.</p><p>Приемник и передатчик могут получать питание от двух батареек АА либо аккумулятора BP4000. Интегрированные зарядные контакты позволяют заряжать опциональный батарейный блок&nbsp; BP&nbsp;4000, не вынимая его из корпуса. Часа зарядки хватает&nbsp;на работу в течение 12 часов. На батарейках типа АА продолжительность непрерывной работы составляет до 15 часов.</p><p>CK99 L – ультралегкий, чрезвычайно компактный и незаметный на одежде конденсаторный петличный микрофон кардиоидной направленности с частотным диапазоном 15 Гц- 18 кГц, чувствительностью 8.8 мВ/Па и сопротивлением 200 Ом, обеспечивающий естественное звучание. Микрофон прекрасно переносит воздействие неблагоприятных факторов внешней среды. CK99 L имеет 3-контактный разъем Mini-XLR.</p>', 35450, '2014-08-28 13:33:03', 147, 'AKG PR4500 PT BD4 накамерная радиосистема.  1x PT4500 поясной передатчик, 1хPR4500 ENG накамерный приёмник, кабель с разъемом XLR, кабель с разъемом Mini-Jack, 4хАА батареи', 19586, NULL, 124, '\0', ''),
  (20489, 'JBL PRX418S', '<p>Описание JBL PRX418S:<br>Вы уже давно подыскиваете компактную модель сабвуфера? Предлагаем вам обратить внимание на компактный сабвуфер JBL PRX418S – стильное и мощное устройство. Независимо от вашего местонахождения, это устройство способно обеспечить вам живой и сильный звук.</p><p>Компактный сабвуфер JBL PRX418S обладает системой выходных разъемов, делающей возможным подключение различных кабелей. В стандартную комплектацию данной модели включены батареи, подключающие низкочастотный динамик. Корпус сабвуфера изготавливается из древесины тополя или березы, а также мультиламината (лиственные породы деревьев), имея прочное покрытие DuraFlex также разработанное компанией JBL. Дополнительную защиту драйвера обеспечивает прозрачная пена, покрывающая решетки изнутри. Дизайн сабвуфера JBL PRX418S достаточно сдержанный и элегантный, что делает устройство привлекательным, а потому вы сможете разместить его на самом видом месте.</p><p>Заявите о себе, как об обладателе высококачественного и компактного оборудования от компании JBL!</p><p>Технические характеристики:</p><p>- Тип: Пассивный сабвуфер<br>- Конструкция: напольная<br>- Количество полос: 2<br>- Номинальная мощность: 800 Вт<br>- Диапазон частот: 50 - 19000 Гц<br>- Акустическое оформление: фазоинвертор<br>- Максимальная мощность: 3200 Вт<br>- Номинальный импеданс: 8 Ом<br>- Чувствительность: 95 дБ<br>- НЧ-излучатели: одноканальный, динамический, 18\"<br>- Максимальное звуковое давление: 130 дб<br>- Разъем подключения к источнику сигнала: Speakon (Neutrik)<br>- Габариты , мм: 678 x 536 x 615<br>- Вес: 36 кг.</p>', 35300, '2014-08-28 11:41:07', 211, 'JBL PRX418S пассивный компактный сабвуфер 18\", 800Вт/1600Вт/3200Вт, 8Ом, 35 Гц – 250 Гц, Max SPL 130дБ, M20 \"стакан\" для соединительной стойки, Вес 36кг, покрытие Tough DuraFlex', 19587, NULL, 1884815, '\0', ''),
  (20490, 'JBL PRX425', '<p>Описание JBL PRX425 2-x:<br>Универсальная акустическая система JBL PRX425 2-x представляет собой мощный, но компактный качественный усилитель звука. Благодаря такой системе можно добиться качественной и чистой передачи звука, как на больших концертных площадках, так и в помещении. Динамики в системе обладают очень высокой мощностью, способны обрабатывать до 2400 Вт. Мощный пластиковый корпус черного цвета, очень прочный, а это значит, что при транспортировке, система не повредится, динамики защищены специальной стальной решеткой. Акустическая система JBL PRX425 2-x очень проста в управлении и имеет ряд профессиональных настроек работающих в широком диапазоне, благодаря которым, можно добиться первоклассного звучания на любых частотах и в любой тональности. Обладает высокой чувствительностью в 134 дБ.</p><p>Технические характеристики JBL PRX425 2-x:</p><p>Производитель: JBL<br>Модель: PRX425 2-x<br>Тип: акустическая система<br>Номинальная мощность: 600/1200/2400 Вт<br>Диапазон частот: от 55 Гц до 19 кГц<br>Частотный диапазон: 75 Гц до 16 кГц<br>Корпус: DuraFlex, стальная решетка<br>Чувствительность: 134 дБ<br>Габариты: 1044 мм x 429 мм x 521 мм<br>Вес: 33, 5 кг</p>', 34400, '2014-08-28 11:41:44', 211, 'JBL PRX425 2-полосная 2 х15\" пассивная акустическая система; 600Вт/1200Вт/2400Вт, 4Ом, Max SPL 134дБ, покрытие DuraFlex, двойной 36 mm \"стакан\", 12 M10 точек подвеса, вес 33.5кг', 19588, NULL, 1884815, '\0', ''),
  (20491, 'JBL PRX625', '<p>PRX625 - активный легкий двухполосный громкоговоритель, способный качественно воспроизводить аудиосигнал с высоким уровнем давления в широком частотном диапазоне.</p><p>Максимальное SPL 135дБ пик<br>2 x 380 мм (15\") Differential Drive® двухкатушечный драйвер<br>37.5 мм (1.5\") неодимовый компрессионный драйвер<br>1500 Вт (3 x 500 Вт) Class-D, Crown® цифровой усилитель<br>DSP входная секция с лимитером dbx® Type IV™, кроссовером, динамическое лимитирование, переключаемая эквализация<br>Профессиональные входы XLR Jack ¼\" микрофон, линия, инструментальный, сквозной канал<br>Obsidian DuraFlex™ полимерное покрытие фанеры<br>Большие литые алюминиевые ручки с эргономичными резиновыми накладками<br>8 шт. подвесных гнезд с резьбой M10 и одна точка для оттяжки</p><p>Характеристики:</p><p>Тип системы : активная 2х15\",<br>двухполосная</p><p>Максимальное давление SPL : 139 дБ пик</p><p>Частотный диапазон (-10 дБ) : Flat: 40 Гц – 19.5 кГц<br>Boost: 39 Гц – 19.5 кГц</p><p>Частотная характеристика (±3 дБ): : Flat: 55 Гц – 17.5 кГц<br>Boost: 50 Гц – 18 кГц</p><p>Раскрытие : 90º x 50º</p><p>Усилитель : Crown® Class D</p><p>Мощность : 1500 Вт ( 3 x 500 )</p><p>Размеры : 1.053 мм x 424 мм x 413 мм</p><p>Вес нетто : 27.2 кг</p>', 54200, '2014-08-28 13:42:34', 211, 'JBL PRX625 активная 2-полосная АС. 1500Вт, усилитель Crown D-класса, Max SPL136дБ, НЧ 2 х 15\", ВЧ 1 х 1.5\", Вес 28кг', 19589, NULL, 1884815, '\0', ''),
  (20492, 'JBL STX812M', '<h3>Описание модели :</h3><p><br>Тип: Акустическая система;<br>Частотный диапазон (-10 дБ): 50 Гц-20 кГц;<br>Частотный диапазон (± 3 дБ): 75 Гц-20 кГц;<br>Угол раскрытия: 70;<br>Чувствительность (1Вт/1м): 95 дБ;<br>Номинальная мощность (продолжительная Pink Noise/Программируемая/Пиковая): 800 Вт/1600 Вт/3200 Вт;<br>Максимальный уровень звукового давления: 130 дБ SPL пик;<br>Номинальное сопротивление: 8 Ом;<br>Входные разъемы: Два NL4;<br>Размеры (В х Ш х Г): 571 х 355 х 264 мм;<br>Вес: 19 кг;</p>', 48800, '2014-08-28 13:48:02', 211, 'JBL STX812M - 2-полосная пассивная мониторная/FOH АС, 800Вт/1600Вт/3200Вт, 8Ом, 36мм \"стакан\", НЧ 1 х 12\" 2206H, ВЧ 1 х 3\" 2432H с рупором 70°x70°, Пассив/Би-амп, Вес 19кг', 19590, NULL, 1884815, '\0', ''),
  (20493, 'JBL STX815M', '<h3>Характеристики JBL STX815M:</h3><p><br>Тип: Акустическая система;<br>Частотный диапазон (-10 дБ): 41 Гц-20 кГц;<br>Частотный диапазон (± 3 дБ): 55 Гц-20 кГц;<br>Угол раскрытия: 70;<br>Чувствительность (1Вт/1м): 96 дБ;<br>Номинальная мощность (продолжительная Pink Noise/Программируемая/Пиковая): 800 Вт/1600 Вт/3200 Вт;<br>Максимальный уровень звукового давления: 131 дБ SPL пик;<br>Номинальное сопротивление: 8 Ом;<br>Входные разъемы: Два NL4;<br>Размеры (В х Ш х Г): 721 х 436 х 329 мм<br>Вес: 26 кг.<br></p>', 59900, '2014-08-28 13:52:22', 211, 'JBL STX815M - 2-полосная пассивная мониторная/FOH АС, 800Вт/1600Вт/3200Вт, 8Ом, 36мм \"стакан\"; НЧ 1 х 15\" 2226H; ВЧ 1 x 3\" 2431H c рупором 70°x70° Horn; Пассив или Би-амп, 8 M10 точек подвеса', 19591, NULL, 1884815, '\0', ''),
  (20494, 'JBL STX825', '<h3>Описание модели :</h3><p><br>Тип: Портативная двухполосная акустическая система;<br>Частотный диапозон: 34 Гц - 20 кГц;<br>МАКС SPL: 135 дБ;<br>Сопротивление: 4 Ом;<br>Мощность (RMS): 1200 Вт;<br>ВЧ элемент: 4\";<br>НЧ элемент: 2x15\";<br>Размеры: 1066 x 568 x 573 мм;<br>Вес: 51 кг</p>', 78900, '2014-08-28 14:06:21', 211, 'JBL STX825 пассивная 2-полосная АС 1600Вт/3200Вт/6400Вт, 4Ом, Max SPL 136дБ, НЧ 2 x15\" 2226H, ВЧ 1 х 4\" 2453H с рупором 90°x50°, Пассив или Би-амп, 12 M10 точек подвеса, Вес 51кг', 19593, NULL, 1884815, '\0', ''),
  (20495, 'JBL STX828S', '<p>Двойной 18\" сабвуфер JBL STX828S высокой мощности в начальном этапе, вентилируемый корпус предназначен для максимально низких частот. Имеет дополнительный комплект колес. Два драйвера дают 2000 Вт непрерывной мощности обработки , 4кВт программная мощность и 8 кВт пиковая.</p><p>Технические характеристики JBL STX828S:</p><p>Частотный диапазон (-10 дБ): 32 Гц-250 Гц.<br>Частотный диапазон (± 3 дБ): 45 Гц-120 Гц.<br>Чувствительность (1Вт/1м): 99 дБ.<br>номинальная мощность: продолжение Pink Noise / программы / пиковая: 2000 Вт / 4000 Вт / 8000 Вт.<br>Номинальная максимальное звуковое давление: 138 дБ SPL пик.<br>Номинальный импеданс: 4Ω.<br>Входные разъемы: два NL4.<br>Режимы работы: Ссабвуфер.<br>Размеры (В х Ш х Г): 564 мм х 1137 мм х 708 мм.<br>Вес нетто: 82 кг.</p>', 83800, '2014-08-28 14:09:57', 211, 'JBL STX828S пассивный сабвуфер 2 x 18\" 2242H, 2000Вт/4000Вт/8000Вт, 4Ом, Max SPL 138дБ, Вес 82кг', 19594, NULL, 1884815, '\0', ''),
  (20496, 'JBL STX835', '<p><br>Трехполосная акустическая система с НЧ: 2 х 15\" в фазоинверторном оформлении и рупорными СЧ и ВЧ. Предназнаена как для широкополосной работы в качестве высоко-мощной системы с высоким акустическим давлением, так и в комплексе с сабвуфером STX828S. Звучание STX835 имеет высокую прозрачность и детальность. Раскрытие рупоров 60 х 40 градусов позволяет делать кластеры из кабинетов для покрытия широкого поля..</p><h3>Технические характеристики:&nbsp;</h3><p><br>Частотный диапазон ( –10 dB) 32 Гц-20 кГц<br></p><p>Частотная Хар-ка (± 3 dB) 43 Гц-20 кГц<br></p><p>Покрытие 60˚ × 40˚ номинально<br></p><p>Чувствительность (1Вт/1м) 96 дБ<br></p><p>Мощность<br>(Роз.шум/Программа/Пик) 1600 Вт / 3200 Вт / 6400 Вт<br></p><p>Максимальное SPL 134 дБ SPL Пик<br></p><p>Номинальный импеданс 4 Ом<br></p><p>Входные коннекторы два NL4<br></p><p>Рабочие режимы Полнодиапазонный / Би-амп<br></p><p>Размеры (В x Ш x Г) 1066 мм x 568 мм x 573 мм<br></p><p>Вес Нетто 57,1 кг</p>', 105000, '2014-08-28 14:14:11', 211, 'JBL STX835 биамп/пассив трехполосная рупорная АС 1600Вт/3200Вт/6400Вт, 4Ом пассив, 4Ом/8Ом биамп, НЧ 2 x15\" 2226H, СЧ 1х8\", ВЧ 1 х 4\" 2453H, покрытие 60°x40°, 12 M10 точек подвеса, Вес 57кг', 19596, NULL, 1884815, '\0', ''),
  (20497, 'JBL VP7212/95DPC', '<p>JBL VP7212/95DPC - 2-х полосная активная компактная АС. НЧ 12\" JBL 2262FF неодим Differential Drive®, ВЧ 1,5\" JBL2452H-SL (мембрана 4\"), волновод 90°x50°. Усилительный модуль DPC1 750+125Вт RMS, аналоговые вход/выход XLR. DSP, аттенюатор 0/-16дБ, обрезной фильтр 80Гц. 55-20000Гц, SPL пик 134дБ. Корпус из берёзовой фанеры, покрытие DuraFlex™, литые алюминиевые ручки для переноски, 9 точек подвеса М10, 2 точки подвеса М6, адаптер 35мм. Габариты 533x358x334мм, вес 21,3кг. Цвет чёрный.<br></p><p>Описание модели :<br>Тип активная<br>Количество полос 2<br>Мощность 875 Вт<br>Частотный диапазон 55 Гц - 20 кГц<br>Частотная характеристика 60 Hz - 18 kHz (±3 dB)<br>Мощность усилителя 2200W Пиковая (1100W Продолжительная)<br>Зона покрытия 90 ° х 50 °<br>Звуковое давление 134 дБ<br>Встроенная система HiQnetТ<br>НЧ динамик 12\" Differential Drive<br>ВЧ драйвер 1.5\" 2452H-SL компрессионный<br>Волновод JBL Progressive Transition™<br>Решётка 1,6 мм перфорированная сталь<br>Входной разъём \"мама\" XLR<br>Сквозной выход \"папа\" XLR<br>Встроенные входы есть<br>Размеры (ШхВхГ) 533 х 358 х 334 мм<br>Вес 21,3 кг</p>', 127000, '2014-08-28 15:27:54', 211, 'JBL VP7212/95DPC - 2-х полосная активная компактная АС. НЧ 12\" JBL 2262FF неодим Differential Drive®, ВЧ 1,5\" JBL2452H-SL (мембрана 4\")', 19597, NULL, 1884815, '\0', ''),
  (20498, 'JBL VPSB7118DP', '<p>Основные параметры<br>Тип концертная, активная<br>Акустическое излучение монополярная<br>Назначение сабвуфер<br>Состав комплекта 1 громкоговоритель<br>Характеристики<br>Количество полос 1<br>Мощность 1800 Вт<br>Максимальная мощность 3600 Вт<br>Максимальное звуковое давление 129 дБ SPL<br>Диапазон воспроизводимых частот 29-165 Гц<br>Усилитель<br>Интерфейсы балансный вход<br>Подключение<br>Разъем для подключения к усилителю мощности Speakon<br>Излучатели<br>НЧ-излучатель 457 мм<br>Дополнительно<br>Размеры (ШхВхГ) 702x514x813 мм<br>Вес 34 кг<br>Дополнительная информация вход Ethernet, RJ45<br></p><p></p>', 179000, '2014-08-28 15:32:45', 211, 'Активный сабвуфер с 18” НЧ-динамиком Differential Drive,частотная хар-ка: 35 Hz - 125 kHz (± 3 dB), мощность усилителя 3600W Пиковая (1800W Продолжительная), решетка - 1,6 мм перфорированная сталь, входной разъем «мама» XLR/»папа» XLR, размеры, (ВхШхГ) 414.4 x 701.8 x 812.8 мм, вес нетто - 58.5 кг, Модель оборудована встроенным «стаканом» для монтажа стойки и имеет размер, позволяющий объединять её в массивы разных конфигураций с другими моделями в серии.', 19598, NULL, 1884815, '\0', ''),
  (20499, 'JBL VRX915M', '<p>VRX915M - специализированный компактный и легкий 15\" двухполосный сценический монитор с высотой над сценой всего 375 мм.</p><p>Патентованный 15\" Differential Drive динамик 2265 держит номинальную мощность 800 Вт с аккуратным и точным воспроизведением НЧ. 4\" компрессионный драйвер 2452H в паре с алюминиевым рупором 50o x 90o обеспечивает мягкое и ясное ВЧ воспроизведение, что критично для мощных мониторов.</p><p>Выбор режима биамп - пассив производится с помощью утопленного высокоамперного переключателя, смонтированного рядом с входным разъемом NL4 на одной из чашек под ручкой. До полнительный разъем NL4 смонтирован на проти воположной чашке как выход сквозного канала для уменьшения количества кабелей на сцене.</p><p>Кабинет из балтийской березовой фанеры высшего качества, покрытой патентованным покрытием Duraflex. Кабинет имеет симметричный дизайн с 30o срезами с четырьмя нескользящими резиновыми ножками на каждой стороне для удобной работы как слева, так и справа. Динамики защищены привлекательной решеткой из толстой стали. С внутренней стороны к решетке прилегает черный акустически прозрачный материал.<br>Частотный диапазон (-10 дБ) - 60 Гц - 20 кГц<br>Частотная характеристика (±3 дБ) - 70 Гц - 20 кГц<br>Диаграмма направленности - Номинальная 50° x 90°<br>Режимы кроссовера - Пассив / Биамп<br>Точка кроссовера - 1,1 кГц<br>Мощность (продолжительная/прграмная/пиковая) - Пассив: 800Вт / 1600Вт / 3200Вт 2 часа , 600Вт / 1200Вт / 2400Вт 100 часов , Биамп НЧ: 800Вт / 1600Вт / 3200Вт 2 часа , 600Вт / 1200Вт / 2400Вт 100 часов , Би-амп ВЧ: 75 Вт / 150 Вт / 300 Вт 2 часа<br>Максимальное SPL - 127 дБ продолжительное, 133 дБ пиковое<br>Чувствительность 1 Вт на 1 м - 98 дБ SPL<br>НЧ динамик - 1 шт. JBL 2265H, 8 Ом, 15\"<br>ВЧ драйвер - 1 шт. JBL 2252H, 8 Ом, 4\"<br>Номинальное сопротивление - 8 Ом<br>Кабинет - Симметричный сценический монитор из 15 мм фанеры<br>Система подвеса / монтажа - рама VRX932LA-AF<br>Переноска - Две встроенные ручки<br>Размеры (В х Ш х Г) - 629мм х 432мм х 324мм<br>Вес нетто - 21 кг</p>', 68000, '2014-08-28 15:37:54', 211, 'JBL VRX915M - 2-полосный низкопрофильный напольный монитор, высота от сцены 375мм,  биамп/пассив, симметричная конструкция (наклон 30°), НЧ 15\", ВЧ 1,5\" (мембрана 4\"), RMS AES НЧ 800Вт, ВЧ 75Вт. Макс. SPL program130дБ, 8/8Ом. 60—20000Гц, волновод 50°х90°. Покрытие - чёрный DuraFlex, стальная сетка со вспененным полимером изнутри. 2хSpeakon NL4 (по одному на боковых стенках). 629x432x324мм, 21кг', 19599, NULL, 1884815, '\0', ''),
  (20500, 'JBL VRX915S', '<p>Благодаря своей конструкции VRX915S легко соединяется с рамой<br>15\" DIFFERENTIAL DRIVE НЧ динамик 2265G-1 обеспечивает продление диапазона НЧ.<br>Легкость и компактность облегчают транспортировку и обеспечивают удобство в обращении<br>Снабженный резьбой 20-мм \"стакан\" дает возможность крепкого и надежного соединения при установке соединения</p><p><br>Технические характеристики сабвуфера :</p><p><br>Частотная диапазон: 35 Гц - 250 Гц<br>Частотная характеристика: 40 Гц - 250 Гц<br>Мощность: 800 Вт пиковая, 1600 Вт программная, 3200 Вт продолжительная<br>Материал корпуса: 18 мм многослойная березовая фанера<br>Покрытие: Черный DuraFlex<br>Решетка: 1,6 мм перфорированная сталь<br>Входные разъемы: Переключаемые, +1/-1 или +2/-2<br>Размеры (В х Ш х Г): 496 x 420 x 597 мм<br>Вес нетто: 26,3 кг</p>', 50900, '2014-08-28 15:41:34', 211, 'JBL VRX915S компактный сабвуфер со встроенной системой подвеса (совместимой с VRX928LA), бас-рефлекс, 15\", RMS AES 800Вт, 4Ом, макс. SPL 126дБ, 31-250Гц. Адаптер М20 для стойки. Покрытие - чёрный DuraFlex, стальная сетка со вспененным полимером изнутри. 2хSpeakon NL4. 496x420x597мм, 26,3кг', 19600, NULL, 1884815, '\0', ''),
  (20501, 'JBL VRX918S', '<p>Субвуфер VRX 918 S, предназначенный для работы в составе линейных массивов, имеет прямоугольный корпус фазоинверторного типа из тринадцатислойной березовой фанеры толщиной 18 мм (отделан материалом DuraFlex черного цвета), защитные решетки из перфорированного стального листа (окрашены порошковым способом и покрыты изнутри акустически прозрачным вспененным материалом), мощность 800 Вт (максимальная 1600 Вт, пиковая 3200 Вт), импеданс 8 Ом, частотный диапазон от 34 до 220 Гц (+/-3 дБ), чувствительность 95 дБ, максимальный уровень звукового давления 130 дБ. Используется низкочастотный динамик JBL 2268H диаметром 18\" с двойной звуковой катушкой и неодимовым магнитом. Входы выполнены на запараллеленных разъемах Neutrik Speakon NL-4. Есть гнездо диаметром 20 мм для регулируемой по высоте стойки SS4BK, заглубленные ручки для переноски. Субвуфер можно подвешивать с помощью рамы VRX-AF. Дополнительно можно приобрести транспортировочный чехол SRX 718 S-CVR. Габариты субвуфера 508 x 597 x 749 мм, масса 37 кг.<br></p>', 56000, '2014-08-28 15:45:32', 211, 'JBL VRX918S компактный сабвуфер со встроенной системой подвеса (совместимой с VRX932LA), бас-рефлекс, 18\", RMS AES 800Вт, 8Ом, макс. SPL 130дБ, 31-220Гц. Адаптер М20 для стойки. Покрытие - чёрный DuraFlex, стальная сетка со вспененным полимером изнутри. 2хSpeakon NL4. 508x597x749мм, 37кг', 19601, NULL, 1884815, '\0', ''),
  (20502, 'JBL VRX928LA', '<p>BL VRX928LA это легкий (13 кг) компактный 8\" двухполосный линейный массив, сконструированный для использования в комплекте до шести юнитов. Применяется в небольших помещениях, а также в проектах звукоусиления малого и среднего масштаба, звуковыми и прокатными компаниями и для постоянных инсталляций.</p><p>Описание JBL VRX928LA<br>Частотный диапазон<br>70 Гц -20 кГц (-10 дБ)</p><p>Частотная характеристика<br>87 Гц - 19 кГц (+/-3дБ)</p><p>Диаграмма направленности<br>100° x 15° номинал</p><p>Режимы кроссовера<br>Би-амп / пассив, внешнее переключение</p><p>Частота кроссовера<br>2.0 кГц</p><p>Мощность<br>Пассив: 400 Вт / 800 Вт / 1600 Вт</p><p>(продолжительная/программная/пиковая)<br>Би-амп НЧ: 400 Вт / 800 Вт / 1600 Вт</p><p><br>Би-амп ВЧ: 30 Вт / 60 Вт / 120 Вт</p><p>Максимальное звуковое давление SPL<br>122 Дб SPL пиковое (пассивный режим)</p><p><br>НЧ: 122 дБ</p><p><br>ВЧ: 128 дБ</p><p>Чувствительность (1Вт@1м)<br>90 дБ SPL (пассивный режим)</p><p><br>НЧ: 90 дБ</p><p><br>ВЧ: 108 дБ</p><p>Громкоговорители:</p><p><br>НЧ<br>1 x JBL 2168H-1, 200 мм(8\") Differential Drive®</p><p>ВЧ<br>2 x JBL 2414H, 25 мм (1\"), неодимовый компресионный драйвер</p><p>Номинальное сопротивление<br>Пассив: 8 Ом</p><p><br>Би-амп НЧ: 8 Ом</p><p><br>Би-амп ВЧ: 16 Ом</p><p>Материал корпуса<br>18 мм, 11-слойная березовая фанера</p><p><br></p><p><br>Система подвеса / монтажа<br>Двойной встроенный стакан 65 мм,</p><p>Для подвешивания требуется рама VRX932LA-AF или рым-болты М10</p><p><br></p><p>Покрытие<br>Черный DuraFlex™</p><p>Защитная решетка<br>Черная, из перфорированной стали, окрашена порошковым способом и покрыта изнутри акустически прозрачным вспененным материалом.</p><p>Входные разъемы<br>Neutrik® Speakon® NL-4 (x2)</p><p>Габариты (высота х ширина х глубина)<br>230 мм x 420 мм x 270 мм</p><p>Вес<br>12,7 кг</p>', 50000, '2014-08-28 15:49:05', 211, 'JBL VRX928LA 2-х полосный компактный элемент линейного массива, биамп/пассив, НЧ 8\", ВЧ 2х1\". RMS AES НЧ 400Вт, ВЧ 30Вт Макс. SPL 122дБ, 8/16Ом. 70—20000Гц, волновод 100°х15°. Покрытие - чёрный DuraFlex, стальная сетка со вспененным полимером изнутри. 2-х угловой адаптер для стойки 35мм. 2хSpeakon NL4. 230x420x267мм, 12,7кг', 19602, NULL, 1884815, '\0', ''),
  (20503, 'JBL VRX932LA-1', '<p>JBL VRX-932LA-1 представляет собой легкий, компактный, пассивный и совместимый с двухканальным усилением двух полосную акустическую систему линейного массива, с непрерывной коммутируемой программной мощностью 800 ватт, предназначенную для использования в массивах до шести единиц.<br>Достойное решение для небольших площадок<br>VRX-932LA-1 оснащена низкочастотным динамиком размером 12 \" с двойной звуковой катушкой и тремя 1\" компрессионными неодимовыми драйверами. Эта модель предлагает достойное решение, когда производительность линейного массива требуется в небольшом помещении.<br>Технология затенения амплитуды<br>VRX-932LA-1 использует технологию затенения амплитуды для формирования покрытия массива. Переключатели на входной пластине позволяют звучанию верхнего элемента массива достичь дальних рядов, в то время как нижняя часть высоких частот ослабляется, чтобы уменьшить чрезмерный уровень в передней части зоны прослушивания.<br>Вертикальное покрытие до 90 градусов<br>Один или два VRX-932LA-1 также могут быть использованы на штативе или поверх сабвуферов, в одном массиве может находиться до шести элементов, создавая вертикальное покрытие вплоть до 90 градусов.<br>Основные особенности:<br>-достойное решение для небольших площадок;<br>-технология затенения амплитуды;<br>-вертикальное покрытие до 90 градусов.<br></p><p>Тип 2-полосный элемент линейного массива<br>Частотный диапазон 57 Гц - 20 кГц<br>Частотная характеристика 75 Гц - 20 кГц<br>Область покрытия 100 x 15 номинальное<br>Режимы кроссовера би-усиление/пассивный, с внешним переключением<br>Частота разделения 1.2 кГц<br>Номинальная мощность (непрерывн. / программн. / пик.) Пассивный: 800 Вт / 1600 Вт / 3200 Вт<br>Максимальный уровень звукового давления Пассивный: 130 дБ SPL пик. , би-усиление НЧ: 130 дБ SPL пик.<br>НЧ драйвер 1 x JBL 2262H, 12\" вуфер Differential Drive® с неодимовым магнитом, двумя звуковыми катушками и двумя магнитными зазорами<br>ВЧ драйверы 3 x JBL 2408J, 1.5\" компрессионные неодимовые драйверы<br>Номинальный импеданс Пассивный: 8 Ом би-усиление НЧ: 8 Ом би-усиление ВЧ: 8 Ом<br>Входные коннекторы Neutrik® Speakon® NL-4 (x2)<br>Органы управления Аттенюатор входа (0-16 дБ)<br>Обработка сигнала На базе цифрового сигнального процессора, резидентный модуль входов<br>Корпус 18-мм, 11-слойная березовая фанера<br>Отделка Черная, DuraFlex™<br>Решетка Решетка из перфорированной стали с порошковым покрытием, с акустически прозрачным пеноматериалом<br>Размеры 343 x 597 x 376 мм<br>Вес Нетто 21 кг</p>', 92000, '2014-08-28 15:52:58', 211, 'JBL VRX932LA-1 2-х полосный элемент линейного массива, биамп/пассив, НЧ 12\", ВЧ 3х1\". RMS AES НЧ 800Вт, ВЧ 75Вт Макс. SPL 130дБ, 8/8Ом. 57—20000Гц, волновод 100°х15°. Покрытие - чёрный DuraFlex, стальная сетка со вспененным полимером изнутри. 2-х угловой адаптер для стойки 35мм. 2хSpeakon NL4. 349x597x381мм, 21кг', 19603, NULL, 1884815, '\0', ''),
  (20504, 'JBL VRX932LAP', '<p><br></p><p>Использование.</p><p>--Самостоятельная полнодиапозонная акустическая система или в составе линейного массива до 6-ти элементов.</p><p>--Для музыкальных и речевых приложений.</p><p>--Озвучивание площадей среднего размера.</p><p>--Постоянные инсталлящии.</p><p>--Прокатные компании, корпоративные центры, коммерческие заведения (клубы, ретораны, казино)</p><p><br></p><p>Совместное использование.</p><p>--VRX932LAP совместим с VRX918SP/VRX918S и SRX781S subwoofers.</p><p><br></p><p>Ключевые особенности.</p><p>--Встроенный JBL DrivePack® DPC-2 модуль усилителя, разработанный Crown, обеспечивающий до 1750 Вт пиковой мощности. DSP входной модуль обеспечивает оптимизацию работы системы и возможность эквализации.</p><p>--Встроенный усилительный модуль Crown, с использованием технологии:</p><p>DBT (Dual Bridged Technology)-Это технология равномерной подачи энергии на две катушки динамика, изготовленного по технологии Differential Drive®. Эта технология позволяет достигать максимальной эффективности громкоговорителя, обеспечивая при этом стабильный режим работы громкоговорителя.</p><p>--Встроенные динамические головки на неодимовом магните, построенные на эксклюзивной технологии Differential Drive® . Эта технология позволяет динамическим головкам работать на больших мощностях и существенно снижает вес акустической системы.</p><p>--VRX932LAP имеет 3 профессиональных патентованных ВЧ драйвера: «2408J Annular Ring Diaphragm HF drivers»</p><p>--Волновод постоянной кривизны обеспечивает когерентность массива.</p><p>--Штатив с двойным углом наклона даёт возможность установки на штативе и обеспечивает гибкость вариантов наклона акустической системы.</p><p>--Акустическая система с помощью встроенных скоб имеет возможность интеграции в состав линейного массива, а так же подвеса на опциональной крестообразной раме.</p><p>--Корпус имеет покрытие Black DuraFlex™</p><p><br></p><p><br></p><p>Основные характеристики.</p><p><br></p><p>Частотный диапазон: (-10 дБ) 57 Гц - 20 кГц</p><p>Частотная характеристика: (±3 дБ) 75 Гц - 20 кГц</p><p>Диаграмма направленности: 100° x 15° номинал</p><p>Максимальное звуковое давление: SPL136 дБ SPL</p><p>Усилитель: встроенный усилительный модуль DPC-2 Output Section с использованием технологии DBT (Dual Bridged Technology) (номинальная нагрузка): 1750 Вт пиковая, 875 Вт продолжительная</p><p>Мощность усилительный модуль DPC-2 Output Section на каждую секцию (Продолжительная на розовом шуме по спецификации IEC) НЧ: 750 Watts, ВЧ: 125 Watts</p><p>Класс встроенного усилителя DPC-2: LF: Dual-Bridged Technology™, Class D, HF: Bridged Class D</p><p>Соединительные разъемы для аудио: XLR with loop through</p><p>Громкоговорители:</p><p>НЧ: 1 x JBL 2262H 305 мм (12\") Differential Drive®</p><p>ВЧ: 3 x JBL 2407J, 25.4 мм (1\"), неодимовый компресионный драйвер</p><p>Пользовательские установки: Входной аттенюатор (0-16 dB)<br>ACS (Array Configuration Selector)<br>Амплитудная коррекция ВЧ секции: выбираемая (+3 dB ,0 dB,-3 dB)</p><p>Сигнальный процессор: основной DSP встроенный входной модуль (Input Module)</p><p>Электропитание: 90-132 VAC или 216-264 VAC, 50/60 Hz</p><p>Соединители электропитания: Neutrik PowerCon (NAC 3MPA)</p><p>Параллельные разьёмы электропитания: Neutrik PowerCon (NAC 3MPB)</p><p>Материал корпуса: 15 мм, 11-слойная березовая фанера</p><p>Покрытие: черный DuraFlex™</p><p>Защитная решетка: Черная, из перфорированной стали, окрашена порошковым способом и покрыта изнутри акустически прозрачным вспененным материалом.</p><p>Габариты (высота х ширина х глубина): 349 мм x 597 мм x 444 мм</p><p>Вес: 24кг.</p>', 118000, '2014-08-28 15:57:39', 211, 'JBL VRX932LAP активный 2-полосный элемент линейного массива, НЧ 12\", ВЧ 3х1\". Усилительный модуль Crown DPC-2 с DSP, НЧ 750Вт, ВЧ 125Вт. Макс. SPL 136дБ, 57—20000Гц, волновод 100°х15°. XLR вход/петля, переключаемый аттенюатор, PowerCon питание/петля. Покрытие - чёрный DuraFlex, стальная сетка со вспененным полимером изнутри. 2-х угловой адаптер для стойки 35мм. 349x597x444мм, 24кг', 19604, NULL, 1884815, '\0', ''),
  (20505, 'JBL VRX-AF', '<p>JBL VRX-AF&nbsp;- рама для подвеса до 6 модулей VRX932LA . Дизайн-фактор 10:1. Включает 4 фиксатора, 2 чекеля, 2 выдвижных профиля.<br></p>', 36500, '2014-08-28 16:03:32', 211, 'JBL VRX-AF рама для подвеса до 6 элементов VRX932', 19606, NULL, 1884815, '\0', ''),
  (20506, 'JBL VRX-SMAF', '<p>JBL VRX-SMAF рама для подвеса до 6 модулей VRX928LA и VRX915S. Включает 4 фиксатора, 2 чекеля, 2 выдвижных профиля.<br></p>', 20000, '2014-08-28 16:08:06', 211, 'JBL VRX-SMAF малая рама для подвеса массивов VRX928LA и VRX915S', 19608, NULL, 1884815, '\0', ''),
  (20507, 'JBL Control 2P/230', '<p>Основные характеристики:<br>Тип активный мастер-монитор<br>Мощность усилителя 2 х 35Вт<br>Частотные характеристики 100Гц-18кГц<br>Входы два балансных XLR и два небалансных RCA входа<br>Выходы на наушники<br>Регулировки стерео громкость, ВЧ-регулировка переключателем<br></p>', 9000, '2014-08-28 16:21:11', 211, 'JBL Control 2P/230 Активный Мастер-монитор с блоком питания. Мощность усилителя 2 х 35Вт, 2 балансных комбо XLR/¼” Jack и 2 небалансных RCA входы; регулятор громкости; стерео выход Jack для наушников; регулятор ВЧ.', 19609, NULL, 1884815, '\0', ''),
  (20508, 'JBL Control 2P/230 Stereo Set', '<p>JBL Control 2P/230 Stereo Set - это трансляционная акустическая система, включающая в себя пару активных двухполосных мониторов с частотными характеристиками 100-18000 Гц. Мощность системы составляет 35 Вт. Она оснащена балансными XLR-входами и небалансными RCA.<br>Кроме того, к этой акустике можно подсоединить наушники. Вы можете купить JBL Control 2P/230 Stereo Set в нашем Интернет-магазине и использовать их для контрольного мониторинга. При необходимость есть возможность регулировки ВЧ при помощи встроенного регулятора.<br></p><p>Основные параметры<br>Тип полочная, пассивная, фазоинверторного типа<br>Акустическое излучение монополярная<br>Состав комплекта 2 громкоговорителя<br>Подключение<br>Разъем для подключения к усилителю мощности Speakon<br>Конструкция<br>Крепления для монтажа есть<br>Характеристики<br>Количество полос 2<br>Мощность 35 Вт<br>Максимальное звуковое давление 115 дБ SPL<br>Диапазон воспроизводимых частот 80-20000 Гц<br>Частота кроссовера 4.2 кГц<br>Излучатели<br>Тип излучателей динамические<br>ВЧ-излучатель 19 мм<br>НЧ-излучатель 135 мм<br>Дополнительно<br>Размеры (ШхВхГ) 159x235x143 мм<br>Вес 4.8 кг</p>', 12000, '2014-08-28 16:24:35', 211, 'JBL Control 2P/230 Stereo Set. Комплект: C2PM/230 Активный Мастер-монитор + пассивный монитор, блок питания и 2 наклонные подставки. 5.25\" НЧ, 0.75\" ВЧ Polycarbonate Dome Tweeter, Мощность усилителя 2 х 35Вт, 2 балансных комбо XLR/¼” Jack и 2 небалансных RCA входы; регулятор громкости; стерео выход Jack для наушников; регулятор ВЧ.', 19610, NULL, 1884815, '\0', ''),
  (20509, 'JBL SS3-BK', '<p>JBL SS3-BK соединительная стойка саб/сателлит для JRX, MRX и PRX. Диаметр 35мм, высота 1,4м<br></p>', 2500, '2014-08-28 16:27:59', 211, 'JBL SS3-BK соединительная стойка саб/сателлит для JRX, MRX и PRX. Диаметр 35мм, высота 1,4м', 19611, NULL, 1884815, '\0', ''),
  (20510, 'JBL SS4-BK', '<p>JBL SS4-BK стойка соединительная сабвуфер / сателлит&nbsp;регулируемая по высоте. 0,9м – 1,45м.&nbsp;&nbsp;Резьба M20 - низ, 35мм - верх. (подходит для SRX718S, PRX418S или VRX918S)<br></p>', 5800, '2014-08-28 16:33:23', 211, 'JBL SS4-BK стойка \"сабвуфер - сателлит\" регулируемая по высоте. 0,9м – 1,45м для SRX718S/VRX918S/VRX918SP/VRX915S/PRX. Резьба M20 - низ, 35мм - верх.', 19612, NULL, 1884815, '\0', ''),
  (20511, 'AKG PR4500 PT BD7', '<p>AKG PR4500 PT Set - накамерная радиосистема с портативными приемником PR4500 и передатчиком PT4500, петличным микрофоном CK99 L. Радиосистема обеспечивает непревзойденную простоту использования и превосходное качество звука.</p><p>PR4500 карманный приемник имеет металлический, но легкий корпус и предназначен для установки на различные видеокамеры, цифровые зеркальные фотокамеры или другой передачи A/V с помощью прилагаемого адаптера. Система способна транслировать до 18 каналов одновременно, что помогает повысить мощность сигнала и снижение помех. PR4500 имеет 1/8 \"TRS выход на наушники для мониторинга звука, а также выход XLR.</p><p>PT4500 - портативный передатчик с прочным литым магниевым корпусом. УКВ диапазон, шириной 30 МГц обеспечивает до 1200 селектируемых частот, а несколько банков предустановленных частот для различных стран облегчают настройку многоканальных систем. Дисплей с фоновой подсветкой упрощает настройку передатчика на ту же частоту, что и приемник. Система пилотного тона постоянно передает данные о состоянии передатчика, включая положение выключателя MUTE и оставшийся заряд батареи, на ресивер. Мощность передатчика составляет 50 мВт для достижения максимальной устойчивости к интерференции и выпадениям. 3-пиновый разъем мини-XLR с изменяемыми параметрами чувствительности совместим с любыми портативными инструментами и микрофонами AKG в любых приложениях. Опциональный дистанционный выключатель mute позволяет пользователю отключать передатчик без необходимости нащупывать выключатель на корпусе, если передатчик спрятан в одежде.</p><p>Приемник и передатчик могут получать питание от двух батареек АА либо аккумулятора BP4000. Интегрированные зарядные контакты позволяют заряжать опциональный батарейный блок BP 4000, не вынимая его из корпуса. Часа зарядки хватает на работу в течение 12 часов. На батарейках типа АА продолжительность непрерывной работы составляет до 15 часов.</p><p>CK99 L – ультралегкий, чрезвычайно компактный и незаметный на одежде конденсаторный петличный микрофон кардиоидной направленности с частотным диапазоном 15 Гц- 18 кГц, чувствительностью 8.8 мВ/Па и сопротивлением 200 Ом, обеспечивающий естественное звучание. Микрофон прекрасно переносит воздействие неблагоприятных факторов внешней среды. CK99 L имеет 3-контактный разъем Mini-XLR.</p><p><br></p>', 35400, '2014-08-29 10:51:10', 147, 'AKG PR4500 PT BD7 накамерная радиосистема.  1x PT4500 поясной передатчик, 1хPR4500 ENG накамерный приёмник, кабель с разъемом XLR, кабель с разъемом Mini-Jack, 4хАА батареи', 19614, NULL, 1884815, '\0', ''),
  (20512, 'AKG WMS450 VOCALSET C5 BD3 50mW ', '<p>Характеристики AKG WMS450 VOCALSET C5 BD3 50mWОбщие данные<br>Тип - UHF-радиосистема с конденсаторным капсюлем С5<br>• - гибкая система, не требующая настройки, простая в подключении.<br>• - высококачественная передача аудиосигнала<br>• - в системе использован новый микрофон C5.<br>• - исключительно прочная конструкция передатчиков<br>HT 450 Ручной передатчик<br>• - версии с капсюлем С5 – повышенная защита от обратной связи и шума.<br>• - сетка из пружинной стали надежно защищает капсюль<br>• - прочный корпус<br>• - легкая настройка с приемника через инфракрасный порт<br>• - одной батареи (АА) хватает на 8 часов работы<br>• - на дисплее отображается уровень заряда батареи<br>• - встроенные контакты для зарядки<br>• - эргономичный дизайн<br>AKG SR450 UHF-приёмник, стационарный<br>• - Наилучшее качество в данном классе.<br>• - Прочный полностью металлический корпус.<br>• - На один диапазон может быть установлено до 12 каналов<br>• - Программируемый дисплей с двухцветной подсветкой<br>• - Инфракрасный порт<br>• - Функция сканирования «мертвых зон»<br></p>', 16920, '2014-08-29 10:56:03', 147, 'AKG WMS450 VOCALSET C5 BD3 50mW вокальная радиосистема с приёмником SR450 и ручным передатчиком с конденсаторным капсюлем C5', 19615, NULL, 1884815, '\0', ''),
  (20513, 'AKG WMS4500 D7 Set BD8', '<p><strong>Приемник&nbsp;</strong><strong>SR</strong><strong>&nbsp;</strong><strong>4500</strong></p><p>Приемник SR 4500 обеспечивает максимальную простоту использования и широчайший набор функций в своем классе. Точный индикатор заряда батареи - это, бесценное преимущество для задач живого звука. Полная линейка аксессуаров делает SR 4500 лучшим выбором для любого применения. Передатчик использует пилотный тон, чтобы передавать данные о состоянии батареи приемнику, на котором отображается оставшийся заряд батареи. Декодер пилотного тона также обеспечивает распознавание и отображение другой важной информации, включая текущее положение переключателя MUTE на передатчике.&nbsp;<br>Функции автонастройки и сканирования автоматически анализируют местную РЧ среду, находят используемые частотные группы и устанавливают частоты. Опциональный HUB 4000 Q интегрирует SR 4500 в систему HiQnet™. С управляющей программой System Architect™ для компьютера, настройка и мониторинг высокосложных систем становится необычайно простым. Логический выход обеспечивает дистанционное управление внешними устройствами, например, автоматическим микрофонным микшером.&nbsp;<br>Естественно, SR 4500 работает в чрезвычайно широком УКВ диапазоне (30 МГц), а каждый частотный пресет обеспечивает до 19 каналов без интермодуляции. Максимальное число селектируемых частот - 1200. Использование нескольких частотных диапазонов позволит оперировать, по меньшей мере, 70 каналами одновременно. Большой цветной дисплей с фоновой подсветкой и поворотный переключатель делают SR 4500 простым в использовании, а программируемое светодиодное кольцо наглядно отображает важные системные параметры.&nbsp;<br>Размещенный в полу-рэковом металлическом корпусе, SR 4500 является самым компактным, надежным и мощным УКВ приемником в своем ценовом диапазоне.&nbsp;<br>SR 4500 можно интегрировать в систему HiQnet™ при помощи опционального концентратора HUB 4000 Q. С ПО System Architect™ для ПК, SR 4500 может дистанционно управляться и контролироваться прямо с компьютера. Настройка и конфигурирование распределения частот всей беспроводной системы в System Architect™ необычайно просто, с такими инструментами, как RF Monitor, Device Manager, Environment Scan и Auto Setup.</p><p><strong>Особенности&nbsp;</strong><strong>SR</strong><strong>&nbsp;</strong><strong>4500:</strong></p><ul><li>Доступен в 8 УКВ диапазонах, шириной 30 МГц каждый, с 1200 селектируемыми частотами.</li><li>Две дополнительных частотных полосы в диапазонах 500 - 530 и 570 - 600 МГц.</li><li>Использование нескольких частотных диапазонов обеспечивает работу до 70 каналов одновременно.&nbsp;</li><li>Мониторинг состояния батареи передатчика и тонового кода бесшумной настройки.</li><li>Автонастройка, сканирование среды и функции репетиции для простоты настройки.</li><li>Программируемый цветной дисплей с фоновой подсветкой и колесо прокрутки для простоты использования.</li><li>Декодер пилотного тона.</li><li>Выход для управления внешними устройствами.</li><li>Поддержка интеграции в систему HiQnet.</li><li>Интегрированный интерфейс данных для управления и мониторинга с компьютера при помощи ПО System Architect™.</li><li>Прочный металлический корпус.</li></ul><p><strong>Технические характеристики&nbsp;</strong><strong>SR</strong><strong>&nbsp;</strong><strong>4500:</strong></p><ul><li>Диапазоны несущих частот: 500 – 530, 570 – 800, 650 - 680, 680 - 710, 720 - 750, 760 - 790, 790 - 820, 835 - 863 MГц</li><li>Частотный диапазон: 35 Гц - до 20 кГц</li><li>Соотношение сигнал/шум: &gt;120 дБ(A) typical</li><li>Срок действия батарейки: 2 батарейки AA: 15 часов; BP 4000 комплект перезаряжаемых батарей: 12 часов</li><li>Размеры: 200 х 44 х 190мм</li><li>Вес: 972 г</li></ul><p><strong>Передатчик HT&nbsp;4500 BD1</strong></p><p>Профессиональный ручной передатчик с возможностью использования шести заменяемых микрофонных капсюлей, имеет прочный экранирующий металлический корпус.</p><p>Ширина диапазона в&nbsp;30 МГц&nbsp;UHF&nbsp;обеспечивает до&nbsp;1200 выбираемых частот, что позволяет быстро настроить многоканальную систему. Мощность выходного сигнала передатчика 50 мВт (ERP) – максимальная для подобных устройств на сегодняшний день. Подсвечиваемый дисплей позволяет произвести быструю настройку на одну частоту между&nbsp;передатчиком HT&nbsp;4500 и приемником&nbsp;SR&nbsp;4500. Система пилотного тона постоянно посылает на приемник информацию о статусе, включая положение переключателя&nbsp;MUTE и остаточный заряд батареи.</p><p>Встроенные контакты позволяют заряжать опциональный батарейный блок&nbsp; BP&nbsp;4000, не вынимая его из передатчика. Часа зарядки хватает&nbsp;на работу в течение 12 часов.</p><p><strong>Особенности HT&nbsp;4500 BD1:</strong></p><ul><li>Мощность передатчика до&nbsp;50 mW, что обезпечивает&nbsp;максимальную защищенность от выпадения сигнала и интерференций&nbsp;</li><li>До&nbsp;15 часов работы на батарейках типа AA, 12 часов на опциональном&nbsp; блоке BP 4000 со встроенной системой&nbsp;Smart Battery Management System</li><li>30 МГц - ширина&nbsp;UHF диапазона,&nbsp;до 1200 выбираемых частот</li><li>Две дополнительных частотных полосы в диапазонах 500 - 530 и 570 - 600 МГц.</li><li>Выбор из шести сменных капсюлей</li><li>Дисплей с подсветкой и поворотный переключатель для простоты использования</li><li>Контакты зарядки на корпусе для использования с опциональной зарядкой&nbsp;</li></ul><p><strong>Микрофонный капсюль D7WL1</strong></p><p><strong>Технические характеристики D7WL1:</strong></p><ul><li>Тип: динамический</li><li>Диаграмма направленности: суперкардиоида</li><li>Частотный диапазон: 70 Гц – 20 кГц</li><li>Чувствительность: 2.6 мВ/Па (-52 дБ)</li><li>Максимальное звуковое давление: 147/156 дБ (при коэффициенте нелинейных искажений 1/3 %)</li><li>Эквивалент шум уровень: 18 дБ-А</li><li>Сигнал/шум соотношение (A-weighted): 76 дБ</li><li>Импеданс: 600 Ом</li><li>Рекомендуемая нагрузка импеданс:2000 Ом</li><li>Высокий перевал фильтр: 80 Гц, всегда активный</li><li>Разъем: 3-pin XLR</li><li>Размеры: длина 185.2 мм, диаметр: 51 мм</li><li>Вес: 340 г</li></ul>', 33250, '2014-08-29 10:57:06', 147, 'AKG WMS4500 D7 Set BD8 радиосистема с ручным передатчиком и динамическим капсюлем D7', 19616, NULL, 124, '\0', ''),
  (20514, 'AKG WMS4500 Instrumental Set BD8', '<p><strong>Приемник&nbsp;</strong><strong>SR 4500</strong></p><p>Приемник SR 4500 обеспечивает максимальную простоту использования и широчайший набор функций в своем классе. Точный индикатор заряда батареи - это, бесценное преимущество для задач живого звука. Полная линейка аксессуаров делает SR 4500 лучшим выбором для любого применения. Передатчик использует пилотный тон, чтобы передавать данные о состоянии батареи приемнику, на котором отображается оставшийся заряд батареи. Декодер пилотного тона также обеспечивает распознавание и отображение другой важной информации, включая текущее положение переключателя MUTE на передатчике.&nbsp;<br>Функции автонастройки и сканирования автоматически анализируют местную РЧ среду, находят используемые частотные группы и устанавливают частоты. Опциональный HUB 4000 Q интегрирует SR 4500 в систему HiQnet™. С управляющей программой System Architect™ для компьютера, настройка и мониторинг высокосложных систем становится необычайно простым. Логический выход обеспечивает дистанционное управление внешними устройствами, например, автоматическим микрофонным микшером. ´<br>Естественно, SR 4500 работает в чрезвычайно широком УКВ диапазоне (30 МГц), а каждый частотный пресет обеспечивает до 19 каналов без интермодуляции. Максимальное число селектируемых частот - 1200. Использование нескольких частотных диапазонов позволит оперировать, по меньшей мере, 70 каналами одновременно. Большой цветной дисплей с фоновой подсветкой и поворотный переключатель делают SR 4500 простым в использовании, а программируемое светодиодное кольцо наглядно отображает важные системные параметры.&nbsp;<br>Размещенный в полу-рэковом металлическом корпусе, SR 4500 является самым компактным, надежным и мощным УКВ приемником в своем ценовом диапазоне.&nbsp;<br>SR 4500 можно интегрировать в систему HiQnet™ при помощи опционального концентратора HUB 4000 Q. С ПО System Architect™ для ПК, SR 4500 может дистанционно управляться и контролироваться прямо с компьютера. Настройка и конфигурирование распределения частот всей беспроводной системы в System Architect™ необычайно просто, с такими инструментами, как RF Monitor, Device Manager, Environment Scan и Auto Setup.</p><p><strong>Особенности&nbsp;</strong><strong>SR</strong><strong>&nbsp;</strong><strong>4500:</strong></p><ul><li>Доступен в 8 УКВ диапазонах, шириной 30 МГц каждый, с 1200 селектируемыми частотами.</li><li>Две дополнительных частотных полосы в диапазонах 500 - 530 и 570 - 600 МГц.</li><li>Использование нескольких частотных диапазонов обеспечивает работу до 70 каналов одновременно.&nbsp;</li><li>Мониторинг состояния батареи передатчика и тонового кода бесшумной настройки.</li><li>Автонастройка, сканирование среды и функции репетиции для простоты настройки.</li><li>Программируемый цветной дисплей с фоновой подсветкой и колесо прокрутки для простоты использования.</li><li>Декодер пилотного тона.</li><li>Выход для управления внешними устройствами.</li><li>Поддержка интеграции в систему HiQnet.</li><li>Интегрированный интерфейс данных для управления и мониторинга с компьютера при помощи ПО System Architect™.</li><li>Прочный металлический корпус.</li></ul><p><strong>Технические характеристики&nbsp;</strong><strong>SR</strong><strong>&nbsp;</strong><strong>4500:</strong></p><ul><li>Диапазоны несущих частот: 500 – 530, 570 – 800, 650 - 680, 680 - 710, 720 - 750, 760 - 790, 790 - 820, 835 - 863 MГц</li><li>Частотный диапазон: 35 Гц - до 20 кГц</li><li>Соотношение сигнал/шум: &gt;120 дБ(A) typical</li><li>Срок действия батарейки: 2 батарейки AA: 15 часов; BP 4000 комплект перезаряжаемых батарей: 12 часов</li><li>Размеры: 200 х 44 х 190мм</li><li>Вес: 972 г</li></ul><p><strong>Передатчик PT</strong><strong>&nbsp;</strong><strong>4500 BD1</strong></p><p>Портативный передатчик с прочным алюминиевым корпусом. УКВ диапазон, шириной 30 МГц обеспечивает до 1200 &nbsp;электируемых частот, а несколько банков предустановленных частот для различных стран облегчают настройку многоканальных систем.</p><p>Дисплей с фоновой подсветкой упрощает настройку RT 4500 на ту же частоту, что и приемник SR 4500. Система пилотного тона постоянно передает данные о состоянии передатчика, включая положение выключателя MUTE и оставшийся заряд батареи, на ресивер. Интегрированные зарядные контакты позволяют производить зарядку опционального батарейного комплекта BP 4000, не вынимая его из передатчика.</p><p>По прошествии часа, батарейный комплект будет полностью заряжен, и Вы сможете непрерывно пользоваться передатчиком на протяжении 12 часов. 3-пиновый разъем мини-XLR с изменяемыми параметрами чувствительности совместим с любыми портативными инструментами и микрофонами AKG в любых приложениях. Опциональный дистанционный выключатель mute позволяет пользователю отключать передатчик бз необходимости нащупывать выключатель на корпусе, если передатчик спрятан в одежде.</p><p><strong>Особенности PT</strong><strong>&nbsp;</strong><strong>4500 BD1:&nbsp;</strong></p><ul><li>УКВ диапазон шириной 30 МГц с 1200 частотами на выбор</li><li>Две дополнительных частотных полосы в диапазонах 500 - 530 и 570 - 600 МГц.</li><li>Дисплей с фоновой подсветкой и поворотный выключатель для простоты использования</li><li>Мощность передатчика до 50 мВт для достижения максимальной устойчивости к интерференции и выпадениям</li><li>Опциональный дистанционный выключатель mute</li><li>Работает до 15 часов на сухих батареях АА, 12 часов – на опциональном батарейном комплекте BP 4000, отображая оставшийся заряд батареи с помощью системы Smart Battery Management</li><li>Интегрированные зарядные контакты упрощают зарядку батареек или опционального адаптера&nbsp;</li></ul><p><strong>Технические характеристики PT</strong><strong>&nbsp;</strong><strong>4500 BD1:</strong></p><ul><li>Диапазоны несущих частот: 500 – 530, 570 – 800, 650 - 680, 680 - 710, 720 - 750, 760 - 790, 790 - 820, 835 - 863 MГц</li><li>Модуляция: FM</li><li>Частотный диапазон: от 35 до 20,000 Гц</li><li>КНИ: &lt;0.3% typical=\"\" li=\"\"&gt;</li><li>Соотношение сигнал/шум: &gt;120 дБ(A) typical</li><li>Радиочастотное излучение: 50 мВт max. (ERP)</li><li>Срок действия батарейки: 2 батарейки AA: 15 часов; BP 4000 комплект перезаряжаемых батарей: 12 часов</li><li>Размеры: 70 x 90 x 25 мм</li><li>Вес нетто: 95 г</li></ul>', 27850, '2014-08-29 11:01:34', 147, 'AKG WMS4500 Instrumental Set BD8 радиосистема с поясным передатчиком', 19617, NULL, 124, '\0', ''),
  (20515, 'AKG WMS450 VOCALSET D5 BD5 50 mW', '<p>AKG WMS450 Vocal Set/D5 UHF-радиосистема с динамическим капсюлем D5<br>Вокальная радиосистема с микрофоном D5.</p><p>- гибкая система, не требующая настройки, простая в подключении.<br>- высококачественная передача аудиосигнала<br>- в системе использован новый микрофон D5.<br>- исключительно прочная конструкция передатчиков</p><p>Радиосистема WMS 450 предоставляет значительно больше возможностей, чем системы, не требующие настройки, но, тем не менее, остается достаточно простой в использовании. На дисплее отображается вся необходимая информация: номер канал, частота передачи в мегагерцах, режим передачи, уровень заряда батареи.</p><p>HT 450 Ручной передатчик</p><p>- версии с капсюлем D5 – повышенная защита от обратной связи и шума.<br>- сетка из пружинной стали надежно защищает капсюль<br>- прочный корпус<br>- легкая настройка с приемника через инфракрасный порт<br>- одной батареи (АА) хватает на 8 часов работы<br>- на дисплее отображается уровень заряда батареи<br>- встроенные контакты для зарядки<br>- эргономичный дизайн</p><p>HT 450 – это высококачественный надежный ручной передатчик, подходящий для различных сценических задач. В нем применены инновационные технологии, значительно повышающие надежность и простоту использования этого прибора.</p><p>Достаточно установить рабочую частоту на приемнике, он сам передаст информацию о ней на передатчик по инфракрасному порту. Настройка будет произведена автоматически в течение нескольких секунд. Таким образом, настройка многоканальных систем не составит особого труда.</p><p>Передатчик HT 450 может работает с динамическим капсюлем D5.</p><p>Бесшумный переключатель ON-MUTE/PRG-OFF делает пользование передатчиком простым и удобным.</p><p>AKG SR450 UHF-приёмник, стационарный</p><p>- Наилучшее качество в данном классе.<br>- Прочный полностью металлический корпус.<br>- На один диапазон может быть установлено до 12 каналов<br>- Программируемый дисплей с двухцветной подсветкой<br>- Инфракрасный порт<br>- Функция сканирования «мертвых зон»</p><p>SR450 – это лучший приемник для высококачественных многоканальных систем за разумные деньги. В каждом диапазоне может работать до 12 каналов; даже большие системы будут работать безотказно и в неблагоприятных условиях передачи радиосигнала.</p><p>SR450 совместим с антеннами, антенными сплитерами и источниками питания серийWMS 4000, что позволяет создавать гибкие и эффективные системы.</p><p>В автоматическом режиме приемник находит доступные для работы диапазоны, свободные от помех каналы и через инфракрасный порт настраивает соответствующим образом передатчик. Эта функция значительно снижает время настройки системы.</p><p>Функция rehearsal позволяет найти «мертвые зоны», программируемый двухцветный дисплей с подсветкой отображает всю информацию о работе системы, его предупреждающие сообщения видны с большого расстояния. Также на дисплее приемника отображается уровень заряда батареи передатчика.</p><p>Спецификация:</p><p>Диапазон радиочастот: 650 - 680, 680 - 710, 720 - 750, 760 - 790, 790 - 820, 835 – 863 мГц.<br>Модуляция: частотная<br>Частотный диапазон: 35 Гц – 20 кГц<br>Коэффициент нелинейных искажений: &lt;0.3% (при частоте 1 кГц)<br>Аудио выходы: балансный XLR и небалансный джек. Уровень сигнала на балансном выходе регулируется в пределах -30 – 0 дБ.<br>Габариты: 200 x 44 x 190 мм<br>Вес: 972 г<br>Патент: индикатор уровня заряда батареи</p><p>AKG D5 WL-1 Сменный капсюль микрофонный динамический гиперкардиоидный для передатчиков радиосистем AKG</p><p>Спецификация:</p><p>Направленность: суперкардиоидная<br>Частотный диапазон: 70 Гц – 20 кГц<br>Чувствительность: 2.6 мВ/Па (-52 дБ)<br>Максимальное звуковое давление: 147/156 дБ (при коэффициенте нелинейных искажений 1/3 %)<br>Соотношение сигнал/шум (при балансном подключении): 76 дБ</p>', 15300, '2014-08-29 11:08:09', 147, 'AKG WMS450 VOCALSET D5 BD5 50 mW вокальная радиосистема с приёмником SR450 и ручным передатчиком с динамическим капсюлем D5', 19618, NULL, 1884815, '\0', ''),
  (20516, 'AKG WMS450 VOCALSET D5 BD7 50mW', '<p>Характеристики AKG WMS450 VOCALSET D5 BD7 50mWОбщие данные<br>Тип - Вокальная радиосистема с \"ручным\" передатчиком с динамическим капсюлем D5<br>- - гибкая система, не требующая настройки, простая в подключении.<br>- - высококачественная передача аудиосигнала<br>- - в системе использован новый микрофон D5.<br>- - исключительно прочная конструкция передатчиков<br></p>', 15300, '2014-08-29 11:07:13', 147, 'AKG WMS450 VOCALSET D5 BD7 50mW вокальная радиосистема с приёмником SR450 и ручным передатчиком с динамическим капсюлем D5', 19618, NULL, 1884815, '\0', ''),
  (20517, 'AKG WMS470 C5 SET BD1', '<p>По словам производителя, WMS 470 беспроводная система включает в себя ряд обновлений из предыдущих линеек AKG и обеспечивает выдающуюся производительность и надежную работу для пользователей.</p><p>Функция автоматической настройки частоты системы сразу находит и отображает все доступные каналы, что делает систему простой даже для не самых опытных пользователей. До того, как открыть канал, функция pilot tone будет предотвращать нежелательные шумы запуска; приемник откроет аудио, если пилот-тон будет обнаружен.</p><p>WMS 470 работает с 16 каналами одновременно в той же полосе частот и с 48 каналами с использованием нескольких частотных диапазонов. Передатчики питаются с помощью одной щелочной, литиевой или Ni-MH сменной батареи, обеспечивающий до 14 часов работы с литиевыми батареями. Кроме того, WMS 470 имеет встроенную дипольную антенну для обеспечения надежной передачи с выходной мощностью 50 мВт.</p><p><strong>WMS470 С5 SET включает:</strong></p><ul><li>1 HT 470 ручной передатчик с микрофоном С 5</li><li>1 SR 470 приемник</li><li>1 стенд адаптер, 1 АА батарея, 2 антенны, 1 комплект монтажа в стойку, блок питания</li></ul>', 20850, '2014-08-29 11:07:09', 147, 'AKG WMS470 C5 SET BD1 радиосистема с приёмником SR470 и ручным передатчиком с конденсаторным капсюлем C5', 19619, NULL, 124, '\0', ''),
  (20518, 'AKG WMS470 INSTR SET', '<p>По словам производителя, WMS 470 беспроводная система включает в себя ряд обновлений из предыдущих линеек AKG и обеспечивает выдающуюся производительность и надежную работу для пользователей. Функция автоматической настройки частоты системы сразу находит и отображает все доступные каналы, что делает систему простой для менее опытных пользователей. До того, как открыть канал, функция pilot tone будет предотвращать нежелательные шумы запуска; приемник откроет аудио, если пилот-тон будет обнаружен. WMS 470 работает с 16 каналами одновременно в той же полосе частот и с 48 каналами с использованием нескольких частотных диапазонов. Передатчики питаются с помощью одной щелочной, литиевой или Ni-MH сменной батареи, обеспечивающий до 14 часов работы с литиевыми батареями. Кроме того, WMS 470 имеет встроенную дипольную антенну для обеспечения надежной передачи с выходной мощностью 50 мВт. WMS 470 доступен в различных конфигурациях для живой музыки, инструментальной, для использования в презентациях, в том числе с портативными, головными и петличными микрофонами. Пакеты включают портативные наборы WMS 470 D5 и C5 , инструментальный набор WMS 470 Instrumental, спортивный набор WMS 470 Sports и набор для презентаций WMS 470 Presentation. WMS 470 Instrumental Set включает: 1 PT 470 поясной передатчик 1 SR 470 приемник 1 MKG L кабель 1 зажим для ремня, 1 батарея типа АА, 2 антенны, 1 комплект монтажа в стойку, блок питания<br></p>', 19050, '2014-08-29 11:09:18', 147, 'AKG WMS470 INSTR SET BD8 инструментальная радиосистема с приёмником SR470 и портативным передатчиком, в комплекте гитарный шнур', 19620, NULL, 124, '\0', ''),
  (20519, 'AKG WMS450 VOCALSET D5 BD8 50mW ', '<p>AKG WMS450 Vocal Set/D5 UHF-радиосистема с динамическим капсюлем D5<br>Вокальная радиосистема с микрофоном D5.</p><p>- гибкая система, не требующая настройки, простая в подключении.<br>- высококачественная передача аудиосигнала<br>- в системе использован новый микрофон D5.<br>- исключительно прочная конструкция передатчиков</p><p>Радиосистема WMS 450 предоставляет значительно больше возможностей, чем системы, не требующие настройки, но, тем не менее, остается достаточно простой в использовании. На дисплее отображается вся необходимая информация: номер канал, частота передачи в мегагерцах, режим передачи, уровень заряда батареи.</p><p>HT 450 Ручной передатчик</p><p>- версии с капсюлем D5 – повышенная защита от обратной связи и шума.<br>- сетка из пружинной стали надежно защищает капсюль<br>- прочный корпус<br>- легкая настройка с приемника через инфракрасный порт<br>- одной батареи (АА) хватает на 8 часов работы<br>- на дисплее отображается уровень заряда батареи<br>- встроенные контакты для зарядки<br>- эргономичный дизайн</p><p>HT 450 – это высококачественный надежный ручной передатчик, подходящий для различных сценических задач. В нем применены инновационные технологии, значительно повышающие надежность и простоту использования этого прибора.</p><p>Достаточно установить рабочую частоту на приемнике, он сам передаст информацию о ней на передатчик по инфракрасному порту. Настройка будет произведена автоматически в течение нескольких секунд. Таким образом, настройка многоканальных систем не составит особого труда.</p><p>Передатчик HT 450 может работает с динамическим капсюлем D5.</p><p>Бесшумный переключатель ON-MUTE/PRG-OFF делает пользование передатчиком простым и удобным.</p><p>AKG SR450 UHF-приёмник, стационарный</p><p>- Наилучшее качество в данном классе.<br>- Прочный полностью металлический корпус.<br>- На один диапазон может быть установлено до 12 каналов<br>- Программируемый дисплей с двухцветной подсветкой<br>- Инфракрасный порт<br>- Функция сканирования «мертвых зон»</p><p>SR450 – это лучший приемник для высококачественных многоканальных систем за разумные деньги. В каждом диапазоне может работать до 12 каналов; даже большие системы будут работать безотказно и в неблагоприятных условиях передачи радиосигнала.</p><p>SR450 совместим с антеннами, антенными сплитерами и источниками питания серийWMS 4000, что позволяет создавать гибкие и эффективные системы.</p><p>В автоматическом режиме приемник находит доступные для работы диапазоны, свободные от помех каналы и через инфракрасный порт настраивает соответствующим образом передатчик. Эта функция значительно снижает время настройки системы.</p><p>Функция rehearsal позволяет найти «мертвые зоны», программируемый двухцветный дисплей с подсветкой отображает всю информацию о работе системы, его предупреждающие сообщения видны с большого расстояния. Также на дисплее приемника отображается уровень заряда батареи передатчика.</p><p>Спецификация:</p><p>Диапазон радиочастот: 650 - 680, 680 - 710, 720 - 750, 760 - 790, 790 - 820, 835 – 863 мГц.<br>Модуляция: частотная<br>Частотный диапазон: 35 Гц – 20 кГц<br>Коэффициент нелинейных искажений: &lt;0.3% (при частоте 1 кГц)<br>Аудио выходы: балансный XLR и небалансный джек. Уровень сигнала на балансном выходе регулируется в пределах -30 – 0 дБ.<br>Габариты: 200 x 44 x 190 мм<br>Вес: 972 г<br>Патент: индикатор уровня заряда батареи</p><p>AKG D5 WL-1 Сменный капсюль микрофонный динамический гиперкардиоидный для передатчиков радиосистем AKG</p><p>Спецификация:</p><p>Направленность: суперкардиоидная<br>Частотный диапазон: 70 Гц – 20 кГц<br>Чувствительность: 2.6 мВ/Па (-52 дБ)<br>Максимальное звуковое давление: 147/156 дБ (при коэффициенте нелинейных искажений 1/3 %)<br>Соотношение сигнал/шум (при балансном подключении): 76 дБ</p>', 15300, '2014-08-29 11:10:01', 147, 'AKG WMS450 VOCALSET D5 BD8 50mW вокальная радиосистема с приёмником SR450 и ручным передатчиком с динамическим капсюлем D5', 19618, NULL, 1884815, '\0', ''),
  (20520, 'AKG WMS470 PRES SET BD1', '<p>По словам производителя, WMS 470 беспроводная система включает в себя ряд обновлений из предыдущих линеек AKG и обеспечивает выдающуюся производительность и надежную работу для пользователей.</p><p>Функция автоматической настройки частоты системы сразу находит и отображает все доступные каналы, что делает систему простой даже для не самых опытных пользователей. До того, как открыть канал, функция pilot tone будет предотвращать нежелательные шумы запуска; приемник откроет аудио, если пилот-тон будет обнаружен.</p><p>WMS 470 работает с 16 каналами одновременно в той же полосе частот и с 48 каналами с использованием нескольких частотных диапазонов. Передатчики питаются с помощью одной щелочной, литиевой или Ni-MH сменной батареи, обеспечивающий до 14 часов работы с литиевыми батареями. Кроме того, WMS 470 имеет встроенную дипольную антенну для обеспечения надежной передачи с выходной мощностью 50 мВт.</p><p><strong>WMS 470 Presenter Set включает:</strong></p><ul><li>1 SR 470 поясной передатчик</li><li>1 PT 470 приемник</li><li>1 CK 99 L петличный микрофон</li><li>1 C 555 L головной микрофон</li><li>1 зажим для ремня, 1 батарея типа АА, 2 антенны, 1 комплект монтажа в стойку, блок питания.</li><li><br></li></ul>', 23200, '2014-08-29 11:11:35', 147, 'AKG WMS470 PRES SET BD1 радиосистема с приёмником SR470 и портативным передатчиком+петличный микрофон СK99L+микрофон с оголовьем C555L', 19621, NULL, 124, '\0', ''),
  (20521, 'AKG WMS470 D5 SET BD8', '<p>По словам производителя, WMS 470 беспроводная система включает в себя ряд обновлений из предыдущих линеек AKG и обеспечивает выдающуюся производительность и надежную работу для пользователей.</p><p>Функция автоматической настройки частоты системы сразу находит и отображает все доступные каналы, что делает систему простой даже для не самых опытных пользователей. До того, как открыть канал, функция pilot tone будет предотвращать нежелательные шумы запуска; приемник откроет аудио, если пилот-тон будет обнаружен.</p><p>WMS 470 работает с 16 каналами одновременно в той же полосе частот и с 48 каналами с использованием нескольких частотных диапазонов. Передатчики питаются с помощью одной щелочной, литиевой или Ni-MH сменной батареи, обеспечивающий до 14 часов работы с литиевыми батареями. Кроме того, WMS 470 имеет встроенную дипольную антенну для обеспечения надежной передачи с выходной мощностью 50 мВт.</p><p>WMS 470 D5 SET включает:<br>1 HT 470 ручной передатчик с микрофоном D 5<br>1 SR 470 приемник<br>1 стенд адаптер, 1 АА батарея, 2 антенны, 1 комплект монтажа в стойку, блок питания</p>', 19000, '2014-08-29 12:07:01', 147, 'AKG WMS470 D5 SET BD8 радиосистема с приёмником SR470 и ручным передатчиком с динамическим капсюлем D5', 19622, NULL, 1884815, '\0', ''),
  (20522, 'AKG WMS470 D5 SET BD9 50mW ', '<p>Вокальная радиосистема с микрофоном D5.- гибкая система, не требующая настройки, простая в подключении.- высококачественная передача аудиосигнала- в системе использован новый микрофон D5.- исключительно прочная конструкция передатчиковРадиосистема WMS 450 предоставляет значительно больше возможностей, чем системы, не требующие настройки, но, тем не менее, остается достаточно простой в использовании. На дисплее отображается вся необходимая информация: номер канал, частота передачи в мегагерцах, режим передачи, уровень заряда батареи.</p><p>Характеристики AKG WMS450 Vocal Set/D5<br>AKG SR450 UH<br>Диапазон радиочастот: 650 - 680, 680 - 710, 720 - 750, 760 - 790, 790 - 820, 835 – 863 мГц.<br>Модуляция: частотная<br>Частотный диапазон: 35 Гц – 20 кГц<br>Коэффициент нелинейных искажений: &lt;0.3% (при частоте 1 кГц)<br>Аудио выходы: балансный XLR и небалансный джек. Уровень сигнала на балансном выходе регулируется в пределах -30 – 0 дБ.<br>Габариты: 200 x 44 x 190 мм<br>Вес: 972 г</p>', 19000, '2014-08-29 12:11:06', 147, 'AKG WMS470 D5 SET BD9 50mW радиосистема с приёмником SR470 и ручным передатчиком с динамическим капсюлем D5', 19623, NULL, 1884815, '\0', ''),
  (20523, 'AKG WMS470 PRES SET BD9', '<p>Новая система предназначена для того, чтобы усовершенствовать сцену до следующего уровня в беспроводных живых выступлениях. По словам производителя, WMS 470 беспроводная система включает в себя ряд обновлений из предыдущих линеек AKG и обеспечивает выдающуюся производительность и надежную работу для пользователей.</p><p>Функция автоматической настройки частоты системы сразу находит и отображает все доступные каналы, что делает систему простой даже для не самых опытных пользователей. До того, как открыть канал, функция pilot tone будет предотвращать нежелательные шумы запуска; приемник откроет аудио, если пилот-тон будет обнаружен.</p><p>WMS 470 работает с 16 каналами одновременно в той же полосе частот и с 48 каналами с использованием нескольких частотных диапазонов. Передатчики питаются с помощью одной щелочной, литиевой или Ni-MH сменной батареи, обеспечивающий до 14 часов работы с литиевыми батареями. Кроме того, WMS 470 имеет встроенную дипольную антенну для обеспечения надежной передачи с выходной мощностью 50 мВт.</p><p>WMS 470 Presenter Set включает:<br>1 SR 470 поясной передатчик<br>1 PT 470 приемник<br>1 CK 99 L петличный микрофон<br>1 C 555 L головной микрофон<br>1 зажим для ремня, 1 батарея типа АА, 2 антенны, 1 комплект монтажа в стойку, блок питания.</p>', 23000, '2014-08-29 12:16:02', 147, 'AKG WMS470 PRES SET BD9 радиосистема: приёмник SR470, порт. передатчик+микрофон СK99L+микрофон с оголовьем C555L', 19624, NULL, 1884815, '\0', ''),
  (20524, 'AKG WMS470 C5 SET BD6', '<p>Приёмник SR470<br>Приемник обеспечивает набор функций, которые включают 1200 выбираемых частот по всей области перестройки 30 МГц, сбалансированный XLR и несимметричные 1/4 \"TS выходы, настройку пространственного разнесения, ЖК-дисплей и многое другое. Инфракрасная синхронизация между передатчиком (продается отдельно ) и приемником позволяет осуществлять удаленную синхронизацию канала. Дополнительные возможности включают цельнометаллический корпус и до 16 запрограммированных частот на группу в диапазоне настройки 30,5 МГц.<br>Передатчик с конденсаторным капсюлем C5<br>HT 470 имеет встроенный беспроводной передатчик, капсюль конденсаторного типа С5 и работает от одной литиевой батареи AA до 14 часов. Передатчик способен выдать до 50 мВт выходной мощности, оснащен переключателем OFF / Standby / On и ЖК-дисплеем для отображения канала и частоты, состояния батареи и многого другого.</p><p></p><p>Характеристики AKG WMS470 C5 SET BD6 (835.100-861.900 863.100-864.900)Общие данные<br>Тип - Радиосистема с приёмником SR470 и ручным передатчиком с конденсаторным капсюлем C5<br>Диапазон радиочастот - 500-530, 570-600, 600-630, 650-680, 680-710, 720-750, 790-820 и 835-865 мГц.<br>Соотношение сигнал/шум - 120 дБ (А)<br>Частотный диапазон - 35 Гц – 20 кГц.<br></p>', 20800, '2014-08-29 12:26:44', 147, 'AKG WMS470 C5 SET BD6 радиосистема с приёмником SR470 и ручным передатчиком с конденсаторным капсюлем C5', 19615, NULL, 1884815, '\0', ''),
  (20525, 'AKG WMS470 SPORTS SET BD5', '<p>Микрофон с оголовьем C544L AKG C544L представляет собой миниатюрный, влагостойкий головной микрофон, который хорошо подходит для фитнес-обучения, презентаций и использования в любых ситуациях, где нужен качественный и удобный головной микрофон. Оголовье крепится вокруг задней части шеи для комфортной, низкопрофильной подгонки. Высокочувствительная кардиоидная капсула дает отличную обратную связь и подавление шумов во внеосевых секциях, специальный барьер защищает микрофон от влажности, пота, макияжа и других жидкостей. Выходной кабель с мини 3-контактным XLR соединением для использования с поясным передатчиком AKG.<br>Приёмник AKG SR470<br>Приемник обеспечивает набор функций, которые включают 1200 выбираемых частот по всей области перестройки 30 МГц, сбалансированный XLR и несимметричные 1/4 \"TS выходы, настройку пространственного разнесения, ЖК-дисплей и многое другое. Инфракрасная синхронизация между передатчиком (продается отдельно ) и приемником позволяет осуществлять удаленную синхронизацию канала. Дополнительные возможности включают цельнометаллический корпус и до 16 запрограммированных частот на группу в диапазоне настройки 30,5 МГц.<br>Портативный передатчик PT470<br>Для микрофонов и кабеля с L-разъемом. Имеет индикатор уровня заряда. Время работы составляет 14 часов на одной батарее размера AA. Дополнительный внешний бесшумный переключатель RMS4000 позволяет пользователю отключать звук передатчика удаленно.<br></p><p>бщие параметры<br>Тип радиосистема<br>Приёмник AKG SR470<br>Тип приёмник для радиосистем WMS470<br>Диапазон радиочастот 500-530, 570-600, 600-630, 650-680, 680-710, 720-750, 790-820, 835-865 мГц<br>Соотношение сигнал-шум 120 дБ<br>Частотный диапазон 35 Гц-20кГц<br>Коэффициент нелинейных искажений<br>AKG C544L<br>Тип конденсаторный<br>Вид головной<br>Направленность кардиоидная<br>Нижняя граница част. диапазона 20 Гц<br>Верхняя граница част. диапазона 20 000 Гц<br>Чувствительность 40 мВ/Па<br>Импеданс 200 Ом<br>Минимальное оконечное сопротивление 2000 Ом<br>Длина кабеля (радиус действия) 1.5 м<br>Подключение mini XLR<br>Питание фантомное 9-52В<br>Длина 130 мм<br>Вес 30 г</p>', 21900, '2014-08-29 12:31:19', 147, 'AKG WMS470 SPORTS SET BD5 радиосистема с приёмником SR470 и портативным передатчиком+микрофон с оголовьем C544L', 19625, NULL, 1884815, '\0', ''),
  (20526, 'AKG WMS470 SPORTS SET BD6', '<p>Микрофон с оголовьем C544L AKG C544L представляет собой миниатюрный, влагостойкий головной микрофон, который хорошо подходит для фитнес-обучения, презентаций и использования в любых ситуациях, где нужен качественный и удобный головной микрофон. Оголовье крепится вокруг задней части шеи для комфортной, низкопрофильной подгонки. Высокочувствительная кардиоидная капсула дает отличную обратную связь и подавление шумов во внеосевых секциях, специальный барьер защищает микрофон от влажности, пота, макияжа и других жидкостей. Выходной кабель с мини 3-контактным XLR соединением для использования с поясным передатчиком AKG.<br>Приёмник AKG SR470<br>Приемник обеспечивает набор функций, которые включают 1200 выбираемых частот по всей области перестройки 30 МГц, сбалансированный XLR и несимметричные 1/4 \"TS выходы, настройку пространственного разнесения, ЖК-дисплей и многое другое. Инфракрасная синхронизация между передатчиком (продается отдельно ) и приемником позволяет осуществлять удаленную синхронизацию канала. Дополнительные возможности включают цельнометаллический корпус и до 16 запрограммированных частот на группу в диапазоне настройки 30,5 МГц.<br>Портативный передатчик PT470<br>Для микрофонов и кабеля с L-разъемом. Имеет индикатор уровня заряда. Время работы составляет 14 часов на одной батарее размера AA. Дополнительный внешний бесшумный переключатель RMS4000 позволяет пользователю отключать звук передатчика удаленно.<br></p><p>Общие параметры<br>Тип радиосистема<br>Приёмник AKG SR470<br>Тип приёмник для радиосистем WMS470<br>Диапазон радиочастот 500-530, 570-600, 600-630, 650-680, 680-710, 720-750, 790-820, 835-865 мГц<br>Соотношение сигнал-шум 120 дБ<br>Частотный диапазон 35 Гц-20кГц<br>Коэффициент нелинейных искажений<br>AKG C544L<br>Тип конденсаторный<br>Вид головной<br>Направленность кардиоидная<br>Нижняя граница част. диапазона 20 Гц<br>Верхняя граница част. диапазона 20 000 Гц<br>Чувствительность 40 мВ/Па<br>Импеданс 200 Ом<br>Минимальное оконечное сопротивление 2000 Ом<br>Длина кабеля (радиус действия) 1.5 м<br>Подключение mini XLR<br>Питание фантомное 9-52В<br>Длина 130 мм<br>Вес 30 г</p>', 21900, '2014-08-29 12:33:39', 147, 'AKG WMS470 SPORTS SET BD6 радиосистема с приёмником SR470 и портативным передатчиком+микрофон с оголовьем C544L', 19625, NULL, 1884815, '\0', ''),
  (20527, 'AKG C111LP', '<p>AKG C111-LP – это вокальный динамический микрофон, который крепится на голову. Отлично подходит для презентаций, для работы в театре или телевидении. Микрофон очень легкий (7 г), поэтому остается удобным даже при длительном использовании. Микрофон AKG C111-LP гарантирует качественный, яркий и чистый звук. Частотный диапазон 60 Гц – 15 кГц. Импеданс 2000 Ом. Разъем 3-контактный miniXLR. Прочный корпус и качественная электроника обеспечат долгий срок службы. В комплект входит прищепка для кабеля. Вес 7 г. Цвет телесный.<br></p><p>Общие параметры<br>Тип микрофона Динамический микрофон<br>Предназначение Вокальный<br>Способ крепления На голову<br>Частотный диапазон 60 Гц - 15 кГц<br>Чувствительность Нет<br>Сопротивление 2000 Ом<br>Корпус Пластиковый</p>', 3350, '2014-08-29 12:37:36', 147, 'AKG C111LP  миниатюрный микрофон  телесного цвета с креплением \"за ухо\". L-разъём.  Круговая направленность', 19626, NULL, 1884815, '\0', ''),
  (20528, 'AKG C411L', '<p><br></p><p>C411L микрофон конденсаторный инструментальный со специально приспособленной частотной характеристикой и диаграммой направленности для озвучивания большинства струнных инструментов — акустических гитар, мандолин, скрипок и т.д.<br>Расположение вблизи или прямо на подгрифке (С 411 очень мал и легок) обеспечивает ясное неокрашенное звучание инструмента и в точности передает его акустический баланс. К инструменту С 411 прикрепляется не засыхающим клейким компаундом.<br>L-версия — с миниатюрным 3-контактным разъемом для подключения к портативным передатчикам радиосистем WMS 40/60/61’’ВО.</p><p>Технические характеристики</p><p>Частотный диапазон: 10 Гц – 20 кГц<br>Чувствительность: 2 mV/ms-2 (incl. MPA V L)<br>Максимальный уровень звукового давления: при 1 % искажений SPL 100 дБ<br>Импеданс: 200 Ом<br>Рекомендуемая нагрузка: &gt; 1000 Ом<br>Питание: 9-52 В фантомное питание согласно норме DIN 45596<br>Потребление тока: &lt; 2.2 мА<br>Разъем: 3-pin mini XLR<br>Размеры: 27 х 14 х 9.5 мм<br>Вес: 98 г</p><p><br></p>', 4300, '2014-08-29 12:40:46', 147, 'AKG C411L  микрофон для струнных инструментов, крепится к поверхности на \'жидкой резине\', L-разъём', 19627, NULL, 1884815, '\0', ''),
  (20529, 'AKG C417L', '<p>C 417 L микрофон конденсаторный всенаправленный петличный. Он обладает круговой характеристикой направленности и широкой полосой рабочих частот - прекрасными качествами для вещательной или театральной работы. Звучание необычайно открытое и естественное, частотная характеристика по оси направленности - линейная, что идеально для одновременной работы с несколькими микрофонами.</p><p>Система поставляется в разных конфигурациях, в т.ч. телесного цвета, со множеством соединительных переходников разной длины и формата. В комплекте с каждым С 417 пользователь получает два держателя-\"клипсы\" и колпачки ветрозащиты. С 417 B-lock - микрофон петличный С 417 L - микрофон конденсаторный всенаправленный петличный С 417 P B-lock - микрофон петличный телесного цвета С 417 P/L - микрофон петличный телесного цвета o B-Lock версия - с 1/8\" мини джеком с резьбовой фиксацией для использования с автономным блоком питания В 29, с адаптером питания МРА II, либо с портативным передатчиком радиосистемы WMS 300. o L-версия - с миниатюрным 3-контактным разъемом для подключения к портативным передатчикам радиосистем WMS 40/60/61\'\'ВО\'\".</p><p>Технические характеристики:<br>Направленность: круговая.<br>Частотный диапазон: 20—20000 Гц.<br>Соотношение сигнал/шум: 60 дБ-А.<br>Питание: Универсальное 9-52 В фантомное питание согласно норме DIN 45596 или с B 29 L источником фантомного питания на батареях, или с помощью. портативного передатчика беспроводной радиосистемы AKG.<br>Разъем: 3-контактный разъем типа мини XLR.<br>Чувствительность: 10 мВ/Па; (-40дБВ).<br>Импеданс: &lt;200 Ом.<br>Потребление тока: &lt;2мА.<br>Эквивалентный уровень шума: 34 дБ-А.<br>Макс. уровень звукового давления: при 1/3% коэф. нелин. искажений, 118/126 дБ SPL.<br>Размеры: Ø 7,5 х 15 мм</p>', 3440, '2014-08-29 12:47:34', 147, 'AKG C417L  петличный конденсаторный всенаправленный микрофон, L-разъём, цвет черный, в комплекте ветрозащита W407, крепление \"крокодил\" H40/1, крепление \"английская булавка\" H41', 19628, NULL, 1884815, '\0', ''),
  (20530, 'AKG C516ML', '<p>Легкий кардиоидный микрофон для подзвучки аккордеонов, фортепиано, гитарных усилителей. Входящие в комплект шурупы и самоклеящиеся демпферные прокладки позволяют установить микрофон на инструмент или усилитель там, где это нужно.</p><p>Чтобы подзвучить аккордеон, нужно два микрофона C516ML (один на правую, один – на левую стороны) и к ним источник фантомного питания на батареях B 29 L. C516ML может работать с источником фантомного питания на батареях B 29 L, с передатчиками AKG серий WMS, или адаптером фантомного питания MPA V L. Специальный адаптер A 400 позволяет присоединить микрофон к карманному передатчику AKG напрямую без шнура.</p><p>Особенности:<br>Кардиоидный инструментальный микрофон с миниатюрным кроншетейном для крепления.<br>Высокая степень защиты от механических шумов- отсоединяющийся микрофонный кабель.<br>Идеален для подзвучки аккордеонов, фортепиано, гитарных усилителей.<br>Технические характеристики:<br>Направленность: кардиоидная.<br>Частотный диапазон: 60 Гц – 20 кГц.<br>Чувствительность 5 мВ/Па.<br>Максимальный уровень звукового давления: 130/132 дБ (при коэффициенте нелинейных искажений 1/3 %).<br>Уровень собственных шумов: 31 дБ.<br>Соотношение сигнал/шум: 63 дБ.<br>Сопротивление: &lt; 200 Ом.<br>Рекомендованное сопротивление нагрузки: &gt;2000 Ом.<br>Потребляемый ток: &lt; 2 мА.<br>Источник фантомного питания: блок питания B 29 L; адаптер MPA V L или передатчики серии AKG WMS.<br>Разъем: 3-котактный мини- XLR Шнур: 1.5 м.<br>Внешний вид: черный матовый.<br>Размеры: длина - 235 мм (без кронштейна), максимальная ширина – 47 мм.<br>Вес: 46 г (микрофон и шнур).<br>Вес с упаковкой: 320 г.<br>Стандартные аксессуары: Адаптер A400 для присоединения к передатчику AKG PT 40 или PT 400, футляр для микрофона, W44 – ветрозащита.</p>', 5350, '2014-08-29 12:53:44', 147, 'AKG C516ML инструментальный микрофон для баяна, аккордеона, фортепиано, кардиоидный, L-разъём', 19629, NULL, 1884815, '\0', ''),
  (20531, 'AKG C519ML', '<p>Микрофон C519ML укрепляется на раструбе тромбона, саксофона, трубы или любого другого духового инструмента (например, диджериду). Кардиоидная направленность микрофона позволяет использовать его рядом с мониторами без опасности «завязки», а благодаря линейной АЧХ он очень точно и чисто передает звучание любого инструмента . Наконец, микрофон C519ML дает свободу передвижения музыкантам духовой секции.<br>Микрофон C519ML – работает от фантомного питания, подающегося с источника питания на батарейках B 29 L, с передатчиков серии AKG WMS или с адаптера MPA V L.</p><p>Особенности<br>- Миниатюрный микрофон на прищепке для духовых инструментов , барабанов и перкуссии.<br>- Миниатюрный гибкий держатель gooseneck для точной регулировки положения микрофона .<br>- В комплект входит специальный адаптер для работы с карманными передатчиками AKG.<br>- Отсоединяющийся микрофонный кабель.<br>- Гибкий подвес микрофона для надежной защиты от шумов.</p><p>Спецификация</p><p>Направленность: кардиоидная<br>Частотный диапазон: 60 Гц – 20 кГц<br>Чувствительность 5 мВ/Па<br>Максимальный уровень звукового давления: 130/132 дБ (при коэффициенте нелинейных искажений 1/3 %).<br>Уровень собственных шумов: 31 дБ<br>Соотношение сигнал/шум: 63 дБ<br>Сопротивление: &lt; 200 Ом<br>Рекомендованное сопротивление нагрузки: &gt;2000 Ом<br>Потребляемый ток: &lt; 2 мА<br>Источник фантомного питания: блок питания B 29 L; адаптер MPA V L или передатчики серии AKG WMS.<br>Разъем: 3-котактный мини- XLR<br>Шнур: 1.5 м.<br>Внешний вид: черный матовый<br>Размеры: длина - 213 мм (без прищепки), максимальная ширина – 47 мм.<br>Вес: 85 г микрофон и шнур).<br>Вес с упаковкой: 310 г.</p>', 6700, '2014-08-29 12:57:04', 147, 'AKG C519ML микрофон для духовых инструментов на \'прищепке\', L-разъем.', 19630, NULL, 1884815, '\0', ''),
  (20532, 'AKG C544L', '<p>AKG C544L представляет собой миниатюрный, влагостойкий головной микрофон, который хорошо подходит для фитнес-обучения, презентаций и использования в любых ситуациях, где нужен качественный и удобный головной микрофон. Оголовье крепится вокруг задней части шеи для комфортной, низкопрофильной подгонки. Высокочувствительная кардиоидная капсула дает отличную обратную связь и подавление шумов во внеосевых секциях, специальный барьер защищает микрофон от влажности, пота, макияжа и других жидкостей. Выходной кабель с мини 3-контактным XLR соединением для использования с поясным передатчиком AKG.<br>Основные особенности:<br>-эргономичное оголовье ;<br>-защита от влаги ;<br>-внешний подвес для минимизации механического шума.<br></p><p>Общие параметры<br>Тип конденсаторный<br>Вид головной<br>Направленность кардиоидная<br>Нижняя граница част. диапазона 20 Гц<br>Верхняя граница част. диапазона 20 000 Гц<br>Чувствительность 40 мВ/Па<br>Импеданс 200 Ом<br>Минимальное оконечное сопротивление 2000 Ом<br>Длина кабеля (радиус действия) 1.5 м<br>Подключение mini XLR<br>Питание фантомное 9-52В<br>Длина 130 мм<br>Вес 30 г</p>', 4290, '2014-08-29 13:00:38', 147, 'AKG C544L микрофон речевой с оголовьем, конденсаторный кардиоидный, L-разъём, 35 мВ/Па. Цвет черный.', 19631, NULL, 1884815, '\0', ''),
  (20533, 'AKG CK77 WR-L/P', '<p>Микрофон петличный конденсаторный всенаправленный, телесного цвета.</p><p>Этот микрофон предназначен для применения с радиосистемами WMS 40, 60, 61, 80, 81 и представляет собой ультралёгкое и чрезвычайно компактное устройство. Модель оптимизирована для использования во время активного движения, в ситуациях когда необходимо обеспечить хорошее качество звука даже в условиях требующих особой мобильности. Микрофон прекрасно переносит воздействие влаги, пота и солей. Помимо всего прочего, модель совместима практически со всеми беспроводными системами. Микрофон телесного цвета.</p><p>Технические характеристики:<br>Диаграмма направленности всенаправленный<br>Частотная характеристика 20—20000 Гц<br>Тип микрофона конденсаторный<br>Чувствительность 8 мВ / Па<br>Сопротивление 3500 Ом<br>Макс. звуковое давление 133, 1 КГц на 1 % КНИ<br>Соотношение сигнал/шум 68 дБ, 1 КГц на 1 Па<br>Размер 55 Ø x 14 мм<br>Масса 0.4 г</p>', 10500, '2014-08-29 13:06:20', 147, 'AKG CK77 WR-L/P микрофон петличный конденсаторный всенаправленный, телесного цвета, L-разъём', 19632, NULL, 1884815, '\0', ''),
  (20534, 'AKG CK99 L', '<p>Кардиоидная характеристика направленности CK 99 L гарантирует минимальный захват фона и высокое усиление до обратной связи в задачах живого звука. CK 99 L оснащен 3-контактным коннектором mini XLR для использования с поясным передатчиком AKG.<br></p><p>Общие параметры<br>Тип конденсаторный<br>Вид петличный<br>Направленность кардиоидная<br>Нижняя граница част. диапазона 15 Гц<br>Верхняя граница част. диапазона 18 000 Гц<br>Соотношение сигнал/шум 60 дБ<br>Чувствительность 8.8 мВ/Па<br>Импеданс 200 Ом<br>Минимальное оконечное сопротивление 2000 Ом<br>Длина кабеля (радиус действия) 1.6 м<br>Подключение mini XLR<br>Питание фантомное 9-52В<br>Вес 2.5 г</p>', 3300, '2014-08-29 13:10:58', 147, 'AKG CK99 L микрофон петличный конденсаторный кардиоидный, L-разъём, металлическая клипса. Цвет чёрный.', 19633, NULL, 1884815, '\0', ''),
  (20535, 'AKG HC577 L ', '<p>Продукция компании AKG отличается исключительным качеством и особыми технологиями, которые применяются при изготовлении беспроводных систем, проводных и беспроводных наушников.<br>Высочайшее качество передачи сигнала<br>Все отделы компании стремятся к созданию качественного и уникального продукта. Наушники AKG отличаются высочайшим качеством передачи сигнала, комфортны в носке благодаря регулирующемуся оголовью.<br>Телесная расцветка<br>HC 577 представляет собой вокальный микрофон, удобный в эксплуатации. Он обеспечит вокалиста высоким уровнем звучания и благодаря телесной расцветке будет незаметен на концертной площадке.<br>Капсюль СК 77<br>Микрофон оснащен капсюлем СК 77. Он имеет запатентованные диафрагмы оригинальной конструкции, которая обеспечивает защиту от пыли, слюны, влаги и механического шума. Легкий вес и компактность обеспечивают свободу движения вокалисту, а удобная и прочная конструкция обеспечит долгий срок службы.<br>Основные особенности:<br>-телесный цвет;<br>-высочайшее качество передачи сигнала;<br>-телесная расцветка.<br></p><p>Технические характеристики вокального микрофона с оголовьем AKG HC577L<br>Направленность: круговая<br>Частотный диапазон: 20 Гц – 20 кГц<br>Чувствительность: 8 мВ/Па<br>Максимальный уровень звукового давления: 133 дБ (при коэффициенте нелинейных искажений 1%)<br>Соотношение сигнал/шум: 68 дБ<br>Эквивалентный уровень шума: 26 дБ-А<br>Сопротивление: =10 кОм<br>Напряжение питания: 1.5 – 12 В</p>', 18200, '2014-08-29 13:15:05', 147, 'AKG HC577 L микрофон вокальный с оголовьем, телесного цвета, L-разъём', 19634, NULL, 1884815, '\0', ''),
  (20536, 'AKG CM311', '<p>Вокальный конденсаторный микрофон с оголовьем AKG CM311 mini XLR (3-pin).</p><p>Компактный конденсаторный микрофон с оголовьем, включает в себя комфорт, мобильность и превосходное качество. Технология шумоподавления Differoid, позволяет полностью отсеивать громкие посторонние звуки исходящие от напольных мониторов, рева толпы и т.д. предотвращая обратную связь. Направленность микрофона охватывает нужную область источника звука, тем самым качество и чистота вокала остается в первозданном состоянии. Микрофон AKG CM311 это идеальное решение для концертов, шоу и шумных вечеринок.</p><p>Основные особенности:<br>Технология шумоподавления Differoid.<br>Комфорные регулируемые оголовье и крепления.<br>Четкое и полное звучание.</p><p>Технические характеристики:<br>Тип: вокальный конденсаторный микрофон с оголовьем.<br>Частотный диапазон: 50 -17000 Гц.<br>Максимальное звуковое давление: 148 дБ.<br>Эквивалентный уровень шума: 26 дБ.<br>Отношение сигнал/шум: 68 дБ.<br>Импеданс: 75 Ом.<br>Потребляемая мощность: 18 - 48 В фантомного питания для DIN / IEC.<br>Вес: 61 г.</p>', 11000, '2014-08-29 13:19:07', 147, 'AKG CM311 mini XLR (3-pin)  микрофон вокальный конденсаторный с оголовьем, цвет черный, L-разъём', 19635, NULL, 1884815, '\0', ''),
  (20537, 'AKG DMM6', '<p>Автоматический, цифровой стерео микшер с 6-ю входами на микрофон (балансный) и 1(AUX) стерео входами. Присутствуют выходы мастер (стерео), выход для записи (стерео), также есть выход на наушники с регулятором громкости. Микшер оптимально смешивает сигналы от микрофонов, благодаря оптимальному альгоритму.Обнаружения шумов, что предотвращает случайную активации входных каналов.Для увеличения системы микшер имеет возможность соединения до нескольких таких же.</p><p>Микрофонные и линейные входы (6);<br>Мастер стерео выход (1);<br>Стерео выход для записи (1);<br>Шумоподавление;<br>Компрессия.</p>', 60000, '2014-08-29 13:36:12', 147, 'AKG DMM6  цифровой автоматический микрофон микшер. 6 входов / 2 линейных выхода.', 19636, NULL, 1884815, '\0', ''),
  (20538, 'AKG DMM12', '<p>DMM12 представляет собой высокопроизводительный цифровой автоматический микрофонный микшер, который прекрасно подходит для использования на больших собраниях и конференциях. Разработан для голосовых приложений, его DSP функции обеспечивают точное микширование до 120 каналов путем каскадирования до 10 DMM12s.<br>Многочисленные DSP функции<br>DMM12 предлагает высокое соотношение сигнал-шум и в то же время снижает шум из нескольких открытых микрофонов к минимуму. Многочисленные функции DSP такие, как фильтры, компрессор / лимитер и маршрутизации позволяют оптимально отрегулировать DMM12 под различные приложения.<br>Точное микширование<br>Оснащен сложным алгоритмом перемешивания 12 каналов для точного смешения, что никогда не позволит пропустить ни слова. До 10 каскадируемых единиц для одновременного использования до 120 каналов. Имеет цифровую обработку аудиосигнала, устраняет искажения и значительно снижает уровень шума, интуитивно понятный пользовательский интерфейс для быстрой и легкой установки. Оборудован аудио матрицей маршрутизации всех каналов для создания нескольких смесей различных сочетаниях выходных.<br>Основные особенности:<br>-множество DSP функций;<br>-точное микширование;<br>-цифровая обработка аудиосигнала.<br></p><p>Общие параметры<br>Тип цифровой автоматический микшер<br>Линейные входы 12 входов<br>Линейные выходы 4</p>', 85000, '2014-08-29 13:40:00', 147, 'AKG DMM12 цифровой автоматический микшер. 12 входов / 4 линейных выхода.', 19637, NULL, 1884815, '\0', ''),
  (20539, 'RODE M1', '<p>Этот динамический микрофон надежно сделан в литом алюминиевом корпусе и оснащен прочным динамическим капсюлем. Особенности такого дизайна позволяют использовать его на сцене бесконечно.</p><p>Вы можете положиться на Rode M1, который обеспечит вам надежную высококачественную работу, день за днем, год за годом.<br>Концертный динамический вокальный микрофон<br>Неодимовый капсюль с высоким уровнем выходного сигнала<br>Позолоченный XLR разъем<br>Встроенный поп-фильтр для уменьшения звуков от шипящих и взрывных звуков<br>Подавление обратной связи<br>Металлический корпус<br>Низкий уровень шумов<br>Разработан и произведен в Австралии</p>', 2740, '2014-08-29 15:34:47', 153, 'RODE M1 - Динамический кардиоидный микрофон для \"живых\" выступлений.', 19638, NULL, 1884815, '\0', ''),
  (20540, 'RODE M1-S', '<p>Этот динамический микрофон надежно сделан в литом алюминиевом корпусе и оснащен прочным динамическим капсюлем. Особенности такого дизайна позволяют использовать его на сцене бесконечно.</p><p>Вы можете положиться на Rode M1, который обеспечит вам надежную высококачественную работу, день за днем, год за годом.<br>Концертный динамический вокальный микрофон<br>Неодимовый капсюль с высоким уровнем выходного сигнала<br>Позолоченный XLR разъем<br>Встроенный поп-фильтр для уменьшения звуков от шипящих и взрывных звуков<br>Подавление обратной связи<br>Металлический корпус<br>Низкий уровень шумов<br>Разработан и произведен в Австралии </p><p>Кнопка выключения микрофона</p><p>Основные характеристики<br>Категория Ручной<br>Тип Динамический<br>Направленность Кардиоида<br>Частотный диапазон, Гц 75..18000<br>Сопротивление, Ом 320<br>Разъем XLR<br>Направленность<br>Кардиоида есть<br>Физические характеристики<br>Размеры, мм 171 x 51.5 x 51.5<br>Вес, г 360</p>', 3590, '2014-08-29 15:40:32', 153, 'RODE M1-S - Динамический кардиоидный микрофон для \"живых\" выступлений с выключателем.', 19640, NULL, 1884815, '\0', ''),
  (20542, 'Rode M3', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>Если необходим универсальный микрофон для записи дома или на студии, на натуре или на концерте, в любом месте, конденсаторный кардиоидный микрофон М3 с широким частотным диапазоном выполнит свою задачу на высочайшем уровне.<br><br>Корпус М3 выполнен из прочного металла и оснащен аттенюатором (0, -10, -20 дБ), индикатором заряда батареи и фильтром обреза НЧ.<br><br>М3 дополняется ветрозащитой и креплением на стойку, а также может работать как от 9 В батареи, так и от 24-48В фантомного питания.</p><ul><li>Прочный металлический корпус</li><li>Внутренняя антивибрационная система подвеса капсуля</li><li>Переключаемый фильтр обреза НЧ @ 80 Гц -12 дБ/Окт</li><li>Трехпозиционный аттенюатор – линейный, -10дБ и -20дБ</li><li>Низкая чувствительность к касаниям корпуса микрофона</li><li>Защитная решетка из закаленной стали</li><li>Питание от 9 В батареи и от 24/48 В фантомного питания</li><li>Индикатор заряда батареи</li><li><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Динамический</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>40..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-40</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>142</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>200</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>73</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>21</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное, батарея</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>225 x 33 x 33</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>390<br><br></td></tr></tbody></table></li></ul></td></tr></tbody></table>', 3350, '2014-09-01 15:57:26', 153, 'Rode M3 - Студийный и сценический конденсаторный кардиоидный микрофон с двумя типами питания - 48В и батарейка. ', 19644, NULL, 124, '\0', ''),
  (20543, 'Rode S1', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>Созданный для сценической работы, бескомпромиссный RODE S1 идеально подойдет и для студийной работы.</p><p>Конденсатор RODE S1 обеспечивает передачу звука студийного качества. Фильтр обреза низких частот избавляет от гула и звуков при касании тела, а суперкардиоидная диаграмма направленности практически исключает внешние шумы и обратную связь.</p><p>Многослойная ветрозащита, встроенная в решетку капсуля, устранит призвуки дыхания, задувания и заплевывания без ущерба для чувствительности и частотного диапазона. Эргономичный дизайн делает RODE S1 очень удобным для активной работы на сцене.</p><p>Электронно сбалансированный выход большой мощности позволит компенсировать потери при использовании длинных кабелей.</p><ul><li>Качество студийного микрофона</li><li>Суперкардиоидная диаграмма направленности</li><li>Корпус из прочного металла</li><li>Привлекательное никелевое покрыти/ Исполнение в черном цвете также доступно (S1-B)</li><li>Защитная решетка из закаленной стали</li><li>Специально разработанная внутренняя ветрозащита</li><li>Низкая чувствительность к касаниям корпуса микрофона</li><li><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Суперкардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-46</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>151</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>50</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>75</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>18</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Суперкардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>183 x 52 x 52</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>308</td></tr></tbody></table></li></ul></td></tr></tbody></table>', 11100, '2014-09-01 16:27:54', 153, 'Rode S1 - Суперкардиоидный конденсаторный микрофон для \"живых\" выступлений. Никелированный или Черный.', 19646, NULL, 124, '\0', ''),
  (20544, 'Rode Classic II Limited Edition', '<p>RØDE Classic II – студийный микрофон премиум-класса. Классическое название – классическое звучание.</p><p><br></p><p>Специальная 1” двойная диафрагма с питанием от классического двойного триода лампы GE JAN-6072 и выходной трансформатор Jensen.</p><p>Результат? Классическая теплота и богатство, как для вокала так и для акустических инструментов.&nbsp;</p><p><br></p><p>Девять диаграмм направленности, различные настройки и фильтры. Отлитый из латуни корпус микрофона отполирован вручную, очищен стеклянной крошкой и покрыт атласным никелем. Также в комплекте усиленный кабель 9м из бескислородной меди с двойным экраном и усиленными разъемами, блок питания, подвесное антивибрационное крепление и прочный алюминиевый кейс для безопасной транспортировки.</p><p><br></p><p>Специальная 1” двойная диафрагма</p><p>Классический двойной триод лампы GE JAN-6072</p><p>Девять диаграмм направленности</p><p>Различные настройки и фильтры</p><p>Корпус отлит из латуни</p><p>Отполирован вручную</p><p>Кабель 9м из бескислородной меди с двойным экраном</p><p>Усиленные разъемы</p><p>Алюминиевый кейс</p><h3>Характеристики Rode Classic II Limited Edition</h3><table><tbody><tr><td colspan=\"3\" style=\"vertical-align:top\"><strong>Общие данные</strong></td></tr><tr><td style=\"vertical-align:top; width:255px\">Тип</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Ламповый конденсаторный микрофон премиум-класса с 1” двойной диафрагмой</td></tr><tr><td style=\"vertical-align:top; width:255px\">Питание</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Блок питания (110 ~ 120В/220 ~ 240В, 50/60 Гц)</td></tr><tr><td style=\"vertical-align:top; width:255px\">Акустическое исполнение</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Давление, Изменение давления</td></tr><tr><td colspan=\"3\" style=\"vertical-align:top\"><strong>Диаграмма направленности</strong></td></tr><tr><td style=\"vertical-align:top; width:255px\">-</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Переключаемая диаграмма направленности в 9-ти положениях.</td></tr><tr><td style=\"vertical-align:top; width:255px\">-</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">Всенаправленный/Кардиоида/Фигурная восьмерка</td></tr><tr><td style=\"vertical-align:top; width:255px\">Частотный диапазон</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">20 Гц-20 кГц</td></tr><tr><td style=\"vertical-align:top; width:255px\">Выходное сопротивление</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">200 Ом</td></tr><tr><td style=\"vertical-align:top; width:255px\">Соотношение сигнал/шум</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">&gt; 76дБ SPL (A - взвешенный на IEC651)</td></tr><tr><td style=\"vertical-align:top; width:255px\">Собственный шум</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">&lt;18 дБ SPL (A - взвешенный на IEC651)</td></tr><tr><td style=\"vertical-align:top; width:255px\">Максимальное звуковое давление</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">131дБ SPL (@ 1 кГц, 1% THD при нагрузке 1 кОм)</td></tr><tr><td style=\"vertical-align:top; width:255px\">Максимальное выходное напряжение</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">+2dBu (@ 1 кГц, 1% THD при нагрузке 1 кОм)</td></tr><tr><td style=\"vertical-align:top; width:255px\">Чуствительность</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">-37дБ 1V/Pa (14 мВ @ 94дБ SPL) +/-2дБ</td></tr><tr><td style=\"vertical-align:top; width:255px\">Вес</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">1440 гр</td></tr><tr><td style=\"vertical-align:top; width:255px\">Размеры</td><td style=\"vertical-align:top\">-</td><td style=\"vertical-align:top\">201 x 65 x 65 мм<br><br></td></tr></tbody></table>', 87000, '2014-09-01 16:46:44', 153, 'Rode Classic II Limited Edition - Ламповый конденсаторный микрофон премиум класса. Ограниченный выпуск в черном исполнении.', 19648, NULL, 124, '\0', ''),
  (20545, 'Rode K2', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>RØDE K2 это результат разработки и производства тысяч ламповых микрофонов.</p><p>Капсуль микрофона K2 HF-1 это вершина ламповых технологий. Качество звука объединило в себе высочайшие современные характеристики с легендарным характером звука микрофонов 50-х. Множество точечных настроек К2 позволят Вам быстро и четко реализовать любую задачу. С появлением К2 RØDE подтверждает свою репутацию производителя передовых инструментов для записи звука высочайшего качества.</p><p>На выставке 2004 Frankfurt Music Messе, 56 наиболее влиятельных изданий музыкальной индустрии назвали К2 “Лучшим Студийным Микрофоном 2004г”</p><ul><li>Большой капсуль с позолоченной диафрагмой на антивибрационном подвесе</li><li>Очень низкий уровень собственного шума</li><li>Широкий динамический диапазон</li><li>Схемотехника класса “А”</li><li>Вручную подобранные двойные триоды (лампы) 6922</li><li>Специальный блок питания</li><li>Защитная сетка из закаленной стали повышенной прочности</li><li>Отполирован и покрыт никельным напылением</li><li>Изменяемая диаграмма направленности с круговой, через кардиоиду на “8” (восьмерку)</li><li><h1><a data-cke-saved-href=\"http://dastore.ru/catalog/audio/mikrofony-i-akseccuary/mikrofony/rode-k2/#\" href=\"http://dastore.ru/catalog/audio/mikrofony-i-akseccuary/mikrofony/rode-k2/#\">Характеристики Rode K2</a></h1><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Ламповый</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида, круговая, восьмерка</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-36</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>162</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>200</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>81</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>10</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Блок питания</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Круговая</p></td><td>есть</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td style=\"width:336px\"><p>Фигурная восьмерка</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>208 x 55 x 55</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>815</td></tr></tbody></table></li></ul></td></tr></tbody></table>', 22800, '2014-09-01 16:51:53', 153, 'Rode K2 - Точный конденсаторный ламповый микрофон.  Двойная 1\" диафрагма. Изменяемая диаграмма направленности.', 19650, NULL, 124, '\0', ''),
  (20546, 'Rode NTK', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>RØDE NTK это микрофон класса А, обладатель престижных премий и признаний профессионалов, который занял достойное место в парке десятков тысяч профессионалов по всему миру.<br><br>Сердце RØDE NTK это разработанный в Австралии капсуль HF-2. Схемотехника основана на сверхчувствительном двойном триоде (лампе) 6922, в сочетании с компонентами высочайшего качества. Как результат богатый, теплый звук NTK идеально подойдет для записи вокала, акустических инструментов, ударных, гитарных громкоговорителей и клавишных.</p><ul><li>Большой 1” (25мм) капсуль с позолоченной диафрагмой.</li><li>Схемотехника класса А</li><li>Подобранный вручную двойной триод (лампа) 6922</li><li>Специальный блок питания</li><li>Очень низкий уровень собств. шума</li><li>Широкий динамический диапазон</li><li>Защитная сетка из закаленной стали повышенной прочности</li><li>Капсуль на антивибрационном подвесе</li><li>Высокий уровень защиты от радио помех</li><li><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-38</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>158</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>200</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>82</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>12</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Блок питания</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>