  (20547, 'Rode NT1-A', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>RØDE NT1-A стал индустриальным стандартом благодаря реалистической передаче звука, большому динамическому диапазону и чувствительности, присущей только самым дорогим микрофонам.<br><br>RØDE NT1-A – Победитель конкурса Electronic Musician 2004 Editor\'s Choice Award как микрофон с самым низким уровнем собственного шума. Эта доработанная версия классического RØDE NT-1 имеет уровень собственного шума всего 5дБА!</p><ul><li>Большой 1\" (25мм) капсюль с позолоченной мембраной</li><li>Кардиоидная диаграмма направленности</li><li>Сверхнизкий уровень собственного шума 5дБ (А)</li><li>Безтрансформаторная схема, новейшие разработки в электронике</li><li>Широкий динамический диапазон</li><li>Позолоченные контакты</li><li>Конденсаторная схема с внешней полязризацией</li><li>Противоударное внутреннее крепление<table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-32</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>137</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>100</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>88</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>5</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>XLR</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физически