  (20549, 'Rode NT1000', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>Очень низкий уровень собственного шума – 6 дБА и высокая чувствительность делают RØDE NT1000 исключительно точным прибором для записи, как вокала, так и инструментов.<br><br>Призванный для выполнения множества задач, микрофон RØDE NT1000 также идеально подойдет для записи ударных или рояля. Капсуль HF-2 с внутренней защитой от вибраций обеспечивает NT1000 динамическим диапазоном 134дБ и давлением до 140дБА в диапазоне 20Гц-20кГц</p><ul><li>Большой дюймовый капсюль HF2 с позолоченной мембраной</li><li>Сверхмалошумящая безстрансформаторная схема</li><li>Кардиоидная диаграмма направленности</li><li>Стойкое никелевое покрытие (\"сатин\")</li><li>Защитная сетка капсюля из закаленной стали повышеной прочности</li><li>Встроенный демпфер капсюля</li><li>Конденсаторная схематика с внешним питанием</li><li>Полная частотная отдача в заявленном диапазоне частот</li><li><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-36</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>140</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>100</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>88</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>6</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>209 x 54 x 54</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>682</td></tr></tbody></table></li></ul></td></tr></tbody></table>', 10450, '2014-09-02 09:58:30', 153, 'Rode NT1000 - Сверхточный студийный конденсаторный микрофон с позолоченной диафрагмой 1\"', 19658, NULL, 124, '\0', ''),
  (20550, 'Rode NT2-A', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>RØDE NT2-A продолжает традицию, начатую уже легендарным NT2. Профессиональный микрофон с большой диафрагмой оснащен трехпозиционным переключателем направленности, аттенюатором и обрезным фильтром НЧ.<br><br>Сердце NT2-A – разработанный в Австралии капсуль HF1 с двойной диафрагмой. Частотный диапазон и чувствительность этого триода(лампы) соответствует самым высоким требованиям современной записи, сохраняя мягкий шелковый характер микрофонов середины прошлого столетия. Эти особенности делают работу с NT2-A простой и эффективной.</p><ul><li>Большой 1” (25 мм) позолоченный капсуль HF1</li><li>Регулировка диаграммы напр., обрезного фильтра НЧ и аттенюатора на борту</li><li>Переключатель направленности: Круговая, Кардиоида, Восьмерка</li><li>Трехпозиционный обрезной фильтр НЧ – линейный, 40Гц или 80Гц</li><li>Трехпозиционный аттенюатор – 0дБ, -5дБ или -10дБ</li><li>Очень низкий уровень собственного шума</li><li>Широкий динамический диапазон</li><li>Внешнее антивибрационное крепление<table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида, круговая, восьмерка</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-36</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>147</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>200</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>87</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>7</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Круговая</p></td><td>есть</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td style=\"width:336px\"><p>Фигурная восьмерка</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>209 x 55 x 55</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>860</td></tr></tbody></table></li></ul></td></tr></tbody></table>', 11500, '2014-09-02 10:13:55', 153, 'Rode NT2-A - Профессиональный конденсаторный микрофон с большой 1” диафрагмой с трехпозиционным переключателем направленности', 19660, NULL, 124, '\0', ''),
  (20551, 'Rode NT2000', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>Первый в мире конденсаторный микрофон с большой диафрагмой и переключателями направленности, фильтрами и аттенюатором на корпусе.<br><br>Превосходное внешнее исполнение в сочетании с подобранными электронными компонентами и новым капсулем HF1, разработанным в Австралии обеспечивают невероятно низкий уровень собственного шума (7 dBA) и давление до 157 dB, при исключительно чистом звуке.</p><ul><li>Большой 1” позолоченный капсуль HF1</li><li>Изменяемая в работе диаграмма с круговой, через кардиоиду на “8” (восьмерку)</li><li>Изменяемые в работе фильтр и аттенюатор</li><li>Система крепления с очень низким уровнем шума</li><li>Широкий динамический диапазон</li><li>Защитная сетка из закаленной стали повышенной прочности</li><li>Капсуль на антивибрационном подвесе<table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида, круговая, восьмерка</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-36</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>147</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>200</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>87</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>7</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Круговая</p></td><td>есть</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td style=\"width:336px\"><p>Фигурная восьмерка</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>208 x 55 x 55</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>831</td></tr></tbody></table></li></ul></td></tr></tbody></table>', 17300, '2014-09-02 10:33:44', 153, 'Rode NT2000 - Легко настраиваемый конденсаторный микрофон с двойной 1” диафрагмой. Трехпозиционный переключатель направленности - всенаправленный, кардиоидный или «восьмерка». ', 19662, NULL, 124, '\0', ''),
  (20552, 'Rode NT3', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>Стильный и современный, RØDE NT3 настоящая рабочая лошадка для студий и записи на натуре. Благодаря возможности не только фантомного 48 В питания, но и от 9 В батареи, RØDE NT3 не заменим как на студии, так и в полевых условиях.<br><br>В любых условиях RØDE NT3 запишет качественный сигнал, держите Вы его в руке или расположите в антивибрационном креплении на стойке. Защита от радиопомех, низкий уровень собственного шума и супер-кардиоидная диаграмма направленности исключают лишние шумы и помехи при записи.<br><br>RØDE NT3 заключен в прочный корпус из литого металла с матовым никелированным покрытием.</p><ul><li>Конденсаторный капсуль 3/4“ с защитой от перегрузок</li><li>Два вида питания</li><li>Полностью металлический корпус c никелиевым полированным покрытием</li><li>Выход без трансформатора</li><li>Противоударное крепление внутренней капсулы</li><li>Пониженная чувствительность к электромагнитным наводкам</li><li>Бесшумная система крепления деталей</li><li>Широкий частотный диапазон</li><li>Индикатор заряда батареи<table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-39</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>140</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>200</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>77</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>16</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное, батарея</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>206 x 32 x 32</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>371<br><br></td></tr></tbody></table></li></ul></td></tr></tbody></table>', 8200, '2014-09-02 10:38:25', 153, 'Rode NT3 - Студийный и для работы на выезде конденсаторный микрофон с диафрагмой 3/4\" и питанием от фантомного 48 Вольт и 9 Вольтовой батарейки. ', 19663, NULL, 124, '\0', ''),
  (20553, 'Rode NT4', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>Стерео чудо. Новый NT4, привлекательный микрофон, который решает проблему века в стерео записи – больше не надо придумывать замысловатых систем подвеса и крепления микрофонов, чтобы получить профессиональный результат.</p><p><br>С фиксированным 90˚ X/Y расположением подобранных конденсаторных капсулей, NT4 позволит записать настоящую, точную стерео панораму.<br>Динамический диапазон 128дБ, давление до 143дБА и низкий уровень собственного шума в сочетании с возможностью питания как от фантомного 48В , так и от батареи 9В с индикатором заряда, делают NT4 самым лучшим решением для стерео записи как на студии, так и в полевых условиях<br><br>NT4 поставляется с кейсом и креплением под стойку RM4, специальным стерео кабелем (XLR на мини-джек) и ветрозащитой WS4.</p><ul><li>Стерео X/Y конденсаторный микрофон</li><li>Два 1/2” капсюля с системой антивибрационного крепления</li><li>Подобранные полнодиапазонные капсюли с позолоченными мембранами</li><li>Два специальных кабеля в комплекте – с двойным XLR и мини стерео jack</li><li>Специальная ветрозащита в комплекте (WS4)</li><li>Литой корпус с прочным матовым никелевым покрытием</li><li>Система бесшумного крепления деталей к корпусу</li><li>Два вида питания<table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Стерео</p></td><td>да</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-38</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>143</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>200</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>78</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>16</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное, батарея</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>231 x 61 x41</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>480<br><br></td></tr></tbody></table></li></ul></td></tr></tbody></table>', 16250, '2014-09-02 10:42:43', 153, 'Rode NT4 - X/Y стерео конденсаторный микрофон с  мембраной 1/2”. Низкий уровень собственного шума,  возможность питания как от фантомного 48В , так и от батареи 9В, индикатор заряда.', 19665, NULL, 124, '\0', ''),
  (20554, 'Rode NT5 ', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p>Подобранные пары NT5 это настоящий шедевр среди кардиоидных конденсаторных микрофонов.<br><br>Созданные для записи акустических инструментов, ударных, перкуссии и живых выступлений, компактные NT5 с 1/2” капсулем обладают высокой чувствительностью и широким частотным диапазоном.<br><br>NT5 можно использовать как независимо, так и X/Y стерео парами. Подобранная пара поставляется в специальном кейсе, ветрозащитами и креплениями.</p><ul><li>Конденсаторный с внешней поляризацией</li><li>Позолоченная 1/2\" мембрана</li><li>Прочный корпус с никелевым покрытием</li><li>Поверхностный монтаж</li><li>Низкий уровень шума</li><li>Широкий частотный диапазон<table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-38</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>143</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>100</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>78</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>16</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>118 x 20 x 20</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>101<br><br></td></tr></tbody></table></li></ul></td></tr></tbody></table>', 6300, '2014-09-02 10:46:36', 153, 'Rode NT5 - Компактный конденсаторный микрофон с 1/2\" капсулем . ', 19667, NULL, 124, '\0', ''),
  (20555, 'Rode NT5 MP', '<table style=\"width:680px\"><tbody><tr><td style=\"vertical-align:top\"><p><br></p><p>Подобранные пары NT5 это настоящий шедевр среди кардиоидных конденсаторных микрофонов.<br><br>Созданные для записи акустических инструментов, ударных, перкуссии и живых выступлений, компактные NT5 с 1/2” капсулем обладают высокой чувствительностью и широким частотным диапазоном.<br><br>NT5 можно использовать как независимо, так и X/Y стерео парами. Подобранная пара поставляется в специальном кейсе, ветрозащитами и креплениями.</p><ul><li>Конденсаторный с внешней поляризацией</li><li>Позолоченная 1/2\" мембрана</li><li>Прочный корпус с никелевым покрытием</li><li>Поверхностный монтаж</li><li>Низкий уровень шума</li><li>Широкий частотный диапазон</li></ul><p>Также доступен, как подобранная пара.</p><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-38</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>143</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>100</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>78</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>16</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>XLR</td></tr><tr><td style=\"width:336px\"><p>Подобранная пара</p></td><td>да</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>118 x 20 x 20</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>101<br><br></td></tr></tbody></table></td></tr></tbody></table>', 14300, '2014-09-02 10:51:56', 153, 'Rode NT5-S MP - Подобранная по параметрам пара конденсаторных микрофонов NT5-S. ', 19668, NULL, 124, '\0', ''),
  (20556, 'Rode NT55-S', '<p>Конденсаторный NT55 с 1/2\" капсулем является более функциональной версией всемирно известного и повсеместно используемого RØDE NT5. NT55 оснащен балансным выходом, обладает низким уровнем собственного шума, и поражает шириной динамического и частотного диапазонов.<br><br>Схема NT55 дополнена трехпозиционным аттенюатором – 0дБ, -10дБ или -20дБ, а также переключаемым обрезным фильтром низких частот на 75Гц или на 150Гц.<br><br>NT55 поставляется с двумя конденсаторными капсулями – с кардиоидной и круговой диаграммами направленности для возможности выполнения множества задач.</p><ul><li>Конденсаторный с внешней поляризацией</li><li>Капсюль 1/2\" с позолоченной мембраной</li><li>Трехпозиционный аттенюатор – 0дБ, -10дБ или -20дБ</li><li>Трехпозиционный обрезной фильтр низких частот – линейный, 75Гц или 150Гц</li><li>Кардиоидный или круговой направленности капсюль</li><li>Прочный корпус с никелевым покрытием</li><li>Поверхностный монтаж</li><li>Низкий уровень шума</li><li>Широкий частотный диапазон</li></ul><p><strong>Технические характеристики</strong></p><p>Питание&nbsp;&nbsp; &nbsp;Фантомное питание 48 В<br>Акустическое исполнение&nbsp;&nbsp; &nbsp;Изменение давления<br>Диаграмма направленности&nbsp;&nbsp; &nbsp;Кардиоида и Круговая<br>Частотный диапазон&nbsp;&nbsp; &nbsp;20 Гц-20 кГц<br>Выходное сопротивление&nbsp;&nbsp; &nbsp;100 Ом<br>Соотношение сигнал/шум&nbsp;&nbsp; &nbsp;79 дБ SPL (A - взвешенный на IEC651)<br>Собственный шум&nbsp;&nbsp; &nbsp;15 дБ SPL (A - взвешенный на IEC651)<br>Максимальное звуковое&nbsp;<br>давление&nbsp;&nbsp; &nbsp;136дБ SPL (@ 1 кГц, 1% THD при нагрузке 1 кОм)<br>Максимальное выходное<br>напряжение&nbsp;&nbsp; &nbsp;+8dBu (@ 1 кГц, 1% THD при нагрузке 1 кОм)<br>Чуствительность&nbsp;&nbsp; &nbsp;-38 дБ 1 Volt/Pascal (16 мВ @ 94 дБ SPL) +/- 2 дБ @ 1 кГц<br>Вес&nbsp;&nbsp; &nbsp;110 г<br>Размеры&nbsp;&nbsp; &nbsp;145 &nbsp;x 20 x 20 мм<br></p>', 11200, '2014-09-02 13:12:57', 153, 'Rode NT55-S Конденсаторный с 1/2\" капсулем. Низкий уровень собственного шума. Трехпозиционный аттенюатор на корпусе – 0дБ, -10дБ или -20дБ. В комплекте два капсуля –  кардиоидный и круговой диаграммой направл.', 19670, NULL, 124, '\0', ''),
  (20557, 'Rode NT55-MP', '<p>Конденсаторный NT55 с 1/2\" капсулем является более функциональной версией всемирно известного и повсеместно используемого RØDE NT5. NT55 оснащен балансным выходом, обладает низким уровнем собственного шума, и поражает шириной динамического и частотного диапазонов.<br><br>Схема NT55 дополнена трехпозиционным аттенюатором – 0дБ, -10дБ или -20дБ, а также переключаемым обрезным фильтром низких частот на 75Гц или на 150Гц.<br><br>NT55 поставляется с двумя конденсаторными капсулями – с кардиоидной и круговой диаграммами направленности для возможности выполнения множества задач.</p><ul><li>Конденсаторный с внешней поляризацией</li><li>Капсюль 1/2\" с позолоченной мембраной</li><li>Трехпозиционный аттенюатор – 0дБ, -10дБ или -20дБ</li><li>Трехпозиционный обрезной фильтр низких частот – линейный, 75Гц или 150Гц</li><li>Кардиоидный или круговой направленности капсюль</li><li>Прочный корпус с никелевым покрытием</li><li>Поверхностный монтаж</li><li>Низкий уровень шума</li><li>Широкий частотный диапазон</li></ul><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида, круговая</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-38</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>136</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>100</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>79</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>15</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>XLR</td></tr><tr><td style=\"width:336px\"><p>Подобранная пара</p></td><td>да</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Круговая</p></td><td>есть</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>145 x 20 x 20</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>110</td></tr></tbody></table>', 24600, '2014-09-02 13:19:48', 153, 'Rode NT55 Matched Pair Подобранная по параметрам пара конденсаторных микрофонов NT55-S. ', 19671, NULL, 124, '\0', ''),
  (20558, 'Rode NTG-3', '<p>NTG-3 является воплощением многолетнего опыта инженеров - разработчиков компании RODE, создавших бескомпромиссный инструмент для вещательной индустрии.</p><p>В RODE NTG-3 применены новейшие технологии, делающие микрофон устойчивым к радиопомехам и практически не чувствительным к изменениям влажности, это позволяет использовать конденсаторный микрофон в любых погодных условиях, что зачастую являлось невозможным. Будь то в тропический ливень, песчаную бурю или вьюгу, NTG-3 безотказно запишет чистый звук там, где любой другой конденсаторный микрофон работать не будет.</p><p>В дополнение к своим лучшим качествам, NTG-3 обладает прочным матовым корпусом и минимальным уровнем собственного шума (13dBA),&nbsp; что делает этот микрофон флагманом А/В (аудиовизуальной) серии компании RODE. Когда Вы не используете NTG-3, микрофон можно убрать в специальный влагозащищенный футляр, который обеспечит дополнительную сохранность во время хранения и перевозки.</p><ul><li>Разработан для работы при любых погодных условиях</li><li>На 50 % меньше собственных шумов, по сравнению с аналогичными микрофонами</li><li>Конденсаторный (с защитой от радиопомех)</li><li>Практически не шумит при касании тела микрофона</li><li>Высокий уровень защиты от различных частотных воздействий</li><li>Превосходное качество звукопередачи</li><li>Поставляется с защитным алюминиевым чехлом</li></ul><table style=\"width:680px\"><tbody><tr><td colspan=\"2\"><strong>Основные характеристики</strong></td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Пушка</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Суперкардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>40..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-30</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>130</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>25</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>81</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>13</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>XLR</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Суперкардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>255 x 19 x 19</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>163</td></tr></tbody></table>', 22900, '2014-09-02 13:39:42', 153, 'Микрофон-пушка вещательного качества. Конденсаторный (с защитой от радиопомех).  Суперкардиоидный.', 19672, NULL, 124, '\0', ''),
  (20559, 'Rode NTG-8', '<p>Является продолжением вещательного микрофона-пушки NTG-3, но со значительно увеличенной направленностью во всём диапазоне частот. Идеальный микрофон для кино, телевидения, спорта, прямого эфира и любых других приложений, где требуется высокое качество звука на большом расстоянии. Демонстрирует минимальный уровень собственного шума, превосходный естественный натуральный звук без окраски как по оси так и вне оси микрофона. Благодаря применению RF bias технологии практически не чувствителен к изменениям влажности и полностью справляется с сыростью. Обладает прочным матовым корпусом и минимальным уровнем собственного шума (13dBA), что делает этот микрофон флагманом А/В (аудиовизуальной) серии компании RODE. Когда Вы не используете NTG-8, микрофон можно убрать в специальный алюминиевый влагозащищенный футляр (миниатюрный тубус), где микрофон надежно защищен, как от погодных условий, так и от всевозможных трясок и вибраций при транспортировке, который обеспечит дополнительную сохранность во время хранения и перевозки.</p><ul><li>Увеличенная направленность микрофона</li><li>Натуральный звук по оси и вне оси микрофона</li><li>Разработан для работы при любых погодных условиях</li><li>Экстремально низкий уровень собственного шума</li><li>Конденсаторный (с защитой от радиопомех)</li><li>Практически не шумит при касании корпуса микрофона</li><li>Высокий уровень защиты от различных частотных воздействий</li><li>Превосходное вещательное качество звукопередачи</li><li>Спроектирован и произведен в Австралии</li><li>Гарантия 10 лет</li></ul><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Пушка</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Суперкардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>40..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-23</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>127</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>25</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>81</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>11</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>XLR</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Суперкардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>559 x 19 x 19</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>345</td></tr></tbody></table>', 28000, '2014-09-02 13:43:51', 153, 'Rode NTG-8 Микрофон-пушка вещательного качества. Острая направленность микрофона. Натуральный звук по оси и вне оси микрофона. Экстремально низкий уровень собственного шума. Конденсаторный (с защитой от радиопомех)', 19673, NULL, 124, '\0', ''),
  (20560, 'Rode Broadcaster', '<p>RØDE Broadcaster – его назначение уже заложено в названии – устойчивый к перегрузкам микрофон специально разработан для решения задач вещания.<br><br>Победитель Radio World/US National Association of Broadcasters (NAB) \'What\'s Cool\' в 1998 году, после чего стал индустриальным стандартом и привнес студийное качество в вещательную индустрию.<br><br>Используя разработанный в Австралии конденсаторный 1” капсуль, защищенный от внешних наводок, Broadcaster также оснащен фильтром обреза НЧ для устранения гула.&nbsp;<br><br>Уникальный индикатор \'ON-AIR\' может быть включен или выключен путем подключения специального разъема.</p><ul><li>Капсуль HF2 с позолоченной мембраной 1”</li><li>Индикатор работы</li><li>Очень низкий уровень собственного шума</li><li>Частотный диапазон с обрезанными НЧ для работы с голосом</li><li>Внутренняя ветрозащита</li><li>Корпус из высококачественной стали</li></ul><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>20..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-34</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>128</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>40</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>80</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>14</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>167 x 50 x 50</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>577</td></tr></tbody></table>', 13900, '2014-09-02 13:48:11', 153, 'Rode Broadcaster Точный вещательный конденсаторный микрофон с  мембраной 1”. Конденсаторный 1” капсуль, защищенный от внешних наводок. Фильтр обреза НЧ для устранения гула. ', NULL, NULL, 124, '\0', '\0'),
