   19674, NULL, 124, '\0', ''), (20566, 'Rode Podcaster',
                                  '<p>Главная идея, воплощенная в Podcaster, это встроенные АЦП, что позволяет подключить и использовать микрофон с любыми компьютерами, которые не оснащены профессиональными звуковыми картами, просто используя кабель USB.<br><br>Podcaster предлагает частотный диапазон для голоса, индикатор включения, прямой выход на наушники и конечно низкий уровень собственного шума.<br><br>Podcaster открывает большие возможности для всех, кому необходимо записать качественный звук, но у кого нет профессионального образования в сфере звукозаписи.</p><ul><li>Вещательное качество</li><li>Динамический капсуль 28мм</li><li>18 битная/8-48кГц дискретизация</li><li>Совместим с Windows и Mac</li><li>Питание от USB разъема</li><li>Внутреннее антивибрационное крепление капсуля</li><li>Выход на наушники с регулятором громкости на борту</li><li>Идеален для систем распознавания речи</li></ul><table style=\"width:680px\"><tbody><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Динамический</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>40..14000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-51</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>78</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>USB</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>215 x 56 x 52</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>610</td></tr></tbody></table>',
