                                  'Rode Podcaster USB микрофон вещательного качества. Частотный диапазон для голоса, индикатор включения, прямой выход на наушники на корпусе, низкий уровень собственного шума. Динамический капсуль 28мм.',
                                  19676, NULL, 124, '\0', ''), (20567, 'Rode Procaster',
                                                                 '<p>RØDE Procaster создан как профессиональный бескомпромиссный инструмент для вещания.<br><br>Обладая узкой направленностью и идеально подходящим для голоса частотным диапазоном,&nbsp;<br>RØDE Procaster будет лучшим решением для задач, где необходимо превосходное звучание и защита от внешних шумов.</p><ul><li>Вещательное качество звука</li><li>Динамический, с мощным выходным сигналом</li><li>Балансный выход с низким сопротивлением</li><li>Специальное антивибрационное крепление капсюля</li><li>Встроенная ветрозащита</li><li>Прочный, полностью металлический</li><li>Разработан и произведен в Австралии</li><li>Десять лет гарантии</li></ul><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Студийный</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Динамический</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Кардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>75..18000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-56</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>320</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Кардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>214 x 53 x 53</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>695</td></tr></tbody></table>',
                                                                 6500, '2014-09-03 16:10:45', 153,
                                                                 'Rode Procaster Динамический микрофон для вещания. Кардиоидная диаграмма. Виброзащищенный внутренний подвес капсюля. Встроенный поп-фильтр.',
                                                                 19677, NULL, 124, '\0', ''), (20568, 'Rode HS1',
                                                                                                '<p>Эргономичный дизайн</p><ul><li>Абсолютно незаметен</li><li>Сверхточное позиционирование микрофона благодаря гибким оголовью и держателю микрофона</li><li>Регулировка положения микрофона в трех плоскостях</li><li>Ультра легкая конструкция для комфортной работы</li><li>Возможность расположения микрофона и справа и слева</li><li>Удобная система крепления кабеля</li></ul><p>Высококачественная работа</p><ul><li>Миниатюрный микрофон диаметром 3.4 мм</li><li>Нержавеющий стальной держатель микрофона</li><li>Влагозащитная лента для уменьшения попадания пота на капсюль</li><li>Сменный КЕВЛАРовый кабель</li><li>Низкий уровень собственного шума</li></ul><p>Универсальная совместимость</p><ul><li>RØDE MiCon™ система подключения позволяет использовать HS1 с радиосистемами AKG, AudioTechnica, Sennheiser, Shure и аудио микшерами с XLR входами. Просто замените разъем на выходном кабеле микрофона. (разъемы можно приобрести дополнительно)</li></ul><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Головной</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Круговая</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>60..18000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-33.5</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Фантомное</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>MICON</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Круговая</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Цвет</p></td><td>Черный</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>5</td></tr></tbody></table>',
                                                                                                9500,
                                                                                                '2014-09-03 16:14:54',
                                                                                                153,
                                                                                                'Rode HS1 Головной микрофон (черный, телесный). Тонкий, эргономичный дизайн с трехкоординатной системой регулировки положения микрофона.',
                                                                                                19678, NULL, 124, '\0',
                                                                                                ''),
  (20569, 'Rode Lavalier',
   '<p>Где бы вам не пришлось работать: в телевизионном шоу или на сцене перед 20.000 тысячной аудиторией, читаете ли вы лекцию или берете интервью - все ваши задачи на- дежно и точно решит петличный микрофон LAPEL-1.</p><p>Микрофон поставляется с влагозащитным поп фильтром и «меховой» ветрозащитой в водонепроницаемом кейсе защищающем микрофон, кабель и аксессуары при хранении.</p><p>В отличии от многих микрофонов, подключаемых только к одному типу приборов, LAPEL-1 оснащен уникальной системой разъемов MiCon, позволяющей быстро и дешево заменить разъем и подключить микрофон к микшеру или радиосистеме производства AKG, AudioTechnica, Sennheiser, Shure.</p>',
   7500, '2014-09-03 16:18:08', 153,
   'Rode Lavalier Петличный всенаправленный. В комплекте влагозащищенный поп-фильтр и ворсистый фильтр для защиты от задувания ветром.',
   19679, NULL, 124, '\0', ''), (20570, 'Rode Stereo VideoMic',
                                  '<p>Стерео X/Y конфигурация позволяет записывать реальную, объемную атмосферу. Оснащенный накамерным креплением, двухпозиционным фильтром обреза НЧ – линейный или 80Гц и аттенюатором -10дБ, RØDE StereoVideoMic питается от 9В батареи. Совсем не обязательно использовать StereoVideoMic исключительно на камере, также StereoVideoMic можно закрепить на стойку для стерео записи отличного качества.</p><ul><li>Стерео X/Y конденсаторный микрофон</li><li>Вещательное качество</li><li>Низкий уровень собственного шума</li><li>Двухпозиционный фильтр обреза НЧ – линейный или 80Гц</li><li>Прочный алюминиевый корпус</li><li>Специально разработанная ветрозащита</li><li>Не шумит при касании тела микрофона</li><li>Питание - батарейка 9 В</li><li>Встроенное накамерное крепление</li></ul><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Пушка</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Стерео</p></td><td>да</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Суперкардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>40..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-38</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>134</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>200</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>74</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>20</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Батарея</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>Jack 3,5 mm</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Суперкардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>65 x 170 x 102</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>288</td></tr></tbody></table>',
                                  6300, '2014-09-03 16:25:21', 153,
                                  'Rode Stereo VideoMic Стерео X/Y накамерный микрофон. Накамерное крепление, двухпозиционный фильтр обреза НЧ линейный и 80Гц, аттенюатор -10дБ, питание от 9В батареи.',
                                  19680, NULL, 124, '\0', '');
                               '<p>Основываясь на успехе VideoMic Pro, выпущенного в начале 2011 года и быстро ставшего стандартом де-факто для DSLR-камер, а также оригинального Rode Stereo VideoMic, новый Stereo VideoMic Pro обеспечивает высокое качество записи стерео-звука при видеосъемке, является идеальным для записи музыки, а также является отличным решением в построении реалистичного звука сцены.</p><p>Построенный на базе подобранной пары высокочувствительных конденсаторных кардиоидных микрофонов, Stereo VideoMic Pro обеспечивает широкий стерео-образ с естественной глубиной.</p><p>Stereo VideoMic Pro, основанный на наборе характеристик VideoMic Pro, с эргономичным форм-фактором, идеально подходит для DSLR-камер, бытовых и профессиональных видеокамер. Интегрированное антивибрационное крепление обеспечивает превосходную изоляцию от вибрации и механических шумов, которые могут ухудшить качество записи. Кроме того, легкий, но прочный многожильный кабель обеспечивает отличную акустическую развязку и значительно более низкий уровень шума по сравнению с традиционными аудио-кабелями.</p><p>На задней части удобно расположены управление питанием и выравниванием звука (включая фильтр высоких частот на 75Hz, предназначенный для вырезания шума, создаваемого кондиционером или двигателем автомобиля и других нежелательных низкочастотных помех).</p><p>Переключатель -10дБ позволяет пользователю снизить чувствительность микрофона, что делает его пригодным для записи громких источников звука, таких как живая музыка или спортивные мероприятия.</p><p>Как и VideoMic Pro, Stereo VideoMic Pro оснащен переключателем усиления уровня +20дБ, специально разработанного для обеспечения высокого качества сигнала при записи на DSLR-камеру. При активации, можно понизить уровень звука на камере, что обеспечивает снижение шума и более четкую запись.</p><p><strong>Особенности</strong></p><p><br></p><ul><li>Накамерный микрофон вещательного качества</li><li>Подобранная пара 1/2\" конденсаторных микрофонов в XY-конфигурации</li><li>Ультра легкий компактный дизайн</li><li>Двухуровневый фильтр высоких частот (flat, 75Hz)</li><li>Трехпозиционное управление уровнем (-10дБ, 0, +20дБ)</li><li>Питание от батареи 9В - более 100 часов работы (при использовании щелочного элемента питания)</li><li>Антивибрационное крепление</li><li>Поролоновая ветрозащита</li><li>Аудиовыход мини-джек 3,5мм&nbsp;</li><li>Адаптер на \"горячий башмак\" с возможностью крепления на микрофонные удочки (3/8\").</li><li>Разработан и произведен в Австралии</li></ul><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Пушка</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Стерео</p></td><td>да</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Суперкардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>40..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-38</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>134</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>200</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>74</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>20</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Батарея</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>Jack 3,5 mm</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Суперкардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>130 x 66 x 108</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>115</td></tr></tbody></table>',
                               6850, '2014-09-03 16:28:09', 153,
                               'Rode Stereo VideoMic Pro Накамерный микрофон вещательного качества.  Подобранная пара ½ конденсаторных капсюлей в конфигурации X/Y стерео. Суперлёгкий и компактный.',
                               19681, NULL, 124, '\0', ''), (20572, 'Rode VideoMic Pro',
                                                              '<p>Компактный накамерный микрофон-пушка для DSLR фотоаппаратов и портативных HD видеокамер.</p><ul><li>Профессионального качества конденсаторный микрофон</li><li>Компактные размеры (длина- 150мм)</li><li>Суперлегкий (85грамм)</li><li>Питание от 9-вольтовой батарейки - более 70 часов (alkaline)</li><li>Встроенная виброзащита</li><li>Встроенная ветрозащита</li><li>3.5мм разъем подключения стерео миниджек (сдвоенный моно сигнал)</li><li>Двухступенчатый фильтр низких частот (flat и 80Гц)</li><li>Три варианта уровня выхода (-10dB, 0, +20dB)</li><li>Крепление на площадку для света камеры (башмак) с 3/8\" резьбой для крепления на удочки и стойки</li><li>Меховая ветрозащита DeadCat VMP продается отдельно</li><li>10 лет гарантии</li></ul><table style=\"width:680px\"><tbody><tr><td colspan=\"2\">Основные характеристики</td></tr><tr><td style=\"width:336px\"><p>Категория</p></td><td>Пушка</td></tr><tr><td style=\"width:336px\"><p>Тип</p></td><td>Конденсаторный</td></tr><tr><td style=\"width:336px\"><p>Направленность</p></td><td>Суперкардиоида</td></tr><tr><td style=\"width:336px\"><p>Частотный диапазон, Гц</p></td><td>40..20000</td></tr><tr><td style=\"width:336px\"><p>Чувствительность</p></td><td>-38</td></tr><tr><td style=\"width:336px\"><p>Максимальное звуковое давление, дБ</p></td><td>134</td></tr><tr><td style=\"width:336px\"><p>Сопротивление, Ом</p></td><td>200</td></tr><tr><td style=\"width:336px\"><p>Соотношение сигнал/шум, дБ</p></td><td>74</td></tr><tr><td style=\"width:336px\"><p>Собственный шум, дБ</p></td><td>20</td></tr><tr><td style=\"width:336px\"><p>Питание</p></td><td>Батарея</td></tr><tr><td style=\"width:336px\"><p>Разъем</p></td><td>Jack 3,5 mm</td></tr><tr><td colspan=\"2\">Направленность</td></tr><tr><td style=\"width:336px\"><p>Суперкардиоида</p></td><td>есть</td></tr><tr><td colspan=\"2\">Физические характеристики</td></tr><tr><td style=\"width:336px\"><p>Размеры, мм</p></td><td>95 x 43 x 150</td></tr><tr><td style=\"width:336px\"><p>Вес, г</p></td><td>85</td></tr></tbody></table>',
                                                              6450, '2014-09-03 16:31:07', 153,
                                                              'Rode VideoMic Pro Направленный суперкардиоидный накамерный микрофон-пушка. Встроенное антивибрационное крепление. Регулировка уровня сигнала. Двухпозиционный фильтр обреза НЧ.',
